INSERT INTO `sententce` VALUES (1, '所有人和事，自己问心无愧就好，不是你的也别强求，反正离去的都是风景，留下的，才是人生。早安！', 2);
INSERT INTO `sententce` VALUES (2, '不要停止奔跑，不要回顾来路，来路无可眷恋，值得期待的只有前方。早安。', 2);
INSERT INTO `sententce` VALUES (3, '在晨光中慢慢醒来，听听鸟语，闻闻花香，让情绪更加舒畅。抛却烦恼忧伤，接纳快乐芬芳，让每一天都充满阳光，让每一秒都尽情飞扬。早安。', 2);
INSERT INTO `sententce` VALUES (4, '只要认为是对的就去做，坚持去做，不要在乎别人的看法，哪怕是错，至少你有去做过，证明以前你努力过。', 2);
INSERT INTO `sententce` VALUES (5, '做一件事情，不管有多难，会不会有结果，这些都不重要，即使失败了也无可厚非，关键是你有没有勇气解脱束缚的手脚，有没有胆量勇敢地应对。在很多的时候，我们不缺方向，缺的是一往无前的决心和魄力。早安！', 2);
INSERT INTO `sententce` VALUES (6, '清晨的第一缕阳光射到你的床头，把一天的温暖送上你心头，清晨的第一声鸣叫传入你的耳中，把一天的快乐送到你心田。早安!', 2);
INSERT INTO `sententce` VALUES (7, '谁让你我静似月，只能在心里默念，檐下燕替我飞到你身边…早安。', 2);
INSERT INTO `sententce` VALUES (8, '这个世界上没有不带伤的人，真正能治愈自己的，只有自己。早安！', 2);
INSERT INTO `sententce` VALUES (9, '富不富有不重要，重要的是你要的恰好都有。人不必太美，只要有人深爱，人不必太富，只要过得温暖。早安！', 2);
INSERT INTO `sententce` VALUES (10, '一年之计在于春，一天之计在于辰。一个问候给你一个新的情绪，一个祝福带给你新的起点，愿你从今晨开始一切顺心安心爽心欢心永远开心!早安!', 2);
INSERT INTO `sententce` VALUES (11, '给时间一点时间，让过去过去，让开始开始。让你难过的事情，有一天，你必须会笑着说出来。早安！', 2);
INSERT INTO `sententce` VALUES (12, '愿你经历再多，都不忘初心；愿你难过再多，都不忘微笑；愿你能披荆斩棘，做到自己想要做到的事情。早安。', 2);
INSERT INTO `sententce` VALUES (13, '历经了风吹雨打，只盼在坎坷路上，能有一颗心相随;历经了百转千回，只盼在困难的堤岸上，能与知己举杯，消除一切疲惫。友谊就是愉悦的蓓蕾，早安!', 2);
INSERT INTO `sententce` VALUES (14, '爱情，本就是件宁缺勿滥的事，急不得。有爱情，便全心对待，没有爱情，也一个人惬意。', 2);
INSERT INTO `sententce` VALUES (15, '想要改变一切，首先要改变自己。早安。', 2);
INSERT INTO `sententce` VALUES (16, '向日葵说，只要你朝着阳光努力向上，生活便会因此变得单纯而完美。完美的一天开始，愿你能向日葵一样，迎着阳光向上!早安!', 2);
INSERT INTO `sententce` VALUES (17, '做一个平静的人，做一个善良的人，做一个微笑挂在嘴边，快乐放在心上的人。心态很重要，好的心态决定好的未来！', 2);
INSERT INTO `sententce` VALUES (18, '每一个成功者都有一个开始。勇于开始，才能找到成功的路。', 2);
INSERT INTO `sententce` VALUES (19, '通常让人迷茫的原因只有一个，那就是本该拼搏的年纪，却想得太多，做得太少。早安', 2);
INSERT INTO `sententce` VALUES (20, '姑娘，你要努力，你想要的，只能你自己给，别人给的，你要问问自己，拿得起么！', 2);
INSERT INTO `sententce` VALUES (21, '用朝阳为你温一杯浓情牛奶，用真心为你做一根活力油条，用清风为你奏一首舒心歌谣，用信息为你道一声真挚祝福，愿收到的你，新的一天情绪舒畅，活力飞扬，工作顺畅!朋友，早安!', 2);
INSERT INTO `sententce` VALUES (22, '人生的坚强，不是期望每一缕阳光都能将自己照亮，而是在绝望的时候，懂得为自己开一扇窗！', 2);
INSERT INTO `sententce` VALUES (23, '不知道是越来越独立，还是越来越心虚，走了这么久，发现唯一能够靠得住的还是自己。早安！', 2);
INSERT INTO `sententce` VALUES (24, '幸福这件事，其实就是清晨睁开眼睛看手机，发现有你的早安简讯，看看闹钟还能多睡一小时的满足感。', 2);
INSERT INTO `sententce` VALUES (25, '天亮了吧，闹铃响了吧，极不情愿地起床了吧，我的问候及时赶到了吧，高兴了吧，那就笑笑吧。早安，祝你好情绪!', 2);
INSERT INTO `sententce` VALUES (26, '歌为知音而唱,酒为亲信而醉,情为间隔而贵,心为路遥而思,月为痴情而羞,星为恋爱而美,桥为流水等候,我为伴侣祝愿,祝你秒秒高兴。早上好!', 2);
INSERT INTO `sententce` VALUES (27, '再长的路，一步一步也能走完；再短的路，不迈开双脚也无法到达。快去为自己的梦想努力吧！早安。', 2);
INSERT INTO `sententce` VALUES (28, '早晨起床伸懒腰，对着镜子哈哈笑，说声早安会心笑，压力全抛无烦恼，刷牙洗脸哼小曲，开开心心一天到，问候不少在今朝，早安一生愿你好。早安。', 2);
INSERT INTO `sententce` VALUES (29, '人最大的烦恼就是记性太好了。如果什么都能够忘了，以后的每一天都将会是一个新的开始。', 2);
INSERT INTO `sententce` VALUES (30, '阳光照，鸟欢叫，小懒猪，起床了，伸懒腰，笑一笑，深呼吸，精神好，开心到，欢乐抱，幸福随，乐淘淘，好运伴，祝福来，每一分，每一秒，轻轻地，问候声，好朋友，早安!', 2);
INSERT INTO `sententce` VALUES (31, '早晨起床伸懒腰，对着镜子哈哈笑，说声早安会心笑，压力全抛无烦恼，刷牙洗脸哼小曲，开开心心一天到，问候不少在今朝，早安一生愿你好。早安。', 2);
INSERT INTO `sententce` VALUES (32, '或许爱，便是女人致命的弱点。哪怕之前她是如何独立与洒脱，当深爱上一个人，也会变得依靠，变得脆弱，变得极端，变得在乎，变得患得患失起来。早安。', 2);
INSERT INTO `sententce` VALUES (33, '晨安，我永久的钟爱人，固然我尚未起床，但思维以前飞到你的身边来了，忽而愉悦，忽而忧伤，等候着命运的信息。不知它能否会依从咱们的期望。', 2);
INSERT INTO `sententce` VALUES (34, '找点空闲，找点时间，叫上朋友多出去走走。带上笑容，带上祝愿，发条信息给真心的朋友。时间常有朋友不常有，用常有的时间祝不常有的朋友，快乐常有!早上好!', 2);
INSERT INTO `sententce` VALUES (35, '人间的事往往如此，当时提起痛不欲生，几年之后，也但是是一场回忆而已。早安！', 2);
INSERT INTO `sententce` VALUES (36, '风起云涌的世界，从不等犹豫不决的人', 2);
INSERT INTO `sententce` VALUES (37, '爱是所有瘟疫中最为黑暗的。假如一个人能够为爱而死，那么它还会有些乐趣，但是人们几乎都能够在爱的创伤中痊愈。如果在这个不完美的世界一切都是不完美的，爱是完全不完美中最为完美的。', 2);
INSERT INTO `sententce` VALUES (38, '每一天都想放弃，但每一天又都坚持下来了。没有伞的孩子，必须努力奔跑。早安！', 2);
INSERT INTO `sententce` VALUES (39, '光灿灿，喜颜颜，笑嘻嘻，去上班。路颠颠，车慢慢，心切切，惹人烦。上看看，下看看，人拥拥，无奈盼。不要急，不要愁，不要慌，不要气，把心放平，这是我们都要应对的上班之路，早安!', 2);
INSERT INTO `sententce` VALUES (40, '愿我们上半年所有的遗憾，都是下半年惊喜的铺垫。', 2);
INSERT INTO `sententce` VALUES (41, '太阳当空照，早起晨练好;朝霞说：早早早，欢迎你来把步跑;小草说：请你学我扭扭腰;手机响，信息到：朋友早安，早上好!', 2);
INSERT INTO `sententce` VALUES (42, '永远都不要停止微笑，即使在是你难过的时候，说不定有人会因为你的微笑而爱上你。', 2);
INSERT INTO `sententce` VALUES (43, '予友人诚心，给己真心，生活便可安心;予仇人宽心，给己静心，做事便可放心;予爱人专心，给己恒心，感情生活便可甜蜜清心。早安，兄弟姐妹!', 2);
INSERT INTO `sententce` VALUES (44, '人生所求身空心静云淡风来', 2);
INSERT INTO `sententce` VALUES (45, '我欲乘风向西去无耐风向不顺路，忽闻一阵香风过吹来贵客好门庭。早安。', 2);
INSERT INTO `sententce` VALUES (46, '我们单枪匹马闯入这世间，只为活出属于自己的所有可能，愿你这一生既有随处可栖的江湖，也有追风逐梦的骁勇。早安～', 2);
INSERT INTO `sententce` VALUES (47, '思想不在一个高度上不必互相说服', 2);
INSERT INTO `sententce` VALUES (48, '天亮了，美妙的一天又开端了，起床吧，呼吸清爽，拥抱阳光;浅笑吧，高兴心境，高兴一天。早上好，愿你有个好意情!', 2);
INSERT INTO `sententce` VALUES (49, '不完美的我需要同样不完美的你，携手共创完美的未来。', 2);
INSERT INTO `sententce` VALUES (50, '限制你的，从来就不是什么年龄，而是你的思想。', 2);
INSERT INTO `sententce` VALUES (51, '成功根本没有秘诀，如果有的话，就只有两个：第一个是坚持到底，永不放弃;第二个就是当你想放弃的时候，请回过头来再照着第一个秘诀去做。', 2);
INSERT INTO `sententce` VALUES (52, '早晨空气真正好，出门摔了一大跤;嘴巴亲吻黄土地，双手抓满黄金条;浑身沾满金如意，眼前金豆一个劲的冒;接到信息的朋友，每一天早晨都要来摔跤。哈哈，朋友，早安!', 2);
INSERT INTO `sententce` VALUES (53, '世上最好的保鲜就是不断进步，让自己成为一个更好和更值得爱的人。早安。', 2);
INSERT INTO `sententce` VALUES (54, '清晨阳光照在身，祝你幸福又平安;清晨微风吹你脸，祝你梦想早实现;清晨信息祝福你，祝你开心每一天。早安!早安心语。', 2);
INSERT INTO `sententce` VALUES (55, '除非你不想活，否则当低头时必须要低头。不要相信唯心，那是阶级的统治工具，唯物是硬道理。这个和你的宗教信仰无关，即使菩萨会帮忙你那也是有N多条件的，求人不如求己。', 2);
INSERT INTO `sententce` VALUES (56, '减少不必要的社交才是快乐的灵丹妙药。', 2);
INSERT INTO `sententce` VALUES (57, '早上好，一束阳光照在身，祝你天天都开心，财神家中去，梦想变成真，今日中大奖，明天去上任，朋友的祝福全都是真心。', 2);
INSERT INTO `sententce` VALUES (58, '最好的生活就是：不嫉妒别人，不看轻自己，岁月静好，别来无恙。', 2);
INSERT INTO `sententce` VALUES (59, '做一个有自控力的人，做一个寡言，却心有一片海的人，一个人的自愈的潜力越强，才越有可能接近幸福。早安！', 2);
INSERT INTO `sententce` VALUES (60, '我所知道的关于你的事情，就只有天气预报了。', 2);
INSERT INTO `sententce` VALUES (61, '抱怨是一件最没好处的事情，如果实在难以忍受周围的环境，那就暗自努力练好本领，然后跳出那个圈子。早安！', 2);
INSERT INTO `sententce` VALUES (62, '无论你到一个什么样的环境，你不必须有幸遇到与你投缘的人，但永远不会缺少让你感到棘手的人。', 2);
INSERT INTO `sententce` VALUES (63, '晨光踱进窗纱，希望洒满你的脸颊，朝霞打开你的心扉，自信慢慢升华，道声早安把气打，精神饱满乐开花。朋友早安。', 2);
INSERT INTO `sententce` VALUES (64, '努力的好处是为了看到更大的世界，是为了自由的选择人生，是为了变成自己喜欢的样貌，早安，加油！！', 2);
INSERT INTO `sententce` VALUES (65, '生活很简单，喜欢什么就要付出努力去争取什么，但愿所有的努力都不会白费，但愿纷扰过后能够梦想成真。', 2);
INSERT INTO `sententce` VALUES (66, '在最美的年华做最喜欢的事情别辜负了完美时光借时光之手，暖一处花开借一方晴空，拥抱梦想。', 2);
INSERT INTO `sententce` VALUES (67, '平和既是慈悲，温和既是良善;无争既是友好，宽恕既是放下。每一个早晨，都是洒脱的理由，分开了过往和此刻，过去是该忘记的开始，只为向你道一声：“早安。”', 2);
INSERT INTO `sententce` VALUES (68, '一年之计在于春，一天之计在于晨。早上敞开祝福门，问候早早添精神。事业架起红火锅，生活支起聚宝盆。开心舒心享不尽，顺风顺水好前程!', 2);
INSERT INTO `sententce` VALUES (69, '你不懂我的时候，就算我把我心掏给你看，你也看不懂。', 2);
INSERT INTO `sententce` VALUES (70, '阳光照，鸟欢叫，小懒猪，起床了，伸懒腰，笑一笑，深呼吸，精神好，开心到，欢乐抱，幸福随，乐淘淘，好运伴，祝福来，每一分，每一秒，轻轻地，问候声，好朋友，早安!', 2);
INSERT INTO `sententce` VALUES (71, '早晨的霞光灿烂无比，早晨的露珠晶莹无比，早晨的鲜花美丽无比，早晨的空气新鲜无比，早晨的情绪舒畅无比，祝你早安!', 2);
INSERT INTO `sententce` VALUES (72, '生活就是一只看不见的储蓄罐，你投入的每一份努力都不会白费。', 2);
INSERT INTO `sententce` VALUES (73, '你的善良，需要带点锋芒；你的爱，需要带些理智。带眼识人，毕竟不是所有人都配拥有它们。', 2);
INSERT INTO `sententce` VALUES (74, '人真的要自己争气。一做出成绩来，全世界都会和颜悦色。——亦舒', 2);
INSERT INTO `sententce` VALUES (75, '有些风景只能喜欢却不能收藏，就像有些人只适合遇见却不适合久伴。', 2);
INSERT INTO `sententce` VALUES (76, '早上好，送你清爽的问候，温馨的祝愿，早晨，美妙的开端，祝你今日精力棒棒，生机多多，心境好好，一切都好!', 2);
INSERT INTO `sententce` VALUES (77, '当个坏人吧，好人没前途，除了哭就只会细数痛苦。', 2);
INSERT INTO `sententce` VALUES (78, '信息到,早上好!知道你美梦还没做完，把你吵醒也别抱怨。揉揉迷茫的小眼,洗洗困倦的小脸,再吃顿美美的早饭，开始自己完美的一天。亲爱的朋友，早安!', 2);
INSERT INTO `sententce` VALUES (79, '晨光洒进心房，快乐开始荡漾，完美的一天又登场。把愁情烦事全流放，让好运自在伴身旁。何必沧桑，只愿安详，让美丽情绪展翅飞翔。早安。', 2);
INSERT INTO `sententce` VALUES (80, '人生中出现的一切，都无法拥有，只能经历。深知这一点的人，就会懂得：无所谓失去，只是经过而已；无所谓失败，只是经验而已。用一颗浏览的心，去看待人生，一切的得与失隐与显，都是风景与风情。早安！', 2);
INSERT INTO `sententce` VALUES (81, '早晨日出东方，信息到手机响;给你送来祝福，愿你情绪舒畅;耳边祝福声声，眼前一片金光;信息祝福灵验，一天都会快乐吉祥!亲爱的，早安!', 2);
INSERT INTO `sententce` VALUES (82, '对待生命，你不妨大胆一点，因为我们始终要失去它。——尼采，早安。', 2);
INSERT INTO `sententce` VALUES (83, '你所做的事情，也许暂时看不到成果，但不要灰心或焦虑，你不是没有成长，而是在扎根。', 2);
INSERT INTO `sententce` VALUES (84, '人真的要自己争气。一做出成绩来，全世界都会和颜悦色。——亦舒', 2);
INSERT INTO `sententce` VALUES (85, '当朋友不开心的时候，你只需要静静地坐在他身边，默默陪伴。即使什么也不说，他也会感觉好很多很多。', 2);
INSERT INTO `sententce` VALUES (86, '每一天叫醒的不是闹钟，是伟大的梦想。每一天抛弃的不是别人，是不成熟的自己。每一天迎来的不是漫长黑夜，是奏起的黎明。早安！', 2);
INSERT INTO `sententce` VALUES (87, '没有过不去的事情，只有过不去的情绪。确实是这样，很多事情我们之所以过不去是因为我们心里放不下，比如被欺骗了报复放不下，被讽刺了怨恨放不下，被批评了面子放不下。大部分人都只在乎事情本身并沉迷于事情带来的不愉快的情绪。其实只要把情绪变一下，世界就完全不一样了。', 2);
INSERT INTO `sententce` VALUES (88, '时光如水流着，每一个日子的喜怒哀乐，每一个时刻的幸福忧愁，很多都消失在了滔滔浪花之中，无处寻觅。惟有朋友，始终陪在左右，祝快乐每一天。早安!', 2);
INSERT INTO `sententce` VALUES (89, '往后的好运，都是平时日积月累的努力。', 2);
INSERT INTO `sententce` VALUES (90, '天使托我告诉你:你的好运和天上星星一样多,愉悦像海底鱼儿一样多!早上睁开眼,射向你的第一缕阳光即是一切完美开始!祝你开心每一天!', 2);
INSERT INTO `sententce` VALUES (91, '无需做过多的解释，真正懂你的人不会轻易否定你。早安。', 2);
INSERT INTO `sententce` VALUES (92, '六点起床很困难，背单词很困难，静下心很困难。但是总有一些人，五点能够起床，一天背六课单词，耐心读完一本书。谁也没有超潜力，但是自己能够决定一天去做什么事情。你以为没有了路，事实上路可能就在前方一点点。那些比自己强大的人都在拼命，我们还有什么理由停下脚步?', 2);
INSERT INTO `sententce` VALUES (93, '时间会让你看清每一张脸，久伴会让你知道每一颗心。', 2);
INSERT INTO `sententce` VALUES (94, '不要着急，最好的总会在最不经意的时候出现。早安。', 2);
INSERT INTO `sententce` VALUES (95, '人生中最艰难的两场考验：等待时机到来的耐心，和应对一切际遇的勇气。早安~!', 2);
INSERT INTO `sententce` VALUES (96, '人生就像一出戏，恩恩怨怨又何必太在意，名和利啊什么东西，生不带来死不带去。人生就像一段旋律，在跳动的音符中完成生命的过程。', 2);
INSERT INTO `sententce` VALUES (97, '天空亮了，早晨到了;花儿开了，草儿笑了;手机响了，信息来了;你看到了，脸儿红了;我想你了，我爱你了;看看东方，精神来了;迈开腿了，赴约去了;早安了，等你了!', 2);
INSERT INTO `sententce` VALUES (98, '所谓成熟，就是：你要习惯，任何人的忽冷忽热；也要看淡，任何人的渐行渐远。不乱于心，不困于情。不畏将来，不念过去。淡然地过着自己的生活，不要轰轰烈烈，只求安安心心。如此，安好。早安！', 2);
INSERT INTO `sententce` VALUES (99, '不要开口就来日方长，要习惯人走茶凉。', 2);
INSERT INTO `sententce` VALUES (100, '事多不心烦，来了就来了;倦了别硬撑，睡了就睡了;成功莫强求，努力就对了;简单日子好好过，漫漫人生心静了就快乐了。早安!', 2);
INSERT INTO `sententce` VALUES (101, '你的名字，一遍又一遍，是心心念念，是此情深深，是岁月流年里，我最温柔的心意。早安。', 2);
INSERT INTO `sententce` VALUES (102, '开挂的人生，不是天生就有持续不断的鸡血，而是后天获得了从痛苦中给自己充电的潜力。', 2);
INSERT INTO `sententce` VALUES (103, '早晨推开窗，拥抱阳光，觉得天然的浅笑;夜晚散漫步，聊聊家常，品尝普通的愉悦。伴侣，拥有好意态，愿你愉悦美妙!', 2);
INSERT INTO `sententce` VALUES (104, '真切的祝福你，我的朋友，生活虽然天天平淡，但却天天开心：早上醒来笑一笑，中午睡个美容觉，晚上烦恼都跑掉，明天生活会更好，幸福永远将你绕!', 2);
INSERT INTO `sententce` VALUES (105, '总有些事放不下，让人忘了时间。总有些事必须放下，因为还有明天。', 2);
INSERT INTO `sententce` VALUES (106, '你此刻的努力，辛苦，压力，承受的一切，都是为了攒够潜力和本钱，去做自己更喜欢的事，去为自己争取选择的权利。早安！', 2);
INSERT INTO `sententce` VALUES (107, '女人这一生，唯有美，不可妥协；唯有自己，不可辜负；因为全世界，你最珍贵。', 2);
INSERT INTO `sententce` VALUES (108, '一个人在世间需要两种潜力：好好说话和稳定情绪。', 2);
INSERT INTO `sententce` VALUES (109, '哥们儿，今日有档期吗?外边空气可真新鲜呀，鸟叫的可真欢畅啊，收拾收拾，快出来撒撒欢儿吧!出来了吗?我怎样看不见你呀?没出来就没出来吧，反正我也没出来，发信息就是想跟你说一声：朋友，早安!', 2);
INSERT INTO `sententce` VALUES (110, '清新的早晨，太阳透过空气照射到树叶上，到处都散发着阳光的气息。请泡杯咖啡走到阳台来接收我的气息：周末早安!', 2);
INSERT INTO `sententce` VALUES (111, '爱一个人要付出很多，你要思考清楚，否则就不要去爱。感情从来都不是对等的，你很在意对方，不必要求对方是否在意你，你付出了说明你乐意，所以你不必委屈。', 2);
INSERT INTO `sententce` VALUES (112, '一年之计在于春，一天之计在于辰。愿你在早晨起床后心境好好，胃口棒棒，福运佳佳，笑口开开，早上好!', 2);
INSERT INTO `sententce` VALUES (113, '这短短的一生，我们最终都会失去，你不妨大胆一些，爱一个人攀一座山追一个梦……', 2);
INSERT INTO `sententce` VALUES (114, '不走心的努力，都是在敷衍自己。', 2);
INSERT INTO `sententce` VALUES (115, '微笑和沉默是两个有效的武器微笑能解决很多问题，沉默能避免许多问题。早安。', 2);
INSERT INTO `sententce` VALUES (116, '早上好，一束阳光照在身，祝你天天都高兴，财神家中去，胡想酿成真，今日中大奖，明日去上任，伴侣的祝愿全都是真心。', 2);
INSERT INTO `sententce` VALUES (117, '善良和爱都是免费的，但不是廉价的，你的善良，需要带点锋芒，你的爱，需要带些理智，带眼识人，毕竟不是所有人都配拥有它们。早安！', 2);
INSERT INTO `sententce` VALUES (118, '固然繁忙将问候落下，虽然岁月将旧事推远，但每一次回忆，每一次立足，每一次想起你，心便温馨怡然，愿我的祝愿伴你每时每刻，愿你今日有个好意情!', 2);
INSERT INTO `sententce` VALUES (119, '人生最幸福的事，莫过于透过努力，把一切都变成自己想要的样貌。', 2);
INSERT INTO `sententce` VALUES (120, '我觉得成熟的感情就应是，两个人懂得了为以后做计划，什么时候买房，什么时候结婚，如何赡养老人，如何规划职业，以什么样的方式生活，如何处理生活中的矛盾。懂得了宽容和理解，不会再拿那些鸡毛蒜皮的小事来彼此考验，所有的爱意和浪漫都根植于生活，平淡度日，全心相待。', 2);
INSERT INTO `sententce` VALUES (121, '一生只有一遍，所以好好努力，时光欠你的，会在往后的日子慢慢归还。早安。', 2);
INSERT INTO `sententce` VALUES (122, '悄悄的，我进入了你的梦中，慢慢的，我在你的梦中漫步，轻轻的，我呼唤你的名字，起床吧，新的一天开始了，亲爱的，早安!', 2);
INSERT INTO `sententce` VALUES (123, '亲爱的，又是新的一天，愿美丽的阳光美丽你的情绪，好运与你相伴行。不忙碌，不烦恼，绽放你的微笑，感受生活的完美，把幸福紧紧拥抱。早安。', 2);
INSERT INTO `sententce` VALUES (124, '没有什么事情是简单简单的，唯有不断努力，才能更加顺利。', 2);
INSERT INTO `sententce` VALUES (125, '物以类聚，人以群分，不一样的人，永远走不到一起。曹操再奸都有知心友，刘备再好都有死对头。不要太在乎别人对你的评价，做好自己个人，干好自己的事，走好自己的路。活在别人眼里，是世上最可悲的一件事。', 2);
INSERT INTO `sententce` VALUES (126, '也许你错过了上一站的完美，才遇见了下一站的惊喜。应对复杂，持续欢喜。加油，别让人生输给情绪！早安！', 2);
INSERT INTO `sententce` VALUES (127, '清早打开手机，有我的祝福陪你，在早餐的香气里，享受新鲜的空气，每一天都有幸福围绕你，因我的祝福只给你!', 2);
INSERT INTO `sententce` VALUES (128, '田田田口田田田，推开一扇窗，屋子里才会充满光亮;为心灵打开一扇窗，才能体验更多的鸟语花香。让心融入世界，把温暖注入心房。早上愉悦!', 2);
INSERT INTO `sententce` VALUES (129, '清清的晨风摇响愉悦的铃铛，我的心奏起欢快的乐曲，说声“早安”，向你问好。早安心语', 2);
INSERT INTO `sententce` VALUES (130, '我们都为逝去的时光感到惋惜，殊不知此刻的一切也是完美的！早安。', 2);
INSERT INTO `sententce` VALUES (131, '有希望在的地方，痛苦也成欢乐。', 2);
INSERT INTO `sententce` VALUES (132, '未来会怎样，要用力走下去才知道，你既然认准了一条路，又何必去打听要走多久。先变成更喜欢的自己，路还长，天总会亮。', 2);
INSERT INTO `sententce` VALUES (133, '^抓住一缕晨光，轻轻抚摸脸庞，带来整天清爽;愿你睁开惺惺睡眼，幸福飘到耳畔，对你轻轻诉说：朋友，早安!', 2);
INSERT INTO `sententce` VALUES (134, '窗外雨蒙蒙，窗内酣甜声。阳光洒落心中，惊扰流光美梦。挣开梦眼惺忪，健康快乐出行，祝福记心间，希望常存信念，温馨道声早安。', 2);
INSERT INTO `sententce` VALUES (135, '这个世界不会因为你有多惨，就对你有多好。', 2);
INSERT INTO `sententce` VALUES (136, '这个世界并不会在意你的自尊，而是要求你在自我感觉良好之前先有所成就。', 2);
INSERT INTO `sententce` VALUES (137, '不论做什么事，都要相信你自己，别让别人的一句话将你击倒。人生没有对错，只有选择后的坚持，不后悔，走下去，走着走着，花就开了。', 2);
INSERT INTO `sententce` VALUES (138, '不管是阳光灿烂还是风雨交加，在时间的流逝中，都将是成为旅程中的一部分回忆，既然选择了就得走下去，要想走的好，那么只有随时持续足够的信心和勇气，才能不断前进，寻找到更多更完美的风景。早安。', 2);
INSERT INTO `sententce` VALUES (139, '你当刚强壮胆，不要惧怕，也不要惊惶；因为你无论往那里去，耶和华你的神必与你同在。早安。', 2);
INSERT INTO `sententce` VALUES (140, '甘露为你擦亮晶莹的明眸，阳光为你烘烤温暖的味道，问候为你带来快乐的奇妙，清新的早晨，希望我的一条信息，给你一天简单而充实的幸福，早上好。', 2);
INSERT INTO `sententce` VALUES (141, '人的最高情商不是心机，而是替别人着想的善意！', 2);
INSERT INTO `sententce` VALUES (142, '每一天醒来告诉自我：理由少一点，肚量大一点，嘴巴甜一点，脾气小一点，行动快一点，效率高一点，微笑露一点，脑筋活一点。清清的晨风摇响愉悦的铃铛，我的心奏起欢快的乐曲，说声“早安”，向你问好!', 2);
INSERT INTO `sententce` VALUES (143, '年轻的时候，连多愁善感都要渲染的惊天动地。长大后却学会，越痛，越不动声色。越苦，越持续沉默。早安！', 2);
INSERT INTO `sententce` VALUES (144, '睡去昨日的疲惫，忘却昨日的烦恼，睁开今日的双眼，打开今日的完美。早上好，愿我的问候如清凉的清晨般滋润你!', 2);
INSERT INTO `sententce` VALUES (145, '早安，我永恒的爱人，虽然我尚未起床，但思想已经飞到你的身边来了，忽而高兴，忽而忧伤，等待着命运的信息。不知它是否会顺从我们的心愿。', 2);
INSERT INTO `sententce` VALUES (146, '早上空气清新，叫你事事顺心;上午阳光明媚，祝你薪水翻倍;下午小风娇好，愿你青春不老。', 2);
INSERT INTO `sententce` VALUES (147, '伴着昨夜美梦，呼吸舒爽晨风，亲吻美丽曙光，带着完美渴望，为了心中理想，喜迎新的一天，暗呼一声加油，赶紧穿衣起床，祝你精神抖擞，活力常伴心房。朋友，早安!', 2);
INSERT INTO `sententce` VALUES (148, '失败时有人伸手来为你擦泪，会好过成功时无数人伸手为你鼓掌。早安。', 2);
INSERT INTO `sententce` VALUES (149, '鸡鸣枕上，夜气方回，因想余生平，繁华靡丽，过眼皆空，五十年来，总成一梦。', 2);
INSERT INTO `sententce` VALUES (150, '时光如水，蹉跎年华，唯一不变的是那浓浓的牵挂;寂寂清晨，寥寥微风，想说的是那暖暖的知心话。岁月一片静好，唔友，早安!', 2);
INSERT INTO `sententce` VALUES (151, '清晨的微风飘过窗台抚过发鬓一角，清晨的鸟叫进入耳朵清醒了笑，大地的环境自然完美，自然界的“朋友”把你召：“好朋友，快起床，‘早安’时间又来到。”', 2);
INSERT INTO `sententce` VALUES (152, '悄悄的，我进入了你的梦中，慢慢的，我在你的梦中漫步，轻轻的，我呼唤你的名字，起床吧，新的一天开始了，亲爱的，早安!', 2);
INSERT INTO `sententce` VALUES (153, '不管昨夜经历了怎样的撕心裂肺，早晨醒来这个城市依旧会车水马龙。开心或者不开心，没几个人会真正在乎你，你只能铭记或者遗忘，那一站你爱过或者恨过的旅程，那一段你拼命努力却感觉不到希望的日子，都将会成为过去，在人生这条单行路上，跌跌撞撞，下一站，总会有不期而遇的温暖和生生不息的希望。早安！', 2);
INSERT INTO `sententce` VALUES (154, '早晨起床伸懒腰，对着镜子哈哈笑，说声早安会心笑，压力全抛无烦恼，刷牙洗脸哼小曲，开开心心一天到，问候不少在今朝，早安一生愿你好。早安。', 2);
INSERT INTO `sententce` VALUES (155, '做人，不必须要风风光光，但必须要堂堂正正。处事，不必须要尽善尽美，但必须要问心无愧。', 2);
INSERT INTO `sententce` VALUES (156, '这是一个和谐的早晨，阳光还是一样光彩，花朵还是一样盛开，微风还是一样徘徊，幸福还是一样开怀，我们还是一样精彩，早安!', 2);
INSERT INTO `sententce` VALUES (157, '有两个字藏在心中很久，哽住了喉咙总是说不出口，于是对着镜子微微笑，阳光透过镜子将我的笑容折射给了你，里面包含了我无限祝福。早安!', 2);
INSERT INTO `sententce` VALUES (158, '年轻，受一点苦，才会真正谦恭。不然，自以为是的聪明和藐视一切的优越感迟早要毁了自己。早安。', 2);
INSERT INTO `sententce` VALUES (159, '一粒种子，是在痛苦中，萌生出新的希望；一个婴儿，是在痛苦中，分娩出新的生命；稚嫩的雏鹰，是在痛苦中，倔强的展翅。一切的一切，都要经历过痛苦的探索，才会收到成功的喜悦。早安！', 2);
INSERT INTO `sententce` VALUES (160, '一缕晨光柔和舒适,一份祝福快乐陪伴,一声问候送去关怀,一个微笑开心祝愿,一个拥抱完美一天,一条信息友谊相牵,一句话语朋友早安!', 2);
INSERT INTO `sententce` VALUES (161, '清新的空气，快乐的气息，透过空气射入你的灵魂里，将阳光呼吸，将幸福抱起，泡一杯甜蜜的咖啡，品尝幸福的好处，理解祝福的信息，祝你早安温馨无比!', 2);
INSERT INTO `sententce` VALUES (162, '如果星星知道自我背负着所有的愿望。那它会发奋地闪射。当你看见最亮的一颗星星时。那是我为你许的愿;愿你平安愉悦。', 2);
INSERT INTO `sententce` VALUES (163, '其实，没有什么东西是不能放手的。时日渐远，当你回望，你会发现，你以前以为不能够放手的东西，只是生命里的一块跳板，令你成长。早安！', 2);
INSERT INTO `sententce` VALUES (164, '改变，永远不嫌晚。无论你是几岁，也无论你目前所处的境况有多糟，只要立定目标一步一步往前走，人生随时都有翻盘的可能性。早安！', 2);
INSERT INTO `sententce` VALUES (165, '人之所以有一张嘴，而有两只耳朵，原因是听的要比说的多一倍。', 2);
INSERT INTO `sententce` VALUES (166, '这是一条独一无二的健康快乐好运信息，装着我的问候，真诚的祝福溜到了你手机，祝你天天快乐!查收后请发给心里惦记的朋友，别自个儿独吞哦', 2);
INSERT INTO `sententce` VALUES (167, '白日欺人，难逃清夜之鬼报；红颜失志，空贻皓首之悲伤。早安。', 2);
INSERT INTO `sententce` VALUES (168, '偶尔，只需要一个鼓励的微笑，就能够说服自己继续坚强下去。早安！', 2);
INSERT INTO `sententce` VALUES (169, '每个人出生的时候都是原创，可悲的是很多人渐渐都成了盗版。你可能只是这个世界上的一个人，但对于某人来说，你就是全世界。早安！', 2);
INSERT INTO `sententce` VALUES (170, '阳光照获得的当地就有我给你的祝愿，雨水淋获得的当地就有我给你的问候，消息能抵达的当地就有我心爱的伴侣，早上好!祝你天天高兴，高兴永远!', 2);
INSERT INTO `sententce` VALUES (171, '清晨到，对着镜子照，照一照，笑一笑，所有烦恼都跑掉，抑郁忧愁全都消，快乐自然不会少。问候跟着来报到，给你道声早，祝你情绪妙，一天幸福乐逍遥。早安!', 2);
INSERT INTO `sententce` VALUES (172, '不到最后一秒，就不会知道究竟是谁胜利，所以哪怕只有一秒，也别轻言放弃。', 2);
INSERT INTO `sententce` VALUES (173, '没有人嘲笑你的梦想，他们只是嘲笑你的实力！', 2);
INSERT INTO `sententce` VALUES (174, '如果做不到彼此理解，希望做到彼此諒解;如果做不到彼此相愛，希望做到彼此相容。', 2);
INSERT INTO `sententce` VALUES (175, '不要追求外表，它会骗人。不要追求财富，它会消失。追求一个能让你经常微笑的人吧，因为微笑会让你灰暗的世界豁然开朗，阳光明媚。', 2);
INSERT INTO `sententce` VALUES (176, '做人不要那么敏感，也不要那么心软，太敏感和太心软的人，肯定过得也不快乐，别人随便的一句话，你都要胡思乱想一整天。或许太重感情的人，日子终究不会好过，分分钟把你虐的万劫不复。早安！', 2);
INSERT INTO `sententce` VALUES (177, '甘露为你擦亮晶莹的明眸，阳光为你烘烤温暖的味道，问候为你带来快乐的奇妙，清新的早晨，希望我的一条信息，给你一天简单而充实的幸福，早上好。', 2);
INSERT INTO `sententce` VALUES (178, '喜好一种声响，是和风吹落露水，赏识一幅景色，是明月装点星空;沉醉一种气味，是幽兰洋溢空谷;祝愿一位伴侣，是笑看消息的你。早上好!', 2);
INSERT INTO `sententce` VALUES (179, '如果没有超强的社交潜力，那么具备过硬的才华；如果没有一颗坚强的心，就学会忘记和知足。', 2);
INSERT INTO `sententce` VALUES (180, '轻轻的我来的，悄悄的又走了，忘了带走一个东西，就是愉悦，因此你要好好的为我保存这份愉悦哟，不然我随时能够找你的麻烦，嘿嘿，早上好，兄弟姐妹!', 2);
INSERT INTO `sententce` VALUES (181, '这是条绝无仅有的安康高兴好运消息，装着我的问候，朴拙的祝愿溜到了你手机，祝你天天高兴!查收后请发给心里想念的伴侣，别自个儿独吞哦', 2);
INSERT INTO `sententce` VALUES (182, '每个人的心里都藏着一个了不起的自己，只要你不颓废不消极，一向悄悄酝酿着乐观！培养着豁达坚持着善良！只要在路上，就没有到达不了的远方！', 2);
INSERT INTO `sententce` VALUES (183, '早晨起床伸懒腰，对着镜子哈哈笑，说声早安会心笑，压力全抛无烦恼，刷牙洗脸哼小曲，开开心心一天到，问候不少在今朝，早安一生愿你好。早安。', 2);
INSERT INTO `sententce` VALUES (184, '你所做的事情，也许暂时看不到成果，但不要灰心或焦虑，你不是没有成长，而是在扎根。', 2);
INSERT INTO `sententce` VALUES (185, '别把最好的时光，浪费在无谓的等待与犹豫不决中。', 2);
INSERT INTO `sententce` VALUES (186, '早晨空气真正好，出门摔了一大跤;嘴巴亲吻黄土地，双手抓满黄金条;浑身沾满金如意，眼前金豆一个劲的冒;接到信息的朋友，每一天早晨都要来摔跤。哈哈，朋友，早安!', 2);
INSERT INTO `sententce` VALUES (187, '天空亮了，早晨到了;花儿开了，草儿笑了;手机响了，信息来了;你看到了，脸儿红了;我想你了，我爱你了;看看东方，精神来了;迈开腿了，赴约去了;早安了，等你了!', 2);
INSERT INTO `sententce` VALUES (188, '最近各种真的，假的新闻，好的，恶意的评论，希望世界多些阳光，正能量，多些用温暖的眼光看完美事物的人。早安。', 2);
INSERT INTO `sententce` VALUES (189, '低质量的勤奋，但是是营造一个我很努力的幻觉。勤奋不是马不停蹄，而是有效利用手头的时间；努力不是一味埋头苦干，而是用智慧解决问题。', 2);
INSERT INTO `sententce` VALUES (190, '决定你的人生高度的，不是你的才能，而是你的人生态度！', 2);
INSERT INTO `sententce` VALUES (191, '简单的事情重复做，重复的事情坚持做，坚持不是为了感动谁，也不为证明给谁看而是我知道，一路奔跑总比原地踏步的好，早安。', 2);
INSERT INTO `sententce` VALUES (192, '如果你向上天寻求帮忙，说明你相信老天的潜力。而如果上天不帮你，则意味着他也相信你的潜力。', 2);
INSERT INTO `sententce` VALUES (193, '这个世界并不是掌握在那些嘲笑者的手中，而恰恰掌握在能够经受得住嘲笑与批评并不断往前走的人手中。早安！', 2);
INSERT INTO `sententce` VALUES (194, '清晨的完美就如青草般芳香，如河溪般清澈，如玻璃般透明，如甘露般香甜。亲爱的兄弟姐妹，早上好，愿你这天有个好情绪!早晨，清凉的空气如牛乳般新鲜，冉起的太阳如梦想般期望。天明，亮起的不只是阳光，还要有你的好情绪哦，早安!睁开眼，缓一缓;快起床，伸懒腰;笑一笑，完美的一天又开始了。早安，祝你这天好情绪，工作顺利，生活甜美。', 2);
INSERT INTO `sententce` VALUES (195, '总有一天你会明白，委屈要自己消化，故事不用逢人就讲。真正理解你的人没几个，大多数人只会站在他们自己的立场，偷看你的笑话。你能做的，就是把秘密藏起来，然后一步步变强大。早安！', 2);
INSERT INTO `sententce` VALUES (196, '快，等不及了，我要随着太阳的升起率领天兵天将各路神仙飞速来到你身边，把最完美的祝福第一个送给你：愿你睁眼见快乐，伸手抓如意;抬腿跨祥云，张嘴进幸福;然后，一天都顺利!朋友，早安!', 2);
INSERT INTO `sententce` VALUES (197, '清晨到，清晨早，清晨送你灵丹妙药，晨鸣声声，清头脑，晨光满面，精神好;晨风拂来，烦恼消;晨露闪闪，信心到，愿你每一天乐逍遥，早安。', 2);
INSERT INTO `sententce` VALUES (198, '当你放弃时，只有一小段日子很简单，后面的一辈子可能都会越过越难。而当你坚持住，努力的当下可能会有点苦，但未来的每一天却会越过越简单。早安！', 2);
INSERT INTO `sententce` VALUES (199, '晨星一点万物醒，晨光一片送光华，晨风一缕春发芽，晨露一滴开鲜花，信息一条送祝福，请你一一都笑纳，祝你一天情绪爽，快乐笑容似彩霞!', 2);
INSERT INTO `sententce` VALUES (200, '努力是人生的一种精神状态，往往最美的不是成功的那一刻，而是那段努力奋斗的过程。朋友，愿你努力后的明天更精彩，早安!', 2);
INSERT INTO `sententce` VALUES (201, '晚上好，送上我温馨的问候，洗去你一天的疲惫，祝你明天会更好!', 4);
INSERT INTO `sententce` VALUES (202, '星星眨着眼，点缀你美丽的梦乡，让你的梦境更加美丽。月亮扬起帆，为你的梦想而护航，让你的美梦成真。快乐相陪，美梦常伴。', 4);
INSERT INTO `sententce` VALUES (203, '思念不因劳累而改变，问候不因疲惫而变懒，祝福不因休息而变缓，关怀随星星眨眼，牵挂在深夜依然，轻轻道声：晚上好!', 4);
INSERT INTO `sententce` VALUES (204, '生活最沉重的负担不是工作，而是思想压力。人生最疲惫的劳累不是身累，而是心累。朋友，放下一切，该吃就吃，睡时就睡，祝晚安安眠，眠好好梦。', 4);
INSERT INTO `sententce` VALUES (205, '秋天到，秋天好，都说秋眠不觉晓，白昼去，深夜来，祝你美梦睡到饱。隔夜有微风，梦醒无烦恼，熏香伴你眠，明天会更好！', 4);
INSERT INTO `sententce` VALUES (206, '春安夏安秋安冬安年年平安。你的平安是我的心愿，我的祝福愿你：身安心安早安晚安一生平安。', 4);
INSERT INTO `sententce` VALUES (207, '暮春之夜，微风渐暖，睡意缱绻，移身临窗，近看柳枝月色下翩舞摇曳，遥听池塘绵绵蛙鸣。携一份恬淡，悍然入梦。晚上好。', 4);
INSERT INTO `sententce` VALUES (208, '夜幕降临了，我的信息发送了，愿我的祝福能够消除你一天的疲惫，洗去你一天的劳累，带你进入美妙的梦境。祝你平安入睡，一觉天明。', 4);
INSERT INTO `sententce` VALUES (209, '想着开心的事，不想烦恼的事；想着完美的事，不想丑恶的事；想着幸运的事，不想倒霉的事；想着幸福的事，不想痛苦的事，想着想着，你就睡着了。', 4);
INSERT INTO `sententce` VALUES (210, '春安夏安秋安冬安年年平安。你的平安是我的心愿，我的祝福愿你：身安心安早安晚安一生平安。', 4);
INSERT INTO `sententce` VALUES (211, '立秋天高云淡风轻，夜晚悠然静雅闲舒，情绪闲逸简单开怀，清唱泄压无负畅笑，问候温馨情切暖怀，嘴角上翘眼眯心乐，信息目的到达最妙，愿你天天开怀常笑。晚安。', 4);
INSERT INTO `sententce` VALUES (212, '撕下伪装，为自己变一变脸，由严肃变得温和慈祥。放下包袱，为自己放松一下情绪，由紧张变得舒心惬意。静下心来泡杯清茶，悠闲地看看新闻，快快乐乐的好梦。晚安!', 4);
INSERT INTO `sententce` VALUES (213, '星星在银河眨眼，为你巡逻整夜不眠；月儿在夜空高悬，为你平安日日清减；我在相同城市的另一边，为你的梦境祝愿：乖宝贝，晚上好！', 4);
INSERT INTO `sententce` VALUES (214, '银杏叶缓缓从指间滑落，上方有你的笔迹。我站在雨中，离你是那么远，好想晓得谁会站在你的伞边。', 4);
INSERT INTO `sententce` VALUES (215, '在这宁静的夜空，我让蚊子给你捎来悄悄的问候：瞧！听见“嗡嗡嗡”的声音了吗？那是我牵挂的千千万万。感受到“啵”的一声了吗？无论距离多远，总有我在陪你。你在睡觉前也十分想我吧，那就请拍打下蚊子示意下吧。晚安！', 4);
INSERT INTO `sententce` VALUES (216, '有钱，用不到下辈子;貌美，不能当饭吃;幸福，就是两个人过日子。最美的日子，无非是我在闹，你在笑，如此足矣。晚上好，朋友!', 4);
INSERT INTO `sententce` VALUES (217, '朋友常来挂念，忘记白天工作的劳累，抛开日常生活的琐碎，让习习晚风当床，让丝丝清凉当被，让我完美祝福陪你入睡，晚安!好梦!', 4);
INSERT INTO `sententce` VALUES (218, '一句挂念，带来唯美的笑颜;一声问候，带来真诚的诺言，一份纯真，带来收获的喜悦;一条信息，带来沁人的香甜。夏夜，愿我的信息带给你深深的祝愿，晚安!', 4);
INSERT INTO `sententce` VALUES (219, '天色变更快，我来送关心，出门要加衣，不能再俏皮，漂亮是要的，健康也莫疏忽，要是冻感冒，天天把罪遭。气象冷了，留神保暖哟！', 4);
INSERT INTO `sententce` VALUES (220, '今晚温馨笑一笑，舒舒服服睡个觉，明天醒来笑一笑，整天生活有情调，收到信息笑一笑，一切烦恼都忘悼!晚上好!', 4);
INSERT INTO `sententce` VALUES (221, '晚上好，长夜漫漫，清风是我的笑颜;灯光闪闪，霓虹是我的眷恋;激情荡荡，回忆是我的温暖，祝福连连，信息是我的祝愿，愿这唯美夜晚让你收获人生非凡，晚安!', 4);
INSERT INTO `sententce` VALUES (222, '上班不瞌睡，手机调静音，晚上准时睡，放弃心杂念，忧愁全抛弃，欢乐也淡然，舒服睡一天，补个好睡眠，祝你做个好梦。', 4);
INSERT INTO `sententce` VALUES (223, '一夜好梦，忘记所有忧愁;一夜香甜，抛却所有烦恼;一夜深睡，甩掉所有苦痛;一觉醒来，开启新的完美。朋友晚安。', 4);
INSERT INTO `sententce` VALUES (224, '每当黑夜来临，便是我想你的开始，星星不眨眼，你就为它闪烁，今日是北半球黑夜最长的一天，也是我一年中想你最多的一晚！', 4);
INSERT INTO `sententce` VALUES (225, '在这宁静的夜晚，寄上我温馨的祝福，带去我深深的思念，愿我的一声祝福洗去你一天的劳累，一句晚安带你进入美妙的梦境!一片心意使你天天平平安安。', 4);
INSERT INTO `sententce` VALUES (226, '把一身疲惫甩在家门外，晚饭间家人的谈笑让你简单自然。看看新闻咨询让你遍知天下事，洗个澡泡个脚让你神清气爽，舒舒服服睡个觉让你美梦一晚。说一声晚安!道一句你辛苦了!', 4);
INSERT INTO `sententce` VALUES (227, '劳累一整天，但是为三餐。简单或艰难，苦辣酸与甜。素食心愈安，宁静可志远。自由需金钱，暖心亲密谈。规划好明天，朋友你晚上好!', 4);
INSERT INTO `sententce` VALUES (228, '一闪一闪亮晶晶，天上的星星眨眼睛，寂静的夜空，送你一堆好梦，愿你在人生的旅途中，烦恼都成空，朋友，晚上好！', 4);
INSERT INTO `sententce` VALUES (229, '卸去一天的重负，轻轻闭上你的眼睛，让快乐悄悄进入你的梦乡，让幸福静静守在你的身旁，让我的祝福为你建造一个完美的梦境。晚上好！', 4);
INSERT INTO `sententce` VALUES (230, '黑夜里，那满天繁星，是我凝视你的眼睛。那皎洁明月，是我思念你的神情。那浪漫轻风，是我相伴你的梦萦。那明灭的灯光，是我祝福你的心声：晚安!', 4);
INSERT INTO `sententce` VALUES (231, '微风吹来丝丝秋意，月亮照出梦的甜蜜，亲爱的朋友，一声问候，一个愿望送给你，希望你每一天能少一点忧愁，多一些快乐，少一点烦恼，多一些顺意，祝你每一天快乐相随，晚上好!', 4);
INSERT INTO `sententce` VALUES (232, '晚上好，遥遥的梦亮起一盏灯，听我心愿一声声，但愿你的人生再也没有伤痕，但愿你平安一程又一程，但愿所有的完美装满您的梦，祝你今晚好梦。', 4);
INSERT INTO `sententce` VALUES (233, '卸下一天的烦恼，幸福此刻围你绕。除去紧张的情绪，简单自由乐不停。朋友祝福已来到，看到信息开口笑。凉爽夜晚伴月光，幸福快乐一整晚。晚上好，宝贝。', 4);
INSERT INTO `sententce` VALUES (234, '白天有你就有梦。晚上有梦就有你。你要好好照顾你自己。不要感冒流鼻涕。要是偶尔打喷嚏。那就代表我想你。', 4);
INSERT INTO `sententce` VALUES (235, '幸福很简单，就是每一天过得平淡完美。每一天花点时间，满足自己的饥渴。因为我们追求的是自己的幸福，而不是比别人幸福，晚上好!', 4);
INSERT INTO `sententce` VALUES (236, '晚上好，今晚眨一下眼，代表我在惦记你;眨两下眼，代表我在想念你;眨三下眼，代表我十分想念你;不停眨眼，嘿，代表你用眼过度，早点休息吧!晚安!', 4);
INSERT INTO `sententce` VALUES (237, '你事业有成我替你开心，你身体健康我真心开心；你生意兴隆我替你高兴，你休息安稳我真心高兴；我知道你很忙，你很多应酬，但是我也知道你需要休息，需要更多时间照顾好自己的身心。朋友，你要好好的，休息，睡觉。晚安！', 4);
INSERT INTO `sententce` VALUES (238, '夜来了，为你洗洗脚，让一天的劳累随风而去；为你揉揉肩，放松下紧张一天的神经；为你唱首歌，驱走一天的不快与烦闷。朋友，做个美梦。', 4);
INSERT INTO `sententce` VALUES (239, '听说思念一个人会让她彻夜难眠，听说梦到一个人会让她半夜惊醒，为了让你能够安然入睡，我决定忍痛不想你不梦你。祝你好梦!', 4);
INSERT INTO `sententce` VALUES (240, '长江后浪推前浪，疲惫死在祝福上，忧愁海啸里荡漾，烦恼撞在大坝上，愉悦直冒幸福光，开心翻在沙滩上，你的笑声掀笑浪。读完信息心花放，愿你乐乐呵呵入梦乡，晚安好梦到天亮!', 4);
INSERT INTO `sententce` VALUES (241, '月儿窗外盯梢，眯缝着眼睡不着觉。汗水湿了问候，借着夜风来捎。屏幕光亮一闪，跳出一串快乐符号。祝你睡个好觉，晚安!', 4);
INSERT INTO `sententce` VALUES (242, '宁静的晚上，远离了喧嚣。在此为你送去一声祝福，消灭一天的劳累；为你送去一句问候，摧毁一天的烦恼，此刻为你发一条信息，你将会延续一晚上的美梦。祝你晚安！', 4);
INSERT INTO `sententce` VALUES (243, '今日下雨，就像降落来临，问候不只是在在夜里，祝福永恒藏在在心底，雨停而不止，夜深却牵挂依然，宝贝，晚安!', 4);
INSERT INTO `sententce` VALUES (244, '星星在银河眨眼，为你巡逻整夜不眠;月儿在夜空高悬，为你平安日日清减;我在相同城市的另一边，为你的梦境祝愿:乖宝贝，晚上好!', 4);
INSERT INTO `sententce` VALUES (245, '生活总会有酸有甜，能微笑应对便是强者;人生总会有得有失，能平淡看待便是智者;朋友总会有聚有散，能经常联系便是知己。晚上好!', 4);
INSERT INTO `sententce` VALUES (246, '深呼吸，甩掉所有脾气，淋场雨，放弃所有复杂，等彩虹，等待所有美丽，赞生命，如此伟大的信仰，睡一觉，和天亮，说句晚安。', 4);
INSERT INTO `sententce` VALUES (247, '鲜花爬满整片的原野，月光闪耀在波光粼粼的湖面，微风把温馨悄悄吹进你我的心田，在这美丽的夜晚，为你送上祝愿，晚上好。', 4);
INSERT INTO `sententce` VALUES (248, '夕阳洒下余辉，星光露出笑脸，月光修改思念，静静一页祝福，愿你将压力压扁，和烦恼分离，与幸福缠绵，和快乐亲密，晚安好梦甜蜜。晚安!', 4);
INSERT INTO `sententce` VALUES (249, '晚上，对着孤灯，我陷入不可名状的思念之中，切实排遣不开时，我排徊在我俩漫步的海滩草地，对着星星月亮，声声召唤着你！', 4);
INSERT INTO `sententce` VALUES (250, '工作有点累，梦里直直背；工作有点苦，梦里享享福；工作有点烦，梦里解解馋；工作有点忙，梦里能补偿。晚安，祝你好梦！', 4);
INSERT INTO `sententce` VALUES (251, '哈喽，当你收到这条信息的时候，我真的是深感抱歉，把你吵醒了!说声晚安吧，祝你不要在梦里遇见我我怕你不愿醒来，哈哈哈!', 4);
INSERT INTO `sententce` VALUES (252, '有朋友关心是一种幸运，有朋友鼓励是一种督促，有朋友思念是一种幸福，有朋友祝福是一种愉快，愿我小小的问候给你带来安慰。', 4);
INSERT INTO `sententce` VALUES (253, '阳光很美，比不上朋友的抚慰；天空很美，比不上友谊的装点；星星很美，比不上问候的可贵。', 4);
INSERT INTO `sententce` VALUES (254, '在这完美的夜晚，夜空的繁星代表我温馨的祝福，窗外皎洁的月色洒在你身上，替你洗去一天的劳累，愿你今夜有一个甜蜜的梦境!', 4);
INSERT INTO `sententce` VALUES (255, '工作是忙是闲，让健康永远;联系是多是少，让问候永远;距离是远是近，让牵挂永远;生活是苦是甜，让平安永远。晚安，好梦!', 4);
INSERT INTO `sententce` VALUES (256, '窗外知了声声阵阵；想起了你情情真真；风风雨雨都归凡尘；生生世世惜你缘分；枕边发出心中信息；祝福虽短情意很深；朋友千万要记在心；道声晚安送去安稳！', 4);
INSERT INTO `sententce` VALUES (257, '劝烦恼打个小盹，让快乐冒个小泡;让痛苦小憩歇会儿，让幸福接连赛跑;哄晦气睡个长觉，等好运悄悄来到。明天是崭新的一天!', 4);
INSERT INTO `sententce` VALUES (258, '贴心祝福送给你，愿你天天都有善意情，每晚都做美梦。每时有人关心，每分有人思念，每秒出色人生。妄想都实现，快乐永相伴。我的祝福，要牢记心间。', 4);
INSERT INTO `sententce` VALUES (259, '夜晚到，多完美，送个信息好上好：烦恼抛，舒心抱，日间纷扰都赶跑;星星瞧，月亮耀，你的美梦真不少;风儿笑，虫儿祷，今夜安睡乐淘淘!', 4);
INSERT INTO `sententce` VALUES (260, '劝烦恼打个小盹，让快乐冒个小泡;让痛苦小憩歇会儿，让幸福接连赛跑;哄晦气睡个长觉，等好运悄悄来到。明天是崭新的一天!', 4);
INSERT INTO `sententce` VALUES (261, '星星在银河眨眼，为你巡逻整夜不眠;月儿在夜空高悬，为你平安日日清减;我在相同城市的另一边，为你的梦境祝愿：乖宝贝，晚安!', 4);
INSERT INTO `sententce` VALUES (262, '看着夜空中的月亮圆了一轮有一轮，盼望你的梦境也想月亮一样美满。', 4);
INSERT INTO `sententce` VALUES (263, '夜幕降临，我托黑夜带给你幸运，托月光带给你温馨，托星晨带给你美满，托鸟儿带给你安康，天不早了，注意身体，别再熬夜了，晚安!', 4);
INSERT INTO `sententce` VALUES (264, '晚上好，城市的夜空没有繁星点点!但是却湮没不了我对你的思念之光!炎炎的夏夜没有禅鸣声声!但是却少不了我送去的祝福点点!点点思念伴你晚安，声声祝福望你好梦!', 4);
INSERT INTO `sententce` VALUES (265, '遥寄相思与日月，点燃祝福心灯;快乐随风送真情，描绘幸福图腾;问候点点几多情，祝你幸福伴美梦!晚安!', 4);
INSERT INTO `sententce` VALUES (266, '一个早安吻，愿你一天好情绪；一个午安吻，愿你中午小睡养颜；一个晚安吻，愿你一夜睡的香甜。亲吻情人节来到，愿你事事顺利，天天好情绪！', 4);
INSERT INTO `sententce` VALUES (267, '直销优质睡眠，推销驱除疲倦，报销烦恼杂乱，促销美梦连连，放下压力的包袱，换上简单新装，愿你安心入眠，好梦甜甜，晚安!', 4);
INSERT INTO `sententce` VALUES (268, '自从咱们离开后，我像一只孤单的大雁，扇动着疲乏的翅膀，望天也迷茫，望水也迷茫，但我衷心肠祝福你！', 4);
INSERT INTO `sententce` VALUES (269, '捕几只萤火虫的光，铺一张舒适的床，采几许晚霞的美，编织你温暖的梦，挂漫天闪亮的星辉，留一句晚安陪你入睡，亲爱的，晚安。', 4);
INSERT INTO `sententce` VALUES (270, '朋友，是两弯新月，一个在莲塘，一个在天上；友人，是两颗星星，在安静的夜晚，把彼此照亮；朋友，是两个太阳，即便在寒夜，心里也充斥阳光！', 4);
INSERT INTO `sententce` VALUES (271, '写一首诗歌，带去我的思念；送一缕清风，给你温馨祝愿；致一声问候，让你酣然成眠；唱一首歌谣，请你莫要忧烦；道一句晚安，愿你夜夜平安。晚安。', 4);
INSERT INTO `sententce` VALUES (272, '每一天我都有一个梦想,让你收到我的祝福,心里会开心快乐,一天的烦恼能够消除,睡觉熟得像猪,甜蜜如乳,一早醒来,得见美丽的日出晚安,让梦开始进入', 4);
INSERT INTO `sententce` VALUES (273, '长夜漫漫，我为你精心调制了一剂安眠药：十分乐观加一分豁达，十分糊涂加一分放松，去火气三分，不要焦，不要燥，以宽心为引，用我的爱心汤服下。包你好梦连连，睡眠充足，一觉醒来容光焕发，精神倍儿爽!', 4);
INSERT INTO `sententce` VALUES (274, '这样的深夜，你在做什么。这样的深夜，我在思念你。你看那天上的星星，颗颗代表我的祝福。睡吧，睡吧，明天再告诉我你到底收到了多少祝福。晚安。', 4);
INSERT INTO `sententce` VALUES (275, '现代社会，压力很大，焦虑失眠，比比皆是，中医重本，天人合一，入夜则寐，放昼则寤，体脑并用，不要疲劳，豁达开朗，心态平和，修身养性，觉睡得好，信息送上，天天好觉。晚安！', 4);
INSERT INTO `sententce` VALUES (276, '遥遥的梦亮起一盏灯，听我心愿一声声，但愿你平安一程又一程，但愿所有的完美装满您的梦，祝您今晚安然入睡，好梦!', 4);
INSERT INTO `sententce` VALUES (277, '无论与你间隔有多远，一份关怀永远在，渴望能听到你过得开怀！', 4);
INSERT INTO `sententce` VALUES (278, '夜幕临，蝉蛐鸣，还有蛙唱来合声;月光明，清风吹，还有珍露来添凉;发信息，送祝福，晚安一声送梦乡;好梦陪，甜梦随，嘴角一弯心还美。晚安好梦。', 4);
INSERT INTO `sententce` VALUES (279, '要记住，没有任何事任何人，需要你过了半夜点还苦想不睡的，累了就睡觉，如此简单，祝你做个好梦，晚安。', 4);
INSERT INTO `sententce` VALUES (280, '仰望天空，我不必须能看到繁星漫天;临渊而叹，我抓不住流淌的时间;你看到我笑的灿烂，你看不到我泪流满面;晚安吧，好梦吧，一转眼就是三千里江山!', 4);
INSERT INTO `sententce` VALUES (281, '当你在梦中轻触我的脸颊，温顺使全部宇宙为之发抖。于是我甘心化作一粒小小的尘埃，溶入永远不醒的梦境。', 4);
INSERT INTO `sententce` VALUES (282, '途径是波折的，甚至是曲折的，但它究竟是越走越宽。祝你将来一路顺风。', 4);
INSERT INTO `sententce` VALUES (283, '这安静的夜晚，寄上我温馨的祝福，带去我深深的怀念，愿我的一声祝福洗去你一天的操劳，一句晚安带你进入甜美的梦乡，一片情意使你睡得更香！', 4);
INSERT INTO `sententce` VALUES (284, '微风吹来丝丝秋意，月亮照出梦的甜蜜，亲爱的朋友，一声问候，一个愿望送给你，希望你每一天能少一点忧愁，多一些快乐，少一点烦恼，多一些顺意，祝你每一天快乐相随，晚安！', 4);
INSERT INTO `sententce` VALUES (285, '让夜风带走一天的疲惫，让月光驱走一天的烦恼，让星星点亮一天的好情绪，祝你简单入眠，美梦连篇，晚安。', 4);
INSERT INTO `sententce` VALUES (286, '夕阳抚慰你一天的疲累，星辉按揉酸痛的背，夜晚要卸落工作的累赘，开心打闹，休憩大脑，听轻音乐，品美酒佳肴，放松精神，洗去烦恼，美美的睡一觉。祝美梦，晚安。', 4);
INSERT INTO `sententce` VALUES (287, '假如人生不曾与你相遇，我不会相信，有一种人一认识就觉得温馨。你是那抹温馨里的甜蜜，爱你无需浪漫的言语，只需一生一世的美丽，亲爱的晚安!', 4);
INSERT INTO `sententce` VALUES (288, '一枚绿叶在你面前飘荡，带着山野的馨香，云天的寄托，盛夏的幻想，归途的舒服，轻轻捎你一份安祥！', 4);
INSERT INTO `sententce` VALUES (289, '我以为，我已经把你藏好，藏在泛黄的记忆里。谁知，那轻轻的银铃声，又撩起我向往的情绪，我欲以美丽的织锦，缀成无数的祝福给你。', 4);
INSERT INTO `sententce` VALUES (290, '我愿化作一阵和风，穿过崇山峻岭来到你的窗前，将你温柔包围。你听见那遥遥的梦亮起一盏灯，听我心愿一声声，但愿你的人生再也没有伤痕，但愿你平安一程又一程，但愿所有的完美装满您的梦，祝你今晚好梦。流星划过天际的声音吗?不管距离多远，总有一个我在陪着你。亲爱的，晚安!今晚做个好梦!', 4);
INSERT INTO `sententce` VALUES (291, '晚安：在这宁静的夜晚，寄上我温馨的祝福，带去我深深的思念，愿我的一声祝福洗去你一天的劳累，一句晚安带你进入美妙的梦境!一片心意使你天天平平安安。', 4);
INSERT INTO `sententce` VALUES (292, '今日变天，当心着凉;注意身体，吃么么香;凉天添衣，少吃冰棒;吃香睡香，身体倍棒!晚安!', 4);
INSERT INTO `sententce` VALUES (293, '真挚的问候无需太多的语言，多灾的年月少不了真情的陪同，愿我的祝愿像一叶痴迷的小舟缓缓驶入您的港湾！为你带走一身疲惫！晚上是懊恼的停止，凌晨是快活的开端，晴天照出你残暴的心境，雨天冲去你所有的发愁，无论是迟早，不论是晴雨，我都愿陪在你身边，愿你快乐每一天！', 4);
INSERT INTO `sententce` VALUES (294, '该做的事做了，该说话的话说了，该看的风景看了，该玩的游戏玩了，该写的总结写了，该做的梦也该做了吧？早点睡吧，晚安！', 4);
INSERT INTO `sententce` VALUES (295, '一天时间又过去，不知你是忧还是喜，若是忧愁都收起，要是喜悦则延续。愿你每一天都开心，快快乐乐才会有好身体！夜深了，晚安！', 4);
INSERT INTO `sententce` VALUES (296, '尺有所长，寸有所短，高有高的长处，低有低的优势。富有富的苦恼，穷有穷的开心。何必盯着他人风光，抱着嫉妒独自惆怅。不管高人一等，还是矮人半截。只要尽本份，做好自己就好。晚安~', 4);
INSERT INTO `sententce` VALUES (297, '我们此刻比赛，谁先梦见到周公!如果我赢了，你让我亲一下!如果你赢了，我让你亲一下!加油——快睡吧!明天早上信息公布比赛结果，明晚见面“颁奖”。晚安!', 4);
INSERT INTO `sententce` VALUES (298, '今日天色越来越晚，疲惫睡意更是充满，可脑海中你的身影依旧忽隐忽现，而内心中我的思念仍然牢牢深陷，忍不住想对你说：宝贝，晚安!愿你好梦甜甜!', 4);
INSERT INTO `sententce` VALUES (299, '生气容易长皱纹，开心就会变年轻，熬夜肯定会伤身，适当睡眠一身轻!提醒调皮又可爱的你：少在深夜晒月亮!容易出事!祝：睡眠甜甜!好梦圆圆!', 4);
INSERT INTO `sententce` VALUES (300, '你来自云南元谋，我来自北京周口，牵着你毛茸茸的小手，微微地咬上一小口，啊！是恋情让我们竖立行走！', 4);
INSERT INTO `sententce` VALUES (301, '阳光普照，园西心田春意浓；甘雨润泽，桃李枝头蓓蕾红。祝您节日高兴！', 4);
INSERT INTO `sententce` VALUES (302, '奉天承运，皇帝召曰：近日来，烦恼压力疲惫经常为非做歹，扰得民众睡觉不得安宁，特将三者发配充军到脑后，并派快乐舒心健康三位来抚慰大家，让大家安心入眠，开心入梦，钦比！朕的金口已开，你还不快快入睡！', 4);
INSERT INTO `sententce` VALUES (303, '我的梦中夜夜有你我想,我也必须走进了你的梦里?我们在同一星空下?织思念!晚安，祝今晚好梦!', 4);
INSERT INTO `sententce` VALUES (304, '夜晚来，问候到，愿你抛开烦恼乐逍遥;微风吹，星光照，愿你今夜安然入睡充足好;祝你今夜美梦甜甜。', 4);
INSERT INTO `sententce` VALUES (305, '请微风吹拂我的思念，请黑夜掩盖你的忧烦，请月光照耀我的依恋，请流星闪烁我的牵挂，请信息发送我的祝愿：祝你晚安!', 4);
INSERT INTO `sententce` VALUES (306, '忘记白天工作的劳累，抛开日常生活的琐碎，让习习晚风当床，让丝丝清凉当被，让我完美祝福陪你入睡，晚安!', 4);
INSERT INTO `sententce` VALUES (307, '晨曦之前的启明星，是我的双眼;朝霞之前的晨露，是我的泪水;黄昏之前的夕阳，是你的温暖;黑夜之前的黄昏，是你的晚安。朝朝暮暮，思念悠长!', 4);
INSERT INTO `sententce` VALUES (308, '风不吹，雨不下，此刻你什么都别怕;月光泻，星眼眨，时常我把你牵挂;云想衣，花想容，好梦伴你到天亮;祝你晚安。', 4);
INSERT INTO `sententce` VALUES (309, '睡一睡，精神好，烦恼消，快乐长;睡一睡，情绪好，做美梦，甜蜜蜜;睡一睡，身体健，头脑清，眼睛明。愿你酣然入梦，晚安!', 4);
INSERT INTO `sententce` VALUES (310, '写一首诗歌，带去我的思念;送一缕清风，给你温馨祝愿;致一声问候，让你酣然成眠;唱一首歌谣，请你莫要忧烦;道一句晚安，愿你夜夜平安。晚安。', 4);
INSERT INTO `sententce` VALUES (311, '夜深人静，风清气爽，完美的世界缠绵着梦想，道生晚安，挂念不断，愿温柔的臂弯守候在你的身边，信息声声，祝福连连，愿你今夜开心入眠，晚安!', 4);
INSERT INTO `sententce` VALUES (312, '我用“吸尘器”，吸走你一身的风尘，我用“按摩椅”，带走你一身的困乏，我用“足浴盆”洗，去你一天的疲劳，我用“七仙女”，给你一夜的好梦，睡前看看，美梦连连，醒后读读，快乐百倍!祝你幸福!', 4);
INSERT INTO `sententce` VALUES (313, '忙忙碌碌让生命和时间好久不见，简简单单让压力和烦恼好聚好散，快快乐乐让幸福和甜蜜形影结伴，漂漂亮亮让我和你说句晚安。', 4);
INSERT INTO `sententce` VALUES (314, '风铃在窗边摇摆，轻轻敲掉你的“心烦意乱”;花香在空气蔓延，慢慢化解你的“思绪万千”;我的信息在此时抵达，深深祝福你会“美梦徜徉”!', 4);
INSERT INTO `sententce` VALUES (315, '晚上好，思念不因劳累而改变，问候不因疲惫而变懒，祝福不因休息而变缓，关怀随星星眨眼，牵挂在深夜依然，轻轻道声：祝你晚安!', 4);
INSERT INTO `sententce` VALUES (316, '动人的故事让人久久回味，美妙的歌曲可能熏陶情操，浪漫的诗句把情写入心底，淡淡的茶香能够品出快乐的情绪，久违的始终在惦念。秋已尽，冬又来，天多变，雪花飘。深深祝福送给你，句句问候在心底，加衣防寒莫忘却，珍重身材，好好照料自己！', 4);
INSERT INTO `sententce` VALUES (317, '晚安：在这宁静的夜晚，寄上我温馨的祝福，带去我深深的思念，愿我的一声祝福洗去你一天的劳累，一句晚安带你进入完美的梦幻！一片心意使你每一天平安全安。', 4);
INSERT INTO `sententce` VALUES (318, '夜里，那满天繁星，就是我凝视你的眼睛。那皎洁明月，就是我思念你的神情。晚风轻轻拂来，带去我的问候：夜深了，做个好梦!', 4);
INSERT INTO `sententce` VALUES (319, '有些朋友如斯简略，简单到能够良久不用接洽，可就是不能忘记，思念如此神奇，神奇到无论何时都会莫名其妙的想起，朋友是什么？是悲哀时最想见的人，是打搅了不必说对不起的人，是辅助了不用说多谢的人，是步步分开也不用转变称说的人，是无论天南地北都时时牵挂的人，人之所以快乐，不是因为得到的多或计较的少，财产不是一辈子的朋友，而朋友却是一辈子的财富，真诚的祝你开心快乐每一天。', 4);
INSERT INTO `sententce` VALUES (320, '夜晚来，问候到，愿你抛开烦恼乐逍遥;微风吹，星光照，愿你今夜安然入睡充足好;祝你今夜美梦甜甜。', 4);
INSERT INTO `sententce` VALUES (321, '白天，当我看到太阳跟白云的时候不会寂寞，因为它们就像你灿烂纯挚的颜面一样，使我觉得暖和；晚上，我更不会孤独，由于月亮和星星里有你深深的思念。', 4);
INSERT INTO `sententce` VALUES (322, '一夜好梦，忘记所有忧愁;一夜香甜，抛却所有烦恼;一夜深睡，甩掉所有苦痛;一觉醒来，开启新的完美。朋友晚安。', 4);
INSERT INTO `sententce` VALUES (323, '送走一天的忙碌，忘掉一天的烦恼，重温一天的快乐，回想一天的完美，然后闭上眼睛，睡个好觉，晚安!', 4);
INSERT INTO `sententce` VALUES (324, '寂静的夜，愿月亮为你祈祷，星星为你唱摇篮曲，清风为你催眠，床为你带来放松，枕头带你进入梦乡，我的祝福送你好梦，晚安!', 4);
INSERT INTO `sententce` VALUES (325, '宁静夜，月亮圆，月光明，带去我，深思念。温馨星，闪闪闪，传递我，美祝愿，祝福你，美梦香，好梦甜，佳梦圆。', 4);
INSERT INTO `sententce` VALUES (326, '今日下雨，就像思念降落来临，问候不只是在夜里，祝福永恒藏在心底，雨停而想念不止，夜深却牵挂依然，晚安!', 4);
INSERT INTO `sententce` VALUES (327, '夜的黑暗挡不住我对你的思念，辗转反侧我孤枕难眠。思念你秀发的清香，思念你耳畔的亲昵，思念你深情的拥吻。没有我的夜晚，我托月光在送去我对你的思念。宝贝晚安!', 4);
INSERT INTO `sententce` VALUES (328, '夜晚因繁星而美美人生因相遇而美妙朋友因相助而情深恋人因相知而相爱愿爱你的人更爱你你爱的人更懂你！！祝你每一天快乐！！', 4);
INSERT INTO `sententce` VALUES (329, '星星的约定不曾坠落，青春的辉煌不曾褪色，暂时的失落烦恼算什么，早当一盆洗澡水泼出去了。亲人微笑和安慰拥抱着你，爱人的叮咛散发温热气息。愿你珍惜完美的拥有，梦里和开心握手。', 4);
INSERT INTO `sententce` VALUES (330, '月光亮着，夜空就不会黑暗；问候伴着，心灵就不会孤单；祝福传递，温暖送你。愿你今晚有个好梦，晚安！', 4);
INSERT INTO `sententce` VALUES (331, '将情绪放开，将烦恼放走，将身体放松，将快乐放入，将睡眠放沉。睡个好觉，晚安，朋友。', 4);
INSERT INTO `sententce` VALUES (332, '我们此刻比赛，?先梦?到周公!如果我赢了，你让我亲一下!如果你赢了，我让你亲一下!加油~~~快睡吧!明天早上信息公布比赛?果，明晚?面“?奖”', 4);
INSERT INTO `sententce` VALUES (333, '宁静的夜晚，柔柔月光带去我深深的思念。温馨的夜晚，闪闪星光传递我真挚的祝福。在这幸福的夜晚，一句晚安带你进入完美梦境。', 4);
INSERT INTO `sententce` VALUES (334, '喜报：今晚天象吉兆，“安眠”给你投怀送抱，周公邀你“熟睡”通宵，星月之光“简单”普照，“压力”愁云通通跑掉，月夜良霄，愿你简单入睡，安眠一夜。', 4);
INSERT INTO `sententce` VALUES (335, '以前喝酒是为了别人的一句：厉害!醉了;此刻喝酒是为了自己的一句：舒服!睡了;所以生活能够玩味，但是别逞强别受累!累了，就好好休息，祝你健康快乐!', 4);
INSERT INTO `sententce` VALUES (336, '早上太阳升起，好运追随着你；傍晚太阳偏西，一天过得如意；晚上星月争辉，美梦陪你入睡。四小时里，愿你被快乐肢解，被好运瓜分，乐在每一天。', 4);
INSERT INTO `sententce` VALUES (337, '没有星星的夜晚，我们当风把星星吹丢了；没有花香的夜晚，我们当雨把花打落了；不你的夜晚，我能做什么样的假设呢？在我想你时候，你会这样想我吗？', 4);
INSERT INTO `sententce` VALUES (338, '我问佛：如果遇到了能够爱的人，却又怕不能把握该怎样办?佛曰：留人间多少爱，迎浮世千重变，和有情人，做快乐事，别问是劫是缘。我爱的人我要亲手给他幸福，别人我不放心。晚安!', 4);
INSERT INTO `sententce` VALUES (339, '零点的最后一秒，路灯的最后一盏，我的勇敢最后一点点，写给了今日的最后一句，想你，念你，爱着你，直到我心跳的最后一次，亲爱的，晚上好。', 4);
INSERT INTO `sententce` VALUES (340, '夜深了，睡觉吧，送你几声呼噜吧：一声好运气，二声有福气，三声喜气罩，四声运气到。收到祝福开始呼噜吧，哈哈，晚上好！', 4);
INSERT INTO `sententce` VALUES (341, '宁静夜，月亮圆，月光明，带去我，深思念。温馨星，闪闪闪，传递我，美祝愿，祝福你，美梦香，好梦甜，佳梦圆。', 4);
INSERT INTO `sententce` VALUES (342, '我愿化作一阵和风，穿过崇山峻岭来到你的窗前，将你温柔包围。你听见那流星划过天际的声音吗?不管距离多远，总有一个我在陪着你。', 4);
INSERT INTO `sententce` VALUES (343, '我用手记忆了你的样貌，用耳记忆了你的声音，用唇记忆了你的味道，用眼睛记住了你的点点滴滴，用心记忆了你的一切，宝贝!我爱你，晚安!', 4);
INSERT INTO `sententce` VALUES (344, '星星眨着眼睛，伴你静静入眠，温柔将你包围，美梦即将来临，朋友真情温馨，美觉睡到天明。不管距离有多远，好朋友都在真诚祝福，祝你天天快乐，晚安!', 4);
INSERT INTO `sententce` VALUES (345, '晚上睡不着，怎样办?数数，太俗;吃安眠药，太伤身体，干脆就默念对你的祝福，准保你睡得香，祝你晚安!', 4);
INSERT INTO `sententce` VALUES (346, '夏天的月亮好大好圆，你看见了吗？那是我望着你熟睡的眼睛，你睡得越熟越甜，我就越安慰，我一向都在你的身边，宝贝——晚上好！', 4);
INSERT INTO `sententce` VALUES (347, '一年一度，夏季纷沓而来。高温登场，忙碌之时，别忘了防暑;一丝清凉，几许惬意，轻送到你身旁。惟愿生活一切安康，晚安哦!', 4);
INSERT INTO `sententce` VALUES (348, '夜幕降临，睡眠来伴，一天劳累，就此停止，一天好坏，从心放下;不思烦恼，莫念忧愁，心无挂碍，入睡安然。祝你今夜，好梦相随。', 4);
INSERT INTO `sententce` VALUES (349, '我想不梦见你，可心里却牵挂你；我想不挂念你，可心里却想着你；我想不想着你，可心里却爱好你；我想不喜欢你，那是本人骗自己。', 4);
INSERT INTO `sententce` VALUES (350, '微风吹来丝丝秋意，月亮照出梦的甜蜜，亲爱的朋友，一声问候，一个愿望送给你，希望你每一天能少一点忧愁，多一些快乐，少一点烦恼，多一些顺意，祝你每一天快乐相随，晚上好!', 4);
INSERT INTO `sententce` VALUES (351, '好听的话别当真，难听的话别较真。', 5);
INSERT INTO `sententce` VALUES (352, '不要指望麻雀会飞得多高，因为上方是鹰的领域，只有找准位置，才会幸福。', 5);
INSERT INTO `sententce` VALUES (353, '唯有痛才能解救失落的心灵。唯有伤才能填平情感的沟壑。', 5);
INSERT INTO `sententce` VALUES (354, '人生最大的勇敢之一，就是经历欺骗和伤害之后，还能持续信任和爱的潜力。', 5);
INSERT INTO `sententce` VALUES (355, '距离之所以可怕，因为根本不知道对方是把你想念，还是把你忘记。', 5);
INSERT INTO `sententce` VALUES (356, '青春和时光都会凋零，只有住在心里的那一朵花能够永远地灿烂下去', 5);
INSERT INTO `sententce` VALUES (357, '忘掉失败，但是要牢记失败中的教训。', 5);
INSERT INTO `sententce` VALUES (358, '有时候委屈了并不想哭，但一有人问怎样了，就会忍不住掉眼泪。', 5);
INSERT INTO `sententce` VALUES (359, '很多我们以为一辈子都不会忘掉的事情，就在我们念念不忘的日子里，被我们遗忘了。', 5);
INSERT INTO `sententce` VALUES (360, '晚上想想千条路，早上醒来走原路', 5);
INSERT INTO `sententce` VALUES (361, '耀眼的人很多，可闪到我的只有你一个。', 5);
INSERT INTO `sententce` VALUES (362, '生活其实也很简单，喜欢的就争取，得到的就珍惜，失去了就忘记', 5);
INSERT INTO `sententce` VALUES (363, '道不尽铁树千年恨，释不尽人妖千年情。', 5);
INSERT INTO `sententce` VALUES (364, '以前以为，悲哀是会流很多眼泪的，原来，真正的悲哀，是流不出一滴眼泪。什么事情都会过去，我们是这样活过来的。', 5);
INSERT INTO `sententce` VALUES (365, '爱情这把刀，他无锋无芒，却把你伤的那么深。', 5);
INSERT INTO `sententce` VALUES (366, '思念不能自已，痛苦不能自理，结果不能自取，幸福不能自予。', 5);
INSERT INTO `sententce` VALUES (367, '就算是微笑对着我你都笑的是那么勉强。', 5);
INSERT INTO `sententce` VALUES (368, '牵着你的手，无论是在哪里，我都感觉像是在朝天堂奔跑。', 5);
INSERT INTO `sententce` VALUES (369, '给我一条路，我教你怎样走。', 5);
INSERT INTO `sententce` VALUES (370, '孤意如月寂如莲，孤月独映人不眠，灯深月浅两相念。', 5);
INSERT INTO `sententce` VALUES (371, '全心付出过，生命才会精彩。', 5);
INSERT INTO `sententce` VALUES (372, '动了情的痞子连刀都拿不稳，怎样赢？', 5);
INSERT INTO `sententce` VALUES (373, '你对我好，我自然也会对你好，就是这么简单。', 5);
INSERT INTO `sententce` VALUES (374, '你的拒绝就像一个快巨石压在我的心头上，让我怎样开心起来。', 5);
INSERT INTO `sententce` VALUES (375, '真正你爱的人，其实总惹你生气，你却发觉不了他到底做错了什么。', 5);
INSERT INTO `sententce` VALUES (376, '谁应了谁的劫，谁又变成谁的执念。', 5);
INSERT INTO `sententce` VALUES (377, '只有经历了迷茫彷徨伤害痛苦的人，上帝才发个他一张pass卡，这是一张成长的晋级卡。', 5);
INSERT INTO `sententce` VALUES (378, '最后知道有很多事情，不是丢掉送走分手不再联络，就能够解决的。有了牵挂，一切就输了。', 5);
INSERT INTO `sententce` VALUES (379, '生活是种律动，须有光有影，有左有右，有晴有雨，滋味就含在这变而不猛的曲折里。', 5);
INSERT INTO `sententce` VALUES (380, '微笑，不是因为快乐的太久，是太久的时间里忘记去悲伤。', 5);
INSERT INTO `sententce` VALUES (381, '不去追逐你所渴求，你将永远不会拥有。', 5);
INSERT INTO `sententce` VALUES (382, '心缺自尊，言行必卑贱;心缺敬畏，言行必随便。', 5);
INSERT INTO `sententce` VALUES (383, '如果你足够勇敢说再见，生活便会奖励你一个新的开始。', 5);
INSERT INTO `sententce` VALUES (384, '内心再强大一点，就不会听风是雨。知道的事再多一点，就不会人云亦云。', 5);
INSERT INTO `sententce` VALUES (385, '你就应想办法跑得快，而不能老是琢磨怎样让别人慢下来。', 5);
INSERT INTO `sententce` VALUES (386, '强颜欢笑做故人，含泪隐伤自己扛。', 5);
INSERT INTO `sententce` VALUES (387, '女人，不需要倾国倾城，只需要一个男人为她倾尽一生。', 5);
INSERT INTO `sententce` VALUES (388, '事到如今你叫我如何在坚持自己的忠诚，一向都在利用我，把我当成你恋爱的棋子。', 5);
INSERT INTO `sententce` VALUES (389, '我只是希望向你伸出双手，去触碰你的寂寞。', 5);
INSERT INTO `sententce` VALUES (390, '别人稍一注意你，你就敞开心扉，你觉得这是坦率，其实这是孤独。', 5);
INSERT INTO `sententce` VALUES (391, '人生如果错了方向，停止就是进步。', 5);
INSERT INTO `sententce` VALUES (392, '有时候，你问的问题，对方一向在闪躲，就是在委婉的告诉你，真实的回答很残忍。', 5);
INSERT INTO `sententce` VALUES (393, '有些伤害，就如同用刀子在脚上划了一道口，每走一步都撕心裂肺的痛!', 5);
INSERT INTO `sententce` VALUES (394, '人生就像弈棋，一步失误，全盘皆输，这是令人悲哀之事；而且人生还不如弈棋，不可能再来一局，也不能悔棋。', 5);
INSERT INTO `sententce` VALUES (395, '一段感情，要经过多少风雨，才能经得起反复丈量。', 5);
INSERT INTO `sententce` VALUES (396, '嘴，迎接雨水的抚慰，将内心火辣的热情好好中和一下。', 5);
INSERT INTO `sententce` VALUES (397, '每个人出生时都是原创，但绝大多数人渐渐活成了盗版。', 5);
INSERT INTO `sententce` VALUES (398, '最后知道有很多事情，不是丢掉送走分手不再联络，就能够解决的。有了牵挂，一切就输了。', 5);
INSERT INTO `sententce` VALUES (399, '比起遇到心动的人，更想遇到让自己心安的人。', 5);
INSERT INTO `sententce` VALUES (400, '所谓的坚强，就是无疑的逞强。', 5);
INSERT INTO `sententce` VALUES (401, '有些人想想就算了，别去找了，说不定他早把你忘了。', 5);
INSERT INTO `sententce` VALUES (402, '推销产品要针对顾客的心，不要针对顾客的头。', 5);
INSERT INTO `sententce` VALUES (403, '人在的时候，以为总会有机会，其实人生就是减法，见一面少一面。', 5);
INSERT INTO `sententce` VALUES (404, '停下来休息的时候不要忘记别人还在奔跑', 5);
INSERT INTO `sententce` VALUES (405, '爱情本来并不复杂，来来去去但是三个字，不是我爱你我恨你，便是算了吧你好吗对不起。', 5);
INSERT INTO `sententce` VALUES (406, '从你走进我心里的那一刻，我就没打算再把你放出去。', 5);
INSERT INTO `sententce` VALUES (407, '我们始终都在练习微笑，最后变成不敢哭的人。', 5);
INSERT INTO `sententce` VALUES (408, '遇见你，感激。就算没有未来没有以后。', 5);
INSERT INTO `sententce` VALUES (409, '世上没有绝望的处境，只有对处境绝望的人', 5);
INSERT INTO `sententce` VALUES (410, '没有关心，没有体贴，没有一句温柔的话语，我的生命里除了你们的嘲讽已经别无所有。', 5);
INSERT INTO `sententce` VALUES (411, '只有你尽力了，才有资格说自己的运气不好。', 5);
INSERT INTO `sententce` VALUES (412, '一路走啦，是悲伤多过愉快还是愉快多过了悲伤，不再计较。', 5);
INSERT INTO `sententce` VALUES (413, '我不想忘记你，就把你尘封在我的回忆里。', 5);
INSERT INTO `sententce` VALUES (414, '有些人就像画纸上的画，即使擦去了也会留下痕迹。', 5);
INSERT INTO `sententce` VALUES (415, '生生的两端，我们彼此站成了岸。', 5);
INSERT INTO `sententce` VALUES (416, '如果人生能够刷新，复制，粘贴。那么一切是不是能够注销，关机，再重启。', 5);
INSERT INTO `sententce` VALUES (417, '生活中，我们常常被迫带着面具，但是，不要迷失自己。', 5);
INSERT INTO `sententce` VALUES (418, '如果结局不是我想要的，那么我宁愿不去参与这个过程。我有我的骄傲，凭什么为了你去卑微自己。', 5);
INSERT INTO `sententce` VALUES (419, '眼泪是我无言的安慰，微笑是我自嘲的卑微。', 5);
INSERT INTO `sententce` VALUES (420, '用我三生烟火，换你一世迷离。', 5);
INSERT INTO `sententce` VALUES (421, '时间没有等我，是你忘了带走我。', 5);
INSERT INTO `sententce` VALUES (422, '创造机会的人是勇者。等待机会的人是愚者。能说不能行，不是真智慧。', 5);
INSERT INTO `sententce` VALUES (423, '简单，而又温馨的生活才叫做幸福。', 5);
INSERT INTO `sententce` VALUES (424, '一个人最大的动力，除了兴趣，就是耻辱。', 5);
INSERT INTO `sententce` VALUES (425, '你要是愿意，我就永远爱你，你要不愿意，我就永远相思', 5);
INSERT INTO `sententce` VALUES (426, '我们必须理解失望，因为它是有限的，但千万不可失去希望，因为它是无穷的。', 5);
INSERT INTO `sententce` VALUES (427, '不要浪费你的生命，在你必须会后悔的地方上。', 5);
INSERT INTO `sententce` VALUES (428, '超过别人一点点，别人就会嫉妒你;超过别人一大截，别人就会羡慕你', 5);
INSERT INTO `sententce` VALUES (429, '人生，有时轻似风，淡如水，有时浓如油，烈如酒。', 5);
INSERT INTO `sententce` VALUES (430, '生命匆匆，内在的美，德行的美，是能够直抵人心的，这样的美就如空谷幽兰，自然高贵', 5);
INSERT INTO `sententce` VALUES (431, '年华里，我们失去的是一种情绪。', 5);
INSERT INTO `sententce` VALUES (432, '有些路很远，走下去会很累。但是，不走，会后悔。', 5);
INSERT INTO `sententce` VALUES (433, '晚上想想千条路,早上醒来走原路', 5);
INSERT INTO `sententce` VALUES (434, '如果你无法忘掉昨日，就不会有一个更好的明天。', 5);
INSERT INTO `sententce` VALUES (435, '有时候，闭上嘴，放下骄傲，承认是自己错了，不是认输，而是成长。', 5);
INSERT INTO `sententce` VALUES (436, '打算开创新事业时，十人中有一两人赞成时就可开始，以免太迟。', 5);
INSERT INTO `sententce` VALUES (437, '一个懒惰的少年将来就是一褴褛的老人。', 5);
INSERT INTO `sententce` VALUES (438, '生活，每一天都需要清晰的方向和前行的速度。同时，不要忘记去获得宁静的惬意与悠然的怀想。', 5);
INSERT INTO `sententce` VALUES (439, '没有背叛和谎言，我也不会那么悲哀。', 5);
INSERT INTO `sententce` VALUES (440, '生活常常出人意料。如果你不逼逼自己，根本不知道自己有多棒。', 5);
INSERT INTO `sententce` VALUES (441, '分手时，不哭。当然，不是要你一点都不哭。当着面，别哭，背地里，往死里哭。', 5);
INSERT INTO `sententce` VALUES (442, '任何的限制，都是从自己的内心开始的。', 5);
INSERT INTO `sententce` VALUES (443, '只是因为太年轻，所以所有的悲伤和快乐都显得那么深刻，轻轻一碰就惊天动地。', 5);
INSERT INTO `sententce` VALUES (444, '到最后，只是我们与旧时光相遇。一见如故，再见陌路。', 5);
INSERT INTO `sententce` VALUES (445, '爱一个人从来都是这样，明明想要月亮，但是却只能得到月光。', 5);
INSERT INTO `sententce` VALUES (446, '以前只是以前，过去只是过去，从前只是从前，回忆只是回忆，有什么好难过的!', 5);
INSERT INTO `sententce` VALUES (447, '不要指望，麻雀会飞得很高。高处的天空，那是鹰的领地。麻雀如果摆正了自己的位置，它照样会过得很幸福!', 5);
INSERT INTO `sententce` VALUES (448, '如果等待能够换来奇迹的话，我宁愿等下去，哪怕一年，抑或一生！', 5);
INSERT INTO `sententce` VALUES (449, '人多半是自私的，只有少半的人是无比自私的。', 5);
INSERT INTO `sententce` VALUES (450, '想要走的更快，请独行;要想走的更远，请结伴而行', 5);
INSERT INTO `sententce` VALUES (451, '一切有如流砂过隙，染指风华。', 5);
INSERT INTO `sententce` VALUES (452, '因为你，我不再爱哭；也是因为你，我眼泪成诗。', 5);
INSERT INTO `sententce` VALUES (453, '你是你人生的作者，何必把剧本写得苦不堪言。', 5);
INSERT INTO `sententce` VALUES (454, '谁能体会那撕心裂肺的痛，谁能给我一个不再心灰意冷的答复。', 5);
INSERT INTO `sententce` VALUES (455, '快乐和幸福那么相似，但是快乐就是幸福吗？', 5);
INSERT INTO `sententce` VALUES (456, '当一个女子在看天空的时候，她并不想寻找什么。她只是寂寞。', 5);
INSERT INTO `sententce` VALUES (457, '别说什么不稀罕，葡萄要吃到嘴里，才有资格说他酸。', 5);
INSERT INTO `sententce` VALUES (458, '以前拥有的不要忘记，属于自己的不要放弃，已经失去的留作回忆。', 5);
INSERT INTO `sententce` VALUES (459, '我所认为最深沉的爱，莫过于分开以后，我将自己，活成了你的样貌。', 5);
INSERT INTO `sententce` VALUES (460, '难过了不要告诉别人，自己陪着自己就好。', 5);
INSERT INTO `sententce` VALUES (461, '不信命运，所以比别人加倍努力;想改变自己，所以拼命学习;阴晴圆缺的社会努力打了白条，学习成了黑道。', 5);
INSERT INTO `sententce` VALUES (462, '善于妥协的女人，很宝贵。但是，只善于妥协的女人，很廉价。', 5);
INSERT INTO `sententce` VALUES (463, '我们始终都在练习微笑，最后变成不敢哭的人。', 5);
INSERT INTO `sententce` VALUES (464, '就算是伤悲，我不想太狼狈。', 5);
INSERT INTO `sententce` VALUES (465, '我还记得你说的话，我想爱你到窒息。', 5);
INSERT INTO `sententce` VALUES (466, '时光是一鼓残酷的力量，它拿走了我们最好的年华，却只给我们留下留下满目的创痍。', 5);
INSERT INTO `sententce` VALUES (467, '命运就像自己的掌纹，虽然弯弯曲曲，却永远掌握在自己手中。', 5);
INSERT INTO `sententce` VALUES (468, '但是我真的不够勇敢，总为你忐忑，为你心软。', 5);
INSERT INTO `sententce` VALUES (469, '感悟人生的经典句子——有时候，亲密并不必须和爱有关，而疏离并不代表不喜欢', 5);
INSERT INTO `sententce` VALUES (470, '别把敷衍当感动，别把套路当深情。', 5);
INSERT INTO `sententce` VALUES (471, '无情的你敢应对现实，无奈的我只好忍痛任凭那冷血的医生一刀一刀地在我身上狂刮。', 5);
INSERT INTO `sententce` VALUES (472, '大部份的痛苦，都是不肯离场的结果，没有命定的不幸，只有死不放手的执着', 5);
INSERT INTO `sententce` VALUES (473, '第一片翠绿的树叶轻轻发芽时，爱扣响了我们的心扉。', 5);
INSERT INTO `sententce` VALUES (474, '心本来不大，不要背负太多。对昨日的纠结，最终只是囚禁了今日和明天。', 5);
INSERT INTO `sententce` VALUES (475, '人生就是要和对的人，以大家都舒服的方式，一起度过。', 5);
INSERT INTO `sententce` VALUES (476, '命运和忐忑一样都是曲折不堪。', 5);
INSERT INTO `sententce` VALUES (477, '缘分像一本书。翻的不经意会错过童话读得太认真又会流干眼泪。”', 5);
INSERT INTO `sententce` VALUES (478, '眼泪终究流不成海洋，人总要不断成长。', 5);
INSERT INTO `sententce` VALUES (479, '有些人，才遇见一下子，就好像认识了很久似的，什么事都想和他说。', 5);
INSERT INTO `sententce` VALUES (480, '世上所有巧合，都是蓄谋已久。', 5);
INSERT INTO `sententce` VALUES (481, '闭上眼睛，清理你的心，过去的就让它过去吧，用心甘情愿的态度，过随遇而安的生活。', 5);
INSERT INTO `sententce` VALUES (482, '爱一个不爱你的人，就像在机场等一艘船。', 5);
INSERT INTO `sententce` VALUES (483, '有的事情，没法说明。你觉得值，就值，你觉得不值，别人说值，你也觉得不值。', 5);
INSERT INTO `sententce` VALUES (484, '大多数事情，不是你想明白后才觉得无所谓，而是你无所谓之后才突然想明白。', 5);
INSERT INTO `sententce` VALUES (485, '你若不勇敢，没人替你坚强…（很短但深入人心的句子）', 5);
INSERT INTO `sententce` VALUES (486, '一辈子有多少的来不及，某个不留意的遗弃就拉远了彼此的距离。', 5);
INSERT INTO `sententce` VALUES (487, '时光越老，人心越淡。轻轻地呼吸，浅浅地微笑。', 5);
INSERT INTO `sententce` VALUES (488, '爱，从来就是一件千回百转的事。不曾被离弃，不曾受伤害，怎懂得爱人？', 5);
INSERT INTO `sententce` VALUES (489, '所有美丽的东西都是荒芜而斑驳的。', 5);
INSERT INTO `sententce` VALUES (490, '有時候，流泪，并不代表脆弱，而是真的被伤到了。', 5);
INSERT INTO `sententce` VALUES (491, '你若赐我一段浮华，我便许你满世繁花。', 5);
INSERT INTO `sententce` VALUES (492, '不闻不问不必须是忘记了，但必须是疏远了，彼此沉默太久就连主动都需要勇气。', 5);
INSERT INTO `sententce` VALUES (493, '有时候，学会把失望当次一种收获，因为有祈望，才会有失望。', 5);
INSERT INTO `sententce` VALUES (494, '某些人的爱情，只是一种“当时的情绪”。如果对方错将这份情绪当做长远的爱情，是本身的幼稚。', 5);
INSERT INTO `sententce` VALUES (495, '每一次妥协，都是杀死自己一点点。', 5);
INSERT INTO `sententce` VALUES (496, '这个世界上总有一些，你去不到的地方;得不到的东西;爱不到的人。', 5);
INSERT INTO `sententce` VALUES (497, '真情，真心，真意；欣赏，被爱，去爱，这便是文字的含义。', 5);
INSERT INTO `sententce` VALUES (498, '那烛火未明摇曳满地的冷清。', 5);
INSERT INTO `sententce` VALUES (499, '人们日常所犯最大的错误，是对陌生人太客气，而对亲密的人太苛刻，把这个坏习惯改过来，天下太平。', 5);
INSERT INTO `sententce` VALUES (500, '学着做自己，并优雅的放手所有不属于你的东西。', 5);
INSERT INTO `sententce` VALUES (501, '我们都有着爱的残疾。我们像是眼睛与眼泪，没有泪的眼睛，是会要干涸的。', 5);
INSERT INTO `sententce` VALUES (502, '小时候，幸福很简单。长大后，简单很幸福。', 5);
INSERT INTO `sententce` VALUES (503, '真正能保护你的，是你自己的人格选择和文化选择。', 5);
INSERT INTO `sententce` VALUES (504, '若我的生命是一个不完整的圆，你，便是我最大的缺口', 5);
INSERT INTO `sententce` VALUES (505, '不要太依靠一个人，因为依靠，所以期望，因为期望，所以失望。', 5);
INSERT INTO `sententce` VALUES (506, '你迷茫的原因往往只有一个：那就是在本该拼命去努力的年纪，想得太多，做得太少。', 5);
INSERT INTO `sententce` VALUES (507, '你只有走完必须走的路，才能过想过的生活。', 5);
INSERT INTO `sententce` VALUES (508, '随着年龄的增长，人总会变得越来越宽容，所以很多事情到最后并不是真的解决了，而是算了吧。', 5);
INSERT INTO `sententce` VALUES (509, '很短但又很伤人的个性签名', 5);
INSERT INTO `sententce` VALUES (510, '你清纯就罢，你假装清纯，比丑还难看，明白么?', 5);
INSERT INTO `sententce` VALUES (511, '成功是分两半的，一半在上帝手中，那是宿命；另一半在自己手中，那是拼命。', 5);
INSERT INTO `sententce` VALUES (512, '现实中人们用真名说假话，网络中用假名说真话。', 5);
INSERT INTO `sententce` VALUES (513, '他对我说，我错了，我是浪，但我爱你……', 5);
INSERT INTO `sententce` VALUES (514, '人生是一场错过，愿你别蹉跎。', 5);
INSERT INTO `sententce` VALUES (515, '心若计较，时时都有怨言；心若宽容，处处都是晴天。', 5);
INSERT INTO `sententce` VALUES (516, '喜欢是不离开，爱是离不开。很短但深入人心的句子。', 5);
INSERT INTO `sententce` VALUES (517, '在乎和悲哀似乎是一个不分离的组合，在乎多了，伤的自然就多了。', 5);
INSERT INTO `sententce` VALUES (518, '背灯和月就花阴已是十年踪迹十年心。', 5);
INSERT INTO `sententce` VALUES (519, '不去追逐你所渴求，你将永远不会拥有。不往前走，就将永远停留', 5);
INSERT INTO `sententce` VALUES (520, '一曲一歌，一醉一醒，一梦一生，也许，人生就是如此而已。', 5);
INSERT INTO `sententce` VALUES (521, '不是不想说话，而是有很多话讲不出来，放在心里会安全点。', 5);
INSERT INTO `sententce` VALUES (522, '天气甚好阳光正美你说在一起我说我愿意。', 5);
INSERT INTO `sententce` VALUES (523, '遇见平凡说：缘分像一本书。翻的不经意会错过童话读得太认真又会流干眼泪。”', 5);
INSERT INTO `sententce` VALUES (524, '无论吵闹多少次，说多少伤人的话，最后还是会因为在乎对方而和好如初，这就是幸福的爱情。', 5);
INSERT INTO `sententce` VALUES (525, '身体累了到头睡下，心里累了却怎样也找不到抚平的情刷。', 5);
INSERT INTO `sententce` VALUES (526, '我最恨有人抢走属于我的东西，凡是我失去的，我都要亲手一件件夺回来。', 5);
INSERT INTO `sententce` VALUES (527, '世界上只有两种人，一种是不断的理解，一种是不断的付出。', 5);
INSERT INTO `sententce` VALUES (528, '男人哭了，是因为他真的爱了~女人哭了，是因为她真得放弃了~。”', 5);
INSERT INTO `sententce` VALUES (529, '心痛了，迷茫了，彻悟了，淡化了，失恋是一种状态，痛苦一个过程。', 5);
INSERT INTO `sententce` VALUES (530, '花自飘零水自流，一种相思，两处闲愁。此情无计可消除，才下眉头，却上心头。', 5);
INSERT INTO `sententce` VALUES (531, '每个人都是一个国王，在自己的世界里纵横跋扈，你不要听我的，但你也不要让我听你的。', 5);
INSERT INTO `sententce` VALUES (532, '你要抓紧我的手，别缺席我的以后。很短但深入人心的句子', 5);
INSERT INTO `sententce` VALUES (533, '人生最大的悲哀不是失去太多，而是计较太多，这也是导致一个人不快乐的重要原因。', 5);
INSERT INTO `sententce` VALUES (534, '每个人，都有一个世界，安静而孤独。', 5);
INSERT INTO `sententce` VALUES (535, '任他凡事清浊，为你一笑间轮回甘堕。', 5);
INSERT INTO `sententce` VALUES (536, '时光没有教会我任何东西，却教会了我不要轻易去相信神话。', 5);
INSERT INTO `sententce` VALUES (537, '如果换我先开口，日子是否还一样细水长流。', 5);
INSERT INTO `sententce` VALUES (538, '每一种创伤，都是另一种成熟。', 5);
INSERT INTO `sententce` VALUES (539, '有一次，你说爱我。那一瞬间，我以为是永远。', 5);
INSERT INTO `sententce` VALUES (540, '人类身上最大的两把武器，信心和勇气。', 5);
INSERT INTO `sententce` VALUES (541, '别人说厌恶你时，你就应高傲告诉他，你以为我喜欢你吗?', 5);
INSERT INTO `sententce` VALUES (542, '时间就像一张网，你撒在哪里，你的收获就在哪里。', 5);
INSERT INTO `sententce` VALUES (543, '以前只是以前，过去只是过去，从前只是从前，回忆只是回忆，有什么好难过的!', 5);
INSERT INTO `sententce` VALUES (544, '有些人想想就算了，别去找了，说不定他早把你忘了。', 5);
INSERT INTO `sententce` VALUES (545, '剑因刺得太深，刚好割破心脏，汩汩的鲜血流向内脏。', 5);
INSERT INTO `sententce` VALUES (546, '你笑一次，我就能够高兴好几天；可看你哭一次，我就难过了好几年。', 5);
INSERT INTO `sententce` VALUES (547, '大提琴的声音就象一条河，左岸是我无法忘却的回忆，右岸是我值得紧握的璀璨年华，中间流淌的，是我年年岁岁淡淡的感伤！', 5);
INSERT INTO `sententce` VALUES (548, '我好像散落野地里的沙，唤也唤不回了过往。', 5);
INSERT INTO `sententce` VALUES (549, '记住，只要自己不跪着，就永远不比别人矮。', 5);
INSERT INTO `sententce` VALUES (550, '有些事，你把它藏到心里，也许还更好，等时间长了，也就变成了故事。', 5);
INSERT INTO `sententce` VALUES (551, '蝴蝶很美，终究蝴蝶飞但是沧海。', 5);
INSERT INTO `sententce` VALUES (552, '有些人就像画纸上的画，即使擦去了也会留下痕迹。', 5);
INSERT INTO `sententce` VALUES (553, '菩提本无树，明镜亦非台。本来无一物，何处惹尘埃。', 5);
INSERT INTO `sententce` VALUES (554, '永远不要向任何人解释你自己。因为喜欢你的人不需要，而不喜欢你的人不会相信。', 5);
INSERT INTO `sententce` VALUES (555, '你永远也看不到我最寂寞时候的样貌，因为只有你不在我身边的时候，我才最寂寞。', 5);
INSERT INTO `sententce` VALUES (556, '喜欢一个人，就要努力去追，有时，一刻迟疑，便是一生天涯。', 5);
INSERT INTO `sententce` VALUES (557, '青春是一道明媚的忧伤。', 5);
INSERT INTO `sententce` VALUES (558, '原来，人这一生中，惟独离别，才是真正的永远。', 5);
INSERT INTO `sententce` VALUES (559, '加州的阳光是一种幻觉，它让你无法哭出来。', 5);
INSERT INTO `sententce` VALUES (560, '不要埋怨别人让你失望了。怪我们自己期望太多。', 5);
INSERT INTO `sententce` VALUES (561, '是我勇敢太久，决定为你一个人而活。', 5);
INSERT INTO `sententce` VALUES (562, '人最大的修养，是知人不评人。不懂别人就少说话，议论最掉价。', 5);
INSERT INTO `sententce` VALUES (563, '当依靠的肩膀不在，当我的眼泪流干，当我决定放手，我的心已不在。', 5);
INSERT INTO `sententce` VALUES (564, '在乎和悲哀似乎是一个不分离的组合，在乎多了，伤的自然就多了。', 5);
INSERT INTO `sententce` VALUES (565, '难以抚平的伤痛还在蔓延，触及不到的悲哀在心底发芽。', 5);
INSERT INTO `sententce` VALUES (566, '爱情就像面镜子，碎了也就碎了。即使勉强粘在一起，总会有裂痕的。', 5);
INSERT INTO `sententce` VALUES (567, '暧昧就像“正在输入”，可能等了很久之后还是什么资料都没有。', 5);
INSERT INTO `sententce` VALUES (568, '此刻你的位置并不重要，重要的是你前进的方向', 5);
INSERT INTO `sententce` VALUES (569, '一个人的旅途，一片叶子乱舞出的单调，没有准确的节奏，乐章依旧循环着，泯灭着模糊又清晰的记忆。', 5);
INSERT INTO `sententce` VALUES (570, '之后我才发现，钱不是万能是对有钱人说的。', 5);
INSERT INTO `sententce` VALUES (571, '当你快乐时，你要想，这快乐不是永恒的。当你痛苦时，你要想，这痛苦也不是永恒的。', 5);
INSERT INTO `sententce` VALUES (572, '城市在下雨，而我在想你。', 5);
INSERT INTO `sententce` VALUES (573, '如果只是相遇，而不能相守，人生最好不相见。', 5);
INSERT INTO `sententce` VALUES (574, '那是不一样高度上的两片云——你在底下看上去它们重合了，事实上却永远不会相遇。', 5);
INSERT INTO `sententce` VALUES (575, '如果敌人让你生气，那说明你还没有胜他的把握；如果朋友让你生气，那说明你仍然在意他的友情。', 5);
INSERT INTO `sententce` VALUES (576, '因为无能为力，所以顺其自然。因为心无所恃，所以随遇而安。', 5);
INSERT INTO `sententce` VALUES (577, '如果抓不住旧时光的影子，我们就能够微笑的看着往昔。', 5);
INSERT INTO `sententce` VALUES (578, '陪伴是最长情的告白秒回是最贴心的等待。', 5);
INSERT INTO `sententce` VALUES (579, '生活就像骑自行车，只有不断前进，才能持续平衡。', 5);
INSERT INTO `sententce` VALUES (580, '和聪明人交流，和靠谱的人恋爱，和用心的人共事，和幽默的人随行。人生若能如此，足矣。', 5);
INSERT INTO `sententce` VALUES (581, '用无所谓的态度，过好随遇而安的生话。', 5);
INSERT INTO `sententce` VALUES (582, '你突然点醒了我，我们的相识能够以年计算了，你找到你爱的，而我，还在原地徘徊着。', 5);
INSERT INTO `sententce` VALUES (583, '靠山山会倒，靠水水会流，靠自己永远不倒。', 5);
INSERT INTO `sententce` VALUES (584, '无论怎样样，一个人借故堕落总是不值得原谅的，越是没有人爱，越要爱自己。', 5);
INSERT INTO `sententce` VALUES (585, '既然是自己选择的路，那么即使跪着也要将它走完。', 5);
INSERT INTO `sententce` VALUES (586, '人没钱不如鬼，汤没盐不如水，你会慢慢发现，一颗好心，永远比不上一张好嘴。', 5);
