INSERT INTO `sententce` VALUES (746, '如果你在背后议论我，那只能说明，我活的明显要比你精彩许多。', 5);
INSERT INTO `sententce` VALUES (747, '你就应想办法跑得快，而不能老是琢磨怎样让别人慢下来。', 5);
INSERT INTO `sententce` VALUES (748, '不要因为一段感情，就彻底的对爱情失去占有欲，步入黑暗的角落。', 5);
INSERT INTO `sententce` VALUES (749, '不要走，请逗留，不要再让我心痛，难道你认为伤我还不够？', 5);
INSERT INTO `sententce` VALUES (750, '我这辈子最执着的一件事，就是上了十多年的学。', 5);
INSERT INTO `sententce` VALUES (751, '能驾驭你的人，都是你心甘情愿，视如生命爱的人', 5);
INSERT INTO `sententce` VALUES (752, '有些人一向没机会见，等有机会见了，却又犹豫了，相见不如不见。', 5);
INSERT INTO `sententce` VALUES (753, '好想抱抱你闻闻你身上的味道把下巴搁在你的肩上然后乖乖睡着。', 5);
INSERT INTO `sententce` VALUES (754, '风华是一指流砂，苍老是一段年华。', 5);
INSERT INTO `sententce` VALUES (755, '因为要生存，我开始学会放弃。', 5);
INSERT INTO `sententce` VALUES (756, '人生就像一杯茶，不会苦一辈子，但总会苦一阵子。', 5);
INSERT INTO `sententce` VALUES (757, '任何的限定，都是从自己的心田开始的。', 5);
INSERT INTO `sententce` VALUES (758, '轻轻拂去岁月的尘埃，打开历久弥新的宋词，氤氲在词中的聚散离合爱恨情仇，浓得像一杯化不开的咖啡。', 5);
INSERT INTO `sententce` VALUES (759, '不闻不问不必须是忘记了，但必须是疏远了。', 5);
INSERT INTO `sententce` VALUES (760, '人生只需我们不停的用心体会。一点一滴方能得到你想要的。', 5);
INSERT INTO `sententce` VALUES (761, '我们终究如愿以偿，但彼此都不是当初约好的模样。', 5);
INSERT INTO `sententce` VALUES (762, '总有些事放不下，让人忘了时间。总有些事必须放下，因为还有明天。', 5);
INSERT INTO `sententce` VALUES (763, '永远不要向任何人解释你自己。因为喜欢你的人不需要，而不喜欢你的人不会相信。', 5);
INSERT INTO `sententce` VALUES (764, '不要为明天忧虑，因为明天自有明天的忧虑;一天的难处，一天担当就够了', 5);
INSERT INTO `sententce` VALUES (765, '被遗迭了的心，一点一点变冷漠，一点一点变孤单', 5);
INSERT INTO `sententce` VALUES (766, '人人都会错过，人人都以前错过，真正属于你的，永远不会错过。', 5);
INSERT INTO `sententce` VALUES (767, '如果没法忘记他，就不要忘记好了。真正的忘记，是不需要努力的。', 5);
INSERT INTO `sententce` VALUES (768, '今日做的一切挣扎都是在为明天积蓄力量，所以别放弃。', 5);
INSERT INTO `sententce` VALUES (769, '不要因为努力变成别人喜欢的样貌，到头来忘了最真实的自己', 5);
INSERT INTO `sententce` VALUES (770, '能冲刷一切的除了眼泪只有时间，以时间来推移感情，时间越长冲突越淡，仿佛不断稀释的茶。', 5);
INSERT INTO `sententce` VALUES (771, '在你还不够强大时，你只能学会和你厌恶的人相处，这是现实。', 5);
INSERT INTO `sententce` VALUES (772, '朝也挂念，暮也挂念，挂念的滋味苦苦甜甜。', 5);
INSERT INTO `sententce` VALUES (773, '我是不是你最疼爱的人,你为什么不说话。', 5);
INSERT INTO `sententce` VALUES (774, '时光没有教会我任何东西,却教会了我不要轻易去相信神话。', 5);
INSERT INTO `sententce` VALUES (775, '生活是一场完美，不要把它熬成了苦药，把自己的生活埋葬。', 5);
INSERT INTO `sententce` VALUES (776, '有些事，总能让你看清一些人，放下一些执着!', 5);
INSERT INTO `sententce` VALUES (777, '十八岁和幸福都能够是奢侈的。', 5);
INSERT INTO `sententce` VALUES (778, '真正的寂寞是很真实的。', 5);
INSERT INTO `sententce` VALUES (779, '分崩离析的心脏，支撑不了软弱无力的灵魂', 5);
INSERT INTO `sententce` VALUES (780, '花开了，人来了，一切都只是开始。经历过世事之后，一切都会变的。花谢了，人已去，一切都已经结束。', 5);
INSERT INTO `sententce` VALUES (781, '人生中有许多事情是不需要理由的，同时也是不需要要答案的', 5);
INSERT INTO `sententce` VALUES (782, '高潮时享受成就，低潮时享受人生。有心思时干有好处的活，没情绪时做有意思的事。', 5);
INSERT INTO `sententce` VALUES (783, '有些事不要傻傻的等待，因为你想等待的结局是完美的，但真实的结局却是个杯具。', 5);
INSERT INTO `sententce` VALUES (784, '把自己的心带入你的位置，用三分沉静来体会你的咆哮。', 5);
INSERT INTO `sententce` VALUES (785, '如果一个女人真的爱你，她会因为很多事情对你发脾气，却始终坚守在你身边。', 5);
INSERT INTO `sententce` VALUES (786, '别觉得你被世界抛弃了，世界根本就没空搭理你', 5);
INSERT INTO `sententce` VALUES (787, '东边日出西边雨，道是无晴却有晴。', 5);
INSERT INTO `sententce` VALUES (788, '丢了的自己，要记得捡回来', 5);
INSERT INTO `sententce` VALUES (789, '不期待突如其来的好运，只希望所有的努力终有回报。', 5);
INSERT INTO `sententce` VALUES (790, '恨天恨地恨自己不争气，躺在最悲哀的谷底，任凭生命的去留。', 5);
INSERT INTO `sententce` VALUES (791, '与其讨好别人，不如武装自己;与其逃避现实，不如笑对人生;与其听风听雨，不如昂首出击!', 5);
INSERT INTO `sententce` VALUES (792, '如果回忆象钢铁般坚硬那么我是该微笑还是哭泣，如果钢铁象记忆般腐蚀那那里是欢城还是废墟？', 5);
INSERT INTO `sententce` VALUES (793, '我们微笑着说我们停留在时光的原处其实早已被洪流无声地卷走。', 5);
INSERT INTO `sententce` VALUES (794, '结局和过程都有了，再去纠缠，连自己都觉得贪婪。', 5);
INSERT INTO `sententce` VALUES (795, '那种狂舞的胜利，我们称之为桑巴。', 5);
INSERT INTO `sententce` VALUES (796, '这个世界上总有一些，你去不到的地方;得不到的东西;爱不到的人。', 5);
INSERT INTO `sententce` VALUES (797, '生活就像海洋，只有意志坚强的人，才能到达彼岸。', 5);
INSERT INTO `sententce` VALUES (798, '每个微笑的背后，又隐藏着多少的伤呢？', 5);
INSERT INTO `sententce` VALUES (799, '上天不给我的，无论我十指怎样紧扣，仍然走漏；给我的，无论过去我怎样失手，都会拥有。', 5);
INSERT INTO `sententce` VALUES (800, '能够说出的委屈，便不算委屈;能够抢走的爱人，便不算爱人。', 5);
INSERT INTO `sententce` VALUES (801, '杨柳青青江水平，闻郎江上唱歌声。东边日出西边雨，道是无晴却有晴。', 5);
INSERT INTO `sententce` VALUES (802, '告别以前的不如意，挥手迈步走向世界。', 5);
INSERT INTO `sententce` VALUES (803, '真心喜欢你，却总是猜不懂你心里在想什么。', 5);
INSERT INTO `sententce` VALUES (804, '有没有看见我为你铺设一地的繁歌。', 5);
INSERT INTO `sententce` VALUES (805, '尝尽人间百草，试遍奇闻异毒，救你哪怕千山万水?', 5);
INSERT INTO `sententce` VALUES (806, '女人的心慈手软，与男人的口是心非，成正比。', 5);
INSERT INTO `sententce` VALUES (807, '爱情啊，是一种诅咒，我们都会变成魔鬼的。', 5);
INSERT INTO `sententce` VALUES (808, '只有胜利才能生存，只有成功才有代价，只有耕耘才有收获。', 5);
INSERT INTO `sententce` VALUES (809, '现今还有谁会照顾谁一辈子，那是多沉重的一个包袱，所以非自立不可。', 5);
INSERT INTO `sententce` VALUES (810, '你永远不知道自己有多坚强，直到有一天你除了坚强再无选择。', 5);
INSERT INTO `sententce` VALUES (811, '有些话，你想说自然会说，不想说，听到的也只是假话。', 5);
INSERT INTO `sententce` VALUES (812, '千万别迷恋网络游戏，要玩就玩好人生这场大游戏。', 5);
INSERT INTO `sententce` VALUES (813, '初恋，是我最好的年华。', 5);
INSERT INTO `sententce` VALUES (814, '有没有一次，你听着歌，想起我。', 5);
INSERT INTO `sententce` VALUES (815, '哭红的双眼只为了哪个无情的人，伤碎的心只为了那个不断给我伤害的魔鬼。', 5);
INSERT INTO `sententce` VALUES (816, '当你被失败拥抱时，成功可能正在一边等着吻你。', 5);
INSERT INTO `sententce` VALUES (817, '爱一个人不必须要拥有，但拥有一个人必须要好好爱她。', 5);
INSERT INTO `sententce` VALUES (818, '想为你拾掇满地落花，却怎样也捡不起当年的美丽。', 5);
INSERT INTO `sententce` VALUES (819, '再丑的人也能结婚，再美的人也会单身！~', 5);
INSERT INTO `sententce` VALUES (820, '被在乎的人忽略，会难过。而更难过的是还要装作根本不在乎。', 5);
INSERT INTO `sententce` VALUES (821, '困难是一块顽石，对于弱者它是绊脚石，对于强者它是垫脚石。', 5);
INSERT INTO `sententce` VALUES (822, '每个人的心都有一道墙，推开就能看见天堂。', 5);
INSERT INTO `sententce` VALUES (823, '爱不必须是痛，痛不必须代表爱。', 5);
INSERT INTO `sententce` VALUES (824, '生命里充满了遗憾，岁月装满了后悔，我的幸福在没有开始的时候就已经结束。', 5);
INSERT INTO `sententce` VALUES (825, '世人骂我太懦弱，老婆说我真软弱，申不直腰板，我只能卑躬屈膝的生活着。', 5);
INSERT INTO `sententce` VALUES (826, '人就是很奇怪，不喜欢别人骗自己，却喜欢自己骗自己。', 5);
INSERT INTO `sententce` VALUES (827, '你记住了，风水轮流转，万事都不要做太绝，有你他妈求我的时候', 5);
INSERT INTO `sententce` VALUES (828, '世界上难以自拔的，除了牙齿，还有爱情。', 5);
INSERT INTO `sententce` VALUES (829, '爱，从来就是一件千回百转的事。不曾被离弃，不曾受伤害，怎懂得爱人?', 5);
INSERT INTO `sententce` VALUES (830, '我们做不到被所有人喜欢，但求无愧于心便足够。', 5);
INSERT INTO `sententce` VALUES (831, '不是每一次努力都会有收获，但是，每一次收获都必须努力，这是一个不公平的不可逆转的命题。', 5);
INSERT INTO `sententce` VALUES (832, '完美之人生，不外乎个人顺其性情，做好分内之事', 5);
INSERT INTO `sententce` VALUES (833, '一花一世界，一叶一追寻。一曲一场叹，一生为一人。', 5);
INSERT INTO `sententce` VALUES (834, '淡然是一种优美，一种心态，一种涵养。', 5);
INSERT INTO `sententce` VALUES (835, '对不起是一种真诚，没关系是一种风度。如果你付出了真诚，却得不到风度，那只能说明对方的无知与粗俗!', 5);
INSERT INTO `sententce` VALUES (836, '是谁伤了你的心，是谁刺出你的泪，是谁把你丢在荒郊野地里不闻不问!', 5);
INSERT INTO `sententce` VALUES (837, '跋涉千里来向你道别，在最初和最后的雪夜。', 5);
INSERT INTO `sententce` VALUES (838, '紫晶湮韶华转瞬已百年羲和曾现凤凰醉荫间。', 5);
INSERT INTO `sententce` VALUES (839, '爱情有两种姿态，一种是追逐，一种是等待。', 5);
INSERT INTO `sententce` VALUES (840, '未曾清贫难做人，不经打击永天真。成熟，但是是善于隐藏；沧桑，但是是无泪有伤。', 5);
INSERT INTO `sententce` VALUES (841, '我曾给你最温暖的怀抱，你却给我最痛心的玩笑。', 5);
INSERT INTO `sententce` VALUES (842, '有些事，总能让你看清一些人，放下一些执着!', 5);
INSERT INTO `sententce` VALUES (843, '满脑子里都是你的好，叫我怎样忘记掉。', 5);
INSERT INTO `sententce` VALUES (844, '自由可贵，但是，每一天数以万计的人，在用自由换取爱情。', 5);
INSERT INTO `sententce` VALUES (845, '许我一段最美的时光，就让我在青春里与你相逢。', 5);
INSERT INTO `sententce` VALUES (846, '没有值不值得，只有愿不愿意。', 5);
INSERT INTO `sententce` VALUES (847, '小时候，幸福是一个东西，拿到了也就会幸福；成熟了，幸福是种心态，领悟了，那才能幸福。', 5);
INSERT INTO `sententce` VALUES (848, '人的心只容得下必须程度的绝望，海绵已经吸够了水，即使大海从它上方流过，也不能再给它增添一滴水了。', 5);
INSERT INTO `sententce` VALUES (849, '看那天地日月，恒静无言；青山长河，世代绵延；就像在我心中，你从未离去，也从未改变。', 5);
INSERT INTO `sententce` VALUES (850, '这个世界没有无缘无故的恨，只因为有强大的爱支撑。', 5);
INSERT INTO `sententce` VALUES (851, '人这一生，看似潇洒，说来就来，说去就去，实则艰难无比。总以为日子过一天算一天，却不知有多少人想方设法的让自己挨过这一世。有时候过程于我们来说只但是是修饰，在结局面前犹如镜中虚月，水中落花，半点不由己。', 6);
INSERT INTO `sententce` VALUES (852, '一个喜欢你的人，不会总让你做什么。而会想着替你做点什么，取悦你才是种喜欢；一个在乎你的人，不会轻易惹你生气，而是害怕失去你，心怀恐惧才是种在乎。爱是付出，被爱是得到。你得到的多，那他是爱你的。你付出得多，那很可能只是单恋而已。不必一味讨好别人，不管走在何处，都不要迷失自己。', 6);
INSERT INTO `sententce` VALUES (853, '熟悉的习惯，熟悉的路线，熟悉的日子里，永远不会有奇迹发生。改变思路，改变习惯，改变一种活的方式，往往会创造无限，风景无限。发生一件事，喜欢它那就享受它，不喜欢它那就避开它。有时候我会感觉，我和任何人都不是一个世界的人，我不懂他们在热闹什么。', 6);
INSERT INTO `sententce` VALUES (854, '我并不快乐，但我能够笑着生活。', 6);
INSERT INTO `sententce` VALUES (855, '如果你的童年不游乐，少年不好学，青年不立志，中年不创业，那么，你的生命就将随着年老而逝去。', 6);
INSERT INTO `sententce` VALUES (856, '在人之初，别拿人当幼欺;在人之暮，别拿人当弱辱;在人之前，别拿己当众扬;在人之后，别拿人当猴谤;在人之上，别拿人不当人;在人之下，别拿己不当人。当你习惯过一种日子，那么，你的一生只过上一天;如果你生活常新，那么你每一天都会过得很精彩。', 6);
INSERT INTO `sententce` VALUES (857, '没有伞的孩子必须努力奔跑。', 6);
INSERT INTO `sententce` VALUES (858, '也许每个喜欢夜的人，心里都藏有沉重的故事，也许每个躲在黑暗中的人，都在默默地翻看着那沉重的故事。伴随而来的孤独，流在黑暗中，流在心里，没有人看得见，也不会让别人看见。一切，都不会有人看见。', 6);
INSERT INTO `sententce` VALUES (859, '在生活中，很多时候，我们飘泊在流淌不息的岁月长河中。不想去索求哪里是归航的终点，哪里是时间的末端。只想静拥一怀淡雅，一怀悠然，踏舟而去，随心而舞，找寻一种平静淡然的生活，感受一种凌空而舞的美丽。', 6);
INSERT INTO `sententce` VALUES (860, '没有内在的平静，没有外在的安宁。我们每一天努力地忙碌，用力地生活，却总在不知不觉间遗失了什么。有时候，我们需要的，只是一颗静下来的心。人，是难以改变的，只是往往因为爱情，都会下意识掩饰自己的缺点，但是时间久了，还是还原本性。', 6);
INSERT INTO `sententce` VALUES (861, '对于生活，我们就应从容的应对与理解，无论结果是获得还是失去。', 6);
INSERT INTO `sententce` VALUES (862, '宁可自己去原谅别人，莫让别人来原谅你。', 6);
INSERT INTO `sententce` VALUES (863, '不记得是从什么时候起，你不再在太多人面前宣泄自己的负面情绪。人生感悟的句子，毋庸置疑，对于十分情绪化的你来说这是一个好现象，或许意味着你开始真正的理解何谓节制。生活中糟心的时刻依然还有，但慢慢发觉，自己消化掉这些，所获得的经验和能量要比倾诉和抱怨强大得多。从前你依靠他人，如今你相信时间和自己。', 6);
INSERT INTO `sententce` VALUES (864, '为人处事十忌：你能够缺钱，但不能缺德；你能够失言，但不能失信；你能够倒下，但不能跪下；你能够求名，但不能盗名；你能够低落，但不能堕落;你能够放松，但不能放纵；你能够虚荣，但不能虚伪；你能够平凡，但不能平庸；你能够浪漫，但不能浪荡；你能够生气，但不能生事。', 6);
INSERT INTO `sententce` VALUES (865, '千万不要因为面子而失去不该失去的人。', 6);
INSERT INTO `sententce` VALUES (866, '我心底最深的触动和殷殷的向往。我的心，在世俗里不断的被流离，曾爱过，曾痛过，也曾迷失过，以为谁会是谁的谁，其实我们都只是个体，谁也并非是谁的谁，你是你，而我最终也只是我自己。', 6);
INSERT INTO `sententce` VALUES (867, '获致幸福的不二法门是珍视你所拥有的，遗忘你所没有的。', 6);
INSERT INTO `sententce` VALUES (868, '知道看人背后的是君子;知道背后看人的是小人。', 6);
INSERT INTO `sententce` VALUES (869, '正是入冬以来最冷的时节，气温也降到最低，那里难得下雪，霏霏细雨中，风也萧萧，树也萧萧，人也萧萧，枝上的飞鸟，园中的小径，草尖上的雨滴，湖面上翩翩的白鹭，都在这份冷意中变得萧萧落落。', 6);
INSERT INTO `sententce` VALUES (870, '有时候，人生就是这般像一篇无常的没有营养的流水账。我们会遇到很多人，走很多路，而我们终会记住其中最重要的一些人，一段路。他给我们的启示是，尽管你们以前擦肩而过，尽管也曾行过一段路，但始终不是终点等你的那一个，但却是最不会忘记的那一个。', 6);
INSERT INTO `sententce` VALUES (871, '人生烦恼就个字：放不下想不开看不透忘不了！', 6);
INSERT INTO `sententce` VALUES (872, '人们会死于厌倦，死于于疾病，但不会死于努力工作。', 6);
INSERT INTO `sententce` VALUES (873, '生活很多时候是会有很多不公平的，当幻想和现实应对时，总是很痛苦的。当一个社会说假话容易，说真话困难时，人们常常都是无语。因为，真话不能说，假话不愿说，于是，沉默就是最好的选择。', 6);
INSERT INTO `sententce` VALUES (874, '人生短短几十年，不要给自己留下了什么遗憾，想笑就笑，想哭就哭，该爱的时候就去爱，无谓压抑自己', 6);
INSERT INTO `sententce` VALUES (875, '在还没有人疼你的时候，你必须活得像个爷们。', 6);
INSERT INTO `sententce` VALUES (876, '你能够敬佩别人，但绝不能够看不起自己，不能忽视你本就拥有的勇气。每一个向往成功不甘沉沦者，都具备一往无前的勇气。一个人没有勇气时，就如同没有脊椎骨的人永远站不起来一样，任何事情都无法做成功。对一个人事业来说，勇气能够创造奇迹，那些即使机会来也没有勇气把握的人，只能获得失败的结局。', 6);
INSERT INTO `sententce` VALUES (877, '没有值得或不值得，只有心甘或不情愿。', 6);
INSERT INTO `sententce` VALUES (878, '古代的人没有专门锻炼身体的习惯，及一顿饱一顿全无赘肉。生存的需要逼得他们不停的奔跑狩猎，闲暇的时候就装神弄鬼，在岩壁上苗画，在篝火边跳舞，都不是轻体力劳动，积攒不下剩余的卡路里。', 6);
INSERT INTO `sententce` VALUES (879, '世间技巧无穷，唯有德者能够其力，世间变幻莫测，唯有人品可立一生!这就是作为一个成功人士或希望成为一个成功人士就应具备的优秀品质。', 6);
INSERT INTO `sententce` VALUES (880, '随着年龄的增长，我们不变得更好也不更坏，而是变得更像我们自己。', 6);
INSERT INTO `sententce` VALUES (881, '上天赋予的生命，就是要为人类的繁荣和平和幸福而奉献。', 6);
INSERT INTO `sententce` VALUES (882, '明悟说话的方寸，顿悟人生的浮沉，命运由自己控制着年轮，拼搏是成长的灵魂，勤奋是一切的根本，付出才会收获灿烂人生。', 6);
INSERT INTO `sententce` VALUES (883, '时间只是给你机会，不会给你其他什么；时间能不能改变一切，完全取决于时间里面的人。', 6);
INSERT INTO `sententce` VALUES (884, '人生的每一段时光，每一种情景，总有一首歌曲能够代表你的心声，让你一向循环，也许是它悄悄地吐露你的心声，也许它就是一勺调味剂，让你在那段时间的情感，顷刻间释放，甚至让你情不自禁爱上回忆，有时候，喜欢听一首歌，并不是说它多么好听，而是它带给你的不仅仅仅仅是一首歌，而是一个故事，一段时光。', 6);
INSERT INTO `sententce` VALUES (885, '时间，在仆风仆尘中，仍旧是一副模样。生活中，不是每个人，都能理解你的用心，不是每件事，都能顺从你的意愿。应对问题，不能焦急；应对矛盾，不要悲哀。应对不快，学会宽容，遇到不顺，试着忍耐。记住：没有谁，是吃最少的苦头，走最短的弯路，就能获得最大的收益。', 6);
INSERT INTO `sententce` VALUES (886, '好好去爱，去生活。青春如此短暂，不要叹老。偶尔能够停下来休息，但是别蹲下来张望。走了一条路的时候，记得别回头看。时不时问问自己，自己在干嘛？坚定了自己的步伐，就不要轻言放弃，记住，自信的女子最美丽。', 6);
INSERT INTO `sententce` VALUES (887, '比陆地宽广的是大海，比大海宽广的是天空，比天空宽广的是人的胸怀。', 6);
INSERT INTO `sententce` VALUES (888, '人生的巨笔由你自己握住，是泼墨卷袖书还是凝神挥毫着，所经历的是曲折离奇，还是平淡无味，其实都是取决于自己怎样把握。', 6);
INSERT INTO `sententce` VALUES (889, '累不是一种无能，而是一种担当。没有人永远十七岁，但永远有人十七岁。因为依靠一份只有我记得的回忆，我已经长大。长到能够勇敢的应对人间所有的风风雨雨。', 6);
INSERT INTO `sententce` VALUES (890, '复杂中带着简朴的思索，是人和动物的分别。', 6);
INSERT INTO `sententce` VALUES (891, '人生像小河一样流淌，心酸曲折都是寻常，细数过往，流动着沧桑；人生是一片海，汹涌起伏，惊涛骇浪，到最后都在内心深深的藏，汇聚成生命的涵养；人生是一条路，曲曲折折，泥泞坎坷，风雨中历练出对风景的欣赏。', 6);
INSERT INTO `sententce` VALUES (892, '把脾气拿出来，那叫本能；把脾气压回去，才叫本事。', 6);
INSERT INTO `sententce` VALUES (893, '用灵魂撞击命运，用观念超越梦想。此刻做什么并不重要，将来做什么才重要。为改变以后的命运，先改变此刻的观念！', 6);
INSERT INTO `sententce` VALUES (894, '学业不如就业，就业不如创业,创业追求事业,事业成就伟业。红尘万丈一腔情，千秋伟业天地人，事在人为，敢作敢为，一切人为，拼搏创业——基业长青!', 6);
INSERT INTO `sententce` VALUES (895, '每个人的每一段路，都会有一些领悟，只是有些人会简单随时，随时而悟，是坎坷，悟磨砺；是顺境，悟生活；是心境简约随意，悟人生尘缘随意；有所悟，也有所得，是忙碌，得充实于心；是慰藉，得安于生活；是悠闲，得幽雅修身；时间的永恒向前，决定我们每个人都在前行的路上，没有后路，也是一次领悟。', 6);
INSERT INTO `sententce` VALUES (896, '人们常觉得准备的阶段是在浪费时间，只有当真正机会来临，而自己没有潜力把握的时候，才能觉悟自己平时没有准备才是浪费了时间。', 6);
INSERT INTO `sententce` VALUES (897, '多少人间烟火，在细细碎碎的时光里静静氤氲；多少沧桑坎坷，在身手相牵的岁月中远去，任容颜在日复一日的平淡中慢慢变老，花虽落，风住尘香；水长流，云淡过往，惟不变的是彼此旧时的欢颜。', 6);
INSERT INTO `sententce` VALUES (898, '人生有两大天敌，一是诱惑，二是惰性。我们周围，诱惑重重。一个真正有定力的人，才能禁得起诱惑这条“高压线”的考验。惰性是成长的天敌。我们每个人或多或少都有那么一点惰性。智者在诱惑中茁壮成长，愚者却成为惰性的奴隶。人生要禁得起诱惑，踩得住惰性。别让诱惑迷了你的眼，别让惰性占据你的心。', 6);
INSERT INTO `sententce` VALUES (899, '应对人生旅途中的挫折与磨难，我们不仅仅仅要有勇气，更要有坚强的信念。', 6);
INSERT INTO `sententce` VALUES (900, '世间情感千万种，又有多少情谊能够经得起时间的考验，空间的距离。而能够经久不变的，又该是多么的弥足珍贵？春到芳菲春淡去，情到深处情转薄。', 6);
INSERT INTO `sententce` VALUES (901, '人生就像是一场戏，自拍自导自演，多希望有多一点点时间，把里面的杂碎全部忘却，只留下那完美的每个瞬间。其实我们的生活最好的幸福就是平淡，每个人都有自己的烦恼所以我们该从容的应对！这才是属于我们自己的生活本色！', 6);
INSERT INTO `sententce` VALUES (902, '微笑是对世界的感恩。我们的境遇，春风得意也好，平平淡淡也罢，内心多一份知足，人生就多了一份甜美。', 6);
INSERT INTO `sententce` VALUES (903, '人生最大一种痛，不是失败，而是没有经历自己想要经历的一切。别忘了心底的那个梦想。', 6);
INSERT INTO `sententce` VALUES (904, '一条叫做心历，一条叫做经历。心历引领着经历，经历丰满着心历。心若年轻，即使经历坎坷，人生与天地不老；心若老去，就算经历平静，人生已步入荒年。人生有时候需要沉淀，要有足够的时间去反思，才能让自己变得更完美；人生需要积累，只有常回头看看，才能在品味得失和甘苦中升华。', 6);
INSERT INTO `sententce` VALUES (905, '时光越老，人心越淡。以前说好生死与共的人，到之后老死不相往来。岁月是贼，总是不经意地偷去许多，完美的容颜，真实的情感，幸福的生活。也许我们无法做到视若无睹，但也不必干戈相向。毕竟谁都拥有过花好月圆的时光，那时候，就要做好有一天被洗劫一空的准备。', 6);
INSERT INTO `sententce` VALUES (906, '当时光的背影悄然远走，将回忆抛在了来时的路上时，我们总会在不断变化的场景中，或者回忆中，寻找自己过去的模样，以便留下最深的念想。今日的时光或许晴朗，阳光充沛，但明天抬头，或许又是另一番模样。其实，生活就是在不断地思考中，不断地跋涉中找到自我的位置。我的生活如是，你们亦如是。', 6);
INSERT INTO `sententce` VALUES (907, '看看你的排行，就知道你班有多少人。', 6);
INSERT INTO `sententce` VALUES (908, '我们听到的一切都是一个观点，不是事实。我们看见的一切都是一个视角，不是真相。', 6);
INSERT INTO `sententce` VALUES (909, '若生活是一杯茶，那么成长就是喝茶。开始，只是盲目的喝了下去；然后自以为品出些什么；最后才明白，其实茶只有两种味道，先苦后甜。人生没有绝对的公平，而是相对公平。在一个天平上，你得到越多，势必要承受更多，每一个看似低的起点，都是通往更高峰的必经之路。', 6);
INSERT INTO `sententce` VALUES (910, '信念是辉煌的光，照遍周围也引导着人自身，信仰是人生的动力。', 6);
INSERT INTO `sententce` VALUES (911, '人生其实更像一座钟，总是在受到打击之时，才释放术自己美丽的新生，那悠扬的声音，一声比一声悦耳，一声比一声从容。', 6);
INSERT INTO `sententce` VALUES (912, '生命只有一次，生命中的坎坷和快乐有很多次，这些都值得去珍惜，去感恩。', 6);
INSERT INTO `sententce` VALUES (913, '人的一生，如同草木，春萌秋萎。走过这一程，我们经历的太多，能够于心铭记的，却只有那么微小的一部分。待到有一天，我们将要与这个世界告别之时，我们都不知道自己能够带走什么，又能够留下些什么。', 6);
INSERT INTO `sententce` VALUES (914, '看别人不顺眼，是自己修养不够。人愤怒的那一个瞬间，智商是零，过一分钟后恢复正常。人的优雅关键在于控制自己的情绪，用嘴伤害人，是最愚蠢的一种行为。我们的不自由，通常是因为来自内心的不良情绪左右了我们。一个能控制住不良情绪的人，比一个能拿下一座城池的人强大。', 6);
INSERT INTO `sententce` VALUES (915, '你看到什么，取决于你站在哪里。你看得多远，取决于你站得多高。', 6);
INSERT INTO `sententce` VALUES (916, '没有谁能只凭借思考就解决这世界上的一切问题。不要试图去想通一切问题，那样只是会让自己陷入可怕的理性思维的沼泽。遇到想不通的问题怎样办呢？不要去想它，感受它就通了。人生有所求，求而得之，我之所喜；求而不得，我亦无忧。若如此，人生哪里还会有什么烦恼可言？', 6);
INSERT INTO `sententce` VALUES (917, '一个人的梦想越崇高，生活越纯洁。', 6);
INSERT INTO `sententce` VALUES (918, '走得最急的，都是最美的风景；伤得最深的，也总是那些最真的感情。当初有些事，让我们刻骨铭心；以前有些人，令我们难以释怀。我们一路走来，告别一段往事，走入下一段风景。路在延伸，风景在变幻，人生没有不变的永恒。生命的精彩，以一种无法想象的形式展现出来，我们只能描摹。', 6);
INSERT INTO `sententce` VALUES (919, '最可怕的不是真坏人，而是假好人。', 6);
INSERT INTO `sententce` VALUES (920, '轻拈一朵带露的晨花，同清纯的小女孩一样，捧在手心里把玩。花瓣如同指甲般富有血色，在明媚里独显一份娇艳与不惧。撕下最粉嫩的一瓣，风干后夹藏于最喜欢的书中，将那份完美朴实地占有。', 6);
INSERT INTO `sententce` VALUES (921, '在人之上，要把人当人;在人之下，要把自己当人。', 6);
INSERT INTO `sententce` VALUES (922, '假装对别人很宽容，其实就是自己无能，因为不敢伤害别人，就懦弱而苍白地解释成原谅。', 6);
INSERT INTO `sententce` VALUES (923, '仰起笑脸，把影子留在身后。', 6);
INSERT INTO `sententce` VALUES (924, '人生需要欣赏，抛弃想占有自己喜爱的一切东西的想法，不要奢望你能拥有很多，用一种平常心态去欣赏一个人一件事，就象欣赏一幅画一样，你会很快乐，也会很坦然。这世上树叶有千万片，这世上人有千万种，不必须都要相爱，不必须都要相守，只要学会欣赏。这才是人性的纯美真情的可贵。', 6);
INSERT INTO `sententce` VALUES (925, '不管发生了什么事，不要抱怨生命中的任何一天，真正的大心境，在于放弃后的坦然，也在于放下后的无意。人生反复，总会让我们悲喜交织，遇时请珍重，飘过请祝福。拥有一个良好心态，生活就是一片艳阳天！', 6);
INSERT INTO `sententce` VALUES (926, '经验不会犯错。只有过于依靠经验，才会决定错误。', 6);
INSERT INTO `sententce` VALUES (927, '哭，并不是因为脆弱，而是因为坚强得太久。', 6);
INSERT INTO `sententce` VALUES (928, '世上没有不能快乐的人，只有不肯快乐的心。', 6);
INSERT INTO `sententce` VALUES (929, '每一个人的敌人都只有一个，那就是自己每一天一句正能量', 6);
INSERT INTO `sententce` VALUES (930, '世间技巧无穷，唯有德者能够其力，世间变幻莫测，唯有人品可立一生!这就是作为一个成功人士或希望成为一个成功人士就应具备的优秀品质。', 6);
INSERT INTO `sententce` VALUES (931, '岁月静好，拈笔生花，指尖轻扣，墨香纷飞，字如其人，翩翩起舞。写字是一种享受，更是一种心境。等我老了，我也还会一向握着心爱的笔，在静静的时光里，在满室的墨香中，在纯净如玉的白纸上，虔诚运笔，用心写下一个又一个，和青春，和情感，和完美，和岁月有关的那些点滴往事。', 6);
INSERT INTO `sententce` VALUES (932, '一个有信念者所开发出的力量，大于一个只有兴趣者。', 6);
INSERT INTO `sententce` VALUES (933, '孔子曰“智者乐水”。老子曰“上善若水”。禅语曰“善心如水”。我曰“人当学水”。人在世上不顺多，当学水之能潜能涌能流能奔能升能降，灵活善变，适镜而生，适镜而居，善待一切，不妄求环境适应自己，而善使自己适应环境。', 6);
INSERT INTO `sententce` VALUES (934, '人生已经如此艰难，有些事情就不要去拆穿。', 6);
INSERT INTO `sententce` VALUES (935, '人生境界：自律境界：无功不受大绿,无助不受大礼,无胆不挣大钱生活境界：常与高人交往，闲与雅人相会，乐与亲人分享。事业境界：尽心负责无憾，养家小康无忧，自己开心无悔。感情境界:风流别下流，喜新别厌旧，互帮别拖后。', 6);
INSERT INTO `sententce` VALUES (936, '有时候，你放弃了某人，并不是因为你不在乎，而是因为你意识到他已不在乎了。', 6);
INSERT INTO `sententce` VALUES (937, '在当今社会上，卓越十分好只是一般般，我的标准是不可思议超越非凡。', 6);
INSERT INTO `sententce` VALUES (938, '你又不是人民币，怎样能让人人喜欢你？', 6);
INSERT INTO `sententce` VALUES (939, '一些事，若细想，就不是那么回事，若不细想，不就是那么回事。生活卡带般停住，我站在那里，没有滋味的人生是会苦，没搞笑味的人生是会累，没有余味的人生就会悲。即使是失意，那样也是无所谓得失，坦坦荡荡，真真切切，平平静静，快快乐乐。', 6);
INSERT INTO `sententce` VALUES (940, '伤感，并不是痛苦不堪，也不是刻意营造；伤感，只是一种态度，一种最真实的情感表露。都说“乐观是一种美丽”，其实伤感也是一种美丽。我们感觉活着累，不是情感的纠结，就是利益的盘桓。看看四周，身边就那么多人，聚散皆是缘，相伴须珍惜，不必相处时常伤害，走远后长叹息。', 6);
INSERT INTO `sententce` VALUES (941, '人生中，许多的事情，我们都没办法预料到，有人说计划总是赶不上变化，有人说，办法总比困难多一点，有的人大起大落，有的人历经坎坷，有的人平淡一生，但不管是哪种人，其实，我觉得人生还是平淡最好，追求的理想往往都可能落空，追求的成功也会遭遇失败，平平淡淡，才是人生最大的幸福与满足。', 6);
INSERT INTO `sententce` VALUES (942, '生活中谁都会有许多不尽人意之处，但只要希望永不泯灭，坚定的信念就会帮忙你去战胜一切。', 6);
INSERT INTO `sententce` VALUES (943, '看破是理人们常犯最大的错误，是对陌生人太客气，而对亲密的人太苛刻，把这个坏习惯改过来，天下太平。', 6);
INSERT INTO `sententce` VALUES (944, '简单的生活之所以很不容易，是因为要活的简单，必须不能想的太多。', 6);
INSERT INTO `sententce` VALUES (945, '有付出，就有收获。努力吧，不要怕艰苦！', 6);
INSERT INTO `sententce` VALUES (946, '迷失方向就去找方向，找到方向就要努力，世界不会等你。', 6);
INSERT INTO `sententce` VALUES (947, '有点懒，喜欢赖床。不太听话，喜欢捣蛋。在陌生人面前会很安静，很冷漠，在熟人面前却很放肆，很霸道，并喜欢没形象的哈哈大笑。也会偶尔的忧郁，朋友问怎样了，也只会说没事，其实只是感觉累了，只是需要一个拥抱。', 6);
INSERT INTO `sententce` VALUES (948, '人生苦短，让一步是心，退一步是情。事艰难，情为难，只有真正看开了，想通了，心病也就根除了。', 6);
INSERT INTO `sententce` VALUES (949, '长大，就要学会，心平气和的应对兵荒马乱。', 6);
INSERT INTO `sententce` VALUES (950, '我们不是每一天都像看起来的那么开心，我们都有很累的时候。你的疲惫，我看得到。我要你开开心心的，即使再难过，但只要想起有个人在默默的陪伴你，即使是在很远很远的地方，也能感觉很温暖。', 6);
INSERT INTO `sententce` VALUES (951, '人生，是踏上了就回不了头的征程。生活总不完美，有辛酸的泪，有失足的悔，有幽深的怨，有抱憾的恨。生活亦很完美，总让我们泪中带笑，悔中顿悟，怨中藏喜，恨中生爱。看生活是否完美，就要淡视那些不完美，放大那些可能的完美。只要你的心完美，这个世界就完美。', 6);
INSERT INTO `sententce` VALUES (952, '生活需要游戏，但不能游戏人生;生活需要歌舞，但不需醉生梦死;生活需要艺术，但不能投机取巧;生活需要勇气，但不能鲁莽蛮干;生活需要重复，但不能重蹈覆辙。把工作当享受，你就会竭尽全力;把生活当乐趣，你就会满怀信心;把读书当成长，你就会勤奋努力;把奉献当快乐，你就会慷慨助人。', 6);
INSERT INTO `sententce` VALUES (953, '人生，少年，中年，老年，就如喝茶的三个阶段。头遍苦涩，正如初入社会磕绊坎坷。二遍舌底生津，在拼搏后收获财富，稳重和信心。第三遍茶已逐渐淡去，犹如年纪渐大，耳顺易平心静，经过时光的洗练，心中一片清澈，诚如茶之味淡，茶水愈加透明。', 6);
INSERT INTO `sententce` VALUES (954, '人生就像攀岩，虽然手摸的更高，可如果不从脚下坐起，你很难到达顶点。', 6);
INSERT INTO `sententce` VALUES (955, '做事先做人，这是自古不变的道理。如何做人，不仅仅仅体现了一个人的智慧，也体现了一个人的修养。一个人不管多聪明，多能干，背景条件有多好，如果不懂得做人，人品很差，那么，他的事业将会大受影响。', 6);
INSERT INTO `sententce` VALUES (956, '人生就像是一次长途旅行，一路走过，有上坡也有下坡，沿途有美景也有陷阱，有风雨雷电，也有烈日炎炎，有好人相助，也可能有坏人拦截，所以一切都要谨慎行事，防止中途迷失方向，走入岐途。', 6);
INSERT INTO `sententce` VALUES (957, '如果你想成功，那么请记住：遗产为零诚实第学习第礼貌第刻苦第精明第五。', 6);
INSERT INTO `sententce` VALUES (958, '什么时候，以前天真无邪的笑脸，不再在我们渐趋僵硬的脸上绽放？看着彼此的波澜不惊，不再有从前心无芥蒂地开怀说笑，不再有从前勾肩搭背地走过长街拉长的背影，各自的悲喜都隐藏在平淡的问候声里，像是有过短暂相逢的平行线，下一刻，不再有交集。', 6);
INSERT INTO `sententce` VALUES (959, '一个人与其在别人指点下规规矩矩行事，还不如让他自己去闯闯，出点差错，反能获得更多的教益。', 6);
INSERT INTO `sententce` VALUES (960, '成功者只是比失败者多爬起来一次而已', 6);
INSERT INTO `sententce` VALUES (961, '无论生活给了我们多少失落与辛酸，以一颗感恩之心去微笑应对一花一木，人生才能变得从容优雅大气。', 6);
INSERT INTO `sententce` VALUES (962, '我明白，在生命的旅程里，每个人的成长都伴随着疼痛的来袭，每一段情感都隐藏着一段悲伤。我常常这样安慰着身边受伤的女子，却无法医治自己此刻内心衍生的巨大伤痕。天亮了，我们不说晚安。天亮了，我们只说再见。', 6);
INSERT INTO `sententce` VALUES (963, '婚姻是件瓷器，要想收藏好它的确困难，但是打碎它却很容易，要想把碎片粘合在一起，却是一件不易的事。', 6);
INSERT INTO `sententce` VALUES (964, '真正的绝望跟痛苦悲伤没有什么关系。它让人心平气和，让你意识到你不能依靠别人，任何人，得到快乐。它让你谦卑，因为所有别人能带给你的，都成了惊喜。它让你只是能够去回到自己的内心。', 6);
INSERT INTO `sententce` VALUES (965, '路的尽头不见了，步子乱了；走着走着就散了，回忆淡了；很多时候，我们都在孤独地走，迎来送往的皆是生命的过客。我们在坚守一个人的世界，寂静聆听心灵的拷问。渴了，饮一杯水，把它酝酿成汗和泪，浇灌我们平凡的人生；累了，做一个梦，在幻想中装饰我们心灵的房子。', 6);
INSERT INTO `sententce` VALUES (966, '人生就是一个大舞台，应对，不必须是最难过。孤独，也不必须不快乐。如果想让生活更加完美，也让自己更加完美地生活，我们不妨就把生活看作是一滴灵动的水。就像它一样，一切随势顺缘，尽情欢畅奔流。', 6);
INSERT INTO `sententce` VALUES (967, '正路并不必须就是一条平平坦坦的直路，难免有些曲折和崎岖险阻，要绕一些弯，甚至难免误入歧途。', 6);
INSERT INTO `sententce` VALUES (968, '人生就是如此，总是忙忙碌碌的，却忽略很多，很多，当真正想起的时候，却再也不能找回当年的感觉了，物是人非，斗转星移，很多丢失的，遗忘的，可能都会袭击自己的记忆深处。谁是谁非，过往的经历，都已经烟云，只要此刻安好就可。', 6);
INSERT INTO `sententce` VALUES (969, '人一生的成就有些靠天分，有些靠运气，有些靠努力，而人所能掌握的仅仅只是自己的那一分深情与用心。但是，这一分深情与用心才是作为人生最重要的价值。至于成就，我们只能尽心而知命，毋须过分在意。', 6);
INSERT INTO `sententce` VALUES (970, '彼岸的呼唤太遥远，早已听不到风声。错过的忧伤，在柳畔徘徊。风触痛我的沧桑，还有那以前的暗香。缘来，如此。打开记忆的闸门，让思念淋一场杏花春雨。油纸伞下，那一抹湿润，是我的眷恋，亦是我的初衷。', 6);
INSERT INTO `sententce` VALUES (971, '聪明的女人知道什么时候该坚强，什么时候该软弱。', 6);
INSERT INTO `sententce` VALUES (972, '时间告诉我，无理取闹的年龄过了，该懂事了。', 6);
INSERT INTO `sententce` VALUES (973, '孔子曰“智者乐水”。老子曰“上善若水”。禅语曰“善心如水”。我曰“人当学水”。人在世上不顺多，当学水之能潜能涌能流能奔能升能降，灵活善变，适镜而生，适镜而居，善待一切，不妄求环境适应自己，而善使自己适应环境。', 6);
INSERT INTO `sententce` VALUES (974, '如果某一天，你耳边不再有人说烦，厌恶；不再有人炫耀自己聪明；不再有人在你电话打不通时坐立不安而狂发信息，最后打通电话时对你发脾气；不再有人可怜兮兮说情绪不好；不再有人撒娇说你坏；不再有人时而温顺的对你言听计从，又突然对你乱发脾气。你失去了这样一个人，会失落吗？', 6);
INSERT INTO `sententce` VALUES (975, '我最害怕的感觉就是：时间嗖嗖地过去，而我除了消耗粮食以外，一无是处。', 6);
INSERT INTO `sententce` VALUES (976, '当那时到来时，一切都那么让人猝不及防，看到世界上千万种死亡的时候我们没有一丝波澜。但是当他靠近了，来到我们身边了，当那一刻忽然来袭，我的世界崩塌了。丝丝忧郁纠缠，心慌慌，真想退回到从前，恨日历不能倒翻。', 6);
INSERT INTO `sententce` VALUES (977, '裁缝匠最忌讳把衣服裁瘦了，因为衣服瘦了无法再肥；厨师做菜时也要先少放点盐，因为味道淡了还能够补盐；雕刻师做面部雕刻时，往往会把眼睛刻得小一点，鼻子刻得大一点，这些都是为了进一步完善时，留有修饰的余地。为人说话办事也是这个道理，无论何时都要提醒自己留有可进可退的余地。', 6);
INSERT INTO `sententce` VALUES (978, '人生，每一次相逢，都是下一次分别的开始，没有永远，不会永久。生活的过程中，总有不幸，也总有悲哀，就像日落花衰，有些事，你越是在乎，痛的就越厉害，放开了，看淡了，慢慢就淡化了。只是，我们总是事后才明白，懂生活，很难，会生活，更难。', 6);
INSERT INTO `sententce` VALUES (979, '其实真的想，是没有做不到的借口。', 6);
INSERT INTO `sententce` VALUES (980, '磨剑三年舍我谁与争锋，逐鹿百日唯我尽显风流。', 6);
INSERT INTO `sententce` VALUES (981, '有人告诉我，为什么世上的好人被坏人所欺骗，因为好人不了解坏人，坏人却很了解好人。所以他们知道如何趁虚而入，利用好人为他谋利和到达目的，虽然很悲哀，但好人根本不值得花宝贵的时间及精力去了解坏人，一旦遇上坏人就当是人生的课题，如同朋友所说就像一頁书頁翻过去，让自己继续走自己的路。——朱德庸', 6);
INSERT INTO `sententce` VALUES (982, '追求成功，享受快乐，乃人之常情，在这个光怪陆离的人间，没有谁能够将日子过得行云流水；但我始终相信，走过平湖烟雨，岁月山河，那些历尽劫数，尝遍百味的人，会更加生动而干净。', 6);
INSERT INTO `sententce` VALUES (983, '经典永远是经典，但垃圾不可能永远是垃圾。', 6);
INSERT INTO `sententce` VALUES (984, '当掉的浅色寂语你开了一家收购店等来了遗忘的海角天光。', 6);
INSERT INTO `sententce` VALUES (985, '人的一生，就是在醒与睡累与不累之间。也仿佛是机器，要不断操作，不断保养，不断生产，也不断加油不断供电。直到有一天，把那电源拉下，不再推上去，人生就结束了。', 6);
INSERT INTO `sententce` VALUES (986, '生活原本很简单，想得太多，顾虑得太多，往往会让自己负担太重，活得太沉重。人生，快乐与苦痛往往同行，凡事看简单一些，随时丢弃苦痛得包袱，简单快乐自然会拥抱整个身心。人生难免会和痛苦不期而遇，其实痛苦并不可怕，可怕的是内心背叛自己，成为痛苦的帮凶。', 6);
INSERT INTO `sententce` VALUES (987, '经历了生活的炎凉冷暖，身边是飘过的繁华世界，看到什么，遇见什么，欣赏什么，命运不会冷落谁，只有内心的患得患失，才是最大的温度计。不以物喜，不以己悲，活一场对生命的尊重，活一场生活的坦白，对青山低头，对浮云让路。淡然清醒一些，生活真的不是一种苦心经营，它更是一种恬淡的分享。', 6);
INSERT INTO `sententce` VALUES (988, '生活总是会抛给我们一些巨大的糟糕的挫折，这很容易让我们放弃对我们所坚持的一切的信仰。人生感悟的句子，我觉得放弃对许多事情的信念能够，但是绝对不要放弃对自己的信仰。要始终相信自己，相信你会得到你想要的一切如果你拥有了这样的思想倾向，那么取得成功只是一个时间问题。', 6);
INSERT INTO `sententce` VALUES (989, '累了，蹲下来抱抱自己，依旧倔强的说：也但是如此。', 6);
INSERT INTO `sententce` VALUES (990, '我多么想像仙人掌那样，能够拥有那所谓的坚强。', 6);
INSERT INTO `sententce` VALUES (991, '人生是一张没有回程的车票，一场无法回放的电影，一扇走出无回的门。过去的不必后悔，把握眼前所有值得珍惜的机会，勇敢的应对生活。将奋斗进行到底!', 6);
INSERT INTO `sententce` VALUES (992, '茫茫人海，没有人不喜欢幸福的，没有人不期待幸福的，没有人不向往幸福的。人生感悟的句子，但不一样的时代有着不一样的理解，不一样的阶层有着不一样的看法，不一样的年龄有着不一样的要求。无论怎样不一样，有一点却是相同的，那就是幸福降临的时候，会感到比美妙更美妙，比快乐更快乐，总会激动不已甚至泪流满面。', 6);
INSERT INTO `sententce` VALUES (993, '每次借学习好的男同学的作业的时候，他总会说一句我瞎做的。', 6);
INSERT INTO `sententce` VALUES (994, '平凡的人生不必须庸庸碌碌，辉煌的人生不必须轰轰烈烈。', 6);
INSERT INTO `sententce` VALUES (995, '如果有缘，错过了还会重来；如果无缘，相遇了也会离开。相识就是一种缘分，相交就是一种情分。聚有聚的理由，离有离的借口，爱你的人会追随你，想你的人会联系你，人生就像蒲公英，看似自由，却身不由己，有些事，不是不在意，而是在意了又能怎样，人生没有如果，只有后果和结果。', 6);
INSERT INTO `sententce` VALUES (996, '成熟的人不问过去；聪明的人不问此刻；豁达的人不问未来。在人之上，要把人当人；在人之下，要把自己当人。知道看人背后的是君子；知道背后看人的是小人。你犯错误时，等别人都来了再骂你的是敌人，等别人都走了骂你的是朋友。人只要能掌握自己，就是人生强者。', 6);
INSERT INTO `sententce` VALUES (997, '只有先做人才能做大事，这是古训，先人早就强调了“做人为先”的重要性。', 6);
INSERT INTO `sententce` VALUES (998, '人们常犯最大的错误，是对陌生人太客气，而对亲密的人太苛刻，把这个坏习惯改过来，天下太平。', 6);
INSERT INTO `sententce` VALUES (999, '我们没有办法把控生活，但是我们能够把控我们的心，你嘲笑别人，自然有更多的人嘲笑你，你赞美别人，也自然有更多的人赞美你，这是吸引力的法则。', 6);
INSERT INTO `sententce` VALUES (1000, '生活本身是乏味的，日出而作，日落而归，有的人为了名利金钱地位，忙得身心疲惫，正是有了这样的纷扰，生活才会五彩缤纷，然而，平平淡淡才是真，完美和快乐在平淡中，平淡才是生活中最完美的时刻。', 6);
INSERT INTO `sententce` VALUES (1001, '生命不是要超越别人，而是要超越自己。', 6);
INSERT INTO `sententce` VALUES (1002, '人生要做两件事：第一件事，就是感恩；第二件事，就是结缘。人生要迈两道坎：情与钱。人生要喘两种气：一种是生命之气，一种是精神之气。人生要会两件事：学会挣钱，学会思考。人生的两个基本点：糊涂点，潇洒点。人生的两种状态：谋生，乐生。', 6);
INSERT INTO `sententce` VALUES (1003, '生命中，不断地有人离开或进入。看见的，看不见了；记住的，遗忘了。生命中，不断地有得到和失落。看不见的，看见了；遗忘的，记住了。然而，看不见的，是不是就等于不存在？记住的，是不是永远不会消失？对自己好点，因为一辈子不长；对身边的人好点，因为下辈子不必须遇见。', 6);
INSERT INTO `sententce` VALUES (1004, '路是自己选的，后悔的话，也只能往自己的肚子里咽。', 6);
INSERT INTO `sententce` VALUES (1005, '要时刻给自己信心与勇气，要有冒险精神，尝试着去做自己感兴趣的事，你会发现，其实自己的确很棒；', 6);
INSERT INTO `sententce` VALUES (1006, '掌握超多知识未必能必须能够带来财富，但肚里没货却百分百注定一辈子匍匐在财富金字塔底层苟延残喘', 6);
INSERT INTO `sententce` VALUES (1007, '必须先去了解市场和客户的需求，然后再去找相关的技术解决方案，这样成功的可能性才会更大。', 6);
INSERT INTO `sententce` VALUES (1008, '做事先做人，这是自古不变的道理。如何做人，不仅仅仅体现了一个人的智慧，也体现了一个人的修养。一个人不管多聪明，多能干，背景条件有多好，如果不懂得做人，人品很差，那么，他的事业将会大受影响。', 6);
INSERT INTO `sententce` VALUES (1009, '雨夜，终究睡不安宁。抹一把眼角的潮湿，打开窗，饮一口凛冽的长风，笑了，清醒了，原来是梦罢了。呵，那些良辰美景的想象，已不配我所有，伏罪的岁月理应被流放，回眸，挥一挥衣袂，道声再见，不带走往事的尘埃；远眺，趁着天未荒地未老，潇洒前行。', 6);
INSERT INTO `sententce` VALUES (1010, '不要让别人告诉你，你不能做什么。那些做不到的人总要告诉你，你也不行。只要有梦想，就要去追求。', 6);
INSERT INTO `sententce` VALUES (1011, '幸福是那么的完美，那么的绚烂。人生，要懂得感恩，感恩，不必须是感谢大恩大德，而是一种生活态度，是一种善良的人性美。当你快乐时，你要想这快乐不是永恒的。当你痛苦时，你要想这痛苦也不是永恒的。', 6);
INSERT INTO `sententce` VALUES (1012, '不要像个落难者告诉别人你的不幸。', 6);
INSERT INTO `sententce` VALUES (1013, '出路出路，走出去了，总是会有路的。困难苦难，困在家里就是难。', 6);
INSERT INTO `sententce` VALUES (1014, '人的理智，本来是不十分靠得住的，往往做了利欲的代言人，但是自己不觉得罢了。', 6);
INSERT INTO `sententce` VALUES (1015, '只有痛苦的人生是决不会有的。有苦就必然有乐，反过来也一样，在这个世界上，生命是一瞬间也不会停止的。人的生命也是这样。', 6);
INSERT INTO `sententce` VALUES (1016, '人生，看透不如看淡。不要刻意的模仿别人，做为这个世界上的匆匆行者，每一段人生，都赋予我们对生命的不一样理解，也许我们走的并不完美，但也在努力绽放，也许会有迷失，但不要抱怨，没有路能够重走，没有人能够重来。', 6);
INSERT INTO `sententce` VALUES (1017, '古之成大事者，不惟有超士之才，亦有坚忍不拔之志。', 6);
INSERT INTO `sententce` VALUES (1018, '发现我成熟了很多，我不再去计较那么多，即使以前伤害过我攻击过我垂骂过我，我都能够变得很淡然，只要他们不再过分，此刻我有爱我自己的人，关心我的家人，支持我的朋友，我凭什么抱世俗的不公，我要努力拼命的努力，生活如此的完美，我们都要朝后看，拼一个好未来。', 6);
INSERT INTO `sententce` VALUES (1019, '一杯茶品人生沉浮，平常心越万千世界。', 6);
INSERT INTO `sententce` VALUES (1020, '只要放下一颗心，才能获自得外的惊喜。我们会发现，实在这个世界没有那么好，然而也尽没有那么坏。', 6);
INSERT INTO `sententce` VALUES (1021, '微笑是对挫折的挑战。微笑的人并非没有失败，并非没有痛苦，只是他们勇于应对生命中的起起伏伏，将目光更多地停留在了完美的一面。如果一味苛求生活，怜悯自我，怨天尤人，愁苦只会越来越多。', 6);
INSERT INTO `sententce` VALUES (1022, '生活就是这样，我们早也不是以前的自己，生活的磨练和挫折改变着我们，当我们发现自己能承担的东西越来越多的时候，突然某个时刻惊醒，会发现自己失去的却是更多更多：以前的好朋友亲情梦那份执着。我们用自己最宝贵的东西，换取着身上的人民币。不管结果怎样样，我们会变，真的变了，孤单了。', 6);
INSERT INTO `sententce` VALUES (1023, '你能够不高尚，但不能无耻;你能够不伟大，但不能卑鄙;你能够不聪明，但不能糊涂;你能够不博学，但不能无知;你能够不交友，但不能孤僻;你能够不乐观，但不能厌世;你能够不慷慨，但不能损人;你能够不追求，但不能嫉妒;你能够不进取，但不能倒退。', 6);
INSERT INTO `sententce` VALUES (1024, '做人低调，说话重要;做事低调,努力重要;感情抓牢,缘分重要;生活平安，快乐重要;时间溜走，好处重要;沧桑岁月,朋友重要;人生在世，知足就好!', 6);
INSERT INTO `sententce` VALUES (1025, '只有先做人才能做大事，这是古训，先人早就强调了“做人为先”的重要性。', 6);
INSERT INTO `sententce` VALUES (1026, '慢慢才知道，太在乎别人了往往会伤害自己；慢慢才知道，对自己好的人会随着时间的流逝越来越少；慢慢才知道，很多东西是可遇而不可求的，很多东西只能拥有一次；慢慢才知道，真心对一个人好不必须有回报，而你忽略的人往往可能是最重视你的；慢慢才知道，原来现实如此的无奈；慢慢才知道，自己长大了。', 6);
INSERT INTO `sententce` VALUES (1027, '婚姻是件瓷器，要想收藏好它的确困难，但是打碎它却很容易，要想把碎片粘合在一起，却是一件不易的事。', 6);
INSERT INTO `sententce` VALUES (1028, '初见，吟一段烟花烂漫，情殇流沙的两端，一端蘸一抹沧桑，一端系一缕搁浅。亦无所思牵，一切随烟迹散。数次邂逅，倾尽高山流水；一捻执着，情愫细雨微风。落一笔迁思神游，饮一浊浮生若梦，花开彼岸，暮然回首。', 6);
INSERT INTO `sententce` VALUES (1029, '少年的时候想逃家，青年的时候想成家，成年的时候想离家，老年的时候想回家。', 6);
INSERT INTO `sententce` VALUES (1030, '人生是一个赌场，我们随时都在下注，或输或赢，或悲或喜，没有一种微笑能够永恒，没有一种哭泣非要长久。有时候，是眼泪清晰了我们的视线，是困苦拓宽了我们的心胸。不要在意脚下的那些坎坷，它们都是铺垫你生命高度的基石。一时的输赢并不重要，重要的是我们在重重的博弈中，不要迷失以前的自己。', 6);
INSERT INTO `sententce` VALUES (1031, '简单人生，要做到也不简单。做个简单的人，抛开世俗的烦恼，给心留出一席之地，做自己喜欢做的事情；做个简单的人，渴了喝水，困了就睡，快乐就笑，悲哀就流泪人生是说不清的，人生感悟的句子，命运是猜不透的；辉煌总会来的，霉头总会有的；命是必须信的，运是能够开的；人生是需要悟的。', 6);
INSERT INTO `sententce` VALUES (1032, '朋友用心交，父母拿命孝。', 6);
INSERT INTO `sententce` VALUES (1033, '如果生活踹了你好多脚，别忘了给它两个耳光，反抗总比流泪强。', 6);
INSERT INTO `sententce` VALUES (1034, '满足自己的需要；人生最痛快的，莫过于因爱一个人至深而迷失了自己，忘了自己也是不可代替的。所以，帮忙他人的同时，别忘了帮帮自己。如果真有这样一个时刻，你能够随性而为，并做点对己有益的事，那就是此刻。', 6);
INSERT INTO `sententce` VALUES (1035, '全力冲刺，笑到最后。', 6);
INSERT INTO `sententce` VALUES (1036, '无论生活给了我们多少失落与辛酸，以一颗感恩之心去微笑应对一花一木，人生才能变得从容优雅大气。', 6);
INSERT INTO `sententce` VALUES (1037, '人生有三件事不能俭省。第一件事是学习。第二件事是旅游。第三件事是锻炼身体。', 6);
INSERT INTO `sententce` VALUES (1038, '如果人生需要一个完美的符号，没有比微笑更适宜的了。微笑，它是甜美的歌声，能唱出生活的快乐;它是温暖的阳光，能驱散心头的阴影;它是无边的春风，能蓬勃事业的生机。', 6);
INSERT INTO `sententce` VALUES (1039, '拼尽全力赢高考，苦尽干来齐欢笑。', 6);
INSERT INTO `sententce` VALUES (1040, '走过风，经过雨，看尽了人生聚散分离，感知了人心太多的凉薄与变故，就连一份单纯的情谊，因了在乎，都怕生出淡漠与疏离。', 6);
INSERT INTO `sententce` VALUES (1041, '人生的奇妙常在细微之中，人生的多彩常在于刹那之间，唯有细细品味生活，认真留心身边的事物，你才会发现生活的美妙。', 6);
INSERT INTO `sententce` VALUES (1042, '微笑是对挫折的挑战。微笑的人并非没有失败，并非没有痛苦，只是他们勇于应对生命中的起起伏伏，将目光更多地停留在了完美的一面。如果一味苛求生活，怜悯自我，怨天尤人，愁苦只会越来越多。', 6);
INSERT INTO `sententce` VALUES (1043, '人活一世，笑就要大声的笑，哭就要尽情的哭，让快乐常在，让悲伤远离。', 6);
INSERT INTO `sententce` VALUES (1044, '浪花，从不伴随躲在避风港的小表演，而始终追赶着拚搏向前的巨轮。', 6);
INSERT INTO `sententce` VALUES (1045, '腰板挺得笔直的人，终究不会走在攀登者队伍的前列。', 6);
INSERT INTO `sententce` VALUES (1046, '不知道什么时候起，看着你的头像亮起时，再也没有和你说话的勇气。只是对着你笑笑，可无语。一遍遍看着，一遍遍想。这个世界好的东西太多。而有些东西永远不属于自己。所以注定只是欣赏，站在远远的地方望着你。', 6);
INSERT INTO `sententce` VALUES (1047, '放空的心，是最好的礼物；独走的路，是最美的风景。时间就像流水。人生感悟的句子，你永远无法触摸同样的流水两次，因为已经流逝的流水不会再来，享受生命的每一个当下。人的生命，似海水奔流，生活那也就是让你不断的去遇到，得到的与失去的，遇到的与错过的！一切都充满好处又毫无好处。', 6);
INSERT INTO `sententce` VALUES (1048, '推销产品要针对顾客的心，不好针对顾客的头。', 6);
INSERT INTO `sententce` VALUES (1049, '人，要学会信念，把以前的，以前的，过去的，慢慢积攒起来，养成一种习惯。', 6);
INSERT INTO `sententce` VALUES (1050, '努力了，或许会被生活辜负，但总算自己没有辜负自己，当熬过了所有的苦难，因为没有遗憾，所以比谁都潇洒。', 6);
INSERT INTO `sententce` VALUES (1051, '冬天还没来，南方的天气就一天比一天的寒冷。晚秋时节，到处是肆虐的风，街上行人少了，有几个不得不出来的年轻人，也是裹着厚厚的外套，疾步走着。南方如此，北方就更不用说了，干冷的清澈，满眼是疾风利剑。这个秋，未入冬，却先闻到了冬的气息，今年的冬，不知来得早，是否也去得早。', 6);
INSERT INTO `sententce` VALUES (1052, '天沉默了，黑夜随风而来，又是一个周末过去，日子在一天天的前进，我们跟随着时光，一日日的向前行走，不知何时，也会坐在附近的公园里，一个人看着夜空，思考着这一年，去过的地方，遇见的人。安守在这座城市，已是半年，我知道还有许许多多个半年等着我去应对，去努力，去安守自己的的内心。', 6);
INSERT INTO `sententce` VALUES (1053, '牵挂是人之间最珍贵的情感，要经过见多少次面，才能够了解一个人。经历多少动荡，才能看清一个人的内心。但为了那点输赢，我们总是不愿承受一场动荡。用平和的心态来看待时间，来看待身边的人或事，善始善终，在卑微时，安贫乐道，慷慨大度；在显赫时，不娇不狂，潇洒人生。', 6);
INSERT INTO `sententce` VALUES (1054, '你对时间的态度，就是你对仅有一次生命的态度。', 6);
INSERT INTO `sententce` VALUES (1055, '在人之初，别拿人当幼欺;在人之暮，别拿人当弱辱;在人之前，别拿己当众扬;在人之后，别拿人当猴谤;在人之上，别拿人不当人;在人之下，别拿己不当人。当你习惯过一种日子，那么，你的一生只过上一天;如果你生活常新，那么你每一天都会过得很精彩。', 6);
INSERT INTO `sententce` VALUES (1056, '得意时要看淡，失意时要看开。人生有许多东西是能够放下的。只有放得下，才能拿得起。尽量简化你的生活，你会发现那些被挡住的风景，才是最适宜的人生。千万不要过于执着，而使自己背上沉重的包袱。', 6);
INSERT INTO `sententce` VALUES (1057, '我们期望分别是相聚的前奏，却不知离开了，就是永远不再相见。', 6);
INSERT INTO `sententce` VALUES (1058, '生活原本没有烦恼，当欲望之火被点燃后，烦恼就来敲你的心门了。生活原本没有痛苦，当你开始计较得失，贪求更多时，痛苦便来缠身了。', 6);
INSERT INTO `sententce` VALUES (1059, '为我们不应做而做了的事而后悔，那伤痛只会是一阵子；但为我们就应做而没有做的事而后悔，那伤痛却是一生的。', 6);
INSERT INTO `sententce` VALUES (1060, '不喜欢那种期待了很久的事情，那种能让我高兴半天的事情，最后却是白高兴白兴奋的那种感觉。像是烧红烧红的铁，最怕的是倒冷水，是不会有水在它身上停留，但是水让它痛了让它发出了声音激着它。直到它心凉了，或许我说的你懂不了，但是那种感觉很难受，它是空欢喜，你就应懂。', 6);
INSERT INTO `sententce` VALUES (1061, '人的生命也如同大自然的花朵一样，活着就是一个开始，从时光的演化里如同年轮的树干，一个年轮是一个标记。每一个年轮都有不一样的事情发生，每一个一天，都会不一样。事物的不覆辙，情绪的变化，都是在这个世间受到环境而生发的一种境界。', 6);
INSERT INTO `sententce` VALUES (1062, '生活常常是充满矛盾的，我们总是会去在意别人的言论，不敢做自己喜欢的事情，追求自己想爱的人，害怕淹没在飞短流长之中。所以，生活真的是需要勇气的，更需要修炼。如果，你认定你前方的路是正确的，就不要被外界影响，一心走你自己的路吧！如果，你活在别人的眼神里，就会迷失在自己的心路上。', 6);
INSERT INTO `sententce` VALUES (1063, '错错对对，是是非非，纷纷扰扰，淡然应对。伤口终会愈合，是非总有定论，流言随风飘散，微笑化解误会，结果定会无悔愿你心比天高，潇洒人生!', 6);
INSERT INTO `sententce` VALUES (1064, '人的一生要经历童年少年青年中年晚年的漫长历程，每个人都会遭遇到很多人生的挫折失败与磨难，无数次的跌倒过，又无数次的爬起来，在这个充满着酸甜苦辣的人生历练中，体味了人生百味，体会着生命的强大与完美。', 6);
INSERT INTO `sententce` VALUES (1065, '成功不在于坚持了多久，而在于你能否继续坚持。成功的关键往往只有几步，其他时候都是默默积淀的过程。', 6);
INSERT INTO `sententce` VALUES (1066, '你的父母还在为你而奋斗,这就是你需要为之坚强的理由', 6);
INSERT INTO `sententce` VALUES (1067, '我们从小到大，有关做人的道理耳熟能详。然而，品性优劣却人各有异，做事的结果也大相径庭。任何失败者都不是偶然的，同样，任何成功者的成功都是其必然性，其中最重要的一个因素就在于怎样做人。', 6);
INSERT INTO `sententce` VALUES (1068, '所有欺骗中，自欺是最为严重的', 6);
INSERT INTO `sententce` VALUES (1069, '死亡教会人一切，如同考试之后公布的结果——虽然恍然大悟，但为时晚矣!', 6);
INSERT INTO `sententce` VALUES (1070, '无人理睬时，坚定执着。万人羡慕时，心如止水。', 6);
INSERT INTO `sententce` VALUES (1071, '您推崇真诚和廉洁，以此视作为人处世的准则。您是我们莘莘学子心目中的楷模。', 6);
INSERT INTO `sententce` VALUES (1072, '生活的最高境界：忘掉过去，满意自己的此刻，乐观自己的未来。', 6);
INSERT INTO `sententce` VALUES (1073, '失败是成功之母。高但是脚底板。', 6);
INSERT INTO `sententce` VALUES (1074, '人生不只是只有艰险，它还时时充满了诱惑与遐想，充满了美的憧憬和渴望。诸如在步行间路遇一朵娇艳的野花，于是我们便驻足观赏却忘了前行。就这样，一朵野花便将我们迷惑，陶醉之中忘了自我。也许有一天我们会突然掉进爱的深渊，幻想着爱情的绮丽和美妙，于是我们便忘了肩上的职责，沉醉在爱情的憧憬里，迷失了方向，忘记了当初的誓言。', 6);
INSERT INTO `sententce` VALUES (1075, '弱者只有千难万难，而勇者则能披荆斩棘;愚者只有声声哀叹，智者却有千路万路。', 6);
INSERT INTO `sententce` VALUES (1076, '在每一次荣光到来之前必须有太多狼狈的时刻；在每一阵掌声到来之前，总有太多唏嘘太多冷眼；在每一个山顶峰巅，总有贝壳；每一片浩瀚的沧海，都是过去的桑田。生活裹着酸酸甜甜，日子却是平平淡淡；爱情也许缠缠绵绵，牵手却是简简单单；只愿相伴生生世世，青丝白发平平安安。', 6);
INSERT INTO `sententce` VALUES (1077, '人生坎坎坷坷，经历风风雨雨，哪怕历尽磨难,不屈不挠前进,纵然难达目标，但已享受过程，勿信神仙鬼怪，只求踏实做人，人生世事无常，祝愿一生平安。', 6);
INSERT INTO `sententce` VALUES (1078, '快乐要有悲伤作陪，雨过就应就有天晴。如果雨后还是雨，如果忧伤之后还是忧伤请让我们从容应对这离别之后的离别。微笑地去寻找一个不可能出现的你!', 6);
INSERT INTO `sententce` VALUES (1079, '人生就是柴米油盐酱醋茶，让我们品味人生的百味。不一样的滋味。', 6);
INSERT INTO `sententce` VALUES (1080, '生活，本来就是五味俱全，缺少了哪一种品尝，都会失去本真的意味！人毕竟不是神仙，终究摆脱不掉凡胎俗骨。既然如此，也只能在浮华和烦燥的世事里，努力寻找一处宁静的港湾，让自己原本纯净的灵魂，得到片刻的憩息。', 6);
INSERT INTO `sententce` VALUES (1081, '君愿买那一米阳光，送给伊彩虹烛光，彩虹画满了君思伊的点点滴滴，君是伊心中的大英雄，有一天会踏着七色云彩而来，与伊再续前世之缘，灵巧的伊，你是否愿再入君怀，做一个望穿秋水踏涟漪，永生陪伴的心上人。', 6);
INSERT INTO `sententce` VALUES (1082, '诚信总会给你带来成功，但可能是下一站。', 6);
INSERT INTO `sententce` VALUES (1083, '心的征程便是人生的征程，而用心去感受世界万物的过程就是生活。人生的完美来源于我们的发现和品味，人生的困苦更需要我们去品尝和体验。只有亲身经历过，我们才会发现人生的不平凡和壮丽。', 6);
INSERT INTO `sententce` VALUES (1084, '微笑是对世界的感恩。我们的境遇，春风得意也好，平平淡淡也罢，内心多一份知足，人生就多了一份甜美。', 6);
INSERT INTO `sententce` VALUES (1085, '人生最低的境界是平凡，其次是超凡脱俗，有些事情，能够改变，我们就要尽力把它们往好的方面改变。有些事情，我们改变不了，但是我们能够坦然理解事实，至少我们不会心力交瘁。', 6);
INSERT INTO `sententce` VALUES (1086, '强者向人们揭示的是确认人生的价值，弱者向人们揭示的却是对人生的怀疑。', 6);
INSERT INTO `sententce` VALUES (1087, '不是你比别人差，只是付出不够多。', 6);
INSERT INTO `sententce` VALUES (1088, '看来我也该整理整理，转个身，红个眼眶，笑着说声再见了。', 6);
INSERT INTO `sententce` VALUES (1089, '人生有三件事不能俭省。第一件事是学习。第二件事是旅游。第三件事是锻炼身体。', 6);
INSERT INTO `sententce` VALUES (1090, '如果你的童年不游乐，少年不好学，青年不立志，中年不创业，那么，你的生命就将随着年老而逝去。', 6);
INSERT INTO `sententce` VALUES (1091, '宁愿做一个高冷的孤独患者，也无心迎取他人的欢喜。', 7);
INSERT INTO `sententce` VALUES (1092, '乡下人怎样了？乡下人都是好人！！', 7);
INSERT INTO `sententce` VALUES (1093, '冬天没回你信息，不是因为高冷，只是因为手冷。', 7);
INSERT INTO `sententce` VALUES (1094, '这一生，你我注定，要仰望对方身后的风景。', 7);
INSERT INTO `sententce` VALUES (1095, '从今日起，你的寂寞与我无关！', 7);
INSERT INTO `sententce` VALUES (1096, '失去多了就成熟了？只是麻木吧。', 7);
