INSERT INTO `sententce` VALUES (1768, '与其患得患失，倒不如彻底失去来得痛快。', 8);
INSERT INTO `sententce` VALUES (1769, '从今日起，你的寂寞与我无关！', 8);
INSERT INTO `sententce` VALUES (1770, '照耀个屁，老子又不是蜡烛!', 8);
INSERT INTO `sententce` VALUES (1771, '硪对沵旳想念，[百度]里搜索不到￠', 8);
INSERT INTO `sententce` VALUES (1772, '寂寞现实的告诉了自我，真真假假，一场戏。', 8);
INSERT INTO `sententce` VALUES (1773, '我也不是蒙娜丽莎，没必要对谁都微笑。', 8);
INSERT INTO `sententce` VALUES (1774, '心软就像是一把刀，递给别人来一捅一自我。', 8);
INSERT INTO `sententce` VALUES (1775, '以往和朋友一齐仰望星空，随之我们泪流满面，他是因为失恋，我则是因为扭伤了脖子。', 8);
INSERT INTO `sententce` VALUES (1776, '不是天生好脾气，是怕失去你，才把你越一宠一越坏困在怀里。', 8);
INSERT INTO `sententce` VALUES (1777, '牵强的微笑，活不出无人能比的高傲。', 8);
INSERT INTO `sententce` VALUES (1778, '别说我很坏，我曾比你们任何人都傻。', 8);
INSERT INTO `sententce` VALUES (1779, '出门一笑大江横。', 8);
INSERT INTO `sententce` VALUES (1780, '明骚易躲，暗贱难防。', 8);
INSERT INTO `sententce` VALUES (1781, '甲之蜜糖，乙之砒霜。', 8);
INSERT INTO `sententce` VALUES (1782, '专家说，饥饿会让人愤怒，所以当我向你发火的时候你只要请我大吃一顿就好了。', 8);
INSERT INTO `sententce` VALUES (1783, '我不是骨头，不能让每条狗都追着跑。', 8);
INSERT INTO `sententce` VALUES (1784, '总有做不完的事，吐不完的怨气，减不完的肥，这就叫生活。', 8);
INSERT INTO `sententce` VALUES (1785, '友不贵多，贵在风雨同行；情不论久，重在有求必应。', 8);
INSERT INTO `sententce` VALUES (1786, '说实话，我很喜欢自我百毒不侵的样貌。', 8);
INSERT INTO `sententce` VALUES (1787, '与其说我花一心不如说你抓不住我的心。', 8);
INSERT INTO `sententce` VALUES (1788, '女人这一生会遇见这样两个男人，一个给她痛，一个给她爱，一个教会她成长，一个陪伴她一生。', 8);
INSERT INTO `sententce` VALUES (1789, '天不给我路走，我自我找路走；地不给我路平，我自我踏平。', 8);
INSERT INTO `sententce` VALUES (1790, '心凉的一瞬间的痛，是你用多少暖心的问候都弥补可是来的。', 8);
INSERT INTO `sententce` VALUES (1791, '或许，此夜，这风只为刺穿我的心扉，留我在深夜无眠相思。而心早已伤痕累累，那结痂的疤未好，又被深深划上几道。', 9);
INSERT INTO `sententce` VALUES (1792, '一句还好吗？你是想我怎样回答，难道我要矫情的朝你哭喊说没你我不快乐吗？算了吧，我还好。', 9);
INSERT INTO `sententce` VALUES (1793, '人穷，别走亲，寒心；不疼你的人，别去找；不帮你的人，别讨好；不想你的人，绝不打扰。疼爱你的人，放在首位；帮你的人，和他深交；惦念你的人，把他记牢！只有真正落难了，才明白：谁是焦急的牵挂，谁是转身的天涯！做人，人心换人心；你真，我更真！你假，我转身…', 9);
INSERT INTO `sententce` VALUES (1794, '越来越任性是因为爱得太深。越来越沉默是因为伤得太痛。越来越礼貌是因为失望透顶。', 9);
INSERT INTO `sententce` VALUES (1795, '我想你明白，最完美的爱，是成全，成全去寻找你的快乐。', 9);
INSERT INTO `sententce` VALUES (1796, '如果当初把那份炽热的爱收藏，也许此刻就能够像普通朋友一样。', 9);
INSERT INTO `sententce` VALUES (1797, '有些东西似乎失去了就再也找不到了，就如同有些人一样。', 9);
INSERT INTO `sententce` VALUES (1798, '不知什么时候我渐渐喜欢上了自己一个人。想想好像是你狠心离开我之后吧。', 9);
INSERT INTO `sententce` VALUES (1799, '想不开就不想，得不到就不要。何必为难我们自己呢。', 9);
INSERT INTO `sententce` VALUES (1800, '刚刚他发了一条信息说分手，我回了一个哦。', 9);
INSERT INTO `sententce` VALUES (1801, '我却要花一生的精力去忘记，去与想念与希望斗争；事情从来都不公平，我在玩一场必输的赌局，赔上一生的情动。', 9);
INSERT INTO `sententce` VALUES (1802, '悲伤逆流成河,蔓延了我那过往的以前,侵蚀着那段远走的岁月十月已不是十月,而是蚀月视线渐渐模糊,记忆慢慢远去这个十月,我依然未能拾起那久违的快乐,反而,蚀进了更多的伤悲', 9);
INSERT INTO `sententce` VALUES (1803, '嫣然一笑，半城烟沙湮没不了岁月遗留的伤。再寻伊人奈何执子之手，却不愿做我新娘。身后落下翻飞的枫叶，终抵不住心的微凉被渲染了一地红尘', 9);
INSERT INTO `sententce` VALUES (1804, '如果时光能够倒流，我希望回到没有认识你的那天。', 9);
INSERT INTO `sententce` VALUES (1805, '水中有楼楼心寒，水中有月月在天，人在水月楼中醉，依稀长歌赴广寒！', 9);
INSERT INTO `sententce` VALUES (1806, '你若爱过一个人，恨她的时候会恨的更深。这种仇恨远比人类所有感情都强烈。', 9);
INSERT INTO `sententce` VALUES (1807, '我要把对你的思念，用云层包裹成一个漫长的句点。', 9);
INSERT INTO `sententce` VALUES (1808, '世界上最凄绝的距离是两个人本来距离很远，互不相识，忽然有一天，他们相识，相爱，距离变得很近。然后有一天，不再相爱了，本来很近的两个人，变得很远，甚至比以前更远。', 9);
INSERT INTO `sententce` VALUES (1809, '我以为我足够坚强，却一天天失望。', 9);
INSERT INTO `sententce` VALUES (1810, '爱，一个让我不懂的感到心寒的字。', 9);
INSERT INTO `sententce` VALUES (1811, '酒冷尚可温，心寒如何暖？', 9);
INSERT INTO `sententce` VALUES (1812, '在错的时间遇上对的人是一场伤，在对的时间遇上错的人是一声叹息，在对的时间遇上对的人是一生的幸福。', 9);
INSERT INTO `sententce` VALUES (1813, '你说你有心事不知道跟谁说，我沉默着突然好难过。', 9);
INSERT INTO `sententce` VALUES (1814, '有个人吵总比一个人好。', 9);
INSERT INTO `sententce` VALUES (1815, '那颗心，以前为他多少次激烈且默默地跳动。是真的真的很爱，才将一颗真心奉上，任由践踏。', 9);
INSERT INTO `sententce` VALUES (1816, '一年一年又一年飞逝尽在一转眼。', 9);
INSERT INTO `sententce` VALUES (1817, '一个人，如果你不逼自己一把，你根本不知道自己有多优秀', 9);
INSERT INTO `sententce` VALUES (1818, '当遗忘变成另一种开始，淡了回忆，痛了现实', 9);
INSERT INTO `sententce` VALUES (1819, '爱情就像是乘法，只要其中一项为零，其结果永远为零。', 9);
INSERT INTO `sententce` VALUES (1820, '想你的时候有些幸福，幸福得有些难过。幸福对我说，你还太小。', 9);
INSERT INTO `sententce` VALUES (1821, '世界在庞大的雨水里变得安静。变得孤单。变得寂寞。变成了一个让人悲伤的星球。', 9);
INSERT INTO `sententce` VALUES (1822, '这年头谁都不是谁的谁，谁都不值的谁为谁掉眼泪！', 9);
INSERT INTO `sententce` VALUES (1823, '寂寞的悲伤，写满了我对你的思念。', 9);
INSERT INTO `sententce` VALUES (1824, '悉数记忆的流沙，那些逝去的年华，洗尽了我的尘沙…', 9);
INSERT INTO `sententce` VALUES (1825, '当一切都回不去了，当我决定要走，你才明白冷落了我，我要的不多，可你都没给够，哪怕一个温柔的相拥，对我来讲，都是幸福的。', 9);
INSERT INTO `sententce` VALUES (1826, '不要整天灰头灰脸，让自己灿烂点，别浪费青春和娇美身材', 9);
INSERT INTO `sententce` VALUES (1827, '别以为我糊里糊涂，其实我真的很在乎；别以为我反反复复，其实我真的不认输。', 9);
INSERT INTO `sententce` VALUES (1828, '坚强的内心，往往会被一句简单的安慰打败，然后泪流满面。', 9);
INSERT INTO `sententce` VALUES (1829, '生命中曾出现太多太多的完美让我拼尽全力去珍惜，然而结局却上演了独自生活，独自哀伤，一生孤独的流泪幸福。', 9);
INSERT INTO `sententce` VALUES (1830, '生活中有太多无可奈何的选择。社会就像江湖，总是让人身不由己，言不由衷。', 9);
INSERT INTO `sententce` VALUES (1831, '此刻才发现，我只是一张便利贴，随时都能够抛弃。', 9);
INSERT INTO `sententce` VALUES (1832, '黑色的天空，散发着诡异的气息，空气中弥漫着压抑的感觉，那感觉，让人窒息。', 9);
INSERT INTO `sententce` VALUES (1833, '一个人自以为刻骨铭心的回忆，别人早已已经忘记了。', 9);
INSERT INTO `sententce` VALUES (1834, '我一向在寻找那种感觉，那种在寒冷的日子里，牵起一双温暖的手，踏实地向前走的感觉。', 9);
INSERT INTO `sententce` VALUES (1835, '不知你们是否经历过，一种卑微且心寒的友情，叫做“你是我的知心密友，而我但是是你的泛泛之交”。', 9);
INSERT INTO `sententce` VALUES (1836, '爱情从希望开始，也由绝望结束。死心了，便是不再存在着任何我以前对你有过的希望。', 9);
INSERT INTO `sententce` VALUES (1837, '我知道我不是一个很好的记录者，但我比任何人都喜欢回首自己来时的路，我不但的回首，伫足，然手时光仍下我轰轰烈烈的向前奔去。', 9);
INSERT INTO `sententce` VALUES (1838, '不明白，别人都说痛苦的记忆能够随着时间慢慢改变，可它在我心里，总是在这样的深夜，悄悄袭上心头，不断的蔓延，不断的重复…', 9);
INSERT INTO `sententce` VALUES (1839, '有些的时候，正是为了爱才悄悄躲开躲开的是身影，躲不开的却是那份默默的情怀。', 9);
INSERT INTO `sententce` VALUES (1840, '心梦无痕-恍然间，彼岸花开，血色花蕊，引渡着迷惘的游魂…花丛间，彩蝶翩翩飞舞，淡蓝色的翅膀晕染七色光圈…我知道，今生，你必须有一只蝴蝶发簪，因为，多年以前，我已破茧成蝶，飞往等候的幸福彼岸……', 9);
INSERT INTO `sententce` VALUES (1841, '此刻才发现，我只是一张便利贴，随时都能够抛弃。', 9);
INSERT INTO `sententce` VALUES (1842, '想爱不能爱才最寂寞，我试着勇敢一点，可我无法应对镜中颤抖的双眼，所以只能跟靠近我的每个人说再见。', 9);
INSERT INTO `sententce` VALUES (1843, '我依然伫立窗前，掩饰了自己的迷惘，埋葬了真实的向往。', 9);
INSERT INTO `sententce` VALUES (1844, '你是不是断定我不会离开你，所以你才这么肆无忌惮的伤害我。', 9);
INSERT INTO `sententce` VALUES (1845, '我们也许能够同时爱两个人，又被两个人所爱。遗憾的是，我们只能跟其中一个厮守到老。', 9);
INSERT INTO `sententce` VALUES (1846, '你说不相信永远，在我爱上你的那一刻时间就停止了', 9);
INSERT INTO `sententce` VALUES (1847, '时间没有等我，是你忘了带我走，我左手过目不忘的的萤火，右手里是十年一个漫长的打坐。', 9);
INSERT INTO `sententce` VALUES (1848, '倒啤酒时上方总有一层泡沫，看似庞大，但抿一口全是空气，你给的感情也是。', 9);
INSERT INTO `sententce` VALUES (1849, '我在想为什么我能够那么清晰地听到你的声音，昰因为在内心深处，我知道你从来都没有停止爱过我。', 9);
INSERT INTO `sententce` VALUES (1850, '那些被你所遗忘的时光，逐渐长成了一根刺，深深的扎进我的心里。', 9);
INSERT INTO `sententce` VALUES (1851, '错过的，都是想要的。没有错过的，都是能够安静理解的。', 9);
INSERT INTO `sententce` VALUES (1852, '我有一份尊严，就算冷得心寒，也不会丢失我的骄傲。', 9);
INSERT INTO `sententce` VALUES (1853, '幸福的日子都觉得一样的平淡，无聊的日子各有不一样的烦琐。', 9);
INSERT INTO `sententce` VALUES (1854, '窗外雨在下，一颗挨着一颗，我的泪水也蓬勃了，如窗外那断了线的雨珠。', 9);
INSERT INTO `sententce` VALUES (1855, '我终生的等待，换不来你刹那的凝眸。', 9);
INSERT INTO `sententce` VALUES (1856, '伤口是别人给与的耻辱，自己坚持的幻觉。像我这样的人，总是以一个难题的形式出此刻感情里。', 9);
INSERT INTO `sententce` VALUES (1857, '该给的我都给了我都舍得，除了让你知道我心如刀割。', 9);
INSERT INTO `sententce` VALUES (1858, '我忘记了哪年哪月的哪一天，我在哪面墙上刻下了一张微笑着，忧伤着，凝望着我的脸。', 9);
INSERT INTO `sententce` VALUES (1859, '接近换来期望期望带来失望的恶性循环。', 9);
INSERT INTO `sententce` VALUES (1860, '发光并非太阳的专利，你也能够发光。', 9);
INSERT INTO `sententce` VALUES (1861, '以前以为你是风筝，我手中握着那根线，无论你飞向何方，我最终都是你的归属。', 9);
INSERT INTO `sententce` VALUES (1862, '怀表里那张陈旧的照片上，有一个说要在天堂和我见面的女人。我把她的笑容放在离时间最近的地方。我只想让我的时光中有她的笑容，一向都有。', 9);
INSERT INTO `sententce` VALUES (1863, '不经意的叹息，时时撕碎着苍凉的心，如此心伤怎能轻易释然？', 9);
INSERT INTO `sententce` VALUES (1864, '我就像是个悲伤容纳器，不断的理解来自你的各种伤害。', 9);
INSERT INTO `sententce` VALUES (1865, '有些话，说与不说，都是伤害，有些人，留与不留，都会离开。', 9);
INSERT INTO `sententce` VALUES (1866, '喜欢一个人没有错，错就错在喜欢一个不喜欢自己的人。', 9);
INSERT INTO `sententce` VALUES (1867, '我们的爱很短暂，但足以让我刻骨铭心…是的，如果有什么是我们生命中注定要留存下来的，那么不论悲与喜乐与忧，都是我们生命中无法剥离和抛弃的财富;如果我们把它当作财富而甘愿守护一生的话，它便是我们一生也享用不完的…有的时候我会想如果真的有来世，给她所有所有，永不言悔…为了亿万光年的那一瞬重逢，我愿意付出一切…没有终点，也没有起点;没有相逢，也没有分离;所有的一切都会一向延续，没有曲折…但是我们没有选择…', 9);
INSERT INTO `sententce` VALUES (1868, '爱情，原来是含笑饮毒酒。', 9);
INSERT INTO `sententce` VALUES (1869, '何苦一再勉强，越期待越失望。', 9);
INSERT INTO `sententce` VALUES (1870, '也许，你走出了我的视线，但是，却没走出我的思念。', 9);
INSERT INTO `sententce` VALUES (1871, '世界那么大，无论爱情还是友情，得攒多少缘分才能在一起。', 9);
INSERT INTO `sententce` VALUES (1872, '我和你们，再也不可能称之为我们，友情也好，爱情也罢，你们能够在我面前嘻嘻哈哈，而我能做的就是为你们的感情鼓掌而已。', 9);
INSERT INTO `sententce` VALUES (1873, '再悲伤再失望，却怎样也不肯放。', 9);
INSERT INTO `sententce` VALUES (1874, '他听那冷雨打在伞上。索性更冷一些就好了，他想。索性把湿湿的灰雨冻成干干爽爽的白雨，六角形的结晶体在无风的空中回回旋旋地降下来。等须眉和肩头白尽时，伸手一拂就落了。', 9);
INSERT INTO `sententce` VALUES (1875, '幸福的日子都觉得一样的平淡，无聊的日子各有不一样的烦琐。', 9);
INSERT INTO `sententce` VALUES (1876, '那些刻在椅子背后的爱情，会不会像水泥上的花朵，开出没有风的，寂寞的森林。', 9);
INSERT INTO `sententce` VALUES (1877, '你临别的微笑虽然只是短短的一瞬，但是摄在我心的底片上，却留下了永恒。我时时将它托在思念的掌心里，那形象是那么真切，那么清晰！', 9);
INSERT INTO `sententce` VALUES (1878, '很多时候，看的太透反而不快乐，还不如幼稚的没心没肺。', 9);
INSERT INTO `sententce` VALUES (1879, '当俄不哭泣的时候，证明俄真的累了。', 9);
INSERT INTO `sententce` VALUES (1880, '脸上的快活别人看得到，心里的痛又有谁能感到到。', 9);
INSERT INTO `sententce` VALUES (1881, '我以为我害怕的，是告别的时刻，原来，我同样害怕重逢。', 9);
INSERT INTO `sententce` VALUES (1882, '因为不能够在一起，所以才会越爱越深吧。也许某天你还会突然想起他，那个曾让你对明天有所期待，但却完全没有出此刻你的明天里的人。', 9);
INSERT INTO `sententce` VALUES (1883, '有些失去是注定的，有些缘分是永远不会有结果的，爱一个人不必须会拥有，拥有一个人就必须要好好去爱她……', 9);
INSERT INTO `sententce` VALUES (1884, '那左手系着对你的思念，右手却牵着你给的悲伤。', 9);
INSERT INTO `sententce` VALUES (1885, '缘起缘落，酒醒终究梦一场，但却无悔，用一切换取你的回眸，今生甘愿沉沦在爱的泥泞里，你于天涯，我便海角…', 9);
INSERT INTO `sententce` VALUES (1886, '我不太主动找人聊天。我主动找的，都是我在乎的人。', 9);
INSERT INTO `sententce` VALUES (1887, '当眼泪流下来，才知道，分开也是另一种明白。', 9);
INSERT INTO `sententce` VALUES (1888, '就让我一个人站在拥挤人潮听嘈杂的笑闹然后孤独终老。', 9);
INSERT INTO `sententce` VALUES (1889, '曾几何时，当我们遥望头顶的灿烂星河，那夜夜的星辉依旧洒满我们的心房，却不见了为牛郎织女感伤的泪光…因为长大，而不再相信童话…', 9);
INSERT INTO `sententce` VALUES (1890, '我不需要全世界都爱我，只要你一个人便已足够。', 9);
INSERT INTO `sententce` VALUES (1891, '天转凉了，你要盖好被子，别着凉。我哄不了你吃药，也给不了你拥抱。', 9);
INSERT INTO `sententce` VALUES (1892, '当初我们那么不甘心，最后还不是成了陌生人。', 9);
INSERT INTO `sententce` VALUES (1893, '朋友说，失恋不是失去一段感情，而是失去一种习惯。', 9);
INSERT INTO `sententce` VALUES (1894, '你的沉默让我心寒，这真是你想要的吗？', 9);
INSERT INTO `sententce` VALUES (1895, '人生的大部分时间里，承诺同义词是束缚，奈何我们向往束缚。', 9);
INSERT INTO `sententce` VALUES (1896, '这年头谁都不是谁的谁，谁都不值的谁为谁掉眼泪！', 9);
INSERT INTO `sententce` VALUES (1897, '我在你心里就像个笑话，你在我心里却美得不像话。', 9);
INSERT INTO `sententce` VALUES (1898, '如果等待能够换来奇迹，那么我愿意一向等下去，是一年，抑或是一生。', 9);
INSERT INTO `sententce` VALUES (1899, '真正爱你的人，一下子说不出真正爱你的理由，只知道自己顾不上注意别人；真正爱你的人，总是惹你生气，你却发觉不了他到底做错了什么；真正爱你的人，只会在你一个人面前流泪；真正爱你的人，会在你忘记回复他信息时狠狠的说你一顿；真正爱你的人，很少当面赞美你，但是心里肯定你是最棒的。', 9);
INSERT INTO `sententce` VALUES (1900, '无法拒绝的是开始，无法抗拒的是结束。', 9);
INSERT INTO `sententce` VALUES (1901, '当女人不再对你流泪，她已经心寒了。当女人不再对你撒娇，她已经没热情了。', 9);
INSERT INTO `sententce` VALUES (1902, '梦已逝，心已碎，留下只是在为离开做准备。', 9);
INSERT INTO `sententce` VALUES (1903, '月冷不知心寒，心寒不懂情伤，情伤牵手寂寞，寂寞更显月冷。', 9);
INSERT INTO `sententce` VALUES (1904, '你是我爱过痛过挣扎过放弃过还是想要倾尽所有爱的人。', 9);
INSERT INTO `sententce` VALUES (1905, '立秋还天冷，愿君勿中暑。暑期未相见，亲友莫心寒。', 9);
INSERT INTO `sententce` VALUES (1906, '你变了，我也变了，回不去的温柔，泪水如泉涌，最熟悉的变得最令我心痛。', 9);
INSERT INTO `sententce` VALUES (1907, '无论怎样回头，无论怎样不舍，谁又能拾回旧时光？铭刻了记忆，老去了悲凉，谁不会是谁的前尘过往？', 9);
INSERT INTO `sententce` VALUES (1908, '所谓的回忆只但是是把伤害你的人在脑海里重放一次而已', 9);
INSERT INTO `sententce` VALUES (1909, '有一种释放叫沉浸，懂不了的人却只能看见随之的堕落。', 9);
INSERT INTO `sententce` VALUES (1910, '生命是从自己的眼泪中开始，在别人的眼泪中结束，这中间的过程叫做幸福。', 9);
INSERT INTO `sententce` VALUES (1911, '你必须找到除了爱情之外，能够使你用双脚坚强站在大地上的东西。亲爱的，你要相信，爱情不是一切，一切也不是爱情。', 9);
INSERT INTO `sententce` VALUES (1912, '深秋的天气更冷了，树叶枯黄了，纷纷扬扬地落在地上，像铺上了一层黄地毯，惟有香樟树不忍枯萎，颇有独立寒秋的味道。', 9);
INSERT INTO `sententce` VALUES (1913, '简单安静的生活其实不幸福`所以我只拥抱刹那`绵延持久的感觉根本不快乐`所以我只信仰瞬间。', 9);
INSERT INTO `sententce` VALUES (1914, '以前相遇，总胜过从未碰头。', 9);
INSERT INTO `sententce` VALUES (1915, '喜欢就喜欢了，心被牵动，无须理由，爱上你是我的自由，请打开窗口，让我的灵魂与你的灵魂相拥。', 9);
INSERT INTO `sententce` VALUES (1916, '莫言今日无生气，雪漫乾坤，席卷苍穹，意冷心寒好个冬！', 9);
INSERT INTO `sententce` VALUES (1917, '在这个秋天，预示着万物开始渐渐的落去，但是夏季还没有褪去，而我却感到了身边的一些在慢慢的凋零。', 9);
INSERT INTO `sententce` VALUES (1918, '我养成了熬夜的习惯，却没有了想晚睡陪着聊天的人。', 9);
INSERT INTO `sententce` VALUES (1919, '如果沦落到让别人主宰你的喜怒哀乐，就太容易失望受伤了。', 9);
INSERT INTO `sententce` VALUES (1920, '我已经风俗了你的疏落，然则我却不能疏落你。由于我怕惧失踪去你的天下，纵然我孤单，我也不会说我难熬。', 9);
INSERT INTO `sententce` VALUES (1921, '爱大概是你说你想要自由我只好忍下失去你的痛苦放你去流浪。', 9);
INSERT INTO `sententce` VALUES (1922, '我们当然能够爱一个人爱到不要命，但是我们绝不能爱一个人爱到不要脸。', 9);
INSERT INTO `sententce` VALUES (1923, '承诺本来就是男人与女人的一场角力，有时皆大欢喜，大部份的状况却两败俱伤。', 9);
INSERT INTO `sententce` VALUES (1924, '是我的终究是我的`我终归是你的一个过客`你始终不爱我`注定我和你就是什么都不会发生`注定`注定只是注定`不管我怎样跨', 9);
INSERT INTO `sententce` VALUES (1925, '爱情使人忘记时间，时间也使人忘记爱情。', 9);
INSERT INTO `sententce` VALUES (1926, '那些以前以为念念不忘的事情就在我们念念不忘的过程里，被我们遗忘了。', 9);
INSERT INTO `sententce` VALUES (1927, '人生，总会有不期而遇的温暖，和生生不息的希望。', 9);
INSERT INTO `sententce` VALUES (1928, '有些人注定是等待别人的，有些人是注定被人等的。', 9);
INSERT INTO `sententce` VALUES (1929, '用一转身离开，用一辈子去忘记。', 9);
INSERT INTO `sententce` VALUES (1930, '不要轻易地评价别人，因为他的人生，你没有经历过。', 9);
INSERT INTO `sententce` VALUES (1931, '情断了，绑不住，试着放手，走与不走，留与不留，我不想懂。伤感的句子', 9);
INSERT INTO `sententce` VALUES (1932, '在这个忧伤而明媚的三月，我从我单薄的青春里打马而过，穿过紫堇，穿过木棉，穿过时隐时现的悲喜和无常。', 9);
INSERT INTO `sententce` VALUES (1933, '我要有多坚强，才能在别人提起你的时候一笑而过。', 9);
INSERT INTO `sententce` VALUES (1934, '邂逅的瞬间，我站在你面前，只是个陌生人…', 9);
INSERT INTO `sententce` VALUES (1935, '我就像是个悲伤容纳器，不断的理解来自你的各种伤害。', 9);
INSERT INTO `sententce` VALUES (1936, '其实，我们都还是孩子。为什么要伪装的那么坚强，苦了自己，累了自己，伤了自己。', 9);
INSERT INTO `sententce` VALUES (1937, '别离，离我们不再遥远，此刻总是完美，终将成为过去，匮乏太多…', 9);
INSERT INTO `sententce` VALUES (1938, '每个没心没肺的人，都有一段为某人掏心掏肺的以前。', 9);
INSERT INTO `sententce` VALUES (1939, '我也想像那些姑娘一样说句我太爱你，离不开你，可话到嘴边说出的却总是那句随便你。', 9);
INSERT INTO `sententce` VALUES (1940, '据说，一个男孩喜欢你，他会一向不叫你的名字。', 9);
INSERT INTO `sententce` VALUES (1941, '我们明明等不起，却总是在等待。我们明明伤不起，却总是在受伤。我们明明不懂爱，却总是在说爱。', 9);
INSERT INTO `sententce` VALUES (1942, '你给我一滴眼泪，我就看到了你心中全部的海洋。', 9);
INSERT INTO `sententce` VALUES (1943, '以前的挚爱已经不在，不管是什么发生了转变，那时的相互都是幸福欢愉的。', 9);
INSERT INTO `sententce` VALUES (1944, '睹物思人的后半句，永远都是物是人非。(xuejuzi)。', 9);
INSERT INTO `sententce` VALUES (1945, '一段感情能给你带来多大痛苦，就曾给你带来过多大快乐。', 9);
INSERT INTO `sententce` VALUES (1946, '你在时你是一切，你不在时一切是你。', 9);
INSERT INTO `sententce` VALUES (1947, '持续微笑，走到哪里，哪里就有阳光', 9);
INSERT INTO `sententce` VALUES (1948, '伤口就像我一样，是个倔强的孩子。因为内心是温暖潮湿的地方，适合任何东西生长。', 9);
INSERT INTO `sententce` VALUES (1949, '痛过之后就不会觉得痛了，有的只会是一颗冷漠的心。', 9);
INSERT INTO `sententce` VALUES (1950, '忘掉岁月，忘掉痛苦，忘掉你的坏，我们永不永不说再见。', 9);
INSERT INTO `sententce` VALUES (1951, '我以为我们会很好，我以为我有很重要。', 9);
INSERT INTO `sententce` VALUES (1952, '失望好过绝望，至少还有机会从头再来。', 9);
INSERT INTO `sententce` VALUES (1953, '如果情能够割舍，为何道别后，心，还是管不住的难过。', 9);
INSERT INTO `sententce` VALUES (1954, '我要有多坚强，才能在别人提起你的时候一笑而过。', 9);
INSERT INTO `sententce` VALUES (1955, '其实人生就像曼珠沙华，于彼岸，心于此，只见花，不见叶。当繁华褪尽，烈火成冰，我们始能平静，看残阳月华……', 9);
INSERT INTO `sententce` VALUES (1956, '你看到我嘴角挂着笑，却忽略了我眼角含着泪。', 9);
INSERT INTO `sententce` VALUES (1957, '爱一个人很难，放弃自己心爱的人更难。', 9);
INSERT INTO `sententce` VALUES (1958, '远去的梦未曾醒来迷离的晨光清月的余辉绕过心头的情愁落向花香的灌丛不曾停留执迷追寻那梦幻般的柔情…', 9);
INSERT INTO `sententce` VALUES (1959, '耳机里面是喜欢但还不会唱的歌，手机屏幕上的照片是喜欢但还没在一起的人。', 9);
INSERT INTO `sententce` VALUES (1960, '从心寒到整颗心被拧碎，你觉得我从不问心自愧？再这一次就够了，连同回忆再也不要。', 9);
INSERT INTO `sententce` VALUES (1961, '我们都是戏子，在别人的故事里，流着自己的眼泪。', 9);
INSERT INTO `sententce` VALUES (1962, '很多人，因为寂寞而错爱了一人，但更多的人，因为错爱一人，而寂寞一生。我们能够彼此相爱，却注定了无法相守。不是我不够爱你，只是我不敢肯定，这爱，是不是最正确的。', 9);
INSERT INTO `sententce` VALUES (1963, '人生的成功不在于拿到一副好牌，而是怎样将坏牌打好，当心灵趋与平静；精神便得到永恒；给自己一个微笑吧，太阳每一天都是新的！', 9);
INSERT INTO `sententce` VALUES (1964, '梨花落满肩，残阳映心寒，苦笑，毫无留恋。', 9);
INSERT INTO `sententce` VALUES (1965, '爱情不伤人，伤人的是永远实现不了的海誓山盟；失去不可怕，可怕的是触景而伤情，睹物而思人。', 9);
INSERT INTO `sententce` VALUES (1966, '寂寞的人总是会用心的记住他生命中出现过的每一个人，于是我总是意犹未尽地想起你在每个星光陨落的晚上一遍一遍数我的寂寞。', 9);
INSERT INTO `sententce` VALUES (1967, '有些缘分是注定要失去的，有些缘分是永远都不会有好结果的，爱一个人不必须要拥有，但拥有一个人就必须要好好的去爱他。', 9);
INSERT INTO `sententce` VALUES (1968, '不要因为结束而哭泣，微笑吧，为你的以前拥有。', 9);
INSERT INTO `sententce` VALUES (1969, '能够说出的委屈，便不算委屈；能够抢走的爱人，便不算爱人。', 9);
INSERT INTO `sententce` VALUES (1970, '如果我不在乎，我不会再为你笑；不会变得这么脆弱；不会在意你做的每件事；不会静静想着你发呆；不会为你心痛；不会一个人珍惜与你在一起的时刻；不会总是不由自主的想起你；不会这么轻易的让痛苦折磨自己；不会为了无关重要的小细节跟你争执；这一切只因为我在乎你。', 9);
INSERT INTO `sententce` VALUES (1971, '我在等一个人，在等我的永恒，告诉我爱不单行，别害怕。', 9);
INSERT INTO `sententce` VALUES (1972, '我在前面像小丑一样做戏，而你却在背后笑着看着议论着。', 9);
INSERT INTO `sententce` VALUES (1973, '不是越长大越孤单，而是我们给别人的爱越来越少了。', 9);
INSERT INTO `sententce` VALUES (1974, '我们离回忆太近，离自由太远。有时候念念不忘，只是爱上回忆。一次犹豫，一次背叛，一次意外，足以让它枯萎。挣脱一切，烟消云散。', 9);
INSERT INTO `sententce` VALUES (1975, '如果等待能够换来奇迹，那么我愿意一向等下去，是一年，抑或是一生。', 9);
INSERT INTO `sententce` VALUES (1976, '生命是一束纯净的火焰，我们依靠自己内心看不见的太阳而存在。', 9);
INSERT INTO `sententce` VALUES (1977, '你要理解这世界上总有突如其来的失去，洒了的牛奶，遗失的钱包，走散的爱人，断掉的友情等等。当你做什么都于事无补的时候，唯一能做的就是努力让自己过的好一点，丢都丢了，就别再哭了。', 9);
INSERT INTO `sententce` VALUES (1978, '在希望中，夹杂着太多得不到的奢望。', 9);
INSERT INTO `sententce` VALUES (1979, '谁是谁生命中的过客，谁是谁生命的转轮，前世的尘，今世的风，无穷无尽的哀伤的精魂。', 9);
INSERT INTO `sententce` VALUES (1980, '也许，他根本不爱你，只是舍不得你鞍前马后的的那份殷勤。', 9);
INSERT INTO `sententce` VALUES (1981, '花开与花落，是天赐，是宿命。任风儿轻柔如云飘绕在心间。纤纤曼舞，一世的繁华。', 9);
INSERT INTO `sententce` VALUES (1982, '走着走着，就散了，回忆都淡了;看着看着，就累了，星光也暗了;听着听着，就醒了，开始埋怨了;回头发现，你不见了，突然我乱了。', 9);
INSERT INTO `sententce` VALUES (1983, '没有一种生命的轮回是命中注定的，就像，隔夜的狂欢。', 9);
INSERT INTO `sententce` VALUES (1984, '你的记忆，残存着你我依昔的记忆；我的记忆，却填满了写你的日记。', 9);
INSERT INTO `sententce` VALUES (1985, '我们每个人都生活在各自的过去中，我们会用一分钟的时间去认识一个人，用一小时的时间喜欢一个人，再用一天的时间去爱上一个人，到最后呢，却要用一辈子的时间去忘记一个人。悲伤的句子', 9);
INSERT INTO `sententce` VALUES (1986, '也许，他根本不爱你，只是舍不得你鞍前马后的的那份殷勤。', 9);
INSERT INTO `sententce` VALUES (1987, '天空的飞鸟，是你的寂寞比我多，还是我的忧伤比你多，剩下的时光，你陪我，好不好，这样你不寂寞，我也不会忧伤……', 9);
INSERT INTO `sententce` VALUES (1988, '高兴的时候，像疯子;难过的时候，就成了傻子……', 9);
INSERT INTO `sententce` VALUES (1989, '为了你我能够做很多，但是，我同时也有亲手毁掉这一切的潜力。', 9);
INSERT INTO `sententce` VALUES (1990, '相逢,不是恨晚,便是恨早。', 9);
INSERT INTO `sententce` VALUES (1991, '爱上你，是在一捧桂花中酿半碗清酒，在冷月下独立单斟，放尤彷徨的醉意一涌而上，醉也茫茫醒也茫茫，只有清冷的月光伴随着一个落寞的身影。', 9);
INSERT INTO `sententce` VALUES (1992, '之后的我独自站在街角，在风里享受你离开后的孤独。', 9);
INSERT INTO `sententce` VALUES (1993, '别以为我糊里糊涂，其实我真的很在乎；别以为我反反复复，其实我真的不认输。', 9);
INSERT INTO `sententce` VALUES (1994, '人生如梦，岁月无情。蓦然回首，才发现人活着是一种情绪。穷也好，富也好，得也好，失也好。一切都是过眼云烟。想想，不管昨日今日明天，能豁然开朗就是完美的一天。', 9);
INSERT INTO `sententce` VALUES (1995, '我爱你不是因为你是谁，而是我在你面前能够是谁。', 9);
INSERT INTO `sententce` VALUES (1996, '在原谅与绝望之间游荡，唯一的感觉是伤伤伤!', 9);
INSERT INTO `sententce` VALUES (1997, '我这人不太懂音乐，所以时而不靠谱，时而不着调。', 9);
INSERT INTO `sententce` VALUES (1998, '不要为那些不愿在你身上花费时间的人而浪费你的时间。', 9);
INSERT INTO `sententce` VALUES (1999, '黑色的天空。散发着诡异的气息。空气中弥漫着压抑的感觉。那感觉。让人窒息。', 9);
INSERT INTO `sententce` VALUES (2000, '不要为旧的悲伤，浪费新的眼泪。', 9);
INSERT INTO `sententce` VALUES (2001, '承诺本来就是男人与女人的一场角力，有时皆大欢喜，大部份的状况却两败俱伤。', 9);
INSERT INTO `sententce` VALUES (2002, '人不要等明天，因为没有人知道自己有没有明天。', 9);
INSERT INTO `sententce` VALUES (2003, '避免失望的最好办法，就是不寄希望于任何人任何事。', 9);
INSERT INTO `sententce` VALUES (2004, '人生如梦，岁月无情。蓦然回首，才发现人活着是一种情绪。穷也好，富也好，得也好，失也好。一切都是过眼云烟。想想，不管昨日今日明天，能豁然开朗就是完美的一天。', 9);
INSERT INTO `sententce` VALUES (2005, '我喝醉了酒，流入街头可怜的像条狗，哭着对你说别走，你义无反顾笑笑也不回头。', 9);
INSERT INTO `sententce` VALUES (2006, '以前以为，校服是种约束，之后才知，那是最无忧无虑的日子。', 9);
INSERT INTO `sententce` VALUES (2007, '找到一个对的人，是给自己以后的生命里最好的礼物。', 9);
INSERT INTO `sententce` VALUES (2008, '如果决定爱上一个人，时间拉长一点，看清楚是否适合你。', 9);
INSERT INTO `sententce` VALUES (2009, '别等我习惯了没有你你才回头假惺惺地说对不起。', 9);
INSERT INTO `sententce` VALUES (2010, '浅唱情歌，萎靡忧伤，忘怯徘徊，独守空房，意冷心寒，断辞情终。', 9);
INSERT INTO `sententce` VALUES (2011, '百世的回眸，一晃而过，飘零的年华，原本都是一个错，散落在沉浮的角落，环绕着青春的沉默，想起独钓月下的一片水墨，心儿回漾着醉人迷景般的情歌，抒发深情未醒，醉卧梦境不觉。', 9);
INSERT INTO `sententce` VALUES (2012, '因为爱你所以尝到了心酸心痛心累心冷心死心甘情愿的滋味。', 9);
INSERT INTO `sententce` VALUES (2013, '以前的挚爱已经不在，不管是什么发生了转变，那时的相互都是幸福欢愉的。', 9);
INSERT INTO `sententce` VALUES (2014, '孤单不是与生俱来，而是由你爱尚上个人的那一刻开始。', 9);
INSERT INTO `sententce` VALUES (2015, '人，总要寒心一次，寒心过后，愿你学会为自己而活。', 9);
INSERT INTO `sententce` VALUES (2016, '其实我们都怕掉眼泪，因为我们都以前爱过。', 9);
INSERT INTO `sententce` VALUES (2017, '我希望能有你，有你在我不会再孤单;有你在，我在花落时分都不会再伤感;只要有你，我宁愿我从未写出过这春天里花的三部曲!', 9);
INSERT INTO `sententce` VALUES (2018, '一个人，一座城，一条路，一颗心，终究还是一生孤单。', 9);
INSERT INTO `sententce` VALUES (2019, '爱情不是数着日子过去，它让每个日子都变得有好处。', 9);
INSERT INTO `sententce` VALUES (2020, '等待也许并不容易;伤害却轻而易举。', 9);
INSERT INTO `sententce` VALUES (2021, '爱上一个人的时候，总会有点害怕，怕得到他；怕失掉他。', 9);
INSERT INTO `sententce` VALUES (2022, '同样一颗心，能够是雄心信心决心，也能够是揪心窝心寒心——其实发生的事很重要，但心对事的理解整理更重要。', 9);
INSERT INTO `sententce` VALUES (2023, '做一个快乐的女子，必须要快乐，不快乐也要制造快乐，笑容不必须能使世界绽放，却可放松紧绷的胸膛，开心，就笑，让大家都感染到，悲伤，就哭，美容，倾诉，然后一切归零，爽朗，对内心卑微的自己笑笑，汲取安慰和力量，信赖，神清气爽，然后能够轻舞飞扬，生活，其实没什么大不了。', 9);
INSERT INTO `sententce` VALUES (2024, '我转身而过，不敢多看你一眼，叶子都心寒的飘落了。', 9);
INSERT INTO `sententce` VALUES (2025, '那些刻在椅背后的爱情，会不会像水泥地上的花朵，开出地老天荒的，没有风的森林。', 9);
INSERT INTO `sententce` VALUES (2026, '我不知道涐扪的爱情还会坚持多久。', 9);
INSERT INTO `sententce` VALUES (2027, '当初觉得爱的死去活来肝肠寸断彻夜难眠的人，或许一觉醒来就再也心动不起来了。', 9);
INSERT INTO `sententce` VALUES (2028, '因为不能够在一起，所以才会越爱越深吧。也许某天你还会突然想起他，那个曾让你对明天有所期待，但却完全没有出此刻你的明天里的人。', 9);
INSERT INTO `sententce` VALUES (2029, '我们很傻，总是把精力放在了不该放的位置上。', 9);
INSERT INTO `sententce` VALUES (2030, '花雨梦，几多情，魂依今生，一切终将逝去，永恒的只有凄美的思念。一曲离殇，此生，你注定是凋落在我身后的繁华旧梦。', 9);
INSERT INTO `sententce` VALUES (2031, '好好珍惜你此刻所拥有的一切吧。因为你此刻拥有的，正是以前梦寐以求的。', 9);
INSERT INTO `sententce` VALUES (2032, '忘掉岁月，忘掉痛苦，忘掉你的坏，我们永不永不说再见。', 9);
INSERT INTO `sententce` VALUES (2033, '天空飘过白云，我会记住一切，不管是快乐的还是悲伤的，尤其是那些刻骨的。', 9);
INSERT INTO `sententce` VALUES (2034, '想说什么就说什么，我可不会读心术。', 9);
INSERT INTO `sententce` VALUES (2035, '做不到让谁为我心疼，我只能一个人学着残忍。', 9);
INSERT INTO `sententce` VALUES (2036, '我知道你我都没有错，只是不知道该如何退后。也许退一步，我们就离幸福近一步。', 9);
INSERT INTO `sententce` VALUES (2037, '脸上的快乐，别人看得到。心里的痛又有谁能感觉到。', 9);
INSERT INTO `sententce` VALUES (2038, '爱一个女孩子，与其为了她的幸福而放弃她，不如留住她，为她的幸福而努力。', 9);
INSERT INTO `sententce` VALUES (2039, '何时樱花雨情怨，朵花缠绵恋雨尘。笑傲书，黯然秋水波波逐，疗熬骨，情然俪水翩翩起。琵琶声色古韵调，宫女三千宠一人。伊人离去，君落魄与野山，君终日暗伤，每每回忆你与君的浪漫过往，嘴角便会扬起淡淡的笑意!', 9);
INSERT INTO `sententce` VALUES (2040, '没有什么是永远灿烂的，太阳都不能，更何况爱情。', 9);
INSERT INTO `sententce` VALUES (2041, '很可惜故事的最后，我们还是退回到了朋友的位置。', 9);
INSERT INTO `sententce` VALUES (2042, '好男人不会让心爱的女人受一点点伤，决不会象阵风在深夜里游荡，好男人不会让等待的情人心越来越伤，孤单单看不见幸福回来的方向。', 9);
INSERT INTO `sententce` VALUES (2043, '缘起缘灭，缘浓缘淡，不是我们能够控制的。我们能做到的，是在因缘际会的时侯好好的珍惜那短暂的时光。', 9);
INSERT INTO `sententce` VALUES (2044, '有些东西似乎失去了就再也找不到了，就如同有些人一样。', 9);
INSERT INTO `sententce` VALUES (2045, '你走之后，我像个拾荒者一样，到处收集你的消息。', 9);
INSERT INTO `sententce` VALUES (2046, '一首歌听久了会腻，一句话说多了会烦。', 9);
INSERT INTO `sententce` VALUES (2047, '在那年入冬的季节，心绪的风，就和着落雪的声息，吹动着这枚果核…它一点一点地敲开愚钝的情殇，让你的眼眉向我的暗语靠近…', 9);
INSERT INTO `sententce` VALUES (2048, '如果没法忘记他，就不要忘记好了。真正的忘记，是不需要努力的。', 9);
INSERT INTO `sententce` VALUES (2049, '错过的电影，总是最好看的，失去的情人，总是最懂你的。', 9);
INSERT INTO `sententce` VALUES (2050, '一个人能够给你许多痛苦，但是没有一次是相同的。', 9);
INSERT INTO `sententce` VALUES (2051, '孤单不是与生俱来，而是由你爱尚上个人的那一刻开始。', 9);
INSERT INTO `sententce` VALUES (2052, '阳光，那么温暖，却灼灼逼人，月光，那么清幽，却寒冷刺骨。', 9);
INSERT INTO `sententce` VALUES (2053, '在我的世界里，你依旧纯洁，脏了的只是这个世界。', 9);
INSERT INTO `sententce` VALUES (2054, '秋天再来时，伴我的是一份孤独和寂寞，秋天再来时，多少分离聚合。', 9);
INSERT INTO `sententce` VALUES (2055, '是我勇敢太久，决定为你一个人而活。', 9);
INSERT INTO `sententce` VALUES (2056, '让流年往事变成扯痛心脉的情愫把孤寂变成岁月的心酸，萧瑟中离愁别绪合乐集聚，浮浮沉沉，成了心间断红残绿的苍白。', 9);
INSERT INTO `sententce` VALUES (2057, '所谓最难忘的，就是从来不曾想起，却永远也不会忘记。', 9);
INSERT INTO `sententce` VALUES (2058, '有没有那么一个人，等了你好久，直到你想和他在一起了，而他却走了。', 9);
INSERT INTO `sententce` VALUES (2059, '我一向以为思念抵但是似水流年，是以为思念没有穿透流年的勇气，分别以后才发现，不是思念执着不了，而是流年的那一头，早已没有了谁可等待…', 9);
INSERT INTO `sententce` VALUES (2060, '你的记忆，残存着你我依昔的记忆；我的记忆，却填满了写你的日记。', 9);
INSERT INTO `sententce` VALUES (2061, '有没有这样一个人，无论多么想念，却不曾再见面。', 9);
INSERT INTO `sententce` VALUES (2062, '人与人之间总是相互的，你对我真心，我便与你贴心。你骗我虚情，我便对你敷衍，人心暖人心，别让人寒心！', 9);
INSERT INTO `sententce` VALUES (2063, '沉默带给你的好处很多，摆低姿态，变的谦虚，换言之就是，隐藏你的聪明。越聪明的人，越懂得沉默，就像成熟的稻子，垂下稻穗。', 9);
INSERT INTO `sententce` VALUES (2064, '有些痛，说不出来，只能忍着，直到能够慢慢淡忘。', 9);
INSERT INTO `sententce` VALUES (2065, '阳光风雨冰雪星月，都一齐浓缩成短短的昼夜，眼睛睁着，看匆匆忙忙演绎着千百年重复的童话，天上云落，也没有了一丝飘过的痕迹;冬去春来的日子，大雁不再北飞，在南方灼热的潮湿里绽开一季的生命，不愿再一味追寻疲惫。', 9);
INSERT INTO `sententce` VALUES (2066, '放眼望去，灯光朦胧。仰望天空，零星点点。我苦笑，如此微弱的光芒怎抵得过黑夜的覆没？', 9);
INSERT INTO `sententce` VALUES (2067, '绝望掩埋了欢笑，失望掩饰了一切，我该做的，就是学会忘记。', 9);
INSERT INTO `sententce` VALUES (2068, '学会多爱自己一点，既然他不爱你，那就自己好好爱自己。', 9);
INSERT INTO `sententce` VALUES (2069, '你转身离我而去的那一刻，便是我哭的最狼狈的时候。', 9);
INSERT INTO `sententce` VALUES (2070, '如果爱不曾来过，如果梦不曾碎过，如果心不曾疼过，那么我，是否还是你认识的我？', 9);
INSERT INTO `sententce` VALUES (2071, '那些离别和失望的伤痛，已经发不出声音来了。', 9);
INSERT INTO `sententce` VALUES (2072, '失望在希望中绝望，过去在轮回里重生', 9);
INSERT INTO `sententce` VALUES (2073, '咽喉里带着没来由的血腥，每次呼吸都牵扯心痛…', 9);
INSERT INTO `sententce` VALUES (2074, '接近换来期望，期望带来失望的恶性循环。', 9);
INSERT INTO `sententce` VALUES (2075, '世上最心痛的距离，不是你冷漠的说你已不在意，而是你放手了，我却永远活在遗憾里，不能忘记!', 9);
INSERT INTO `sententce` VALUES (2076, '世界上有许多无可奈何的事，当我们应对它时，我们应保有豁达的情绪，既已无可奈何，就任它去好了。', 9);
INSERT INTO `sententce` VALUES (2077, '一句还好吗？你是想我怎样回答，难道我要矫情的朝你哭喊说没你我不快乐吗？算了吧，我还好。', 9);
INSERT INTO `sententce` VALUES (2078, '跟自己说声对不起，因为以前为了别人难为了自己。', 9);
INSERT INTO `sententce` VALUES (2079, '偶尔的回忆过去，让我觉得我的人生在退步。', 9);
INSERT INTO `sententce` VALUES (2080, '世上最糟糕的感受就是不得不怀疑先前深信不疑的东西。', 9);
INSERT INTO `sententce` VALUES (2081, '在这个纷绕的世俗世界里，能够学会用一颗平常的心去对待周围的一切，也是一种境界。', 9);
INSERT INTO `sententce` VALUES (2082, '叶子的离开不是风的召唤，而是树的舍弃。', 9);
INSERT INTO `sententce` VALUES (2083, '爱情，从来都是一种百转千回的事情，不曾放弃，不曾受伤害，不曾难过，不曾迷茫，怎懂得爱人?原来，爱情竟是含笑饮砒霜。往事是冰封在记忆中的梦，而你是我唯一的记忆。细数门前落叶;听，窗外雨声，是思念的泪滴。思念是一种忧伤，幸福而惆怅，是一种温馨，痛苦而惊喜。', 9);
INSERT INTO `sententce` VALUES (2084, '善良给对了人，会对你感恩；善良给错了人，会让你寒心。心软给对了人，会对你情深；心软给错了人，会让你痛心。宽容给对了人，会对你热忱；宽容给错了人，会让你窝心。', 9);
INSERT INTO `sententce` VALUES (2085, '坚强的内心，往往会被一句简单的安慰打败，然后泪流满面。', 9);
INSERT INTO `sententce` VALUES (2086, '在最好的年华，做想做的梦，去想去的地方。', 9);
INSERT INTO `sententce` VALUES (2087, '等待你的关心，等到我关上了心。', 9);
INSERT INTO `sententce` VALUES (2088, '他听那冷雨打在伞上。索性更冷一些就好了，他想。索性把湿湿的灰雨冻成干干爽爽的白雨，六角形的结晶体在无风的空中回回旋旋地降下来。等须眉和肩头白尽时，伸手一拂就落了。', 9);
INSERT INTO `sententce` VALUES (2089, '以前的人，为了一段感情不离别，付上很多的代价，譬如放弃自己的理想，放弃机会。此刻的人，却能够为这些而放弃异端感情。离别，只是为了追寻更好的东西。', 9);
INSERT INTO `sententce` VALUES (2090, '谁把谁真的当真，谁为谁心疼。', 9);
INSERT INTO `sententce` VALUES (2091, '你是我最意外的勇敢，也是不得不放弃的纠缠。', 9);
INSERT INTO `sententce` VALUES (2092, '当初觉得爱的死去活来肝肠寸断彻夜难眠的人，或许一觉醒来就再也心动不起来了。', 9);
INSERT INTO `sententce` VALUES (2093, '我遥望着你的方向，把思念凝结成雨滴串联起来，在荒芜的世界里，缠绕着痴情，萦绕着期盼，穿越时空，飞越沧海，用娇弱的身躯抵抗狂风的侵袭，阻挡海浪的撞击…在岁月的磨砺中，奋力拼搏，勇往直前…', 9);
INSERT INTO `sententce` VALUES (2094, '你临别的微笑虽然只是短短的一瞬，但是摄在我心的底片上，却留下了永恒。我时时将它托在思念的掌心里，那形象是那么真切，那么清晰！', 9);
INSERT INTO `sententce` VALUES (2095, '天凉未必秋，心寒方觉冷。', 9);
INSERT INTO `sententce` VALUES (2096, '以前以为，爱情很美，为了那遥遥无期的幸福，丢弃了所有，努力呵护苦苦期待;而如今，却只想能够简单地活着，冷眼看着世事，把一切过往丢在记忆以外…', 9);
INSERT INTO `sententce` VALUES (2097, '每一天等你到这个时候我就失望了。', 9);
INSERT INTO `sententce` VALUES (2098, '你是我今生未完成的歌，唱不到结局却又难以割舍。', 9);
INSERT INTO `sententce` VALUES (2099, '没有什么过不去，只是再也回不去。', 9);
INSERT INTO `sententce` VALUES (2100, '我们依旧善良，当周遭的尘埃落满我们的心灵时，我们挥挥手将之拭去，却不得不忍受心灵这不忍触摸的痛。年幼无知，我们不懂成人世界的规则…', 9);
INSERT INTO `sententce` VALUES (2101, '有时候，执着是一种重负，或是一种伤害，放弃却是一种美丽。', 9);
INSERT INTO `sententce` VALUES (2102, '如此冬夜，总喜欢把所有关于你的字眼都涂抹成白色，即便来不及看黎明的曙光，也依旧能诠释为何今生无悔。望穿天涯，洞彻灵魂，伸开双臂，做一个相拥的姿势，我能，真的能感觉到你清澈的瞳孔中泛出的温度。', 9);
INSERT INTO `sententce` VALUES (2103, '孤独的伤口，好想有你来抚摩。但我去不敢开口。', 9);
INSERT INTO `sententce` VALUES (2104, '既然你喜欢饮料，就不要去碰那杯热水。', 9);
INSERT INTO `sententce` VALUES (2105, '当看破一切的时候，才知道，原来失去比拥有更踏实。', 9);
INSERT INTO `sententce` VALUES (2106, '有一种释放叫沉浸，懂不了的人却只能看见随之的堕落。', 9);
INSERT INTO `sententce` VALUES (2107, '你说你有心事不知道跟谁说，我沉默着突然好难过。', 9);
INSERT INTO `sententce` VALUES (2108, '你给的那份久久的失望，让我没有了等下去的勇气。', 9);
INSERT INTO `sententce` VALUES (2109, '很多人，因为寂寞而错爱了一人，但更多的人，因为错爱一人，而寂寞一生。', 9);
INSERT INTO `sententce` VALUES (2110, '悲伤逆流成河我为谁而不顾一切…', 9);
INSERT INTO `sententce` VALUES (2111, '开始的时侯，我们就知道，总会有终结。', 9);
INSERT INTO `sententce` VALUES (2112, '不要走，请逗留，不要再让我心痛，难道你认为伤我还不够？', 9);
INSERT INTO `sententce` VALUES (2113, '我们以前很幸福，心中每个角落都是关于你的回忆，它将折磨我，直到死去…', 9);
INSERT INTO `sententce` VALUES (2114, '一个人总要走陌生的路，看陌生的风景，听陌生的歌，然后在某个不经意的瞬间，你会发现，原本是费尽心机想要忘记的事情真的就那么忘记了。', 9);
INSERT INTO `sententce` VALUES (2115, '能放在心上的人不多，毕竟心的面积有限。', 9);
INSERT INTO `sententce` VALUES (2116, '孤独的双眼沉默着，何时才被明亮发现，躲在黑暗角落的我。悲哀的句子个性签名', 9);
INSERT INTO `sententce` VALUES (2117, '一个人能够被摧毁，但不能被击败!', 9);
INSERT INTO `sententce` VALUES (2118, '最难受的是听着自己喜欢的人说着他喜欢的人，还要装作不在乎。', 9);
INSERT INTO `sententce` VALUES (2119, '我厌恶有人突然间就不跟我讲话了，还不告诉我原因。', 9);
INSERT INTO `sententce` VALUES (2120, '白宣墨未干，悟时人未还。笔落离别泪，话末违心寒。', 9);
INSERT INTO `sententce` VALUES (2121, '爱情就像一捧沙，抓得越紧，流失得越多。', 9);
INSERT INTO `sententce` VALUES (2122, '就让我一个人站在拥挤人潮听嘈杂的笑闹然后孤独终老。', 9);
INSERT INTO `sententce` VALUES (2123, '坚持的永远都坚持着，而结束的会留下一辈子的遗憾。', 9);
INSERT INTO `sententce` VALUES (2124, '酒醉的夜让心也沉沦，闯出的步迈出奔放的血液，此刻也酩酊大醉，金樽尘颜，滔滔流淌泛滥，冲淡过往，挥霍你的面容，尘缘终将过去。', 9);
INSERT INTO `sententce` VALUES (2125, '冥冥之中，有些是注定的，强求不了!别让爱，为难。', 9);
INSERT INTO `sententce` VALUES (2126, '无人伴我，无人搀扶我，这样也心安，向来不喜任何情感，我还不起。', 9);
INSERT INTO `sententce` VALUES (2127, '没有人值得你流泪，值得让你这么做的人不会让你哭泣。', 9);
INSERT INTO `sententce` VALUES (2128, '我们有幸在美丽的地球上生存，所以，细致去品味生活中的完美，在一支优美的旋律中，或一顿美味的晚餐，被人关心的幸福感觉，珍惜它们吧，只有珍惜，才不会失去。', 9);
INSERT INTO `sententce` VALUES (2129, '你若爱过一个人，恨她的时候会恨的更深。这种仇恨远比人类所有感情都强烈。', 9);
INSERT INTO `sententce` VALUES (2130, '世上最糟糕的感受，就是不得不怀疑先前深信不疑的东西。', 9);
INSERT INTO `sententce` VALUES (2131, '为什么要那么痛苦地忘记一个人，时间自然会使你忘记。如果时间不能够让你忘记不就应记住的人，我们失去的岁月又有甚么好处？', 9);
INSERT INTO `sententce` VALUES (2132, '爱情就像个彩色的泡泡，看似很美丽，其实一戳即破。', 9);
INSERT INTO `sententce` VALUES (2133, '老头子急急走进卧室，然后把烟藏在家里的一个小角落，准备冲进洗手间把口中的气味刷一刷，突然他停住了，然后坐在沙发上泪流满面，原来老伴已经走了半个月。', 9);
INSERT INTO `sententce` VALUES (2134, '眼泪向着冷风扫，此刻，我失神的双眸，残留的只是你的面无表情…酌一口苦酒，一个人的苦笑，哽咽的告诉自己，我此刻过的很好…今日狂哭我继续醉，至少我能得到醉中享受片刻的永远…老雁的哀鸣冷风的伴奏演奏着一曲绝古离殇…残留一脸的落寞，无竭的思，不尽的念…太多的解释，最后难免沦为借口，太多的以前，最终将化成离愁…', 9);
INSERT INTO `sententce` VALUES (2135, '最容易令人感到温暖和惊喜的是陌生人，因为你对他没有期望。最容易令人感到心寒和悲哀的是亲人，因为你爱他们。', 9);
INSERT INTO `sententce` VALUES (2136, '我们从没有忘记真相，只是我们越来越会说谎。', 9);
INSERT INTO `sententce` VALUES (2137, '青春赋予你锋芒，请别让他失望。', 9);
INSERT INTO `sententce` VALUES (2138, '生命是一束纯净的火焰，我们依靠自己内心看不见的太阳而存在。', 9);
INSERT INTO `sententce` VALUES (2139, '凉宵残月冷秋欺，醉卧冰床眠夜迟。炉热心寒风破水，难得阆苑小涟漪。', 9);
INSERT INTO `sententce` VALUES (2140, '一句简单的问候，承载了多少不为人知的情感。', 9);
INSERT INTO `sententce` VALUES (2141, '友情经得起平淡，却经不起风雨。', 9);
INSERT INTO `sententce` VALUES (2142, '我要学着一个人走以后的路，仿佛这辈子从未有过你。', 9);
INSERT INTO `sententce` VALUES (2143, '你的寂寞让我留恋，不留意回头看了你一眼，只有孤单的人会寂寞。', 9);
INSERT INTO `sententce` VALUES (2144, '最美的不是下雨天，是与你一起躲过的屋檐。', 9);
INSERT INTO `sententce` VALUES (2145, '耳机里面是喜欢但还不会唱的歌，手机屏幕上的照片是喜欢但还没在一起的人。', 9);
INSERT INTO `sententce` VALUES (2146, '那些令你悲哀寒心死心的人，也但是是仗着你的在乎，才伤害了你。', 9);
INSERT INTO `sententce` VALUES (2147, '当眼泪流下来，才知道，分开也是另一种明白。', 9);
INSERT INTO `sententce` VALUES (2148, '那些久久惦记的，那些耿耿于怀的，都最终归为安静。', 9);
INSERT INTO `sententce` VALUES (2149, '你回复了他们所有暧昧的留言，偏偏我的晚安遭到了冷落。', 9);
INSERT INTO `sententce` VALUES (2150, '如果有一天我不在烦你，如果有一天，你的生活中没有了我，没有了每一天的电话，每一天的关心，每一天的小小脾气。我把一切一切都表现了出来，你知道了，清楚了，了解了，最终感动了，但是我却离开了，今日陌生的，是昨日熟悉的……', 9);
INSERT INTO `sententce` VALUES (2151, '思愁不禁在心底无端彷徨，泛滥蔓延。蹙眉忧伤，是你给我种下的碎碎念念。', 9);
INSERT INTO `sententce` VALUES (2152, '以前有个传说，流过的泪水都会变成童话，而你在童话的另一端。只要能飞过沧海，便能到达童话里的幸福彼岸今生，我站在寂寞左岸，你伫立海角天边…掌心抚过流年，纵使天涯路远，依旧割断不了尘世漫长而纠缠的思念…', 9);
INSERT INTO `sententce` VALUES (2153, '如果当初把那份炽热的爱收藏，也许此刻就能够像普通朋友一样。', 9);
INSERT INTO `sententce` VALUES (2154, '把我推进悬崖的你真善良，在我背后开枪的你真勇敢。', 9);
INSERT INTO `sententce` VALUES (2155, '之后的我独自站在街角，在风里享受你离开后的孤独。', 9);
INSERT INTO `sententce` VALUES (2156, '黑色的天空，散发着诡异的气息，空气中弥漫着压抑的感觉，那感觉，让人窒息。', 9);
INSERT INTO `sententce` VALUES (2157, '思念一个人的滋味，就象是喝了一杯冰冷的水，然后一滴一滴凝成热泪。', 9);
INSERT INTO `sententce` VALUES (2158, '你越想知道自己是不是忘记的时候，你反而记得越清楚，我以前听人说过，当你不能再拥有的时候，唯一能够做的就是令自己不要忘记。', 9);
INSERT INTO `sententce` VALUES (2159, '无力的蜷缩在黑夜的脚落里，不敢出声，怕打破这寂静却弥漫着清凉的气息，这是一种多么完美的感觉，却又是那么的令人胆战心惊…', 9);
INSERT INTO `sententce` VALUES (2160, '我们明明等不起，却总是在等待。我们明明伤不起，却总是在受伤。我们明明不懂爱，却总是在说爱。', 9);
INSERT INTO `sententce` VALUES (2161, '记住，这一秒不失望，下一秒就会有希望。', 9);
INSERT INTO `sententce` VALUES (2162, '殉花出于自傲而恶此生，残叶出于不甘而心存负…', 9);
INSERT INTO `sententce` VALUES (2163, '有些话，说与不说，都是伤害，有些人，留与不留，都会离开。', 9);
INSERT INTO `sententce` VALUES (2164, '很多我们以为一辈子都不会忘掉的事情，就在我们念念不忘的日子里被我们遗忘了。', 9);
INSERT INTO `sententce` VALUES (2165, '我离开你不是因为我输了，而是因为我懂了。', 9);
INSERT INTO `sententce` VALUES (2166, '人生若只如初见，当时只道是寻常', 9);
INSERT INTO `sententce` VALUES (2167, '最难受的是听着自己喜欢的人说着他喜欢的人，还要装作不在乎。', 9);
INSERT INTO `sententce` VALUES (2168, '最终你选择了适宜，我输给了喜欢。', 9);
INSERT INTO `sententce` VALUES (2169, '生命里，能够记起谁，是快乐的;生命里，能够被谁记起，是幸福的。“真的好想你”这五个字，简单却诠释了爱的真谛，心中有爱，才有深深的爱恋。', 9);
INSERT INTO `sententce` VALUES (2170, '如果上帝要毁灭一个人必先令其疯狂可我疯狂了这么久为何上帝还不把我毁掉。', 9);
INSERT INTO `sententce` VALUES (2171, '一次次心寒，勿怪他人。要怪只能怪心，不够静，妄念多。', 9);
INSERT INTO `sententce` VALUES (2172, '我们害怕岁月，却不知道活着是多么的可喜。我们认为生存已经没意思，许多人却正在生死之间挣扎。甚么时候，我们才肯为自己拥有的一切满怀感激？', 9);
INSERT INTO `sententce` VALUES (2173, '总有一天，你会遇到一个彩虹般绚烂的人，怦然而心动。', 9);
INSERT INTO `sententce` VALUES (2174, '有时，不是世界太虚伪。只是，我们太天真。', 9);
INSERT INTO `sententce` VALUES (2175, '有的时候之前的记忆太深，它会抢走之后的记忆。', 9);
INSERT INTO `sententce` VALUES (2176, '如果不要我，请离开我，留下，只是继续令我难过。', 9);
INSERT INTO `sententce` VALUES (2177, '那些以前以为念念不忘的事情就在我们念念不忘的过程里，被我们遗忘了。', 9);
INSERT INTO `sententce` VALUES (2178, '有些事，明知道是错的，却还要坚持，因为不甘心；有些人，明知是爱的，却还要放弃，因为没结局；有时候，明知道没路了，却还要前行，因为习惯了。', 9);
INSERT INTO `sententce` VALUES (2179, '明知会失去自由，明知这是一生一世的合约，为了得到对方，为了令对方快乐，也甘愿作出承诺。恋爱旳一个追求不自由的过程，当你埋怨太不自由了的时候，就是你不爱他的时候。', 9);
INSERT INTO `sententce` VALUES (2180, '因为爱你所以尝到了心酸心痛心累心冷心死心甘情愿的滋味。', 9);
INSERT INTO `sententce` VALUES (2181, '知道我为什么不心寒吗？因为我的心跳动。', 9);
INSERT INTO `sententce` VALUES (2182, '爱情就是上辈子欠下的情债这辈子来还。(好句子摘抄xuejuzi)我上辈子必须俗不可耐，搞得我今生无债可还？', 9);
INSERT INTO `sententce` VALUES (2183, '因为你的绝情，我的生活从此变了样，之后，时光不知不觉中飞逝，同样的天空不一样的世界，无意间爱上了别人，就像当初爱你一样，让人匆忙让人欢，偶尔的一次回想，才知道当初你给的绝望也是一种新的希望再之后，希望虽有了，但还是不知道我们该怎样做，才能让生活更完美…', 9);
INSERT INTO `sententce` VALUES (2184, '我不怕所有的枪口都指着我，而让我失望的是你也在其中。', 9);
INSERT INTO `sententce` VALUES (2185, '独自品尝期待绽放一生难舍的心伤。生命的旅程注定了孤独，是因为放不下才拒绝了停留。', 9);
INSERT INTO `sententce` VALUES (2186, '我忘记了哪年哪月的哪一天，我在哪面墙上刻下了一张微笑着，忧伤着，凝望着我的脸。', 9);
INSERT INTO `sententce` VALUES (2187, '一开始就就应不去期望然后就不会始料未及的失望。', 9);
INSERT INTO `sententce` VALUES (2188, '往往最善良的人最容易被骗，都是被一些无知的人骗。', 9);
INSERT INTO `sententce` VALUES (2189, '我是温柔的，除了苍凉;我是温柔的，除了忧伤;我是温柔的，除了悲情…', 9);
INSERT INTO `sententce` VALUES (2190, '人心凉薄，我早已明白，我亦不强求。', 9);
INSERT INTO `sententce` VALUES (2191, '人生若只如初见，犹抱琵琶半遮面。所以最好别提人初见，人初见时都装蒜，可又不能不提人初见，人不初见何来散。散去再忆初相见，半心酸来半心寒，半心酸在半遮面，半心寒在曲终散。千呼万唤不出来，何事秋风悲画扇！', 9);
INSERT INTO `sententce` VALUES (2192, '人生的成功不在于拿到一副好牌，而是怎样将坏牌打好，当心灵趋与平静；精神便得到永恒；给自己一个微笑吧，太阳每一天都是新的！', 9);
INSERT INTO `sententce` VALUES (2193, '余下的路我自己走，连同你的那份。说好的大漠孤烟江南烟雨，我自己也会去，多谢你把我带到那里。', 9);
INSERT INTO `sententce` VALUES (2194, '我们始终不曾停留在同一条道路上，就像灯火阑珊处那个闪动的身影，只是瞬间便淹没在无尽的黑暗中。', 9);
INSERT INTO `sententce` VALUES (2195, '思念成河，再也无法承载没有你的海洋。', 9);
INSERT INTO `sententce` VALUES (2196, '早晨的风，带着三分凄然，三分愁楚，三分难过，还有一分心碎茫然地吹着。我独个走在那条熟悉的小道上，突然发现，少了些笑意，多了些哀愁。', 9);
INSERT INTO `sententce` VALUES (2197, '也许有些话该烂在心里，有些伤要学会隐藏，有些痛该懂得承受，不能说的就让它永远的埋在心底，如果明知道是伤害我会选择沉默。', 9);
INSERT INTO `sententce` VALUES (2198, '我只是个小丑，怯懦的小丑。', 9);
INSERT INTO `sententce` VALUES (2199, '我想你，永无止境的思念快要吞噬了我的理智。', 9);
INSERT INTO `sententce` VALUES (2200, '如果上帝要毁灭一个人必先令其疯狂。可我疯狂了这么久为何上帝还不把我毁掉。', 9);
INSERT INTO `sententce` VALUES (2201, '离开之后，我想你不要忘记一件事：不要忘记想念我。想念我的时候，不要忘记我也在想念你。', 9);
INSERT INTO `sententce` VALUES (2202, '我要学着一个人走以后的路，仿佛这辈子从未有过你。', 9);
INSERT INTO `sententce` VALUES (2203, '我以为我努力就够了，可还是握不住你的心，真的心累了，心寒了，是不是该放手了。', 9);
INSERT INTO `sententce` VALUES (2204, '我生命里的温暖就那么多，我全部给了你，但是你离开了我，你叫我以后怎样再对别人笑。', 9);
INSERT INTO `sententce` VALUES (2205, '奋不顾身到全身而退，谁只为感情一点余味。', 9);
INSERT INTO `sententce` VALUES (2206, '人生最遗憾的，莫过于，轻易地放弃了不该放弃的，固执地，坚持了不该坚持的……', 9);
INSERT INTO `sententce` VALUES (2207, '人，总要寒心一次，才知道世界的真真假假，并不是谁都能以心换心。', 9);
INSERT INTO `sententce` VALUES (2208, '别一味等待完美一刻的到来，抓住此刻，创造完美。', 9);
INSERT INTO `sententce` VALUES (2209, '昨日你是谁不重要，重要的是今日你是谁，以及明天你将成为谁。', 9);
INSERT INTO `sententce` VALUES (2210, '亲爱的如果有一天我累了，记得主动理我。', 9);
INSERT INTO `sententce` VALUES (2211, '心寒，即使森林大火也无法升起温度。心燃，即使极地风雪也无法熄灭火苗。', 9);
INSERT INTO `sententce` VALUES (2212, '我们害怕岁月，却不知道活着是多么的可喜。我们认为生存已经没意思，许多人却正在生死之间挣扎。甚么时候，我们才肯为自己拥有的一切满怀感激？', 9);
INSERT INTO `sententce` VALUES (2213, '时光并不残忍。只是对于它来说我们太脆弱。', 9);
INSERT INTO `sententce` VALUES (2214, '缘分是本书，翻得不经意会错过，读得太认真会流泪。', 9);
INSERT INTO `sententce` VALUES (2215, '爱，是一件复杂而又简单的事情。当我们爱一个人，投注了太多的热情，而最终燃烧的是自己。', 9);
INSERT INTO `sententce` VALUES (2216, '世界上，真的会有那么一个人默默关注着你，疼爱着你，却永远不再靠近你。', 9);
INSERT INTO `sententce` VALUES (2217, '你笑一次，我就能够高兴好几天；可看你哭一次，我就难过了好几年。', 9);
INSERT INTO `sententce` VALUES (2218, '为什么我把一切无法决定的交给硬币。', 9);
INSERT INTO `sententce` VALUES (2219, '繁华落尽后，我们还是成为了最熟悉的陌生人。', 9);
INSERT INTO `sententce` VALUES (2220, '冬寒凄凄催花残，遥遥望心寒，一夜恍若隔世墙，容颜情几堪。', 9);
INSERT INTO `sententce` VALUES (2221, '没有一种生命的轮回是命中注定的，就像，隔夜的狂欢。', 9);
INSERT INTO `sententce` VALUES (2222, '多少次失望表示着多少次期盼，事实证明幸福很难。', 9);
INSERT INTO `sententce` VALUES (2223, '“我爱你”只是一句空话！请用实际来弥漫这张白纸。', 9);
INSERT INTO `sententce` VALUES (2224, '追求和渴望，才有快乐，也有沮丧和失望。经过了沮丧和失望，我们才学会珍惜。你以前不被人所爱，你才会珍惜将来那个爱你的人', 9);
INSERT INTO `sententce` VALUES (2225, '擦肩而过，你我，并不是属于彼此的，无所谓的珍重与再见，无所谓的感受与苦涩已化作尘埃飘过，我们该珍惜此刻。', 9);
INSERT INTO `sententce` VALUES (2226, '有些失去是注定的，有些缘分是永远不会有结果的爱一个人不必须会拥有，拥有一个人就必须要好好去爱她……', 9);
INSERT INTO `sententce` VALUES (2227, '“我爱你”只是一句空话！请用实际来弥漫这张白纸。', 9);
INSERT INTO `sententce` VALUES (2228, '我爱你，为了你的幸福，我愿意放弃一切--包括你。', 9);
INSERT INTO `sententce` VALUES (2229, '我们始终不曾停留在同一条道路上，就像灯火阑珊处那个闪动的身影，只是瞬间便淹没在无尽的黑暗中。', 9);
INSERT INTO `sententce` VALUES (2230, '心寒若孤城，容不进笑声。', 9);
INSERT INTO `sententce` VALUES (2231, '旁人能看见你的疤，却始终感受不到你的痛。', 9);
INSERT INTO `sententce` VALUES (2232, '不再追问不再寻找，爱情，你给了我什么?', 9);
INSERT INTO `sententce` VALUES (2233, '想把一个男人留在身边，就要让他知道，你随时能够离开他。', 9);
INSERT INTO `sententce` VALUES (2234, '无人伴我，无人搀扶我，这样也心安，向来不喜任何情感，我还不起。', 9);
INSERT INTO `sententce` VALUES (2235, '孤单不是与生俱来，而是由你爱上一个人的那一刻开始。', 9);
INSERT INTO `sententce` VALUES (2236, '你说爱我却没说只爱我。', 9);
INSERT INTO `sententce` VALUES (2237, '你转身离我而去的那一刻，便是我哭的最狼狈的时候。', 9);
INSERT INTO `sententce` VALUES (2238, '分手后，不要再回头。不要感觉很失败，更不要觉得自己浪费了几年生命。如果这让你学到了一些东西，那么这份感情就不是失败的。', 9);
INSERT INTO `sententce` VALUES (2239, '伤口就像我一样，是个倔强的孩子。因为内心是温暖潮湿的地方，适合任何东西生长。', 9);
INSERT INTO `sententce` VALUES (2240, '如果情能够割舍，为何道别后，心，还是管不住的难过。', 9);
INSERT INTO `sententce` VALUES (2241, '看庭前花开花落，荣辱不惊，望天上云卷云舒，去留无意。', 9);
INSERT INTO `sententce` VALUES (2242, '野猫的女人很任性，他们倔强不失可爱，野蛮不失温柔，他们认定的东西，就算不要也不能让别人拥有，她们是贪心的，因为她们害怕寂寞。', 9);
INSERT INTO `sententce` VALUES (2243, '你给我一滴眼泪，我就看到了你心中全部的海洋。', 9);
INSERT INTO `sententce` VALUES (2244, '消逝的黑夜，请你带走我偏执的思念…', 9);
INSERT INTO `sententce` VALUES (2245, '望穿你眼中的流年，我相信你真的爱过我，就像我当初真的为了你，可生可死。', 9);
INSERT INTO `sententce` VALUES (2246, '有天当你想起我，时间已摆平所有的错，也学会不再问为什么。直到有一天，应对爱情开始吝啬，会不会怀念当初的炙热？一路上经过各自曲折，直到有一天，选某个人相濡以沫。', 9);
INSERT INTO `sententce` VALUES (2247, '当我们还买不起幸福的时候，我们绝不就应走得离橱窗太近，盯着幸福出神。', 9);
INSERT INTO `sententce` VALUES (2248, '就算全世界不要你。不怕。还有我疼你。', 9);
INSERT INTO `sententce` VALUES (2249, '你的理所当然，让我感到心寒。', 9);
INSERT INTO `sententce` VALUES (2250, '无聊的人生，悲伤渲染黑色的夜空。', 9);
INSERT INTO `sententce` VALUES (2251, '人，总要寒心一次，才知道人生并非只有喜乐，有些烦恼只能自己消化。', 9);
INSERT INTO `sententce` VALUES (2252, '清了这杯浊酒，散了一场老友，你的余生，不再有我。', 9);
INSERT INTO `sententce` VALUES (2253, '朝起窗朦晨雨骤，擎伞疾走湿衫袖。衣透心寒西凝眸，低望蜗痕书成愁。', 9);
INSERT INTO `sententce` VALUES (2254, '我不奢求自己多幸福，只要不悲伤就好。', 9);
INSERT INTO `sententce` VALUES (2255, '我不是坚强的人，但我知道该坚强的时候，装也得装出坚强。', 9);
INSERT INTO `sententce` VALUES (2256, '人生的大部份时间里，承诺同义词是束缚，奈何我们向往束缚。', 9);
INSERT INTO `sententce` VALUES (2257, '我想送给你那一朵握紧在手里的花，还不够完成一个童话，所以看着你浅笑安然，匆匆走过有我的年华。', 9);
INSERT INTO `sententce` VALUES (2258, '每一个让人心寒的人，背后都有必须的道理。', 9);
INSERT INTO `sententce` VALUES (2259, '很多我们以为一辈子都不会忘记的事情，就在我们念念不忘的日子里，被我们遗忘了。', 9);
INSERT INTO `sententce` VALUES (2260, '不要再说自由了，这点自由我有了吗？新年的快乐热闹是人家的，好像一切都跟我无关。此情只待成追忆，只是当时已惘然。觉来知是梦，不胜悲！', 9);
INSERT INTO `sententce` VALUES (2261, '有没有这样一个人，无论多么想念，却不曾再见面。', 9);
INSERT INTO `sententce` VALUES (2262, '生如夏花，温暖了一季苦痛挣扎的凄凉，静谧了那炽热一季的喧哗。', 9);
INSERT INTO `sententce` VALUES (2263, '因为爱过，所以知道寂寞的滋味，因为难过，所以会常常流泪，因为不想错过这一站的幸福，所以更加的珍惜你。', 9);
INSERT INTO `sententce` VALUES (2264, '冬注定是寒冷的，我躲在季节的角落里，用一颗淡然的心与岁月对饮，让生命因为酸甜苦辣的感悟和沉淀而更加的厚重，隽永。', 9);
INSERT INTO `sententce` VALUES (2265, '幸福请了假，漂流在何方;若不曾迷茫，又何来悲伤?', 9);
INSERT INTO `sententce` VALUES (2266, '一场缘，两心定三生，四年离散；五更天，六曲动七弦，八夜无眠；九连环，十里皆望穿，百年心寒；千般念，万般只无奈，醉眼冷看。', 9);
INSERT INTO `sententce` VALUES (2267, '爱大概是你说你想要自由我只好忍下失去你的痛苦放你去流浪。', 9);
INSERT INTO `sententce` VALUES (2268, '每当我看天的时候我就不喜欢再说话每当我说话的时候我却不敢再看天。', 9);
INSERT INTO `sententce` VALUES (2269, '秋天再来时，伴我的是一份孤独和寂寞，秋天再来时，多少分离聚合。', 9);
INSERT INTO `sententce` VALUES (2270, '失望只有两种可能：选错了人，或是怀有不该有的期待。', 9);
INSERT INTO `sententce` VALUES (2271, '你是我猜不到的不知所措，我是你想不到的无关痛痒。', 9);
INSERT INTO `sententce` VALUES (2272, '凡事皆有代价，快乐的代价便是痛苦。', 9);
INSERT INTO `sententce` VALUES (2273, '不要再折磨我，我的心已被割破，流尽的不是血，是爱你的错。忧伤的句子', 9);
INSERT INTO `sententce` VALUES (2274, '我以为我会很勇敢我以为我会很习惯我以为我会永远陪在你身旁，但是，这些都只是我以为。', 9);
INSERT INTO `sententce` VALUES (2275, '请不要敷衍我，因为我很容易满足，也很容易心冷。', 9);
INSERT INTO `sententce` VALUES (2276, '当温柔不在，当泪水擦干，我此刻的挽留还算不算？只愿不会成遗憾。', 9);
INSERT INTO `sententce` VALUES (2277, '总有一天我会从你身边默默地走开，不带任何声响。', 9);
INSERT INTO `sententce` VALUES (2278, '如果我从没遇见你，如果我从没爱上你，如果我一开始没坚信，也许我就不会是此刻的这个自己。', 9);
INSERT INTO `sententce` VALUES (2279, '该给的我都给了我都舍得，除了让你知道我心如刀割。', 9);
INSERT INTO `sententce` VALUES (2280, '最厉害的病毒，是爱和谎言。', 9);
INSERT INTO `sententce` VALUES (2281, '以前以为，校服是种约束，之后才知，那是最无忧无虑的日子。', 9);
INSERT INTO `sententce` VALUES (2282, '明知你心里没有我，也永远做不到你想要得那个，却不由自主让你看到最真实的我，掩藏住受伤的我。', 9);
INSERT INTO `sententce` VALUES (2283, '世界上有许多无可奈何的事，当我们应对它时，我们应保有豁达的情绪，既已无可奈何，就任它去好了。', 9);
INSERT INTO `sententce` VALUES (2284, '世界上，真的会有那么一个人默默关注着你，疼爱着你，却永远不再靠近你。', 9);
INSERT INTO `sententce` VALUES (2285, '对于爱情，我从未想过放弃，但再也找不到坚持的理由了', 9);
INSERT INTO `sententce` VALUES (2286, '想你的时候有些幸福，幸福得有些难过。幸福对我说，你还太小。', 9);
INSERT INTO `sententce` VALUES (2287, '男人在结婚前觉得适合自己的女人很少，结婚后觉得适合自己的女人很多。所有的女人都就应结婚，设法叫她们的丈夫赚钱来养活她们。', 9);
INSERT INTO `sententce` VALUES (2288, '深秋的天气更冷了，树叶枯黄了，纷纷扬扬地落在地上，像铺上了一层黄地毯，惟有香樟树不忍枯萎，颇有独立寒秋的味道。', 9);
INSERT INTO `sententce` VALUES (2289, '在这个秋天，预示着万物开始渐渐的落去，但是夏季还没有褪去，而我却感到了身边的一些在慢慢的凋零。', 9);
INSERT INTO `sententce` VALUES (2290, '在意你的一举一动，以至于在意到伤了自己。', 9);
INSERT INTO `sententce` VALUES (2291, '天亮了，美妙的一天又开端了，起床吧，呼吸清爽，拥抱阳光；浅笑吧，高兴心境，高兴一天。早上好，愿你有个好心情！', 2);
INSERT INTO `sententce` VALUES (2292, '用朝阳为你温一杯浓情牛奶，用真心为你做一根活力油条，用清风为你奏一首舒心歌谣，用信息为你道一声真挚祝福，愿收到的你，新的一天心情舒畅，活力飞扬，工作顺畅！朋友，早安！', 2);
INSERT INTO `sententce` VALUES (2293, '一驻足一回首，时光匆匆走；一白昼一黑夜，花开又花谢；一相聚一别离，何处觅岁月；一辈子一条路，光阴莫虚度；一世友一生情，早安祝福你。', 2);
INSERT INTO `sententce` VALUES (2294, '道一声清晨的祝福早上好！说一声清晨的关心吃早餐了吗？问一声清晨的关怀昨晚睡的好吗？真心送一句清晨的祝福。愿你一天心情愉快！', 2);
INSERT INTO `sententce` VALUES (2295, '早上好，送你清爽的问候，温馨的祝愿，早晨，美妙的开端，祝你今日精力棒棒，生机多多，心境好好，一切都好！', 2);
INSERT INTO `sententce` VALUES (2296, '早安，太阳，早安，地球，早安，中国，早安，亲爱的猪猪，快起来了，太阳公公要非礼你屁屁了。', 2);
INSERT INTO `sententce` VALUES (2297, '不要害怕做错什么，即使错了，也不必懊恼，人生就是对对错错，何况有许多事，回头看来，对错已经无所谓了。早安。', 2);
INSERT INTO `sententce` VALUES (2298, '温暖的味道在清晨的怀抱中香甜有营养，浪漫的味道在天亮的祝福中香甜好滋养，幸福的味道在最早的祝福中快乐升级，亲爱的，早上好', 2);
INSERT INTO `sententce` VALUES (2299, '人要懂得珍惜时光，不能丢了夜晚的星星，又错过白天的太阳。天道酬勤的意思是，越努力，越幸运。你若不相信努力和时光，或许它会第一个辜负你。又一个完美的清晨，改变自己，行动起来。早安！', 2);
INSERT INTO `sententce` VALUES (2300, '早上空气清新，叫你事事顺心；上午阳光明媚，祝你薪水翻倍；下午小风娇好，愿你青春不老。', 2);
INSERT INTO `sententce` VALUES (2301, '准时向你播报天气预报：今日你将遇到金钱雨，幸福风，友情雾，爱情露，健康云，顺利霜，安全雹，开心闪。', 2);
INSERT INTO `sententce` VALUES (2302, '早上好！祝你身价贵过大熊猫，名声响遍大中华，事业登上红塔山，情人靓过阿诗玛，一路领先万宝路，事事顺心万事发。', 2);
INSERT INTO `sententce` VALUES (2303, '生活中有太多无奈的选择，总让人身不由己，阡陌交错，五味杂陈。只有走过崎岖，才知平坦；经历风雨，方见彩虹。要学会在阴霾中找寻温暖，在暗夜中探求光明，咀嚼平淡如水的生活，领略四季起伏的风景，走出属于自己的人生。早安', 2);
INSERT INTO `sententce` VALUES (2304, '早晨的霞光灿烂无比，早晨的露珠晶莹无比，早晨的鲜花美丽无比，早晨的空气新鲜无比，早晨的心情舒畅无比，祝你早安！', 2);
INSERT INTO `sententce` VALUES (2305, '成功的人生必定有两个忠实的助手，一个是善于思考的耐心，一个就是不放弃努力的双手。早安。', 2);
INSERT INTO `sententce` VALUES (2306, '阳光洒在心中，惊醒一帘幽梦;问候如沐清风，蓝了朗朗晴空;泛起甜甜笑容，心事一切随风;开启快乐一天，身心时时放松。早安!', 2);
INSERT INTO `sententce` VALUES (2307, '早晨到，用短息把你叫醒，送你一道阳光，二份面包，三点希望，四分祝福，五次幸运，六六大顺，七（起）点之早，最后一句早安。', 2);
INSERT INTO `sententce` VALUES (2308, '天使托我告诉你：你的好运和天上星星一样多，幸福像海底鱼儿一样多！早上睁开眼，射向你的第一缕阳光即是一切完美开始！祝你开心每一天！', 2);
INSERT INTO `sententce` VALUES (2309, '早上好，一束阳光照在身，祝你天天都开心，财神家中去，梦想变成真，今日中大奖，明天去上任，我对你的祝福全都是真心。', 2);
INSERT INTO `sententce` VALUES (2310, '矿泉水爱上了方便面，向她表白，却被拒绝了。矿泉水问：为什么?方便面不屑道：就你，一点热乎劲都没，还想泡我!', 2);
INSERT INTO `sententce` VALUES (2311, '目标是用来超越的，而不仅仅仅仅仅仅仅仅是为了达成的。那么我们的目标是。没有蛀牙！哈哈，开个玩笑，大家早上好，新的一天开始了，我们都要加油！', 2);
INSERT INTO `sententce` VALUES (2312, '人生面临着许多的选择，每个选择不必须都是对的，当经过一段时间的验证，发现自己的选择是错的，那么就得立即停止，进行分析和调整，再从新开始。', 2);
INSERT INTO `sententce` VALUES (2313, '清晨早上好，刷牙洗脸驱烦恼，锻炼身体乐逍遥，喝水清肠毒素消，听听音乐快乐到，吃早餐营养均衡最重要，诵读此时最牢靠，一天的开始，一天的美妙，祝君，早安。', 2);
INSERT INTO `sententce` VALUES (2314, '天亮了吧，闹铃响了吧，极不情愿地起床了吧，我的问候及时赶到了吧，高兴了吧，那就笑笑吧。早安，祝你好心情！', 2);
INSERT INTO `sententce` VALUES (2315, '人没有完美，幸福没有一百分，这个世界上最不开心的，是那些懂得太多和想得太多的人。看得太明白的人通常聪明无比，但，换来的却是烦恼无数和辛苦一场。呵，早安，朋友。无论你是“聪明绝顶”还是“难得糊涂”我都祝福你天天快乐好心情。', 2);
INSERT INTO `sententce` VALUES (2316, '早上好，一束阳光照在身，祝你天天都开心，财神家中去，梦想变成真，今日中大奖，明天去上任，朋友的祝福全都是真心。', 2);
INSERT INTO `sententce` VALUES (2317, '假如能变幻成一片雪花，我愿悄悄落到您的身上渐渐消融悄然祝愿，愿我的温顺能化解您的疲困，愿我的晶莹能过滤您的思路，早上好！', 2);
INSERT INTO `sententce` VALUES (2318, '做一个平静的人，做一个善良的人，做一个微笑挂在嘴边，快乐放在心上的人。愿我小小的问候带给你快乐，早安，我的朋友！', 2);
INSERT INTO `sententce` VALUES (2319, '天亮了，完美的一天又开始了，起床吧，呼吸清新，拥抱阳光；微笑吧，快乐心情，开心一天。早上好，愿你有个好心情！', 2);
INSERT INTO `sententce` VALUES (2320, '睁开明亮的双眼，除去睡意的干扰，舒展美丽的笑脸，早安问候语问候信息拥抱快乐的一天。早安，亲爱的，愿你今日好心情，生活工作都舒心！', 2);
INSERT INTO `sententce` VALUES (2321, '早安，太阳，早安，地球，早安，中国，早安，亲爱的猪猪，快起来了，太阳公公要非礼你屁屁了。', 2);
INSERT INTO `sententce` VALUES (2322, '风吹黎明。我与鸟鸣一同早起，将光阴搂紧在怀中，用没有形容词的诗行和油菜花一同舞蹈。在柔和的三月，以自然朴实的形象，辉映出一个耕者的希望……各位朋友，早上好！', 2);
INSERT INTO `sententce` VALUES (2323, '轻轻的我来的，悄悄的又走了，忘了带走一个东西，就是愉悦，因此你要好好的为我保存这份愉悦哟，不然我随时能够找你的麻烦，嘿嘿，早上好，兄弟姐妹！', 2);
INSERT INTO `sententce` VALUES (2324, '睁开你的眼，我用温馨送你声早安;抬起你的头，我用快乐与你握个手;穿上你的衣，我用祝福伴你赢胜利。早晨快乐!', 2);
INSERT INTO `sententce` VALUES (2325, '阳光照获得的当地就有我给你的祝愿，雨水淋获得的当地就有我给你的问候，信息能抵达的当地就有我心爱的伴侣，早上好！祝你天天高兴，高兴永远！', 2);
INSERT INTO `sententce` VALUES (2326, '晨光踱进窗纱，希望洒满你的脸颊，朝霞打开你的心扉，自信慢慢升华，道声早安把气打，精神饱满乐开花。朋友早安。', 2);
INSERT INTO `sententce` VALUES (2327, '早上开手机，串串铃声连连响起！旭日伴随我的信息，快乐一天开启；白天随时随地，祝福的信息发给你，温馨无比。晚霞和夜幕降临，问候让你甜甜蜜蜜！', 2);
INSERT INTO `sententce` VALUES (2328, '安逸的人生，谁不想拥有。只是，这种安逸，就应是人生的终极目标，而不是年轻时逃避艰辛的理由。真正的安逸是经历年轻时期的奔波岁月后，内心的愉悦富足，它无关享受，无关迷茫，而是内心对未知世界的渴望。什么年龄段做什么事，在还能做梦的年纪，请不要轻易选择妥协。新的一天，早安。', 2);
INSERT INTO `sententce` VALUES (2329, '问路才不会迷路，留退路才不会有绝路，敢回头就没有死路。失去了不必须是失败，成功了也不必须是成就，能够逃避现实，但不能逃避人生。早安。', 2);
INSERT INTO `sententce` VALUES (2330, '早上起床后，请你先把自己沉睡的心打开，然后再把窗户打开。这样，户外的风才能吹进你的心扉。所以，每一天，你要做的第一件事就是开心！', 2);
INSERT INTO `sententce` VALUES (2331, '情人的泪。一滴就醉，多情的泪一揉就碎，爱也累，恨也累。不爱不恨，没有滋味。恩恩怨怨，没有是与非。谁能猜的对，爱情这杯酒，谁喝就的醉。', 2);
INSERT INTO `sententce` VALUES (2332, '睁开双眼，信息向你问安；伸伸懒腰，唤醒福运神灵；穿衣梳洗，快乐与你亲昵；携带清风，踏上幸福路程；信息问候，开心伴随一天。祝你早安愉快！', 2);
INSERT INTO `sententce` VALUES (2333, '太阳冉冉升起，清风柔柔吹起。花儿伸伸懒腰，喜鹊唧唧鸣唱。当你睁开眼睛时，世界的完美送给你。清扬的闹铃响起时，完美的祝福献给你。早安！', 2);
INSERT INTO `sententce` VALUES (2334, '人与人之间，最大的吸引力，不是你的容颜，不是你的财富，也不是你的才华，而是你传递给对方的信赖和踏实真诚和善良。人生，并不全是竞争和利益，更多的是共赢！懂得感恩，便会幸运！早安', 2);
INSERT INTO `sententce` VALUES (2335, '走进戈壁水最宝贵；沉沉夜幕灯火最宝贵；茫茫人海友情最宝贵；幸福生涯安康最宝贵；愿您拥有一切最为宝贵美妙的器械！', 2);
INSERT INTO `sententce` VALUES (2336, '人生似树，只有删除了遗憾与悔恨的繁枝蔓节，才有属于自己的天空。', 2);
INSERT INTO `sententce` VALUES (2337, '阳光照获得的当地就有我给你的祝愿，雨水淋获得的当地就有我给你的问候，信息能抵达的当地就有我心爱的伴侣，早上好！祝你天天高兴，高兴永远！', 2);
INSERT INTO `sententce` VALUES (2338, '找点空闲，找点时间，叫上朋友多出去走走。带上笑容，带上祝愿，发条信息给真心的朋友。时间常有朋友不常有，用常有的时间祝不常有的朋友，快乐常有！早上好！', 2);
INSERT INTO `sententce` VALUES (2339, '送你颗星，早上舒心，出门顺心，路上留意，遇事耐心，做是细心，交友留心，待人诚心，回家开心，夜里安心，对自己有信心，对别人有爱心，祝你永远开心每一天！', 2);
INSERT INTO `sententce` VALUES (2340, '清晨太阳升起，明亮你的心情；传达一声问候，温暖你的心情；发条祝福给你，愉悦你的心情。早安，愿你天天好心情！', 2);
INSERT INTO `sententce` VALUES (2341, '用阳光照耀你，用香花温馨你；用好运装点你，用微笑美丽你；用美酒陶醉你，用幸福祝福你。朋友，早安！', 2);
INSERT INTO `sententce` VALUES (2342, '历经了风吹雨打，只盼在坎坷路上，能有一颗心相随；历经了百转千回，只盼在困难的堤岸上，能与知己举杯，消除一切疲惫。友谊就是幸福的蓓蕾，早安！', 2);
INSERT INTO `sententce` VALUES (2343, '道一声清晨的祝福早上好！说一声清晨的关心吃早餐了吗？问一声清晨的关怀昨晚睡的好吗？真心送一句清晨的祝福。愿你一天心情愉快！', 2);
INSERT INTO `sententce` VALUES (2344, '过去怎样也无法找回，都要全新开始活好当下，再美的雕像站稳了就是精品一件，倒下了就是乱石一堆，再优秀的人放弃了你就是笑话一段，成功了你就是神话一曲，挺住了你就是人生最美的风景线！', 2);
INSERT INTO `sententce` VALUES (2345, '人活着，多半是为了得到别人的赞美，获得更多人的认可。当你发现你所承担的主角有高低之分时，你要让自己乐观快乐自信起来。不要因为职业的卑微而放弃自己梦想，不要因为工作的不如意而自暴自弃，更不要因为生活中出现的苦闷和迷茫而暗淡自己的生命。早安!', 2);
INSERT INTO `sententce` VALUES (2346, '岁月静好，从年少到暮夕，唯有深情共白头。早安！', 2);
INSERT INTO `sententce` VALUES (2347, '手机响了，是不是很兴奋，有没有想到是我我这么早联系你，是要送你好东西，你准备好了吗，我可说了哈！早安！说完了！', 2);
INSERT INTO `sententce` VALUES (2348, '你既然期望辉煌伟大的一生，那么就就应从今日起，以毫不动摇的决心和坚定不移的信念，凭自己的智慧和毅力，去创造你和人类的快乐。', 2);
INSERT INTO `sententce` VALUES (2349, '每个人都有潜在的能量，只是很容易：被习惯所掩盖，被时间所迷离，被惰性所消磨。早安!', 2);
INSERT INTO `sententce` VALUES (2350, '在我心灵的百花园里，采集金色的鲜花，我把最鲜艳的一朵给你，作为我对你的问候。', 2);
INSERT INTO `sententce` VALUES (2351, '天亮了吧，闹铃响了吧，极不情愿地起床了吧，我的问候及时赶到了吧，高兴了吧，那就笑笑吧。早安，祝你好心情！', 2);
INSERT INTO `sententce` VALUES (2352, '蓝天吻着海洋，海洋偎着蓝天，我把祝福写在蓝天碧波上。', 2);
INSERT INTO `sententce` VALUES (2353, '早上朝霞满天，祝你平安伴身边；中午烈日炎炎，祝你幸运一整天；晚上日落西山，祝你快乐在心间！', 2);
INSERT INTO `sententce` VALUES (2354, '早上好，傻傻笑，疲劳不快都笑掉。营养早餐要吃好，身体茁壮助你赚钞票。愿你事业高升财富到，甜蜜爱情一天更比一天妙。祝福总比别人的早到：早安！', 2);
INSERT INTO `sententce` VALUES (2355, '早晨的霞光灿烂无比，早晨的露珠晶莹无比，早晨的鲜花美丽无比，早晨的空气新鲜无比，早晨的心情舒畅无比，祝你早安！', 2);
INSERT INTO `sententce` VALUES (2356, '带上自己的阳光，照亮自己的心灵。心灵的力量是无穷的，它能够把一朵花变成一座花园，也能够把一滴水变成清泉。幸福其实就是一种心境，只要你心中有阳光，无论走到哪里，无论发生任何事情，你都会觉得是幸福的。早安！', 2);
INSERT INTO `sententce` VALUES (2357, '生命就是一个绣花。我们从底下看，乱七八糟的走线，上帝从上方看，则是一朵花。愿你这朵生命之花时刻绚烂夺目。早安，朋友！', 2);
INSERT INTO `sententce` VALUES (2358, '太多的祝福，怕流俗，讲不出口；太多的问候，已足够，怕已随季风飘流。只想轻声道一句早安朋友，愿你一天都精神抖擞，快乐伴左右。', 2);
INSERT INTO `sententce` VALUES (2359, '天亮了是因为太阳起床了，小草绿了是因为春天到了，蝴蝶起舞了是因为鲜花绽放了，我给你发信息，是因为我要叫懒猪起床了，哈哈，起床啦，早安！', 2);
INSERT INTO `sententce` VALUES (2360, '晨的美妙就如青草般芬芳，如河溪般明澈，如玻璃般通明，如甘露般喷鼻甜。亲喜欢的伴侣，早上好，愿你今日有个好意情！', 2);
INSERT INTO `sententce` VALUES (2361, '清清的晨风摇响快乐的铃铛，我的心奏起欢快的乐曲，说声“早安”，向你问好！', 2);
INSERT INTO `sententce` VALUES (2362, '把凝重的相思交给夏荷，让荷香浸满荷塘，叫鱼儿遗忘悲伤。把心底埋藏的记忆，交给岁月，梳理纷乱的年华；把幸福的过往珍藏，将朋友留在心上，早安！', 2);
INSERT INTO `sententce` VALUES (2363, '睡梦醒来好想你，随手发去信息息；不知最近可如意，工作生活皆顺利；愿我祝福永伴你，道声早安祝吉利。', 2);
INSERT INTO `sententce` VALUES (2364, '闹铃响，时间到；晨风吹，阳光照；走出门，把步跑；云儿飘，树儿摇；草儿摆，花儿笑；手机响，信息到；收祝福：早安早安早上好！', 2);
INSERT INTO `sententce` VALUES (2365, '早晨推开窗，拥抱阳光，觉得天然的浅笑；夜晚散漫步，聊聊家常，品尝普通的幸福。伴侣，拥有好意态，愿你幸福美妙！', 2);
INSERT INTO `sententce` VALUES (2366, '睁开明亮的双眼，除去睡意的干扰，舒展美丽的笑脸，拥抱快乐的一天。早安，朋友，愿你今日好心情，生活工作都舒心。', 2);
INSERT INTO `sententce` VALUES (2367, '睁开明亮的双眼，除去睡意的干扰，舒展美丽的笑脸，早安问候语问候信息拥抱快乐的一天。早安，朋友，愿你今日好心情，生活工作都舒心！', 2);
INSERT INTO `sententce` VALUES (2368, '扰，舒展美丽的笑脸，拥抱快乐的一天。早安，朋友，愿你今日好心情，生活工作都舒心！', 2);
INSERT INTO `sententce` VALUES (2369, '人生的每一次付出就像在山谷当中的喊声，你没有必要期望要谁听到，但那延绵悠远的回音，就是生活对你最好的回报，新的一天新的开始！早安。', 2);
INSERT INTO `sententce` VALUES (2370, '早上早霞满天，祝你安全伴身边；午时骄阳炎炎，祝你侥幸一成天；晚上日落西山，祝你高兴在心间！', 2);
INSERT INTO `sententce` VALUES (2371, '春天该很好，倘若你能在场多少执着守望，醉了初遇那一帘烟雨屋檐上的日子，缺了又圆屋前的花草，绿了又黄我知道，你会来你来时，花正开早安～', 2);
INSERT INTO `sententce` VALUES (2372, '如果你哭，你的对手就会笑；如果你笑，你的对手就会哭。人生就像愤怒的小鸟，每次你失败的时候，总有几只猪在笑。你要做的就是无视嘲笑的声音，给自己打气。早安，朋友！', 2);
INSERT INTO `sententce` VALUES (2373, '悄悄的，我进入了你的梦中，慢慢的，我在你的梦中漫步，轻轻的，我呼唤你的名字，起床吧，新的一天开始了，亲爱的，早安！', 2);
INSERT INTO `sententce` VALUES (2374, '人生最难做到的是：只问耕耘不问收获。人生最难放手的是：财富权势和美色。人生最难得到的是：快乐和幸福。但是不管有多难，我的问候依然陪着你，愿你新年快乐，开心每一天，早安。', 2);
INSERT INTO `sententce` VALUES (2375, '走过一些路，才知道辛苦；登过一些山，才知道艰难；趟过一些河，才知道跋涉；道一声问候，才知道这就是幸福。早安，我的朋友！', 2);
INSERT INTO `sententce` VALUES (2376, '早上好，吃饭了吗，没吃的话，送你一盘鸭，吃了会想家；还有一碟菜，天天有人爱；配上一羹汤，一生永健康；再来一杯酒，幸福会长久；另加一碗饭，爱情永相伴。', 2);
INSERT INTO `sententce` VALUES (2377, '早上闹铃一响，战役就此打响。早餐吃在路上，紧急奔赴战场。堵车不敢设想，身上背对翅膀。工作排得老长，天天埋头苦扛。理想支撑梦想，与君互勉分享！', 2);
INSERT INTO `sententce` VALUES (2378, '应对失败和挫折要有重整旗鼓的勇气，应对误解和仇恨要有持续本色的达观，应对赞扬和激励要有不断进取的力量，应对烦恼和忧愁，要有努力化解的境界。早安！', 2);
INSERT INTO `sententce` VALUES (2379, '沐浴着清晨那唯美而又柔和的朝阳，开始新的一天。给一点心灵阳光，心灵就会灿烂。早安！', 2);
INSERT INTO `sententce` VALUES (2380, '真切的祝福你，我的朋友，生活虽然天天平淡，但却天天开心：早上醒来笑一笑，中午睡个美容觉，晚上烦恼都跑掉，明天生活会更好，幸福永远将你绕！', 2);
INSERT INTO `sententce` VALUES (2381, '人生中谁都有梦想，但要立足现实，在拼搏中靠近，在忍耐中坚持。早安！', 2);
INSERT INTO `sententce` VALUES (2382, '清晨到了，你把睡眼睁开，梦想的希望会随着舒爽的阵风吹进来；你把窗户打开，愉悦的心情会随着温暖的阳光射进来；你把手机打开，快乐的铃铛给你带来了幸福的问候，你准备好了吗？朋友，早安！', 2);
INSERT INTO `sententce` VALUES (2383, '快，等不及了，我要随着太阳的升起率领天兵天将各路神仙飞速来到你身边，把最完美的祝福第一个送给你：愿你睁眼见快乐，伸手抓如意；抬腿跨祥云，张嘴进幸福；然后，一天都顺利！朋友，早安！', 2);
INSERT INTO `sententce` VALUES (2384, '托太阳公公轻轻的叩醒你沉睡的心灵，将暖暖的阳光洒满你全身，愿你精神抖擞信心百倍的迎接新的一天，朋友，早安！', 2);
INSERT INTO `sententce` VALUES (2385, '手机一声响，太阳蹦跳出山笑；手机两声响，小鸟叽喳伴晨闹；手机三声响，雨露清风围心绕；手机四声响，开心欢笑不住脚；手机再一响，祝福字句眼前撂；眯眼瞟一瞟，好运幸福就来到。早安。', 2);
INSERT INTO `sententce` VALUES (2386, '感动，是因为有人惦记；幸福，是因为有人可想；满足，是因为彼此默契。无论你在哪里，我都深深祝福你：有我的祝福陪伴，你定会开开心心！早安！', 2);
INSERT INTO `sententce` VALUES (2387, '睁开眼睛，给你一个轻轻的祝福，愿它每分每秒都带给你健康好运和幸福。希望你度过完美的一天！', 2);
INSERT INTO `sententce` VALUES (2388, '早安朋友，请理解我的祝福：让微笑爬上脸庞，让快乐充满心房，让好运陪在身旁，让成功依偎胸膛，让幸福尽情绽放，让友情在你心中珍藏。', 2);
INSERT INTO `sententce` VALUES (2389, '我的信息及时到达你手机，清晨的阳光及时晒到你屁屁。我的祝福及时到达你心底，一天的好运及时缠绕你身体。希望美丽的清晨看见开心的你，早安！', 2);
INSERT INTO `sententce` VALUES (2390, '一路走来，有千万人经过身边，但是却只有你相知相伴。岁月流转，磨灭了誓言，冲淡了情缘，在飞逝的时光面前，唯有你是永远，早安，宝贝儿。', 2);
INSERT INTO `sententce` VALUES (2391, '假如能变幻成一片雪花，我愿悄悄落到您的身上渐渐消融悄然祝愿，愿我的温顺能化解您的疲困，愿我的晶莹能过滤您的思路，早上好！', 2);
INSERT INTO `sententce` VALUES (2392, '我托太阳给你送去第一缕阳光的温暖和祝福，愿整个春天你都有一个好心情，早上好！', 2);
INSERT INTO `sententce` VALUES (2393, '太阳都出来老高，你还在呼呼睡大觉，我一向在把你叫，你反而睡得更美妙；突然我想到一高招，拿根骨头到，只见你向我汪汪叫。', 2);
INSERT INTO `sententce` VALUES (2394, '早上好，一束阳光照在身，祝你天天都开心，财神家中去，梦想变成真，今日中大奖，明天去上任，朋友的祝福全都是真心。', 2);
INSERT INTO `sententce` VALUES (2395, '铃声的旋律多曼妙，清晨的气息真正好，打开手机傻傻的笑，信息问候早早到：捎上我的祝福，怀揣你的自信，收获完美的一天，早安！', 2);
INSERT INTO `sententce` VALUES (2396, '早上的晨光是我问候的主题，愿你今日幸福多彩；初升的太阳是我祝愿的载体，愿你任务步步高升！早上好！', 2);
INSERT INTO `sententce` VALUES (2397, '早上好，吃饭了吗，没吃的话，送你一盘鸭，吃了会想家；还有一碟菜，天天有人爱；配上一羹汤，一生永健康；再来一杯酒，幸福会长久；另加一碗饭，爱情永相伴。', 2);
INSERT INTO `sententce` VALUES (2398, '花落花开，落下满地的思念，开不尽的是我无边的牵挂；云卷云舒，卷起一生的幸福，数不完的是我无限的祝愿。愿你好花常开，好运常来，早安！', 2);
INSERT INTO `sententce` VALUES (2399, '手机响了，是不是很兴奋，有没有想到是我？我这么早联系你，是要送你好东西，你准备好了吗，我可说了哈！早安！说完了！', 2);
INSERT INTO `sententce` VALUES (2400, '不经历风雨的如何能见到彩虹，但有时经历风雨后依然见不到彩虹。那就是应对一切现实给予的困惑与痛苦，因为你面前除了应对你还是应对，只有不断的痛苦之中才会有你多彩而丰富的人生。早安！', 2);
INSERT INTO `sententce` VALUES (2401, '带着昨夜的丝丝清凉，把祝福写在夏日的早上，愿你一天的生活快乐安详，愿你以后的日子幸福吉祥，祝早安！', 2);
INSERT INTO `sententce` VALUES (2402, '选中一天的完美，剪切悲观的烦恼，删除不满的忧虑，粘帖快乐的心境，刷新过滤的苦闷，保存美妙的心情，建立新文件夹：开心每一天！轻轻一声问候愿给你带来清晨完美的一天！早安！', 2);
INSERT INTO `sententce` VALUES (2403, '早晨收到祝福会快乐一天，夏天收到祝福会快乐一年，此刻又是早上又是夏天，我把祝福送给你，愿你秒秒都快乐！', 2);
INSERT INTO `sententce` VALUES (2404, '每一天醒来告诉自己：理由少一点，肚量大一点，嘴巴甜一点，脾气小一点，行动快一点，效率高一点，微笑露一点，脑筋活一点。', 2);
INSERT INTO `sententce` VALUES (2405, '人生如茶，静心以对。对错无辜，缘由前生。认得清，放下是聪明。看不透，一场梦无痕。不雨花犹落，无风絮自飞。应观法界性，一切惟心造。你来世界，请安住世界。', 2);
INSERT INTO `sententce` VALUES (2406, '真切的祝福你，我的兄弟姐妹，生活虽然天天平淡，但却天天开心：早上醒来笑一笑，中午睡个美容觉，晚上烦恼都跑掉，明天生活会更好，愉悦永远将你绕！', 2);
INSERT INTO `sententce` VALUES (2407, '自信的女人，不必须会是漂亮的，比如说凤姐；可爱的女人不必须不雷人，比如说小月月；但是关心你的人，那必须会是我，于每日都问候，早安！', 2);
INSERT INTO `sententce` VALUES (2408, '你想要好身材，只跑了两回步就没再坚持；你想要考试过关，却不到最后一天不会翻开书看；你想要学门外语，可单词书背来背去超但是十页。你能够什么都想要，但前提是你真的去做。潜力配不上野心，是所有烦扰的根源。新的一天，早安。', 2);
INSERT INTO `sententce` VALUES (2409, '睁开眼睛，给你一个轻轻的祝福，愿它每分每秒都带给你健康好运和幸福。', 2);
INSERT INTO `sententce` VALUES (2410, '阳光照，鸟欢叫，小懒猪，起床了，伸懒腰，笑一笑，深呼吸，精神好，开心到，欢乐抱，幸福随，乐淘淘，好运伴，祝福来，每一分，每一秒，轻轻地，问候声，好朋友，早安！', 2);
INSERT INTO `sententce` VALUES (2411, '早晨收到祝福会快乐一天，春天收到祝福会快乐一年；此刻又是早上又是春天，我把祝福送给你，幸福你每一秒。', 2);
INSERT INTO `sententce` VALUES (2412, '早晨的完美就如青草般芳香，如河溪般清澈，如玻璃般透明，如甘露般香甜。亲爱的朋友，早上好，愿你今日有个好心情！', 2);
INSERT INTO `sententce` VALUES (2413, '天亮了，美妙的一天又开端了，起床吧，呼吸清爽，拥抱阳光；浅笑吧，高兴心境，高兴一天。早上好，愿你有个好意情！', 2);
INSERT INTO `sententce` VALUES (2414, '一年之计在于晨，早起的鸟儿有虫吃。懒猪快起床，财神在敲门。懒猪快起床，幸福等着你。一夜好梦今朝成，事事顺心万事发。朋友，早安。', 2);
INSERT INTO `sententce` VALUES (2415, '没有拼搏过的人生终究苍白，没有繁华过的平淡终究浅薄。在追逐梦想的路上，从来没有一帆风顺，没有一蹴而就。很多人都是在打拼多年之后，才有资格获得自己喜欢的生活。而那些貌似无趣的时光，或许正是成就你安稳从容的生活的必经之路。熬过去，你会发现，以前梦想的一切，命运会一件一件送给你。早安。', 2);
INSERT INTO `sententce` VALUES (2416, '大家都说，世界上最遥远的距离就是星期一到星期五，今日又是这个距离的开始，让我们用音乐来把周遭变成浮云吧！微笑着对旁边的人说一声“早上好“吧！', 2);
INSERT INTO `sententce` VALUES (2417, '清晨到，清晨早，清晨送你灵丹妙药，晨鸣声声，清头脑，晨光满面，精神好；晨风拂来，烦恼消；晨露闪闪，信心到，愿你每一天乐逍遥，早安。', 2);
INSERT INTO `sententce` VALUES (2418, '起床是会呼吸的痛，它挣扎在我的每个细胞中，被人叫醒会痛，闹钟响会痛，不起床会痛，起床会更痛，不想起床必须起床最痛。哈哈，逗你清晨一笑!', 2);
INSERT INTO `sententce` VALUES (2419, '太阳都出来老高，你还在呼呼睡大觉，我一向在把你叫，你反而睡得更美妙；突然我想到一高招，拿根骨头到，只见你向我汪汪叫。', 2);
INSERT INTO `sententce` VALUES (2420, '奔跑不单是一种潜力，更是一种态度，决定你人生高度的态度。早安!', 2);
INSERT INTO `sententce` VALUES (2421, '一万个美丽的未来，抵不上一个温暖的此刻，每一个真实的此刻，都是我们以前幻想的未来，愿你爱上此刻，梦见未来。早安!', 2);
INSERT INTO `sententce` VALUES (2422, '早上好，来个笑：），早餐吃好身体好，精神饱满赚钞票，祝你事业芝麻开花节节高，祝你爱情甜甜一天更比一天妙！', 2);
INSERT INTO `sententce` VALUES (2423, '扰，舒展美丽的笑脸，拥抱快乐的一天。早安，朋友，愿你今日好心情，生活工作都舒心！', 2);
INSERT INTO `sententce` VALUES (2424, '幸福阳光洒进来，新鲜空气给关爱，微笑开心最甜美，成就梦想争未来。真诚的祝愿你万事顺意，快乐相随，天天都有好心情，早安！', 2);
INSERT INTO `sententce` VALUES (2425, '人生不能靠心情活着，而要靠心态去生活。每个人身上都有太阳，主要是如何让它发光。不要杞人忧天。烦恼并不会减少明天的负担，却会失去今日的快乐。生命中平淡如水的日子，因为爱而博大，因为感动而温馨，因为信任而厚重。早安，朋友。祝清爽愉快每一天。', 2);
INSERT INTO `sententce` VALUES (2426, '我托太阳给你送去第一缕阳光的温暖和祝福，愿整个春天你都有一个好心情，早上好！', 2);
INSERT INTO `sententce` VALUES (2427, '河流不走直路而走弯路，是因为在前往大海的途中，它会遇到各种障碍，有些还无法逾越，所以，只有绕道而行。人也是如此，遇到挫折，无需悲观失望，不要停滞不前，而是持续平常心，把走弯路看成是前行的另一种形式另一条途径。这样，就能够像那些蜿蜒的河流一样，最终抵达人生的目标。新一天，早安。', 2);
INSERT INTO `sententce` VALUES (2428, '往里走，往里走，里面还空着呢。烦恼到站了，霉运别上来，快乐赶紧上，好运挤一挤，祝福列车将带着你开住幸福下一站，请凭本信息搭乘。早安。', 2);
INSERT INTO `sententce` VALUES (2429, '做一个向日葵族,应对阳光,不自艾自怜,每一天活出最灿烂的自己。早安大家!', 2);
INSERT INTO `sententce` VALUES (2430, '当你拉开窗帘的时候，第一缕阳光是我让它捎去的问候。当你打开窗户的时候，呼吸到的新鲜空气是我让它给你的关爱。早上好。', 2);
INSERT INTO `sententce` VALUES (2431, '清晨的微风飘过窗台抚过发鬓一角，清晨的鸟叫进入耳朵清醒了笑，大地的环境自然完美，自然界的“朋友”把你召：“好朋友，快起床，‘早安’时间又来到。”', 2);
INSERT INTO `sententce` VALUES (2432, '我把最鲜艳的一朵给你，作为我对你的问候。', 2);
INSERT INTO `sententce` VALUES (2433, '清新的空气，快乐的气息，透过空气射入你的灵魂里，将阳光呼吸，将幸福抱起，泡一杯甜蜜的咖啡，品尝幸福的好处，理解祝福的信息，祝你早安温馨无比！', 2);
INSERT INTO `sententce` VALUES (2434, '选中一天的完美，剪切悲观的烦恼，删除不满的忧虑，粘帖快乐的心境，刷新过滤的苦闷，保存美妙的心情，建立新文件夹：开心每一天！轻轻一声问候愿给你带来清晨完美的一天！早安！', 2);
INSERT INTO `sententce` VALUES (2435, '早晨的美妙就如青草般芬芳，如河溪般明澈，如玻璃般通明，如甘露般喷鼻甜。亲喜欢的伴侣，早上好，愿你今日有个好意情！', 2);
INSERT INTO `sententce` VALUES (2436, '带着昨夜的丝丝清凉，把祝福写在夏日的早上，愿你一天的生活快乐安详，愿你以后的日子幸福吉祥，祝早安！', 2);
INSERT INTO `sententce` VALUES (2437, '手机响了，是不是很兴奋，有没有想到是我？我这么早联系你，是要送你好东西，你准备好了吗，我可说了哈！早安！说完了！', 2);
INSERT INTO `sententce` VALUES (2438, '历经了风吹雨打，只盼在坎坷路上，能有一颗心相随；历经了百转千回，只盼在困难的堤岸上，能与知己举杯，消除一切疲惫。友谊就是幸福的蓓蕾，早安！', 2);
INSERT INTO `sententce` VALUES (2439, '天使托我告诉你：你的好运和天上星星一样多，愉悦像海底鱼儿一样多！早上睁开眼，射向你的第一缕阳光即是一切完美开始！祝你开心每一天！', 2);
INSERT INTO `sententce` VALUES (2440, '清晨阳光照在身，祝你幸福又平安；清晨微风吹你脸，祝你梦想早实现；清晨信息祝福你，祝你开心每一天。早安！', 2);
INSERT INTO `sententce` VALUES (2441, '睁开明亮的双眼，除去睡意的干扰，舒展美丽的笑脸，早安问候语问候信息拥抱快乐的一天。早安，亲爱的，愿你今日好心情，生活工作都舒心！', 2);
INSERT INTO `sententce` VALUES (2442, '早晨的美妙就如青草般芬芳，如河溪般明澈，如玻璃般通明，如甘露般喷鼻甜。亲喜欢的伴侣，早上好，愿你今日有个好意情！', 2);
INSERT INTO `sententce` VALUES (2443, '早安！天上的云好洁白，希望你的心情也如白云一般。', 2);
INSERT INTO `sententce` VALUES (2444, '忙碌中别忘了给心灵一点空间和营养，让喜悦与平静自然滋长，随时给生命来个深呼吸，就会发现：完美无处不在，快乐随手可得。祝你永远快乐！', 2);
INSERT INTO `sententce` VALUES (2445, '生活的旋律就像这漂泊的人生，每停滞一个地方都有一个不那么起眼，但却与众不一样的旋律，使我们的生活更加的多彩，绚丽。', 2);
INSERT INTO `sententce` VALUES (2446, '假如你曾有过虚度的时光，请不要以叹息作为补偿，明天的路途毕竟长于逝去的岁月。快迈步，前面相迎的是幸福的曙光!早安!', 2);
INSERT INTO `sententce` VALUES (2447, '成功与失败之间，说简单也很简单，说复杂也很复杂。总而言之一句话，只要做人不失败，那就是最大的成功!早安！', 2);
INSERT INTO `sententce` VALUES (2448, '岁月流逝，你我情意不变；时光荏苒，你我牵挂依然；四季轮回，思念常记心间；早安晚安，问候充满心田。春来暑往路漫漫，心手相牵别走散，有你陪伴我身边，友情绵长心圆满，祝你早安每一天，快乐珍藏在心间！', 2);
INSERT INTO `sententce` VALUES (2449, '天亮了，铃响了，极不情愿睁眼了；别睡了，起床了，再不起来迟到了；高兴了，微笑了，问候及时赶到了；鸟鸣了，花香了，幸福永远跟随了；早安，朋友！', 2);
INSERT INTO `sententce` VALUES (2450, '晨光洒在你的脸庞，晨风吹到你的心房，我的祝福你收到了吗？睡去昨日的疲惫，赢得今日的完美，愿你吃嘛嘛香胃口好，神采奕奕活力棒。朋友，早安！', 2);
INSERT INTO `sententce` VALUES (2451, '把每个睡醒后的早晨当成一件礼物，把每个开心后的微笑当成一个习惯。朋友，信息祝你早上好，愿你微笑今日，快乐永远!', 2);
INSERT INTO `sententce` VALUES (2452, '睁开眼睛，给你一个轻轻的祝福，愿它每分每秒都带给你健康好运和幸福。希望你度过完美的一天！', 2);
INSERT INTO `sententce` VALUES (2453, '在晨光中慢慢醒来，听听鸟语，闻闻花香，让心情更加舒畅。抛却烦恼忧伤，接纳快乐芬芳，让每一天都充满阳光，让每一秒都尽情飞扬。早安。', 2);
INSERT INTO `sententce` VALUES (2454, '天亮了是因为太阳起床了，小草绿了是因为春天到了，蝴蝶起舞了是因为鲜花绽放了，我给你发信息，是因为我要叫懒猪起床了，哈哈，起床啦，早安！', 2);
INSERT INTO `sententce` VALUES (2455, '清新的早晨，太阳透过空气照射到树叶上，到处都散发着阳光的气息。请泡杯咖啡走到阳台来接收我的气息：周末早安！', 2);
INSERT INTO `sententce` VALUES (2456, '我要拽你的耳朵，挠你的腮，再把你的屁股拍；我要拉你的手，晃你的脚，再把你的大头敲；清晨来到问个好：还睡呀！小懒猫起床了哟', 2);
INSERT INTO `sententce` VALUES (2457, '早晨空气真正好，出门摔了一大跤；嘴巴亲吻黄土地，双手抓满黄金条；浑身沾满金如意，眼前金豆一个劲的冒；接到信息的朋友，每一天早晨都要来摔跤。哈哈，朋友，早安！', 2);
INSERT INTO `sententce` VALUES (2458, '心绷得太紧，就容易烦躁。尝试给自己一份松弛的柔软，对暂时不顺心的事，抱以理解与包容。当你的心不再那么紧绷，你会发现你与他人之间多了几分宽和，与世界也会多了几分契合。新的一天，早安！', 2);
INSERT INTO `sententce` VALUES (2459, '愿你带着周末的爽笑，郊游的欢笑，聚会的搞笑，团聚的嬉笑，梦里的微笑；清清爽爽迎来星期一早上，祝你在新的一周里神采奕奕工作好，业绩蹭蹭往上跳，钞票围着你来跑！', 2);
INSERT INTO `sententce` VALUES (2460, '一笑且把苦闷了，水迢迢，看岭上云长云消；闲来悠然倚斜桥，月皎皎，赏庭中花开花凋。愿你与清风共唱逍遥调，万丈红尘心不老，快乐无烦恼。早安。', 2);
INSERT INTO `sententce` VALUES (2461, '在别人肆意说你的时候，问问自己，到底怕不怕，输不输的起。不必害怕，不要后退，不须犹豫，难过的时候就一个人去看看这世界。多问问自己，你是不是已经为了梦想而竭尽全力了?早安！', 2);
INSERT INTO `sententce` VALUES (2462, '在我心灵的百花园里，采集金色的鲜花，我把最鲜艳的一朵送给你，作为我对你的问候。早安！', 2);
INSERT INTO `sententce` VALUES (2463, '奋斗的火苗在冒发，碰触心的温度，简单的充实，简单的满足。一个人的道路，也不孤独。早安!', 2);
INSERT INTO `sententce` VALUES (2464, '不管你是成功人士，还是正在为生活而奋斗的落魄人士，都应有一份豁达，一份宽容。做什么事情都要“拿得起，放得下”，不要刻意的掩饰自己的心情，隐瞒自己的观点，伪装自己的做派，而应当堂堂正正，光明磊落，心底无私。早安！', 2);
INSERT INTO `sententce` VALUES (2465, '开天辟地洪荒史，仓颉造字很努力，孔孟礼仪很得体，如今社会主义文化体，识字知礼是主题，手机信息传我意，每一天起床是必须，惟恐惊扰贵人梦，不得不做“胡汉三”，老大“早安”！', 2);
INSERT INTO `sententce` VALUES (2466, '信息到，早上好！知道你美梦还没做完，把你吵醒也别抱怨。揉揉迷茫的小眼，洗洗困倦的小脸，再吃顿美美的早饭，开始自己完美的一天。亲爱的朋友，早安！', 2);
INSERT INTO `sententce` VALUES (2467, '清晨的完美就如青草般芳香，如河溪般清澈，如玻璃般透明，如甘露般香甜。亲爱的朋友，早上好，愿你今日有个好心情！', 2);
INSERT INTO `sententce` VALUES (2468, '沐浴着清晨那唯美而又柔和的朝阳，开始新的一天。给一点心灵阳光，心灵就会灿烂。早安！', 2);
INSERT INTO `sententce` VALUES (2469, '历经了风吹雨打，只盼在坎坷路上，能有一颗心相随；历经了百转千回，只盼在困难的堤岸上，能与知己举杯，消除一切疲惫。友谊就是愉悦的蓓蕾，早安！', 2);
INSERT INTO `sententce` VALUES (2470, '早晨的完美就如青草般芳香，如河溪般清澈，如玻璃般透明，如甘露般香甜。亲爱的朋友，早上好，愿你今日有个好心情！', 2);
INSERT INTO `sententce` VALUES (2471, '岁月带不走记忆，只会让我更加想念。时间并不能够冲淡一切，只会在我心里生根发芽，开出思念的花。', 2);
INSERT INTO `sententce` VALUES (2472, '走进沙漠水最珍贵；沉沉夜幕灯火最珍贵；茫茫人海友谊最珍贵；幸福生活健康最珍贵；愿您拥有一切最为珍贵完美的东西！', 2);
INSERT INTO `sententce` VALUES (2473, '天上在掉钞票，存折排队来到，工作闲得二郎腿长翘，美女秘书成群报到！这些是你昨晚的美梦还没打上句号！快起床啦，否则会被公司开掉！早上快乐！', 2);
INSERT INTO `sententce` VALUES (2474, '早安！愿你今日有个好心情！', 2);
INSERT INTO `sententce` VALUES (2475, '人生是一条路，你走在路上碰见了不一样的人，有的陪你走一段，有的陪你走一生，陪你走一段的不必须假，陪你走一生的不必须真，来往的过客中也许有你的最爱，也许有最爱你的，可你又怎样会真正了解呢？也许你常对人许出爱的承诺，也许时常听到别人对你的承诺，也常问自己究竟爱谁？末了才发现最爱的是自己。早安~', 2);
INSERT INTO `sententce` VALUES (2476, '送你一杯早茶，茶香飘满情意，意在请你帮我推广，广聚人气，气死你，两块五一杯，掏钱。哈哈，逗你玩呢，早上好啊！', 2);
INSERT INTO `sententce` VALUES (2477, '早上好，我把清晨的第一缕阳光送给你。', 2);
INSERT INTO `sententce` VALUES (2478, '你饿了，我是肉包，任你啃；你冷了，我是蒙古包，任你钻；你穷了，我是钱包，任你掏；你生气了，我是沙包，任你踹；你烦了，我就是炸药包，任你点！早上好！', 2);
INSERT INTO `sententce` VALUES (2479, '太阳懒懒地起床了，小鸟快乐地歌唱了，小树也朦朦胧胧地睁开了双眼，实在不好意思地提醒你，你也不要等了，该起来了哟！早安，朋友！', 2);
INSERT INTO `sententce` VALUES (2480, '友情提示：一日之计在于晨，一晨之计在于勤，一勤之计在于早，一早之计在于人，一人之计在于你，以你之计该如何祝福你，当你收到我的信息后你就会明白答案，另外偷偷的告诉你，（答案就是）早安！', 2);
INSERT INTO `sententce` VALUES (2481, '最公平的是时光，最偏心的也是时光。每个人都拥有同样的小时，最后却活成了不一样的样貌。早安！', 2);
INSERT INTO `sententce` VALUES (2482, '爱人要选温柔似水甜如蜜的。同事要选埋头苦干没脾气的。朋友要选猪头狗脑流鼻涕的。时间差不多了，快把鼻涕擦了好好上班吧！', 2);
INSERT INTO `sententce` VALUES (2483, '时光如水，蹉跎年华，唯一不变的是那浓浓的牵挂；寂寂清晨，寥寥微风，想说的是那暖暖的知心话。岁月一片静好，唔友，早安！', 2);
INSERT INTO `sententce` VALUES (2484, '天上在掉钞票，存折排队来到，工作闲得二郎腿长翘，美女秘书成群报到！这些是你昨晚的美梦还没打上句号！快起床啦，否则会被公司开掉！早安！', 2);
INSERT INTO `sententce` VALUES (2485, '美丽的早晨，把压力释放，清凉的秋风，把欢乐吹响，温柔的阳光，把温馨点亮，简单的心情，把幸福送上，早安!', 2);
INSERT INTO `sententce` VALUES (2486, '花儿吐芳迎接朝阳，雨露滑翔迎接晨风；嘴角翘翘迎接信息，眼眉弯弯迎接祝福；心情洋溢迎接完美，祝你开心一生幸福。早安！', 2);
INSERT INTO `sententce` VALUES (2487, '叮铃铃，愿你起床满身轻;叮铃铃，愿你早晨好心情;叮铃铃，祝福信息不告罄;叮铃铃，问候愿你福一生。早安!', 2);
INSERT INTO `sententce` VALUES (2488, '昨日再苦，都要用今日的微笑，把它吟咏成一段幸福的记忆；以前再累，都要用当下的遗忘，穿越万道红尘，让心波澜不惊。人生最大的荣耀不在于从不跌倒，而在于每一次跌倒后都能爬起来。回忆是件很累的事，就像失眠时怎样躺都不对的样貌。有时候往往直到离开，在回忆里，才能知道自己有多喜欢一座城。早安，各位！', 2);
INSERT INTO `sententce` VALUES (2489, '没有人会是一张白纸，大家都是带着爱与恨阳光与阴影活着。有的人藏得深有的人藏不住而已。早安！', 2);
INSERT INTO `sententce` VALUES (2490, '做一个平静的人，做一个善良的人，做一个微笑挂在嘴边，快乐放在心上的人。早安', 2);
INSERT INTO `sententce` VALUES (2491, '一年之计在于春，一天之计在于辰。愿你在早晨起床后心境好好，胃口棒棒，福运佳佳，笑口开开，早上好！', 2);
INSERT INTO `sententce` VALUES (2492, '亲爱的，又是新的一天，愿美丽的阳光美丽你的心情，好运与你相伴行。不忙碌，不烦恼，绽放你的微笑，感受生活的完美，把幸福紧紧拥抱。早安。', 2);
INSERT INTO `sententce` VALUES (2493, '睡去昨日的疲困，忘怀昨日的懊恼，展开今日的双眼，翻开今日的美妙。早上好，愿我的问候如清冷的早晨般滋养你！', 2);
INSERT INTO `sententce` VALUES (2494, '天上在掉钞票，存折排队来到，工作闲得二郎腿长翘，美女秘书成群报到！这些是你昨晚的美梦还没打上句号！快起床啦，否则会被公司开掉！早安！', 2);
INSERT INTO `sententce` VALUES (2495, '生命就是一个绣花。我们从底下看，乱七八糟的走线，上帝从上方看，则是一朵花。愿你这朵生命之花时刻绚烂夺目。早安，朋友！', 2);
INSERT INTO `sententce` VALUES (2496, '人生短暂，人的一生短暂可悲，所以我们要用有限的生命去做无限的对社会好的事情，才能实现我们人生的价值！', 2);
INSERT INTO `sententce` VALUES (2497, '我把最鲜艳的一朵给你，作为我对你的问候。', 2);
INSERT INTO `sententce` VALUES (2498, '情人的泪。一滴就醉，多情的泪一揉就碎，爱也累，恨也累。不爱不恨，没有滋味。恩恩怨怨，没有是与非。谁能猜的对，爱情这杯酒，谁喝就的醉。', 2);
INSERT INTO `sententce` VALUES (2499, '大浪淘沙万万千，好汉难逃工作间，老总发话是泰山，做好鼓励你向前，做错批评不新鲜，笑问人生谁无错，牛仔很忙在人间，愿你天天一忙再忙，数钱数到手发麻！早安！', 2);
INSERT INTO `sententce` VALUES (2500, '早安！夜里的星星有没有我啊？', 2);
INSERT INTO `sententce` VALUES (2501, '生活处处有压力，白天有，干劲十足，晚上有，睡眠不足；忙时有，动力十足，闲时有，简单不足。要正视压力，简单应对，朋友们早安！', 2);
INSERT INTO `sententce` VALUES (2502, '早晨，当朝霞舞动着她柔曼的翅膀，将我们的梦轻轻唤醒，一丝清新的空气，一缕带给我们快乐的阳光，亲爱的，早安！', 2);
INSERT INTO `sententce` VALUES (2503, '哥们儿，今日有档期吗？外边空气可真新鲜呀，鸟叫的可真欢畅啊，收拾收拾，快出来撒撒欢儿吧！出来了吗？我怎样看不见你呀？没出来就没出来吧，反正我也没出来，发信息就是想跟你说一声：朋友，早安！', 2);
INSERT INTO `sententce` VALUES (2504, '握一束清晨光，轻轻放在你的脸庞，带给你一天的清凉，愿你从睡梦中醒来，看到满眼的希望，心中充满宁静与安详，那是我送你的完美愿望，早安朋友！', 2);
INSERT INTO `sententce` VALUES (2505, '小懒，太阳晒屁股了，一道晨光照射在你脸上，是我在亲吻你，感觉到了没？笑一笑，愿今日的你。心情大大大锦绣，你的笑脸是我所值得珍藏的。想你。', 2);
INSERT INTO `sententce` VALUES (2506, '床前明月光，就想赖个床。举头望明月，抱头睡得香。天苍苍，野茫茫，浑身懒散又发痒，不想上班不想忙。只好提醒添衣裳，愿你快乐一早。', 2);
INSERT INTO `sententce` VALUES (2507, '亲爱的，又是新的一天，愿美丽的阳光美丽你的心情，好运与你相伴行。不忙碌，不烦恼，绽放你的微笑，感受生活的完美，把幸福紧紧拥抱。早安。', 2);
INSERT INTO `sententce` VALUES (2508, '睁开眼睛，给你一个轻轻的祝福，愿它每分每秒都带给你健康好运和幸福。', 2);
INSERT INTO `sententce` VALUES (2509, '真心祝愿你：上班偷偷傻笑，下班活泼乱跳！嘴里哼着小曲，不知不觉跑调！中午下班叽哩呱啦乱叫，晚上下班呼噜呼噜睡觉！早上醒来吓了一跳：又迟到！', 2);
INSERT INTO `sententce` VALUES (2510, '春安夏安秋安冬安年年平安。你的平安是我的心愿，我的祝福愿你：身安心安早安晚安一生平安。', 2);
INSERT INTO `sententce` VALUES (2511, '如果每过一天，气温下降一度，我将为你储存零下度的思念。如果每过一天，心情就回暖一度，我会在快乐的零点等你。早安，这个冬天不太冷！', 2);
INSERT INTO `sententce` VALUES (2512, '早晨，看见红日升起，愿你生活如红日般红火；早晨，看见白云飘荡，愿你的心情如白云般自在；祝早安，开心每一天。', 2);
INSERT INTO `sententce` VALUES (2513, '生活处处有压力，白天有，干劲十足，晚上有，睡眠不足；忙时有，动力十足，闲时有，简单不足。要正视压力，简单应对，早安！', 2);
INSERT INTO `sententce` VALUES (2514, '喜鹊为你歌唱，闹钟为你鸣响，小鸡为你叫你起床，小猫为你喵喵，小狗为你旺旺，懒虫起床，懒虫起床。上课的时刻到了，早安我替你说了。早饭我给你做了，不要耽误上课了。', 2);
INSERT INTO `sententce` VALUES (2515, '花开了，留下芬芳;雨下了，留下清爽;风吹了，留下婀娜;天亮了，留下梦幻;梦醒了，那就起床吧!哈哈，早安!', 2);
INSERT INTO `sententce` VALUES (2516, '睁开迷人的双眼，看白云片片；舒展美丽的笑脸，听流水潺潺；拥抱快乐的今日，盼好运连连；朋友，早安！愿你心情无比灿烂，生活舒心无忧烦！', 2);
INSERT INTO `sententce` VALUES (2517, '闹钟在吵，喜鹊在叫，我的祝福准时来到。缕缕阳光，花儿开笑，我的关怀依旧未少。祝福你我，工作顺心，平平安安始于清晨。', 2);
INSERT INTO `sententce` VALUES (2518, '早上好，送你清爽的问候，温馨的祝愿，早晨，美妙的开端，祝你今日精力棒棒，生机多多，心境好好，一切都好！', 2);
INSERT INTO `sententce` VALUES (2519, '尊敬的中国移动用户，您已经成功定制了清晨闹钟业务，每一天点我们会准时打扰你直至您起床，退定业务请回复“我是猪，我要睡觉，我不起床”。早安！', 2);
INSERT INTO `sententce` VALUES (2520, '人生是一次旅行，在旅程中遇到的每一个人每一件事与每一个景色，都有可能成为一生中难忘的风景。我们前进的脚步始终不能停下，因为时间不允许我们在任何地方停留，我们只有在前进中学会选择，学会欣赏，学会感悟人生。早安！', 2);
INSERT INTO `sententce` VALUES (2521, '把每个睡醒后的早晨当成一件礼物，把每个开心后的微笑当成一个习惯。朋友，信息祝早上好，愿你微笑今日，快乐永远！', 2);
INSERT INTO `sententce` VALUES (2522, '青春不是任性和冲动，而是敢于追梦的勇气和对生活的热爱；成熟不代表圆滑和世故，而应是历经岁月阅遍世事后对人生的洞察和对理想的坚守。无论什么年纪，都能够持续那份纯粹和天真，心中的梦想永不凋零，青春的花儿便会永远绽放！周四，早安！', 2);
INSERT INTO `sententce` VALUES (2523, '微笑，一个多么简单的动作，只须将嘴角轻轻地上扬，就会让他人感觉很舒心。生活中多一点微笑，就会多一点自信，多一点完美。早安', 2);
INSERT INTO `sententce` VALUES (2524, '予友人诚心，给己真心，生活便可安心；予仇人宽心，给己静心，做事便可放心；予爱人专心，给己恒心，爱情生活便可甜蜜清心。早安，朋友！', 2);
INSERT INTO `sententce` VALUES (2525, '冬天里，重调理；多锻炼，日光浴；早安睡，晚游历；勤开窗，通空气；暖腹背，寒不欺；适滋补，强体力；心乐观，无忧虑；温暖情，温馨递，乐无际！', 2);
INSERT INTO `sententce` VALUES (2526, '早上空气清新，叫你事事顺心；上午阳光明媚，祝你薪水翻倍；下午小风娇好，愿你青春不老。', 2);
INSERT INTO `sententce` VALUES (2527, '早安！哪一朵花没有香，哪一阵风没有轻，哪一颗星没有光，哪一份祝福不会长。在我人生的思潮里，思念一向有一个方向。就像是每一条河都有浪，每一艘船都有港，在我的梦境里，始终是你用清脆的声音把友谊清唱。', 2);
INSERT INTO `sententce` VALUES (2528, '很多人都说：我不知道我自己想要什么。其实这句话的真正含义是：我没有勇气应对和足够的努力去争取我想要的。生命中的遇见，都是一种注定。承诺不必说的动听，行动到位才是真心。光阴在行走，你我在路上。早安！', 2);
INSERT INTO `sententce` VALUES (2529, '但愿你的眼睛，只看得见笑容；但愿你以后每一个梦，不会一场空！', 2);
INSERT INTO `sententce` VALUES (2530, '人最软弱的地方，是舍不得。舍不得一段不再精采的感情，舍不得一份虚荣，舍不得掌声。我们永远以为最好的日子是会很长很长的，不必那么快离开，就在我们心软和缺乏勇气的时候，最好的日子毫不留情地逝去了。早安', 2);
INSERT INTO `sententce` VALUES (2531, '成长是一种经历；成熟是一种阅历。每个人都能够成长，但不是每个人都能成熟。生活犹如一杯茶，怎样品也是先苦后甜，你得到的越多，势必要承受更多，每一个看似低的起点，都是通往更高峰的必经之路，欲戴王冠，必承其重！', 2);
INSERT INTO `sententce` VALUES (2532, '一觉醒来好想你，随手发去信息息，几天没见可好吗，祝你天天好心情。', 2);
INSERT INTO `sententce` VALUES (2533, '叮铃铃，愿你起床满身轻；叮铃铃，愿你早晨好心情；叮铃铃，愿你快乐心头涌；叮铃铃，愿你美梦永不终；叮铃铃，祝福信息不告罄；叮铃铃，问候愿你福一生。早安！', 2);
INSERT INTO `sententce` VALUES (2534, '晨安，我永久的喜欢人，固然我尚未起床，但思维以前飞到你的身边来了，忽而快乐，忽而忧伤，等候着命运的信息。不知它能否会依从我们的希望。', 2);
INSERT INTO `sententce` VALUES (2535, '天空亮了，早晨到了；花儿开了，草儿笑了；手机响了，信息来了；你看到了，脸儿红了；我想你了，我爱你了；看看东方，精神来了；迈开腿了，赴约去了；早安了，等你了！', 2);
INSERT INTO `sententce` VALUES (2536, '请注意，智力大比拚：选手有大象，你，猪。透过激烈的比赛，得出：象比猪聪明，你比象聪明。最后的名次是：你象猪。掌声鼓励！', 2);
INSERT INTO `sententce` VALUES (2537, '早安！看着天边的红日蹦出来一次又一次，希望你的一天也如刚升起的红日一般！', 2);
INSERT INTO `sententce` VALUES (2538, '人生逆境时，切记忍耐。生活，就是理解，是应对现实的微笑，在人生的任何时候都不怕重头再来，每一个看似低的起点，都是通往更高峰的必经之路。', 2);
INSERT INTO `sententce` VALUES (2539, '起床了，陪你一起看太阳。', 2);
INSERT INTO `sententce` VALUES (2540, '清新的空气，快乐的气息，透过空气射入你的灵魂里，将阳光呼吸，将幸福抱起，泡一杯甜蜜的咖啡，品尝幸福的好处，理解祝福的信息，祝你早安温馨无比！', 2);
INSERT INTO `sententce` VALUES (2541, '闹铃响起心情糟，动怒有碍美睫毛，千万不要练张飞那一套（莽撞），但是还是要起早，上班不然会迟到，喝了牛奶吃蛋糕，挎上MI你小提包，信息同时也来到，心声传达心情好，美女早安！', 2);
INSERT INTO `sententce` VALUES (2542, '在认识你之后的每一个夜里，我夜夜辗转难眠，心里想的念的都是你！你的笑你的容颜时时刻刻都出此刻我的心里――吓的我睡不着觉！', 2);
INSERT INTO `sententce` VALUES (2543, '送你颗“心”，早上舒心，出门顺心，路上留意，遇事耐心，做是细心，交友留心，待人诚心，回家开心，夜里安心，对自己有信心，对别人有爱心，祝你每一天都开心！早安！', 2);
INSERT INTO `sententce` VALUES (2544, '青春不是闲暇懒惰，不是舒适稳定，而是在一无所有时厚积薄发，去大汗淋漓地拼，去义无反顾地搏。如果说人的结局都一样，而出生又不能改变，那人与人之间最大的不一样，就看你怎样活。青春之你我，要敢于闯荡，勇于挑战。走些弯路不要紧，重要的，是这一路的风景。新一天，早安。', 2);
INSERT INTO `sententce` VALUES (2545, '改变心态只需一分钟，而这一分钟却能改变一整天。面朝镜子对自己说：早安！', 2);
INSERT INTO `sententce` VALUES (2546, '睡眼惺忪迎接黎明，刷牙洗脸手要轻。阳光给我好心情，享受清新好空气。一杯热饮好甜蜜，家有人伴好温馨。新的一天，新期待，完美生活常伴您！', 2);
INSERT INTO `sententce` VALUES (2547, '自信的女人，不必须会是漂亮的，比如说凤姐；可爱的女人不必须不雷人，比如说小月月；但是关心你的人，那必须会是我，于每日都问候，早安！', 2);
INSERT INTO `sententce` VALUES (2548, '大家有没有同样的经历，翻过手腕或伸进口袋，露出手表或掏出手机，瞄了一眼时间，还原，突然发现，根本没看是几点几分。新的一天新的开始，大家早安！', 2);
INSERT INTO `sententce` VALUES (2549, '晨的美妙就如青草般芬芳，如河溪般明澈，如玻璃般通明，如甘露般喷鼻甜。亲喜欢的伴侣，早上好，愿你今日有个好意情！', 2);
INSERT INTO `sententce` VALUES (2550, '你若不想做，会找一个或无数个借口;你若想做，会想一个或无数个办法。早安', 2);
INSERT INTO `sententce` VALUES (2551, '把凝重的相思交给夏荷，让荷香浸满荷塘，叫鱼儿遗忘悲伤。把心底埋藏的记忆，交给岁月，梳理纷乱的年华；把幸福的过往珍藏，将朋友留在心上，早安！', 2);
INSERT INTO `sententce` VALUES (2552, '瞧你的眼睛，沾着眼屎，有时睁有时闭，扑朔又迷离。看我的祝福，温馨又调皮：早上好，愿年你天天数钞票，脸上常常挂微笑。', 2);
INSERT INTO `sententce` VALUES (2553, '所谓永恒，就是消磨一件事物的时间完了，这件事物还在。', 2);
INSERT INTO `sententce` VALUES (2554, '你是我生命中所能经历的，最最深切的感觉！早上好，亲爱的！', 2);
INSERT INTO `sententce` VALUES (2555, '你要做生活的主宰，而不是被生活拖着走。对未来的日子很迷茫，但只是成天抱怨。有梦就去追逐，有困惑就去寻找答案。生命只有一次，每一寸时光都是限量版。不要等到万事俱备再行动，做出改变的最好时机，就是此刻。早安', 2);
INSERT INTO `sententce` VALUES (2556, '予友人诚心，给己真心，生活便可安心；予仇人宽心，给己静心，做事便可放心；予爱人专心，给己恒心，爱情生活便可甜蜜清心。早安，朋友！', 2);
INSERT INTO `sententce` VALUES (2557, '早上空气清新，叫你事事顺心；上午阳光明媚，祝你薪水翻倍；下午小风娇好，愿你青春不老。', 2);
INSERT INTO `sententce` VALUES (2558, '早上好！你昨晚睡觉被人投诉了！枕头投诉你口水直流，被子投诉你手舞足跺，床单投诉你乱画地图。因此周公特派我前来调查：你昨晚是梦见哪个美女了呢？', 2);
INSERT INTO `sententce` VALUES (2559, '晨星一点万物醒，晨光一片送光华，晨风一缕春发芽，晨露一滴开鲜花，信息一条送祝福，请你一一都笑纳，祝你一天心情爽，快乐笑容似彩霞！', 2);
INSERT INTO `sententce` VALUES (2560, '人生就像买西瓜，未知才精彩。大胆尝试，不要畏畏缩缩，要是你尝了真甜，会觉得幸福和满足。要是不甜，你也是勇敢的。怕不甜就不买，你放弃的不是一次吃西瓜的机会，而是失去了自信。早安，朋友。', 2);
INSERT INTO `sententce` VALUES (2561, '天是冷的，心是暖的，对你的祝福是永远的！人是远的，心是近的，对你的思念是不变的！愿你每一天都阳光灿烂笑口常开，早安！', 2);
INSERT INTO `sententce` VALUES (2562, '如果星星知道自我背负着所有的愿望。那它会发奋地闪射。当你看见最亮的一颗星星时。那是我为你许的愿；愿你平安愉悦。', 2);
INSERT INTO `sententce` VALUES (2563, '人生的每一次付出就像在山谷当中的喊声，你没有必要期望要谁听到，但那延绵悠远的回音，就是生活对你最好的回报，新的一天新的开始！早安。', 2);
INSERT INTO `sententce` VALUES (2564, '如果星星知道自己背负着所有的愿望。那它会努力地闪射。当你看见最亮的一颗星星时。那是我为你许的愿；愿你平安快乐。', 2);
INSERT INTO `sententce` VALUES (2565, '说一声早安，有晨曦相伴，遥望一缕晨光，眯起眼睛，一天的繁忙又将开始，收拾梦中的心情，回归绚丽的世界，愿你天天好精神！', 2);
INSERT INTO `sententce` VALUES (2566, '很多状况，你们没有最终走到一起，不是他不爱你，也不是你不够爱他，而是你爱得太多了，没有了自己，给了他承受不住的压力。', 2);
INSERT INTO `sententce` VALUES (2567, '美丽的早晨，灿烂的你，完美的生活在等你！美丽的天气，完美的你，完美的情意滋润你！清新的空气，清晰的你，愉快的心情陪伴你！祝您快乐！', 2);
INSERT INTO `sententce` VALUES (2568, '生活就是要把你折腾的死去活来，你要做的就是咬牙坚持下去。', 2);
INSERT INTO `sententce` VALUES (2569, '愿一个问候带给你一个新的心情，愿一个祝福带给你一个新的起点。', 2);
INSERT INTO `sententce` VALUES (2570, '早上好，一束阳光照在身，祝你天天都开心，财神家中去，梦想变成真，今日中大奖，明天去上任，朋友的祝福全都是真心。', 2);
INSERT INTO `sententce` VALUES (2571, '删除你的疲劳，剪切你的烦恼，复制你的快乐，粘贴你的幸福，储存到你的手机。清晨是第一声问候送给你，早安！', 2);
INSERT INTO `sententce` VALUES (2572, '一路走来，有千万人经过身边，但是却只有你相知相伴。岁月流转，磨灭了誓言，冲淡了情缘，在飞逝的时光面前，唯有朋友永远，早安。', 2);
INSERT INTO `sententce` VALUES (2573, '没有永远的失败，只有被失败打垮的人。他们选择了一颗失败的心，选择了一种充满牢骚和抱怨的生活，选择了绝望，却放弃了很多很多……早安!', 2);
INSERT INTO `sententce` VALUES (2574, '信息一条，祝福送到；信息一条，关怀送到；信息一条，添衣加帽；信息一条，烦恼丢掉；信息一条，开心笑笑；信息一条，幸福报道，祝你早上安好。', 2);
INSERT INTO `sententce` VALUES (2575, '早安！睁开眼睛，给你一个轻轻的祝福，愿它每分每秒都带给你健康好运和幸福。希望你度过完美的一天！', 2);
INSERT INTO `sententce` VALUES (2576, '你笑，全世界都跟着你笑;你哭，全世界只有你一人哭。不是环境决定心情，而是心情决定着环境，学会乐观，愿你笑容永远灿烂!早安', 2);
INSERT INTO `sententce` VALUES (2577, '予友人诚心，给己真心，生活便可安心；予仇人宽心，给己静心，做事便可放心；予爱人专心，给己恒心，感情生活便可甜蜜清心。早安，兄弟姐妹！', 2);
INSERT INTO `sententce` VALUES (2578, '早上好！感谢你陪我走过每一个日子，愿有我的日子你每一天都精彩，每步都平安，每刻都快乐，每分都如意，每秒都幸福。', 2);
INSERT INTO `sententce` VALUES (2579, '早上的晨光是我问候的主题，愿你今日愉悦多彩；初升的太阳是我祝愿的载体，愿你任务步步高升！早上好！', 2);
INSERT INTO `sententce` VALUES (2580, '早晨心情挽着晨曦一起，用温煦美丽驱散烦恼犹疑，快乐从心底升起，精神和晨风一起，用舒畅沁凉洗涤沮丧忧郁，自信从此刻激扬飞翔，新的一天，新的希望，迎接新的机遇，早安。', 2);
INSERT INTO `sententce` VALUES (2581, '一年之计在于春，一天之计在于辰。愿你在早晨起床后心境好好，胃口棒棒，福运佳佳，笑口开开，早上好！', 2);
INSERT INTO `sententce` VALUES (2582, '睁开明亮的双眼，除去睡意的干扰，舒展美丽的笑脸，早安问候语问候信息拥抱快乐的一天。早安，朋友，愿你今日好心情，生活工作都舒心！', 2);
INSERT INTO `sententce` VALUES (2583, '没有人能够回到过去重新开始，但谁都能够从今日开始，书写一个全然不一样的结局。愿你的今日充满希望和幸福，早安。', 2);
INSERT INTO `sententce` VALUES (2584, '一路走来，有千万人经过身边，但是却只有你相知相伴。岁月流转，磨灭了誓言，冲淡了情缘，在飞逝的时光面前，唯有你是永远，早安，宝贝儿。', 2);
INSERT INTO `sententce` VALUES (2585, '睡去昨日的疲惫，忘却昨日的烦恼，睁开今日的双眼，打开今日的完美。早上好，愿我的问候如清凉的清晨般滋润你！', 2);
INSERT INTO `sententce` VALUES (2586, '早上朝霞满天，祝你平安伴身边；中午烈日炎炎，祝你幸运一整天；晚上日落西山，祝你快乐在心间！', 2);
INSERT INTO `sententce` VALUES (2587, '早上好！感谢你陪我走过每一个日子，愿有我的日子你每一天都精彩，每步都平安，每刻都快乐，每分都如意，每秒都幸福。', 2);
INSERT INTO `sententce` VALUES (2588, '睡眼惺忪迎接黎明，刷牙洗脸手要轻。阳光给我好心情，享受清新好空气。一杯热饮好甜蜜，家有人伴好温馨。新的一天，新期待，完美生活常伴您！', 2);
INSERT INTO `sententce` VALUES (2589, '太阳出来喜洋洋，我叫小猪快起床；小猪迷糊抚着墙，刷牙洗脸去水房；洗漱完毕精神爽，吃根油条喝碗浆；就算迟到也别慌，注意安全保健康。', 2);
INSERT INTO `sententce` VALUES (2590, '人的一生，总不是想象中的那么好，每个人的背后都会有辛酸，都会有无法言说的艰难。每个人都会有自己的泪要擦，都会有自己的路要走。只要记得：冷了给自己加件外衣；饿了给自己买个面包；痛了给自己一份坚强；失败了给自己一个目标，跌倒了在伤痛中爬起给自己一个宽容的微笑继续往前走，做最真实的自己！早上好！', 2);
INSERT INTO `sententce` VALUES (2591, '勿谓今日不学而有来日，勿谓今年不学而有来年。日月逝矣，岁不我延。', 11);
INSERT INTO `sententce` VALUES (2592, '问渠那得清如许，为有源头活水来。', 11);
INSERT INTO `sententce` VALUES (2593, '书不记，熟读可记；义不精，细思可精。惟有志不立，直是无着力处。', 11);
INSERT INTO `sententce` VALUES (2594, '鹧鸪天脱却儒冠著羽衣，青山绿水浩然归。看成鼎内真龙虎，管甚人间闲是非。生羽翼，上烟霏，回头祗见冢累累。未寻跨凤吹箫侣，且伴孤云独鹤飞。', 11);
INSERT INTO `sententce` VALUES (2595, '满江红秀野诗翁，念故山十年乖隔。聊命驾朱门旧隐，绿槐新陌。好雨初晴仍半暖，金釭玉斝开瑶席。更流传丽藻借江天，留春色。过里社，将儿侄。谈往事，悲陈迹。喜尊前此刻，镜中如昔。两鬓全期烟树绿，方瞳好映寒潭碧。但一年一度一归来，欢何极。', 11);
INSERT INTO `sententce` VALUES (2596, '大抵观书须先熟读，使其言皆若出于吾之口；继以精思，使其意皆若出于吾之心，然后能够有得也。', 11);
INSERT INTO `sententce` VALUES (2597, '活到老，学到老。', 11);
INSERT INTO `sententce` VALUES (2598, '嘉赏未尝喜，抑挫未尝惧。', 11);
INSERT INTO `sententce` VALUES (2599, '观书亦须从头循序而进，能够浅深难易有所取舍，自然意味详密。', 11);
INSERT INTO `sententce` VALUES (2600, '水调歌头雪月两相映，水石互悲鸣。不知岩上枯木，今夜若为情。应见尘中胶扰，便道山间空旷，与么了平生。与么平生了，◇水不流行。起披衣，瞻碧汉，露华清。寥寥千载，此事本分明。若向乾坤识易，便信行藏无间，处处总圆成。记取渊水冰语，莫错定盘星。', 11);
INSERT INTO `sententce` VALUES (2601, '与肩挑贸易，勿占便宜见贫苦亲邻，须多温恤。刻薄成家，理无久享伦常乖舛，立见消亡。兄弟叔侄，须多分润寡长幼内外，宜法属辞严。听妇言，乖骨肉，岂是丈夫重资财，薄父母，不成人子。嫁女择佳婿，毋索重聘娶媳求淑女，毋计厚奁。', 11);
INSERT INTO `sententce` VALUES (2602, '水调歌头江水浸云影，鸿雁欲南飞。携壶结客，何处空翠渺烟霏。尘世难逢一笑，况有紫萸黄菊，堪插满头归。风景今朝是，身世昔人非。酬佳节，须酩酊，莫相违。人生如寄，何事辛苦怨斜晖。无尽今来古往，多少春花秋月，那更有危机。与问牛山客，何必独沾衣。', 11);
INSERT INTO `sententce` VALUES (2603, '三姑六婆，实淫盗之媒婢美妾娇，非闺房之福。奴仆勿用俊美，妻妾切忌艳妆。祖宗虽远，祭祀不可不诚子孙虽愚，经书不可不读。居身务期质朴，教子要有义方。勿贪意外之财，勿饮过量之酒。', 11);
INSERT INTO `sententce` VALUES (2604, '学者须先立志。今日所以悠悠者，只是把学问不曾做一件事看，遇事则且胡乱恁地打过了，此只是志不立。', 11);
INSERT INTO `sententce` VALUES (2605, '黎明即起，洒扫庭除，要内外整洁。既昏便息，关锁门户，必亲自检点。一粥一饭，当思来处不易半丝半缕，恒念物力维艰。宜未雨而绸缪，毋临渴而掘井。自奉务必俭约，宴客切勿留连。器具质而洁，瓦缶胜金玉。饮食约而精，园蔬胜珍馐。勿营华屋，勿谋良田。', 11);
INSERT INTO `sententce` VALUES (2606, '立志不坚，终不济事。', 11);
INSERT INTO `sententce` VALUES (2607, '自敬则人敬之，自慢则人慢之。', 11);
INSERT INTO `sententce` VALUES (2608, '读书须是遍布周满。某尝以为宁详毋略，宁不毋高，宁拙毋巧，宁近毋远。', 11);
INSERT INTO `sententce` VALUES (2609, '思诚为修身之本，而明善又为思诚之本。', 11);
INSERT INTO `sententce` VALUES (2610, '虚心顺理，学者当守此四字。', 11);
INSERT INTO `sententce` VALUES (2611, '涵养致知力行三者，便是以涵养为首，致知次之，力行又次之。', 11);
INSERT INTO `sententce` VALUES (2612, '诚能体而存之，则众善之源，百行之本。《仁说》实行并保存真诚的心，这是人生完美的源头，行动完美的根本。', 11);
INSERT INTO `sententce` VALUES (2613, '自修则人不得以非理相加。', 11);
INSERT INTO `sententce` VALUES (2614, '勿谓今日不学而有来日，勿谓今年不学而有来年。日月逝矣，岁不我延。', 11);
INSERT INTO `sententce` VALUES (2615, '胸怀坦荡，正大光明。', 11);
INSERT INTO `sententce` VALUES (2616, '看文字须大段精彩看，耸起精神，竖起筋骨，不要困，如有刀剑在后一般。就一段中须要透，击其首则尾应，击其尾则首应，方始是。不可按册子便在，掩了册子便忘。', 11);
INSERT INTO `sententce` VALUES (2617, '西江月睡处林风瑟瑟，觉来山月团团。身心无累久轻安，况有清池凉馆。句稳翻嫌白俗，情高却笑郊寒。兰膏元自少陵残，好处金章不换。', 11);
INSERT INTO `sententce` VALUES (2618, '青玉案雪消春水东风猛。帘半卷犹嫌冷。怪是春来常不醒。杨柳堤边，杏花村里，醉了重相请。而今白发羞垂领。静里时将旧游省。记得孤山山畔景。一湾流水，半痕新月，画作梅花影。', 11);
INSERT INTO `sententce` VALUES (2619, '朋友，以义合者。', 11);
INSERT INTO `sententce` VALUES (2620, '念奴娇临风一笑，问群芳谁是，真香纯白。独立无朋，算只有姑射山头仙客。绝艳谁怜，真心自保，邈与尘缘隔。天然殊胜，不关风露冰雪。应笑俗李麤桃，无言翻引得，狂蜂轻蝶。争似黄昏闲弄影，清浅一溪霜月。画角吹残，瑶台梦断，直下成休歇。绿阴青子，莫教容易披折。', 11);
INSERT INTO `sententce` VALUES (2621, '熟读之法，于循序而渐进，熟读而精思。', 11);
INSERT INTO `sententce` VALUES (2622, '日省其身，有则改之，无则加勉。', 11);
INSERT INTO `sententce` VALUES (2623, '凡事廉恭，不得盛气凌人，自取其辱。', 11);
INSERT INTO `sententce` VALUES (2624, '少年易老学难成，一寸光阴不可轻，未觉池塘春草梦，阶前梧叶已秋声。', 11);
INSERT INTO `sententce` VALUES (2625, '《大学》之修身齐家治国平天下，基本只是正心诚意而已。', 11);
INSERT INTO `sententce` VALUES (2626, '须知三绝韦编者，不是寻行数墨人。', 11);
INSERT INTO `sententce` VALUES (2627, '西江月堂下水浮新绿，门前树长交枝。晚凉快写一篇诗，不说人间忧喜。身老心闲益壮，形臞道胜还肥。软输加璧未应迟，莫道前非今是。', 11);
INSERT INTO `sententce` VALUES (2628, '古之君子如抱美玉而深藏不市，后之人则以石为玉而又炫之也。', 11);
INSERT INTO `sententce` VALUES (2629, '大凡敦厚忠信，能攻吾过者，益友也；其诌媚轻薄，傲慢亵狎，导人为恶者，损友也。', 11);
INSERT INTO `sententce` VALUES (2630, '百学须先立志。', 11);
INSERT INTO `sententce` VALUES (2631, '人之作孽，莫甚于口；言语尖刻，必为人忌。', 11);
INSERT INTO `sententce` VALUES (2632, '看文字须大段精彩看，耸起精神，竖起筋骨，不要困，如有刀剑在后一般。就一段中须要透；击其首则尾应，击其尾则首应，方始是。不可按册子便在，掩了册子便忘。', 11);
INSERT INTO `sententce` VALUES (2633, '读书无疑者，须教有疑，有疑者，却要无疑，到那里方是长进。', 11);
INSERT INTO `sententce` VALUES (2634, '读书之法，在循序而渐进，熟读而精思。', 11);
INSERT INTO `sententce` VALUES (2635, '人之进学在于思，思则能知是与非。', 11);
INSERT INTO `sententce` VALUES (2636, '读书有三到，谓心到，眼到，口到。心不在此，则眼看不仔细，心眼既不专一，却只漫浪诵读，决不能记，久也不能久也。三到之中，心到最急，心既到矣，眼口岂不到乎？', 11);
INSERT INTO `sententce` VALUES (2637, '涵养致和力行三者，便是以涵养为首，致和次之，力行又次之。', 11);
INSERT INTO `sententce` VALUES (2638, '读书譬如饮食，从容咀嚼，其味必长；大嚼大咀，终不知味也。', 11);
INSERT INTO `sententce` VALUES (2639, '自敬，则人敬之；自慢，则人慢之。', 11);
INSERT INTO `sententce` VALUES (2640, '礼即理也。', 11);
INSERT INTO `sententce` VALUES (2641, '少年易老学难成，一寸光阴不可轻。未觉池塘春草梦，阶前梧叶已秋声。', 11);
INSERT INTO `sententce` VALUES (2642, '忆秦娥梅花发，寒梢挂著瑶台月。瑶台月，和羹心事，履霜时节。野桥流水声呜咽，行人立马空愁绝。空愁绝，为谁凝伫，为谁攀折。', 11);
INSERT INTO `sententce` VALUES (2643, '读书之法无它，惟是笃志虚心，反复详玩，为有功耳。', 11);
INSERT INTO `sententce` VALUES (2644, '读书有三到，谓心到，眼到，口到。', 11);
INSERT INTO `sententce` VALUES (2645, '读而未晓则思，思而未晓则读。', 11);
INSERT INTO `sententce` VALUES (2646, '为学，正如撑上水船，一篙不可放缓。', 11);
INSERT INTO `sententce` VALUES (2647, '读书之法，莫贵于循序而致精。', 11);
INSERT INTO `sententce` VALUES (2648, '忆秦娥云垂幕，阴风惨淡天花落。天花落，千林琼玖，一空鸾鹤。征车渺渺穿华薄，路迷迷路增离索。增离索，剡溪山水，碧湘楼阁。', 11);
INSERT INTO `sententce` VALUES (2649, '为学之道，莫先于穷理；穷理之要，必先于读书。', 11);
INSERT INTO `sententce` VALUES (2650, '读书有三到，谓心到，眼到，口到。心不在此，则眼不看仔细，心眼即不专一，却只漫浪诵读，决不能记，记不能久也。三到之中，心到最急。', 11);
INSERT INTO `sententce` VALUES (2651, '施惠勿念，受恩莫忘。凡事当留余地，得意不宜再往。人有喜庆，不可生妒忌心人有祸患，不可生喜幸心。善欲人见，不是真善恶恐人知，便是大恶。见色而起淫心，报在妻女匿怨而用暗箭，祸延子孙。', 11);
INSERT INTO `sententce` VALUES (2652, '少年易学老难成，一寸光阴不可轻。', 11);
INSERT INTO `sententce` VALUES (2653, '水调歌头富贵有余乐，贫贱不堪忧。谁知天路幽险，倚伏互相酬。请看东门黄犬，更听华亭清唳，千古恨难收。何似鸱夷子，散发弄扁舟。鸱夷子，成霸业，有余谋。致身千乘卿相，归把钓渔钩。春昼五湖烟浪，秋夜一天云月，此外尽悠悠。永弃人间事，吾道付沧洲。', 11);
INSERT INTO `sententce` VALUES (2654, '欺人亦是自欺，此又是自欺之甚者。', 11);
INSERT INTO `sententce` VALUES (2655, '水调歌头不见严夫子，寂寞富春山。空余千丈危石，高插暮云端。想象羊裘披了，一笑两忘身世，来把钓鱼竿。不似林间翮，飞倦始知还。中兴主，功业就，鬓毛斑。驰驱一世豪杰，相与济时艰。独委狂奴心事，不羡痴儿鼎足，放去任疏顽。爽气动心斗，千古照林峦。', 11);
INSERT INTO `sententce` VALUES (2656, '水调歌头长记与君别，丹凤九重城。归来故里，愁思怅望渺难平。今夕不知何夕，得共寒潭烟艇，一笑俯空明。有酒径须醉，无事莫关情。寻梅去，疏竹外，一枝横。与君吟弄风月，端不负平生。何处车尘不到，有个江天如许，争肯换浮名。只恐买山隐，却要链丹成。', 11);
INSERT INTO `sententce` VALUES (2657, '不念旧恶，此清者之量。', 11);
INSERT INTO `sententce` VALUES (2658, '读书之乐何处寻，数点梅花天地心。', 11);
INSERT INTO `sententce` VALUES (2659, '鹧鸪天已分江湖寄此生，长蓑短笠任阴晴。鸣桡细雨沧洲远，系舸斜阳画阁明。奇绝处，未忘情，几时还得去寻盟。江妃定许捐双佩，渔父何劳笑独醒。', 11);
INSERT INTO `sententce` VALUES (2660, '读书，始读，未知有疑；其次，则渐渐有疑；中则节节是疑。过了这一番，疑渐渐释，以至融会贯通，都无所疑，方始是学。', 11);
INSERT INTO `sententce` VALUES (2661, '涵养为首，致知次之，力行又次之。', 11);
INSERT INTO `sententce` VALUES (2662, '圣人所说底话，光明正大。', 11);
INSERT INTO `sententce` VALUES (2663, '少年易老学难成，一寸光阴不可轻，未觉池塘春草梦，阶前梧叶已秋声', 11);
INSERT INTO `sententce` VALUES (2664, '好事近春色欲来时，先散满天风雪。坐使七闽松竹，变珠幢玉节。中原佳气郁葱葱，河山壮宫阙。丞相功成千载，映黄流清澈。', 11);
INSERT INTO `sententce` VALUES (2665, '家门和顺，虽饔飧不继，亦有余欢国课早完，即囊橐无余，自得至乐。读书志在圣贤，为官心存君国。守分安命，顺时听天。为人若此，庶乎近焉。', 11);
INSERT INTO `sententce` VALUES (2666, '浣溪沙压架年来雪作堆，珍丛也是近移栽。肯令容易放春回。却恐阴晴无定度，从教红白一时开。多情蜂蝶早飞来。', 11);
INSERT INTO `sententce` VALUES (2667, '谦固美名，过谦者，宜防其诈。', 11);
INSERT INTO `sententce` VALUES (2668, '南乡子落日照楼船，稳过澄江一片天。珍重使君留客意，依然。风月从今别一川。离绪悄危弦，永夜清霜透幕毡。明日回头江树远，怀贤。目断晴空雁字连。', 11);
INSERT INTO `sententce` VALUES (2669, '菩萨蛮暮江寒碧萦长路，路长萦碧寒江暮。花坞夕阳斜，斜阳夕坞花。客愁无胜集，集胜无愁客。醒似醉多情，情多醉似醒。', 11);
INSERT INTO `sententce` VALUES (2670, '傲慢亵狎，导人为恶者，损友也。', 11);
INSERT INTO `sententce` VALUES (2671, '问渠哪得清如许，为有源头活水来。', 11);
INSERT INTO `sententce` VALUES (2672, '见富贵而生谗容者，最可耻遇贫穷而作骄态者，贱莫甚。居家戒争讼，讼则终凶处世戒多言，言多必失。毋恃势力而凌逼孤寡，勿贪口腹而恣杀生禽。乖僻自是，悔误必多颓惰自甘，家道难成。狎昵恶少，久必受其累屈志老成，急则可相依。轻听发言，安知非人之谮诉，当忍耐三思因事相争，安知非我之不是，须平心遭暗想。', 11);
INSERT INTO `sententce` VALUES (2673, '鹧鸪天暮雨朝云不自怜，放教春涨绿浮天。只令画阁临无地，宿昔新诗满系船。青鸟外，白鸥前，几生香火旧因缘。酒阑山月移雕槛，歌罢江风拂玳筵。', 11);
INSERT INTO `sententce` VALUES (2674, '菩萨蛮晚红飞尽春寒浅，浅寒春尽飞红晚。尊酒绿阴繁，繁阴绿酒尊。老仙诗句好，好句诗仙老。长恨送年芳，芳年送恨长。', 11);
INSERT INTO `sententce` VALUES (2675, '學者須先立志。今日所以悠悠者，只是把學問不曾做一件事看，遇事則且胡亂恁地打過了，此只是志不立。——朱熹', 11);
INSERT INTO `sententce` VALUES (2676, '凡讀書，須要讀得字字響亮，不可誤一字，不可少一字，不可倒一字，不可牽強暗記，而是要多讀遍數，自然上口，永遠不忘。——朱熹', 11);
INSERT INTO `sententce` VALUES (2677, '讀書有三到，謂心到眼到口到。——朱熹', 11);
INSERT INTO `sententce` VALUES (2678, '知之愈明，則行之愈篤；行之愈篤，則知之益明。——朱熹', 11);
INSERT INTO `sententce` VALUES (2679, '人光明磊落便是好人。出自：宋·朱熹《朱子語類》卷七十四光明磊落：胸懷坦蕩，正大光明。——朱熹', 11);
INSERT INTO `sententce` VALUES (2680, '讀書無疑者，須教有疑，有疑者，卻要無疑，到這裡方是長進。——朱熹', 11);
INSERT INTO `sententce` VALUES (2681, '人之操履無若誠實。出自：宋·朱熹《宋名臣言行錄》操履：操守。誠實是人的最高品德。——朱熹', 11);
INSERT INTO `sententce` VALUES (2682, '禮即理也。——朱熹', 11);
INSERT INTO `sententce` VALUES (2683, '聖人所說底話，光明正大。出自：宋·朱熹《朱子語類·易九》底：同“的”。——朱熹', 11);
INSERT INTO `sententce` VALUES (2684, '讀書之法，在循序而漸進，熟讀而精思。——朱熹', 11);
INSERT INTO `sententce` VALUES (2685, '自敬，則人敬之；自慢，則人慢之。——朱熹', 11);
INSERT INTO `sententce` VALUES (2686, '謙固美名，過謙者，宜防其詐。——朱熹', 11);
INSERT INTO `sententce` VALUES (2687, '胜日尋芳泗水濱，無邊光景一時新。——朱熹', 11);
INSERT INTO `sententce` VALUES (2688, '《大學》之修身齊家治國平天下，基本只是正心誠意而已。出自：宋·朱熹《四書集注·孟子序說》大學：書名。修身：修養自身品性。齊家：管理好家庭。治國：治理好所在的地區。平天下：使天下太平。正心：使心思端正。誠意：使意念真誠。——朱熹', 11);
INSERT INTO `sententce` VALUES (2689, '問佢那得清如許，為有源頭活水來。——朱熹', 11);
INSERT INTO `sententce` VALUES (2690, '等閒識得東風面，萬紫千紅總是春。——朱熹', 11);
INSERT INTO `sententce` VALUES (2691, '大凡敦厚忠信，能攻吾過者，益友也；其謅媚輕薄，傲慢褻狎，導人為惡者，損友也。——朱熹', 11);
INSERT INTO `sententce` VALUES (2692, '少年易學老難成，一寸光陰不可輕。——朱熹', 11);
INSERT INTO `sententce` VALUES (2693, '朋友，以義合者。——朱熹', 11);
INSERT INTO `sententce` VALUES (2694, '百學須先立志。——朱熹', 11);
INSERT INTO `sententce` VALUES (2695, '為學，正如撐上水船，一篙不可放緩。——朱熹', 11);
INSERT INTO `sententce` VALUES (2696, '讀書，始讀，未知有疑；其次，則漸漸有疑；中則節節是疑。過了這一番，疑漸漸釋，以至融會貫通，都無所疑，方始是學——朱熹', 11);
INSERT INTO `sententce` VALUES (2697, '思誠為修身之本，而明善又為思誠之本。出自：宋·朱熹《四書集注·孟子集注》以真誠為準則是自我修養的關鍵，弄清楚哪些是好的言行舉動，又是堅持真誠的根本。——朱熹', 11);
INSERT INTO `sententce` VALUES (2698, '看文字須大段精彩看，聳起精神，豎起筋骨，不要困，如有刀劍在後一般。就一段中須要透；擊其首則尾應，擊其尾則首應，方始是。不可按冊子便在，掩了冊子便忘。——朱熹', 11);
INSERT INTO `sententce` VALUES (2699, '涵養致知力行三者，便是以涵養為首，致知次之，力行又次之。——朱熹', 11);
INSERT INTO `sententce` VALUES (2700, '自古聖賢，皆以心地為本。出自：宋·朱熹《朱子全書·學二》聖賢：聖人賢人，古代指道德學問都極為傑出的人。心地：佛教語。佛教以三界唯心，心如滋生萬物的大地，能隨緣生一切諸法，故稱之。為人以心地高潔為最重要。——朱熹', 11);
INSERT INTO `sententce` VALUES (2701, '自修則人不得以非理相加。——朱熹', 11);
INSERT INTO `sententce` VALUES (2702, '不能感人，皆誠之不至。——朱熹', 11);
INSERT INTO `sententce` VALUES (2703, '人之進學在於思，思則能知是與非。——朱熹', 11);
INSERT INTO `sententce` VALUES (2704, '守正直而佩仁義。出自：宋·朱熹《宋名臣言行錄》宋：操守。做人要存正直之心，行仁義之德。——朱熹', 11);
INSERT INTO `sententce` VALUES (2705, '日省其身，有則改之，無則加勉。——朱熹', 11);
INSERT INTO `sententce` VALUES (2706, '古之君子如抱美玉而深藏不市，後之人則以石為玉而又炫之也。——朱熹', 11);
INSERT INTO `sententce` VALUES (2707, '誠能體而存之，則眾善之源，百行之本。出自：宋·朱熹《仁說》實行並保存真誠的心，這是人生完美的源頭，行動完美的根本。——朱熹', 11);
INSERT INTO `sententce` VALUES (2708, '問佢哪得清如許，為有源頭活水來。——朱熹', 11);
INSERT INTO `sententce` VALUES (2709, '立身以立學為先，立學以讀書為本。——朱熹', 11);
INSERT INTO `sententce` VALUES (2710, '虛心順理，學者當守此四字。——朱熹', 11);
INSERT INTO `sententce` VALUES (2711, '月盈則虧，日中則昃——朱熹', 11);
INSERT INTO `sententce` VALUES (2712, '心大則百物皆通，心小則百物皆病。——朱熹', 11);
INSERT INTO `sententce` VALUES (2713, '三十功名尘与土，八千里路云和月。', 12);
INSERT INTO `sententce` VALUES (2714, '靖康耻，犹未雪；臣子恨，何时灭。', 12);
INSERT INTO `sententce` VALUES (2715, '欲将心事付瑶琴。知音少，弦断有谁听？《小重山》', 12);
INSERT INTO `sententce` VALUES (2716, '秋风江上驻王师，暂向云山蹑翠微。', 12);
INSERT INTO `sententce` VALUES (2717, '斩除顽恶还车贺，不问登坛万户侯。', 12);
INSERT INTO `sententce` VALUES (2718, '归来报明主，恢复旧神州。', 12);
INSERT INTO `sententce` VALUES (2719, '仁，智，信，勇，严，阙一不可。摘录《宋史岳飞传》', 12);
INSERT INTO `sententce` VALUES (2720, '经年尘土满征衣，特特寻芳上翠微。', 12);
INSERT INTO `sententce` VALUES (2721, '敌未灭，何以家为。', 12);
INSERT INTO `sententce` VALUES (2722, '南服只今歼小丑，北辕何日返神州？', 12);
INSERT INTO `sententce` VALUES (2723, '湓浦庐山几度秋，长江万折向东流。', 12);
INSERT INTO `sententce` VALUES (2724, '莫等闲白了少年头，空悲切。', 12);
INSERT INTO `sententce` VALUES (2725, '誓将七尺酬明圣，怒指天涯泪不收。', 12);
INSERT INTO `sententce` VALUES (2726, '怒发冲冠，凭栏处潇潇雨歇。抬望眼，仰天长啸，壮怀激烈。', 12);
INSERT INTO `sententce` VALUES (2727, '大丈夫用兵之诡道无人可测。', 12);
INSERT INTO `sententce` VALUES (2728, '“皇天后土，可表此心。”摘录《宋史岳飞传》', 12);
INSERT INTO `sententce` VALUES (2729, '主上宵旰，岂大将安乐时。摘录《宋史岳飞传》', 12);
INSERT INTO `sententce` VALUES (2730, '功业要刊燕石上，归休终伴赤松游。《寄浮图慧海》', 12);
INSERT INTO `sententce` VALUES (2731, '正己而后能够正物，自治而后能够治人。', 12);
INSERT INTO `sententce` VALUES (2732, '山林啸聚何劳取，沙漠群凶定破机。', 12);
INSERT INTO `sententce` VALUES (2733, '花下少年应笑我，垂垂赢马访高人《过张溪赠张完》', 12);
INSERT INTO `sententce` VALUES (2734, '燕绕龙旗舞，莺随凤辇吟。', 12);
INSERT INTO `sententce` VALUES (2735, '以身许国，何时不可为？', 12);
INSERT INTO `sententce` VALUES (2736, '号令风霆迅，天声动北陬。', 12);
INSERT INTO `sententce` VALUES (2737, '予虽江上老，心羡白云还。', 12);
INSERT INTO `sententce` VALUES (2738, '何日请缨提锐旅，一鞭直渡清河洛。《满江红·登黄鹤楼有感》', 12);
INSERT INTO `sententce` VALUES (2739, '万岁山前珠翠绕，蓬壶殿里笙歌作。', 12);
INSERT INTO `sententce` VALUES (2740, '誓将七尺酬明圣，怒指天涯泪不收。', 12);
INSERT INTO `sententce` VALUES (2741, '“敌未灭，臣何以家为？”摘录《宋史岳飞传》', 12);
INSERT INTO `sententce` VALUES (2742, '嵬石山前寺，林泉胜景幽。', 12);
INSERT INTO `sententce` VALUES (2743, '岛树萧疏外，征帆杳霭间。', 12);
INSERT INTO `sententce` VALUES (2744, '靖康耻，犹未雪。臣子恨，何时灭！驾长车，踏破贺兰山缺。壮志饥餐胡虏肉，笑谈渴饮匈奴血。', 12);
INSERT INTO `sententce` VALUES (2745, '归来报明主，恢复旧神州。', 12);
INSERT INTO `sententce` VALUES (2746, '一帝双魂杳，孤臣百战酣。', 12);
INSERT INTO `sententce` VALUES (2747, '壮志饥餐胡虏肉，笑谈渴饮匈奴血。', 12);
INSERT INTO `sententce` VALUES (2748, '立马林冈豁战眸，阵云开处一溪流。', 12);
INSERT INTO `sententce` VALUES (2749, '莫轻易，白了少年头，空悲切。', 12);
INSERT INTO `sententce` VALUES (2750, '文官不爱钱，武官不惜死。不患天下不太平！', 12);
INSERT INTO `sententce` VALUES (2751, '欲将心事付瑶琴。知音少，弦断有谁听。', 12);
INSERT INTO `sententce` VALUES (2752, '琐细夜谈皆可听，烟霏秋雨欲同归。', 12);
INSERT INTO `sententce` VALUES (2753, '此心一发，天地知之，知我者知之。《题宜兴张大年家厅事屏记》', 12);
INSERT INTO `sententce` VALUES (2754, '何处高人云路迷，相逢忽荐目前机。', 12);
INSERT INTO `sententce` VALUES (2755, '遥望中原，荒烟外许多城郭。想当年花遮柳护，凤楼龙阁。', 12);
INSERT INTO `sententce` VALUES (2756, '待从头收拾旧山河，朝天阙。', 12);
INSERT INTO `sententce` VALUES (2757, '雄气堂堂贯斗牛，誓将直节报君仇。', 12);
INSERT INTO `sententce` VALUES (2758, '手持竹杖访黄龙，旧穴空遗虎子踪。', 12);
INSERT INTO `sententce` VALUES (2759, '长驱渡河洛，直捣向燕幽。《送紫岩张先生北伐》', 12);
INSERT INTO `sententce` VALUES (2760, '何日请缨提锐旅，一鞭直渡清河洛。', 12);
INSERT INTO `sententce` VALUES (2761, '功业要刊燕石上，归休终伴赤松游。', 12);
INSERT INTO `sententce` VALUES (2762, '长驱渡河洛，直捣向燕幽。', 12);
INSERT INTO `sententce` VALUES (2763, '翛然又向诸方去，无数山供玉尘挥。', 12);
INSERT INTO `sententce` VALUES (2764, '“我辈荷国厚恩，当以忠义报国，立功名，书竹帛，死且不朽。若降而为虏，溃而为盗，偷生苟活，身死名灭，岂计之得耶！建康，江左形胜之地，使胡虏盗据，何以立国！今日之事，有死无二，辄出此门者斩！”摘录《鄂王行实编年》', 12);
INSERT INTO `sententce` VALUES (2765, '轻阴弄晴日，秀色隐空山。', 12);
INSERT INTO `sententce` VALUES (2766, '敕报游西内，春光霭上林。', 12);
INSERT INTO `sententce` VALUES (2767, '兵安在？膏锋锷。民安在？填沟壑。叹江山如故，千村寥落。', 12);
INSERT INTO `sententce` VALUES (2768, '余发愤河朔，起自相台，总发从军，小大历二百余战，虽未及远涉夷荒，讨荡巢穴，亦且快国仇之万一。《题宜兴张大年家厅事屏记》', 12);
INSERT INTO `sententce` VALUES (2769, '忠义必期清塞水，功名直欲镇边圻。', 12);
INSERT INTO `sententce` VALUES (2770, '花围千朵锦，柳捻万株金。', 12);
INSERT INTO `sententce` VALUES (2771, '壮志饥餐胡虏肉，笑谈渴饮匈奴血。《满江红怒发冲', 12);
INSERT INTO `sententce` VALUES (2772, '好水好山看不足，马蹄催趁月明归。', 12);
INSERT INTO `sententce` VALUES (2773, '云锁断崖无觅处，半山松竹撼秋风。', 12);
INSERT INTO `sententce` VALUES (2774, '行复三关迎二圣，金酋席卷尽擒归。', 12);
INSERT INTO `sententce` VALUES (2775, '丁宁寄语东林老，莲社从此著力修。', 12);
INSERT INTO `sententce` VALUES (2776, '待从头收拾旧山河，朝天阙。', 12);
INSERT INTO `sententce` VALUES (2777, '我来属龙语，为雨济民忧。', 12);
INSERT INTO `sententce` VALUES (2778, '燕绕龙旗舞，莺随凤辇吟。', 12);
INSERT INTO `sententce` VALUES (2779, '功业要刊燕石上，归休终伴赤松游。', 12);
INSERT INTO `sententce` VALUES (2780, '万岁山前珠翠绕，蓬壶殿里笙歌作。', 12);
INSERT INTO `sententce` VALUES (2781, '强胡犯金阙，驻跸大江南。', 12);
INSERT INTO `sententce` VALUES (2782, '恢复山河日，捐躯分亦甘。', 12);
INSERT INTO `sententce` VALUES (2783, '以身许国，何事不可为？', 12);
INSERT INTO `sententce` VALUES (2784, '“勇不足恃也，用兵在先定谋。谋者，胜负之机也，故为将之道，不患其无勇，而患其无谋。摘录《鄂王行实编年》', 12);
INSERT INTO `sententce` VALUES (2785, '白首为功名。旧山松竹老，阻归程。欲将心事付瑶琴。知音少，弦断有谁听。', 12);
INSERT INTO `sententce` VALUES (2786, '阵而后战，兵法之常，运用之妙，存乎一心。', 12);
INSERT INTO `sententce` VALUES (2787, '云锁断岩无觅处，半山松竹撼秋风。', 12);
INSERT INTO `sententce` VALUES (2788, '紫金诸佛相，白雪老僧头。', 12);
INSERT INTO `sententce` VALUES (2789, '君王多雨露，化育一人心。', 12);
INSERT INTO `sententce` VALUES (2790, '誓将七尺酬明圣，怒指天涯泪不收。《题骤马冈》', 12);
INSERT INTO `sententce` VALUES (2791, '兵威空朔漠，法力仗瞿昙。', 12);
INSERT INTO `sententce` VALUES (2792, '偶看菜叶随流水，知有茅茨在翠微。', 12);
INSERT INTO `sententce` VALUES (2793, '“十年之功，废于一旦。所得州郡，一朝全休。社稷江山，难以中兴。乾坤世界，无由再复。——《乞止班师诏奏略》”。', 12);
INSERT INTO `sententce` VALUES (2794, '大丈夫用兵之诡道无人可测。', 12);
INSERT INTO `sententce` VALUES (2795, '到而今铁骑满郊畿，风尘恶。', 12);
INSERT INTO `sententce` VALUES (2796, '复三关，迎二圣，使宋朝再振，中国安强。《广德军金沙寺题壁记》', 12);
INSERT INTO `sententce` VALUES (2797, '好生恶死，天下常情。若临大难而不变。视死如归者，非忠臣义士有所不能。《鄂国金佗稡编》卷九', 12);
INSERT INTO `sententce` VALUES (2798, '昨夜寒蛩不住鸣。惊回千里梦，已三更。起来独自绕阶行。人悄悄，帘外月胧明。', 12);
INSERT INTO `sententce` VALUES (2799, '爱此倚栏干，谁同寓目闲。', 12);
INSERT INTO `sententce` VALUES (2800, '男儿立志扶王室，圣主专师灭虏酋。', 12);
INSERT INTO `sententce` VALUES (2801, '仁智信勇严，缺一不可。', 12);
INSERT INTO `sententce` VALUES (2802, '马蹀阏氏血，旗袅可汗头。', 12);
INSERT INTO `sententce` VALUES (2803, '阵而后战，兵之常法，然势有不可拘者，且运用之妙，存于一心。摘录《鄂王行实编年》', 12);
INSERT INTO `sententce` VALUES (2804, '忠义必期清耳水，功名直欲镇边圻。', 12);
INSERT INTO `sententce` VALUES (2805, '潭水寒生月，松风夜带秋。', 12);
INSERT INTO `sententce` VALUES (2806, '却归来再续汉阳游，骑黄鹤。', 12);
INSERT INTO `sententce` VALUES (2807, '机舂水沚犹传晋，黍秀宫庭孰悯周？', 12);
INSERT INTO `sententce` VALUES (2808, '好水好山看未足，马蹄催趁明月归。', 12);
INSERT INTO `sententce` VALUES (2809, '白首为功名。旧山松竹老，阻归程。', 12);
INSERT INTO `sententce` VALUES (2810, '有心杀贼，无力回天。', 12);
INSERT INTO `sententce` VALUES (2811, '“文臣不爱钱，武臣不惜死，天下太平矣。”摘录《宋史岳飞传》', 12);
INSERT INTO `sententce` VALUES (2812, '谋者胜负之机也。故为将之道，不患无勇，而患无谋。', 12);
INSERT INTO `sententce` VALUES (2813, '人，真是奇怪，没有外人来证明你，就往往看不出自己的价值。我，那一阵，很陶醉在这个沙地的城堡里。', 13);
INSERT INTO `sententce` VALUES (2814, '某些人的爱情，只是一种“当时的情绪”。如果对方错将这份情绪当做长远的爱情，是本身的幼稚。', 13);
INSERT INTO `sententce` VALUES (2815, '人之所以悲伤，是因为我们留不住岁月;而更无法应对的是有一日,青春,就这样消逝过去。', 13);
INSERT INTO `sententce` VALUES (2816, '放松身心，不存目的不刻意寻找一个投诉的对象，那份自在和愉快，必定是不一样的。', 13);
INSERT INTO `sententce` VALUES (2817, '结婚以前在塞哥维亚的雪地里，已经换过了心，你带去的那颗是我的，我身上的，是你。埋下去的，是你，也是我。走了的，是我们。', 13);
INSERT INTO `sententce` VALUES (2818, '人类往往少年老成，青年迷茫，中年喜欢将别人的成就与自己相比较，因而觉得受挫，好不容易活到老年仍是一个没有成长的笨孩子。我们一向粗糙的活着，而人的一生，便也这样过去了。——三毛名句', 13);
INSERT INTO `sententce` VALUES (2819, '三毛说:当我们应对一个害怕的人，一桩恐惧的事，一份使人不安的心境时，唯一克服这些感觉的态度，便是去应对它，勇敢的去应对，而不是逃避，更不能将自己干脆关起来。痛苦是', 13);
INSERT INTO `sententce` VALUES (2820, '三毛说:我笑，便面如春花，定是能感动人的，任他是谁。', 13);
INSERT INTO `sententce` VALUES (2821, '我不能确定我见过飞碟，但我确实见过不明飞行物！', 13);
INSERT INTO `sententce` VALUES (2822, '孩子真情流露的时候，好似总是背着你们，你们向我显明最深的爱的时候，也好似恰巧在文章里偷偷的写出来，什么时候我才肯明明白白的将这份真诚在我们有限的生命里向你们交代得清清楚楚呢。', 13);
INSERT INTO `sententce` VALUES (2823, '如果我不喜欢，百万富翁我也不嫁如果我喜欢，千万富翁也嫁', 13);
INSERT INTO `sententce` VALUES (2824, '一个朋友很好，两个朋友就多了一点，三个朋友就未免太多了。', 13);
INSERT INTO `sententce` VALUES (2825, '因为缘在而来的东西，终有缘尽而别的时候。我们并不须为此更加难过。——三毛名言', 13);
INSERT INTO `sententce` VALUES (2826, '在那里，与各位再共同勉励一次，我们要做聪明的人，做有智慧的人有慈爱又肯诚实对人对己的勇者。就算天大的事情来了，也不逃避它，心平气和地为自己争取最合理的解决之道，不能够做一个弱者，凡是不顺心便跌倒的人是要被社会淘汰的，做一个有弹性的人，当是我们一生追求的目标。', 13);
INSERT INTO `sententce` VALUES (2827, '哀愁的人，给他们安慰，饥饿的人，给他们食物，而我所能做的，为什么总只是后者。', 13);
INSERT INTO `sententce` VALUES (2828, '朋友绝对落时空，儿时玩伴一旦阔别，再见时，情感只是一种回忆中的承诺，见面除了话当年以外，再说什么都难了。', 13);
INSERT INTO `sententce` VALUES (2829, '学着主宰自己的生活；即使孑然听书网有声小说一身，也不算一个太坏的局面。不自怜不自卑不怨叹，一日一日来，一步一步走，那份柳暗花明的喜乐和必然的抵达，在于我们自己的修持', 13);
INSERT INTO `sententce` VALUES (2830, '刻意去找的东西，往往是找不到的。天下万物的来和去，都有他的时间。', 13);
INSERT INTO `sententce` VALUES (2831, '朋友还是必须分类的——例如图书，一架一架混不得。过分混杂，匆忙中急着着，往往找错类别。', 13);
INSERT INTO `sententce` VALUES (2832, '红尘十丈，茫茫的人海，竟还是自己的来处。', 13);
INSERT INTO `sententce` VALUES (2833, '希望我的天空是一片永恒的蓝色,只是一片!有时候我们要对自己残忍一点,不能纵容自己的悲哀失望;有时候我们要对自己深爱的人残忍一点,将对他们的爱,记忆搁置。', 13);
INSERT INTO `sententce` VALUES (2834, '先走的是比较幸福的，留下的，也并不是强者，但是，在这彻心的苦，切肤的疼痛里，我仍就要说——为了爱的缘故，这永别的苦水，还是让我来喝下吧！——三毛名句', 13);
INSERT INTO `sententce` VALUES (2835, '生活，是一种缓缓如夏日流水般地前进，我们不要焦急我们岁的时候，不就应去急五十岁的事情，我们生的时候，不必去期望死的来临，这一切，总会来的。', 13);
INSERT INTO `sententce` VALUES (2836, '我当心的去关爱他人，这使情感不流于泛滥。', 13);
INSERT INTO `sententce` VALUES (2837, '生活，是一种缓缓如夏日流水般地前进，我们不要焦急我们岁的时候，不就应去急五十岁的事情，我们生的时候，不必去期望死的来临，这一切，总会来的。', 13);
INSERT INTO `sententce` VALUES (2838, '远方有多远？请你，请你告诉我，到天涯海角，算不算远？问一问你的心，只要它答应，没有地方，是到不了的那么远。', 13);
INSERT INTO `sententce` VALUES (2839, '我唯一锲而不舍，愿意以自己的生命去努力的，只但是是保守我个人的心怀意念，在我有生之日，做一个真诚的人，不放弃对生活的热爱和执着，在有限的时空里，过无限广大的日子。', 13);
INSERT INTO `sententce` VALUES (2840, '人之所以悲伤,是因为我们留不住岁月;而更无法应对的是有一日,青春,就这样消逝过去', 13);
INSERT INTO `sententce` VALUES (2841, '我来不及认真地年轻，待明白过来时，只能选择认真地老去。', 13);
INSERT INTO `sententce` VALUES (2842, '你是自由的，你有权利以自己的方式表达自己的路。他人喜不喜欢你走出来的路，不是你的事情，因为，毕竟，你没有强迫任何人。', 13);
INSERT INTO `sententce` VALUES (2843, '世上的姑娘总以为自己是骄傲的公主（除了少数极丑和少数极聪明的姑娘例外）。', 13);
INSERT INTO `sententce` VALUES (2844, '青年人对于社会的要求也高，失望也快，却很少注意到，一个成功的中年人或老年人的背后，往往有着许多辛酸血泪的故事。这尚不够，那份持续的认真与努力，也是一个成功者必然的付出。这以上说得又不完全，智慧才是一个人成功最大的条件之一，缺了它，什么也不成。', 13);
INSERT INTO `sententce` VALUES (2845, '风淡云轻,细水长流何止君子之交,爱情不也是如此,才叫落花流水,天上人间?', 13);
INSERT INTO `sententce` VALUES (2846, '有时婚姻也会使一个女性迷失自己----不然,世界上杰出的女性原应多得多。', 13);
INSERT INTO `sententce` VALUES (2847, '朋友这种关系，美在锦上添花，贵在雪中送炭。－－三毛[友谊名言]', 13);
INSERT INTO `sententce` VALUES (2848, '在一个个漫漫长夜，思念象千万只蚂蚁一样啃噬着我的身体。', 13);
INSERT INTO `sententce` VALUES (2849, '不要去看那个伤口，它有一天会结疤的，疤痕不褪，可它不会再痛', 13);
INSERT INTO `sententce` VALUES (2850, '读书多了，容颜自然改变，许多时候，自己可能以为许多看过的书籍都成了过眼云烟，不复记忆，其实他们仍是潜在的。在气质里，在谈吐上，在胸襟的无涯，当然也可能显露在生活和文字里。', 13);
INSERT INTO `sententce` VALUES (2851, '不知什么时候开始，我已经沉醉在那个世界里不能自拔，虽然我害怕，我矛盾。但我却说不出对那种快感的依恋。夜以继日的，我逃避，我也寻找，我知道，我已经和它溶为一体了。', 13);
INSERT INTO `sententce` VALUES (2852, '三毛说:有时候我们要对自己残忍一点，不能纵容自己的悲哀失望；有时候我们要对自己深爱的人残忍一点，将对他们的爱记忆搁置。', 13);
INSERT INTO `sententce` VALUES (2853, '三毛说:可进可出，若即若离，可爱可怨，可聚而不会散，才是最天长地久的一种好朋友。', 13);
INSERT INTO `sententce` VALUES (2854, '从容不迫的举止，比起咄咄逼人的态度，更能令人心折。', 13);
INSERT INTO `sententce` VALUES (2855, '悲哀最大的建设性，在于明白，那颗心还在老地方。', 13);
INSERT INTO `sententce` VALUES (2856, '遇到不能解决的事情,去问孩子,孩子脱口而出的意见往往就是最精确而实际的答案。', 13);
INSERT INTO `sententce` VALUES (2857, '三毛说:家，对每一个人，都是欢乐的泉源啊！再苦也是温暖的，连奴隶有了家，都不觉得他过分可怜了。', 13);
INSERT INTO `sententce` VALUES (2858, '爱是恒久忍耐而又有恩慈。', 13);
INSERT INTO `sententce` VALUES (2859, '我在想，飞蛾扑火时，必须是极幸福快乐的。', 13);
INSERT INTO `sententce` VALUES (2860, '爱情如果不落实到穿衣吃饭数钱睡觉这些实实在在的生活里去，是不容易天长地久的。', 13);
INSERT INTO `sententce` VALUES (2861, '不要为怕而怕，不要再落入隔世的深渊，不要再幻想外面的世界可怖。——三毛名句', 13);
INSERT INTO `sententce` VALUES (2862, '我迎著朝野站在大海的面前,对自己说:如果时光不能倒流,就让这一切,随风而去吧', 13);
INSERT INTO `sententce` VALUES (2863, '如果有来生，要做一只鸟，飞越永恒，没有迷途的苦恼。东方有火红的希望，南方有温暖的巢床，向西逐退残阳，向北唤醒芬芳。如果有来生，希望每次相遇，都能化为永恒。', 13);
INSERT INTO `sententce` VALUES (2864, '真正的快乐，不是狂喜，亦不是苦痛，在我很主观的来说，它是细水长流，碧海无波，在芸芸众生里做一个普通的人，享受生命一刹间的喜悦，那么我们即使不死，也在天堂里了。', 13);
INSERT INTO `sententce` VALUES (2865, '一个有职责的人，是没有死亡的权力的。许多的夜晚，许多次午夜梦回的时候，我躲在黑暗里，思念几成疯狂，相思，像一条虫一样的慢慢啃着我的身体，直到我成为一个空空茫茫的大洞。夜是那样的长，那么黑，窗外的雨，是我心里的泪，永远都没有滴完的一天。先走的是比较幸福的，留下的，也并不是强者，但是，在这彻心的苦，切肤的疼痛里，我仍就要说——为了爱的缘故，这永别的苦水，还是让我来喝下吧！', 13);
INSERT INTO `sententce` VALUES (2866, '忍耐的女人，男人很少看在眼里，还有可能要轻视。忍耐的男人，女人又说他没有用，一样看不起。', 13);
INSERT INTO `sententce` VALUES (2867, '锁上我的记忆，锁上我的忧伤，不再想你，怎样可能再想你，快乐是禁地，生死之后，找不到进去的钥匙。', 13);
INSERT INTO `sententce` VALUES (2868, '不要去看那个伤口，它有一天会结疤的，疤痕不褪，可它不会再痛。——三毛名句', 13);
INSERT INTO `sententce` VALUES (2869, '在朋友交谈之间，语言需要当心。成年人更要步步为营，不传坏话，便可促进双方的友谊。减少是非是促进人际关系重要的一环，好话要多传，坏话一句也不传', 13);
INSERT INTO `sententce` VALUES (2870, '爱情有如佛家的禅不可说，不可说，一说就是错。', 13);
INSERT INTO `sententce` VALUES (2871, '而爱的及可贵和崇高，也在这种比较之下显出了它无与伦比的永恒。', 13);
INSERT INTO `sententce` VALUES (2872, '刻意去找的东西，往往是找不到的，天下万物的来和去都有它的时间和地点。是你的，就是你的，不是你的，就不是你的。人有权力去追求幸福，一个肯于认清这个事实的人，是智慧，而且是进去的。', 13);
INSERT INTO `sententce` VALUES (2873, '我愿意在父亲母亲丈夫的生命圆环里做最后离世的一个，如果我先去了，而将这份我已尝过的苦杯留给世上的父母，那么我是死不瞑目的，因为我已明白了爱，而我的爱有多深，我的牵挂和不舍便有多长。', 13);
INSERT INTO `sententce` VALUES (2874, '之后，我有一度变成了一个不相信爱情的女人，于是我走了，走到沙漠里头去，也不是去找爱情，我想大概是去寻找一种前世的乡愁吧', 13);
INSERT INTO `sententce` VALUES (2875, '可进可出，若即若离，可爱可怨，可聚而不会散，才是最天长地久的一种好朋友。', 13);
INSERT INTO `sententce` VALUES (2876, '三毛说:锁上我的记忆,锁上我的忧伤,不再想你,怎样可能再想你,快乐是禁地,生死之后,找不到进去的钥匙。', 13);
INSERT INTO `sententce` VALUES (2877, '一般的快乐往往能够传言真正深刻的快乐，没有可能使得他人会意快乐和悲伤都是寂寞。', 13);
INSERT INTO `sententce` VALUES (2878, '如果你给我的，和你给别人的是一样的，那我就不要了。', 13);
INSERT INTO `sententce` VALUES (2879, '今生是我的初恋,今世是我的爱人！', 13);
INSERT INTO `sententce` VALUES (2880, '那些因为缘分而来的东西，终有缘尽而别的时候。', 13);
INSERT INTO `sententce` VALUES (2881, '过分为己，是为自私自利。完全舍我，也是虐待了一个生灵——自己。', 13);
INSERT INTO `sententce` VALUES (2882, '世上的生命，大半朝生暮死，而蝴蝶也是朝生暮死的东西，可依然为着它的色彩目眩神迷，觉着生命所有的神秘与极美已在蜕变中彰显了全部的答案。', 13);
INSERT INTO `sententce` VALUES (2883, '知音，能有一两个已经很好了，实在不必太多。朋友之乐，贵在那份踏实的信赖。', 13);
INSERT INTO `sententce` VALUES (2884, '这时候我注视着眼前的雨水，心里想着，下吧下吧，随便你下到哪一天，大地要再度绚丽光彩起来，经过了无尽的雨水之后。', 13);
INSERT INTO `sententce` VALUES (2885, '在这儿，友谊这个字都是做作而剩余的，因为，没有人会想到这一套。', 13);
INSERT INTO `sententce` VALUES (2886, '燃烧一个人的灵魂，正是对生命的爱，那是至死方休。', 13);
INSERT INTO `sententce` VALUES (2887, '我让人欠我的钱，这使我做傻瓜。', 13);
INSERT INTO `sententce` VALUES (2888, '我们一生复杂，一生追求，总觉得幸福遥不可企及。不知那朵花啊，那粒小小的沙子，便在你的窗台上。——三毛名言', 13);
INSERT INTO `sententce` VALUES (2889, '锁上我的记忆,锁上我的忧伤,不再想你,怎样可能再想你,快乐是禁地,生死之后,找不到进去的钥匙。', 13);
INSERT INTO `sententce` VALUES (2890, '世上的喜剧不需要金钱就能产生，世上的杯具大半和金钱脱不了关系。', 13);
INSERT INTO `sententce` VALUES (2891, '当我们应对一个害怕的人，一桩恐惧的事，一份使人不安的心境时，唯一克服这些感觉的态度，便是去应对它，勇敢的去应对，而不是逃避，更不能将自己干脆关起来。', 13);
INSERT INTO `sententce` VALUES (2892, '与朋友之间不要有金钱来往，不要借钱给朋友，要是你借钱给人家，就象胡适先生一样，我借了，就不要求还。人与人之间可有金钱来往，使我们人际关系比较成功。－－三毛', 13);
INSERT INTO `sententce` VALUES (2893, '之后，我有一度变成了一个不相信爱情的女人，于是我走了，走到沙漠里头去，也不是去找爱情，我想大概是去寻找一种前世的乡愁吧。', 13);
INSERT INTO `sententce` VALUES (2894, '谁来发明一种机器：站在机器面前，一切灵肉能够分解另外许多地方再放一架”接收机”，出来一拼，又是个原来人。', 13);
INSERT INTO `sententce` VALUES (2895, '交朋友，贵在眼慈，横看成岭侧成峰――总是个好家伙。小疵人人有，哪个还不是也有，自己难道没有？－－三毛[友谊名言]', 13);
INSERT INTO `sententce` VALUES (2896, '因为上帝恒久不变的大爱,我就能学着去爱这世上的一草一木一沙', 13);
INSERT INTO `sententce` VALUES (2897, '快乐是那么的陌生而遥远，快乐是禁地，生死之后，找不到进去的钥匙。', 13);
INSERT INTO `sententce` VALUES (2898, '如果你的爱作为爱没有引起对方的爱，如果你作为恋爱者透过你的生命表现没有使你成为被爱的人，那么你的爱就是无力的，就是不幸。', 13);
INSERT INTO `sententce` VALUES (2899, '真正的爱情，绝对是天使的化身；一段孽缘，只是魔鬼的玩笑。', 13);
INSERT INTO `sententce` VALUES (2900, '让那永不醒觉的人自生自灭好了，如果他们抱怨，我们把耳朵塞起来。因为，他们不肯对人生对世界，对生命，有一丝一毫感激的心。', 13);
INSERT INTO `sententce` VALUES (2901, '一刹知心的朋友，是贵在于短暂，拖长了，那份契合总有枝节。', 13);
INSERT INTO `sententce` VALUES (2902, '知音，能有一个已经很好了，不必太多，如果实在没有，还有自己，好好对待自己，跟自己相处，也是一个朋友。', 13);
INSERT INTO `sententce` VALUES (2903, '为纪念ECHO而存在', 13);
INSERT INTO `sententce` VALUES (2904, '真正的快乐，不是狂喜，亦不是苦痛，在我很主观的来说，它是细水长流，碧海无波，在芸芸众生里做一个普通的人，享受生命一刹间的喜悦，那么我们即使不死，也在天堂里了。', 13);
INSERT INTO `sententce` VALUES (2905, '飞蛾扑火时，必须是极快乐幸福的。', 13);
INSERT INTO `sententce` VALUES (2906, '一刹真情，不能说那是假的，爱情永恒，不能说只有那一刹。－－三毛[爱情名言]', 13);
INSERT INTO `sententce` VALUES (2907, '朋友这种关系，最美在于锦上添花；最可贵，贵在雪中送炭；朋友中的极品，便如好茶，淡而不涩，清香但不扑鼻，缓缓飘来，似水长流。', 13);
INSERT INTO `sententce` VALUES (2908, '红尘十丈，茫茫的人海，竟还是自己的来处', 13);
INSERT INTO `sententce` VALUES (2909, '三毛说:某些人的爱情，只是一种“当时的情绪”。如果对方错将这份情绪当做长远的爱情，是本身的幼稚。', 13);
INSERT INTO `sententce` VALUES (2910, '爱情的滋味复杂，绝对值得一试二尝三醉。', 13);
INSERT INTO `sententce` VALUES (2911, '痛苦是因为你将自己弄得走投无路，你的心魔在告诉你——不要去接触外面的世界，它们是可怕的，将自己关起来，便安全了。', 13);
INSERT INTO `sententce` VALUES (2912, '我笑，因为不能不笑呀！', 13);
INSERT INTO `sententce` VALUES (2913, '哀愁的人，给他们安慰，饥饿的人，给他们食物，而我所能做的，为什么总只是后者。', 13);
INSERT INTO `sententce` VALUES (2914, '青年人对于社会的要求也高，失望也快，却很少注意到，一个成功的中年人或老年人的背后，往往有着许多辛酸血泪的故事。这尚不夠，那份持续的认真与努力，也是一个成功者必然的付出。这以上说得又不完全，智慧才是一个人成功最大的条件之一，缺了它，什么也不成。', 13);
INSERT INTO `sententce` VALUES (2915, '人情冷暖正如花开花谢，不如将这种现象，想成一种必然的季节。', 13);
INSERT INTO `sententce` VALUES (2916, '人之所以悲哀，是因为我们留不住岁月，更无法不承认，青春，有一日是要这么自然的消失过去。而人之可贵，也在于我们因着时光环境的改变，在生活上得到长进。岁月的流失固然是无可奈何，而人的逐渐蜕变，却又脱不出时光的力量。', 13);
INSERT INTO `sententce` VALUES (2917, '我真愿意慢慢化作一个实实在在的乡下人，化作泥土，化作大地，因为生命的层层面貌只有这个最贴近我心了。', 13);
INSERT INTO `sententce` VALUES (2918, '三毛说:在我的生活里，我就是主角。', 13);
INSERT INTO `sententce` VALUES (2919, '三毛说:不知什么时候开始，我已经沉醉在那个世界里不能自拔，虽然我害怕，我矛盾。但我却说不出对那种快感的依恋。夜以继日的，我逃避，我也寻找，我知道，我已经和它溶为一体了。', 13);
INSERT INTO `sententce` VALUES (2920, '有一天,如果不留意发了财,要抱它几千万美金,,浇上汽油烧,点了火,回头就走,看都不要看它是怎样化成灰烬的,这个东西,既爱它又恨它——三毛语录', 13);
INSERT INTO `sententce` VALUES (2921, '快乐的日子总是很短促的，躲在心里的枷锁不可能永远不去应对处理。时光无情，来去匆匆——不能够伤感呀，天下哪有不散的筵席，即使千里搭长蓬。', 13);
INSERT INTO `sententce` VALUES (2922, '我最后明白我的生命在爱我的人眼里是多么的重要……我的爱有多长，我的牵挂与不舍也就有多长。', 13);
INSERT INTO `sententce` VALUES (2923, '情的难忘与否，是你个人的自由。先了解自己比急着去了解一个初次见面的人来的重要。交友就是交友，这两个字最重要的是因为交往而带来的身心舒畅和健康，还有随缘而得的友谊，这份友谊的有，或者没有，都不是交友最重要的目标。放松身心，不存目的不刻意寻找一个投诉的对象，那份自在和愉快，必定是不一样的。', 13);
INSERT INTO `sententce` VALUES (2924, '三毛说:一刹知心的朋友，是贵在于短暂，拖长了，那份契合总有枝节。', 13);
INSERT INTO `sententce` VALUES (2925, '我笑，便面如春花，定是能感动人的，任他是谁。', 13);
INSERT INTO `sententce` VALUES (2926, '不要去看那个伤口，它有一天会结疤的，疤痕不褪，可它不会再痛。', 13);
INSERT INTO `sententce` VALUES (2927, '刻意去找的东西，往往是找不到的。天下万物的来和去，都有他的时间。——三毛名言', 13);
INSERT INTO `sententce` VALUES (2928, '一个不欣赏自己的人，是难以快乐的。', 13);
INSERT INTO `sententce` VALUES (2929, '朋友共乐，锦上添花绝对有必要。朋友共苦，除非同病相怜，不然总有高低。', 13);
INSERT INTO `sententce` VALUES (2930, '家，对每一个人，都是欢乐的泉源啊！再苦也是温暖的，连奴隶有了家，都不觉得他过分可怜了。', 13);
INSERT INTO `sententce` VALUES (2931, '先了解自己比急着去了解一个初次见面的人来的重要。', 13);
INSERT INTO `sententce` VALUES (2932, '能哭，对活着的人，总是好事。——三毛名言', 13);
INSERT INTO `sententce` VALUES (2933, '人类往往少年老成，青年迷茫，中年喜欢将别人的成就与自己相比较，因而觉得受挫，好不容易活到老年仍是一个没有成长的笨孩子。我们一向粗糙的活着，而人的一生，便也这样过去了。', 13);
INSERT INTO `sententce` VALUES (2934, '爱情是一种奥妙，在爱情中出现籍口时，籍口就是籍口，显然已经没有热情的籍口而已，来无影，去无踪。如果爱情消逝，一方以任何理由强求再得，这，正如强收覆水一样的不明事理。', 13);
INSERT INTO `sententce` VALUES (2935, '夜是那样的长，那么黑，窗外的雨，是我心里的泪，永远都没有滴完的一天。', 13);
INSERT INTO `sententce` VALUES (2936, '窗外的雨，是我心里的泪，永远没有瓮?的那一天……?', 13);
INSERT INTO `sententce` VALUES (2937, '我看书，这使我多活几度生命。', 13);
INSERT INTO `sententce` VALUES (2938, '流去的种种，化为一群一群蝴蝶，虽然早已明白了，世上的生命，大半朝生暮死，而蝴蝶也是朝生暮死的东西，但是依然为着它的色彩目眩神迷，觉着生命所有的神秘与极美', 13);
INSERT INTO `sententce` VALUES (2939, '对于他人的生活，我们充其量只是一份暗示一种鼓励启发还有真诚的关爱。这些态度，可能因而丰富了他人的生活，但这没有可能发展为——代办他人的生命。我们当不起完全为另一个生命而活――即使他人给予这份权利。', 13);
INSERT INTO `sententce` VALUES (2940, '假如我选择自己结束生命这条路，你们也要想得明白，因为这对于我，将是一种幸福。', 13);
INSERT INTO `sententce` VALUES (2941, '我苛刻得对待往事，这使人不必缅怀太多过去。我很少开口求人，这使我自由。我留意地去关爱他人，这使情感不流于泛滥。——三毛名句', 13);
INSERT INTO `sententce` VALUES (2942, '三毛说:不合意的东西，是就应舍弃的，不必留恋它们，哪怕只是一件，也不必把他留下来。', 13);
INSERT INTO `sententce` VALUES (2943, '个人的遭遇，命运的多舛都使我被迫成熟，这一切的代价都当是日后活下去的力量。——三毛名言', 13);
INSERT INTO `sententce` VALUES (2944, '万水千山走遍中的世上的欢乐幸福,总结起来只有几种,而千行的眼泪,却有千种不一样的疼痛,那打不开的泪结,只有交给时间去解——三毛名言', 13);
INSERT INTO `sententce` VALUES (2945, '虽然我的翅膀断了，我的羽毛脱了，我已没有另一半能够比翼，但是那颗碎成片片的心，仍是父母的珍宝，再痛，再伤，只要他们不肯死去，我便也不再有放弃他们的念头。', 13);
INSERT INTO `sententce` VALUES (2946, '朋友再亲密，分寸不可差失，自以为熟，结果反生隔离。', 13);
INSERT INTO `sententce` VALUES (2947, '如果爱情不落到--洗衣做饭数钱带孩子这些零散的小事上，是不容易长久的。', 13);
INSERT INTO `sententce` VALUES (2948, '红尘十丈，茫茫的人海，竟还是自己的来处。', 13);
INSERT INTO `sententce` VALUES (2949, '云淡风轻，细水长流，何止君子之交。爱情不也是如此，才叫落花流水，天上人间？', 13);
INSERT INTO `sententce` VALUES (2950, '童年，只有在回忆中显现时才成就了那么完美。', 13);
INSERT INTO `sententce` VALUES (2951, '雨中的日了总是湿的,不知是雨还是自己总在弄湿这个流光……', 13);
INSERT INTO `sententce` VALUES (2952, '三毛说:戏，这么演，叫戏，那么演，也叫戏，这一场下了，那一场上来，看戏的，是自己，上台的，也是自己。你是自由的，你有权利以自己的方式表达自己的路。他人喜不喜欢你走', 13);
INSERT INTO `sententce` VALUES (2953, '交朋友，贵在眼慈，横看成岭侧成峰——总是个好家伙。小疵人人有，哪个还不是也有，自己难道没有？', 13);
INSERT INTO `sententce` VALUES (2954, '不做不可及的梦，这使我的睡眠安恬。避开无事时过分热络的友谊，这使我少些负担和承诺。不说无谓的闲言，这使我觉得清畅。我尽可能不去缅怀往事，因为来时的路不可能回头。我当心的去爱别人，这样不会泛滥。我爱哭的时候哭，我爱笑的时候笑，我不求深刻，只求简单。', 13);
INSERT INTO `sententce` VALUES (2955, '快乐的日子总是很短促的，躲在心里的枷锁不可能永远不去应对处理。', 13);
INSERT INTO `sententce` VALUES (2956, '人生一世，也但是是一个又一个四小时的叠加，在这样宝贵的光阴里，我必须明白自己的选择。', 13);
INSERT INTO `sententce` VALUES (2957, '青年人对于社会的要求也高，失望也快，却很少注意到，一个成功的中年人或老年人的背后，往往有着许多辛酸血泪的故事。这尚不够，那份持续的认真与努力，也是一个成功者必然的付出。这以上说得又不完全，智慧才是一个人成功最大的条件之一，缺了它，什么也不成。－－三毛[成败名言]', 13);
INSERT INTO `sententce` VALUES (2958, '因为缘分再而来的东西，终有缘尽而别的时候。我们并不须为此更加难过。人，空空的来，空空的去，尘世间所拥有的一切，都但是转眼成空。我们所能带走的，留下的，除了爱之外，还有什么呢？而爱的及可贵和崇高，也在这种比较之下显出了它无与伦比的永恒。', 13);
INSERT INTO `sententce` VALUES (2959, '情的难忘与否，是你个人的自由。', 13);
INSERT INTO `sententce` VALUES (2960, '每想你一次，天上飘落一粒沙，从此构成了撒哈拉。', 13);
INSERT INTO `sententce` VALUES (2961, '刻意去找的东西，往往是找不到的，天下万物的来和去都有它的时间和地点。', 13);
INSERT INTO `sententce` VALUES (2962, '悲哀没有可能一次偿还，它是被迫的分期付款即使人有本钱，在这件事上，也没有办法快速结帐。', 13);
INSERT INTO `sententce` VALUES (2963, '比较快乐的人生看法，在于起床时，对于将临的一日，没有那么深沉的算计。完全没有缺乏的人也不可能再有更多的快乐了。快乐是一种等待的过程。突然而来的所谓“惊喜”，事实上叫人手足无措。一般性的快乐往往能够言传。最深刻的快乐，没有可能使得他人意会。快乐和悲伤都是寂寞。快乐是不堪文问的鬼东西，如果不相信，请问自己三遍——我快乐吗？快乐是另外一件国王的新衣。这一回，如果国王穿着它出来游街，大家都笑死了——笑一个国王怎样不穿衣服出来乱跑呀！你快乐吗？你快乐吗？你快乐吗？试试看，每一天吃一颗糖，然后告诉自己——今日的日子，果然是甜的。', 13);
INSERT INTO `sententce` VALUES (2964, '婴儿诞生，一般人不知晓婴儿的未来，但是都说恭喜！恭喜！某人死了，一般人也不明白死后的世界，却说可惜！可惜！', 13);
INSERT INTO `sententce` VALUES (2965, '那时的我，是一个美丽的女人。我知道，我笑，便如春花，必能感动人的——任他是谁', 13);
INSERT INTO `sententce` VALUES (2966, '男人是泥，女人是水。泥多了，水浊；水多了，泥稀。不多不少，捏两个泥人好一对神仙眷侣。', 13);
INSERT INTO `sententce` VALUES (2967, '我们不肯探索自己本身的价值，我们过分看重他人在自己生命里的参与。于是，孤独不再完美，失去了他人，我们惶惑不安。', 13);
INSERT INTO `sententce` VALUES (2968, '轰轰烈烈的恋爱，舍命的读书！', 13);
INSERT INTO `sententce` VALUES (2969, '岁月极美，在于它必然的流逝春花，秋月，夏日，冬雪。——三毛名句', 13);
INSERT INTO `sententce` VALUES (2970, '连死的勇气都有，何况活呢？', 13);
INSERT INTO `sententce` VALUES (2971, '没有人能够在世界上能够“弃”你，除非你自己自暴自弃，因为，我们是属于自己的，并不属于他人。事情已经发生了，要应对的状况才是最实际的。', 13);
INSERT INTO `sententce` VALUES (2972, '失了欲，来了心，大梦处醒，那人却是归彼大荒去也……', 13);
INSERT INTO `sententce` VALUES (2973, '我很少开口求人，这使我自由。', 13);
INSERT INTO `sententce` VALUES (2974, '爱是一种潜力，健康是本钱。失败，没有这个字。请记住，一场付出艰辛的失败是另一种成功。快乐是最大的勇气和智慧。', 13);
INSERT INTO `sententce` VALUES (2975, '得之我幸，不得我命！', 13);
INSERT INTO `sententce` VALUES (2976, '爱情有如佛家的禅，不可说不可说，一说就是错。——三毛语录', 13);
INSERT INTO `sententce` VALUES (2977, '流去的种种，化为一群一群蝴蝶，虽然早已明白了，世上的生命，大半朝生暮死，而蝴蝶也是朝生暮死的东西，但是依然为着它的色彩目眩神迷，觉着生命所有的神秘与极美', 13);
INSERT INTO `sententce` VALUES (2978, '今日的事情，尽心尽意尽力去做了，无论成绩如何，都就应高高兴兴地上床恬睡。', 13);
INSERT INTO `sententce` VALUES (2979, '我总以为，朋友的相交，最可贵在于知心，最不可取，在于霸占和单方强求。西方有句谚语，说：朋友的可贵，就在于自由。', 13);
INSERT INTO `sententce` VALUES (2980, '戏，这么演，叫戏，那么演，也叫戏，这一场下了，那一场上来，看戏的，是自己，上台的，也是自己。', 13);
INSERT INTO `sententce` VALUES (2981, '有谁，在这个世界上不是孤独的生，孤独的死？——三毛语录', 13);
INSERT INTO `sententce` VALUES (2982, '我决但是分对人热络，这使我掌握分寸。', 13);
INSERT INTO `sententce` VALUES (2983, '血随你流吧，流完全身最后一滴。流干吧，我不在乎！', 13);
INSERT INTO `sententce` VALUES (2984, '因为我明白了爱，而我的爱有多深，我的牵挂和不舍便有多长。', 13);
INSERT INTO `sententce` VALUES (2985, '你拒绝了我，你伤害了我的骄傲！', 13);
INSERT INTO `sententce` VALUES (2986, '逢场作戏，连儿戏都不如，这种爱情游戏只有天下最无聊的人才会去做。要是真有性情，认真办一次家家酒，才叫好汉烈女。', 13);
INSERT INTO `sententce` VALUES (2987, '记得当时年纪小，你爱谈天我爱笑。', 13);
INSERT INTO `sententce` VALUES (2988, '个人的遭遇，命运的多舛都使我被迫成熟，这一切的代价都当是日后活下去的力量。', 13);
INSERT INTO `sententce` VALUES (2989, '三毛说:一个不欣赏自己的人，是难以快乐的。', 13);
INSERT INTO `sententce` VALUES (2990, '交友就是交友，这两个字最重要的是因为交往而带来的身心舒畅和健康，还有随缘而得的友谊，这份友谊的有，或者没有，都不是交友最重要的目标。', 13);
INSERT INTO `sententce` VALUES (2991, '要到你很老我也很老，两个人都走不动也扶不动了，穿上干干净净的衣服，一齐躺在床上，闭上眼睛说：好吧！一齐去吧！——三毛语录', 13);
INSERT INTO `sententce` VALUES (2992, '过分为己，是为自私自利。完全舍我，也是虐待了一个生灵——自己。——三毛名句', 13);
INSERT INTO `sententce` VALUES (2993, '在我的生活里，我就是主角。', 13);
INSERT INTO `sententce` VALUES (2994, '我心中有一个不变的信仰，它是什么，我也不很清楚，但我不会放弃这在冥冥之中引导我的力量，直到有一天我离开尘世，回返永恒的地方。', 13);
INSERT INTO `sententce` VALUES (2995, '人活在世界上，重要的是爱人的潜力，而不是被爱。我们不懂得爱人又如何能被人所爱。', 13);
INSERT INTO `sententce` VALUES (2996, '三毛说:一个朋友很好，两个朋友就多了一点，三个朋友就未免太多了。知音，能有一个已经很好了，不必太多，如果实在没有，还有自己，好好对待自己，跟自己相处，也是一个朋友', 13);
INSERT INTO `sententce` VALUES (2997, '生活，是一种缓缓如夏日流水般地前进，我们不要焦急我们岁的时候，不就应去急五十岁的事情，我们生的时候，不必去期望死的来临，这一切，总会来的。', 13);
INSERT INTO `sententce` VALUES (2998, '有分寸的节制的狂喜的哭泣的', 13);
INSERT INTO `sententce` VALUES (2999, '走得突然，我们来不及告别。这样也好，因为我们永远不告别。', 13);
INSERT INTO `sententce` VALUES (3000, '我喜欢把快乐当做一种传染病，每一天将它传染给我所接触的社会和人群。', 13);
INSERT INTO `sententce` VALUES (3001, '梦里花落知多少中的即使不成功,也不至于空白万水千山走遍中的世上的欢乐幸福,总结起来只有几种,而千行的眼泪,却有千种不一样的疼痛,那打不开的泪结,只有交给时间去解', 13);
INSERT INTO `sententce` VALUES (3002, '因为上帝恒久不变的大爱,我就能学着去爱这世上的一草一木一沙', 13);
INSERT INTO `sententce` VALUES (3003, '三毛说:不要害怕拒绝他人，如果自己的理由出于正当。当一个人开口提出要求的时候，他的心里根本预备好了两种答案。所以，给他任何一个其中的答案，都是意料中的。', 13);
INSERT INTO `sententce` VALUES (3004, '世间最平和的快乐就是静观天地与人世慢慢地品味出它的和谐', 13);
INSERT INTO `sententce` VALUES (3005, '学校能够滚，但书不能够不读！', 13);
INSERT INTO `sententce` VALUES (3006, '青年人对于社会的要求也高，失望也快，却很少注意到，一个成功的中年人或老年人的背后，往往有着许多辛酸血泪的故事。－－三毛[青年名言]', 13);
INSERT INTO `sententce` VALUES (3007, '是你的，就是你的，不是你的，就不是你的。', 13);
INSERT INTO `sententce` VALUES (3008, '如果期待的太多那就不好了啊！要承担的是自己的前程和情绪，又有谁能够真正的分担呢？', 13);
INSERT INTO `sententce` VALUES (3009, '好孩子，刻意去找的东西，往往是找不到的。天下万物的来和去，都有他的时间。', 13);
INSERT INTO `sententce` VALUES (3010, '给自己时间，不要焦急，一步一步来，一日一日过，不要急，请相信生命的韧性是惊人的。跟自己向上的心去合作，不要放弃对自己的爱护。', 13);
INSERT INTO `sententce` VALUES (3011, '朋友之义，难在义字千变万化。', 13);
INSERT INTO `sententce` VALUES (3012, '朋友是五伦之外的一种人际关系，必须要求朋友共生共死的心态，是因为人，没有界定清楚这一个名词的含意。——三毛名言', 13);
INSERT INTO `sententce` VALUES (3013, '生命无所谓长短,无所谓欢乐哀愁,一切都会过去,向那些花,那些水……', 13);
INSERT INTO `sententce` VALUES (3014, '许多的夜晚，许多次午夜梦回的时候，我躲在黑暗里，思念几成疯狂，相思，像一条虫一样的慢慢啃着我的身体，直到我成为一个空空茫茫的大洞。', 13);
INSERT INTO `sententce` VALUES (3015, '我相信，真正在乎我的人是不会被别人抢走的，无论是友情，还是爱情。', 13);
INSERT INTO `sententce` VALUES (3016, '强占友谊，最是不聪明，雪泥鸿爪，碰着当成一场欢喜。一旦失去朋友，最豁达的想法莫如——本来谁也不是谁的。', 13);
INSERT INTO `sententce` VALUES (3017, '不要害怕拒绝他人，如果自己的理由出于正当。当一个人开口提出要求的时候，他的心里根本预备好了两种答案。所以，给他任何一个其中的答案，都是意料中的。——三毛名句', 13);
INSERT INTO `sententce` VALUES (3018, '一个有职责的人，是没有死亡的权力的。', 13);
INSERT INTO `sententce` VALUES (3019, '一个国家的民族性，初抵它的土地就能够立刻区别出来。你有“眼睛”，再平凡的风景在心里一看，全都活了起来。人间到处有青山，何必能够去安排将来的旅程呢？', 13);
INSERT INTO `sententce` VALUES (3020, '一个人至少拥有一个梦想，有一个理由去坚强。心若没有栖息的地方，到哪里都是在流浪。', 13);
INSERT INTO `sententce` VALUES (3021, '锁上我的记忆，锁上我的忧虑，永远不再想你我已不再想你，怎样能想你？只剩我搁浅的心，在千年的孤影里。', 13);
INSERT INTO `sententce` VALUES (3022, '爱情不是必需，少了它心中却也荒凉。荒凉日子难过。难过的岂止是爱情？——三毛名句', 13);
INSERT INTO `sententce` VALUES (3023, '朋友之间，相求小事，顺水人情，理当成全。过分要求，得寸进尺，是存心丧失朋友最快得捷径。——三毛名言', 13);
INSERT INTO `sententce` VALUES (3024, '男人是泥，女人是水，泥多了，水浊；水多了，泥稀；不多不少，捏成两个泥人――好一对神仙眷侣。这一类，因为难得一见，老天爷总想先收回一个，拿到掌心去看看，看神仙到底是什么样貌。－－三毛[爱情名言]', 13);
INSERT INTO `sententce` VALUES (3025, '所以，我是没有选择的做了暂时的不死鸟，虽然我的翅膀断了，我的羽毛脱了，我已没有另一半能够比翼，但是那颗碎成片片的心，仍是父母的珍宝，再痛，再伤，只有他们不肯我死去，我便也不再有放弃他们的念头。', 13);
INSERT INTO `sententce` VALUES (3026, '我们一步步走下去，踏踏实实的去走，永不抗拒生命给我们的重负，才是一个勇者。', 13);
INSERT INTO `sententce` VALUES (3027, '接住我的真诚和拥抱。', 13);
INSERT INTO `sententce` VALUES (3028, '所有的人，起初都只是空心人，所谓自我，只是一个模糊的影子，全靠书籍绘画音乐电影里他人的生命体验唤出方向，并用自己的经历去充填，渐渐成为实心人。而在这个由假及真的过程里，最具决定性的力量，是时间。', 13);
INSERT INTO `sententce` VALUES (3029, '锁上我的记忆，锁上我的忧伤，不懒人听书再想你，怎样可能再想你，快乐是禁地，生死之后，找不到进去的钥匙。', 13);
INSERT INTO `sententce` VALUES (3030, '人的生命不在于长短，在于是否痛快活过。', 13);
INSERT INTO `sententce` VALUES (3031, '在朋友交谈之间语言需要当心，成年人要步步为营，不传坏话，便可促进双方的友谊。减少是非是促进人际关系重要的一环，好话要多传，坏话一句也不传。－－三毛[友谊名言]', 13);
INSERT INTO `sententce` VALUES (3032, '三毛说:朋友再亲密，分寸不可差失，自以为熟，结果反生隔离。', 13);
INSERT INTO `sententce` VALUES (3033, '毕竟，先走的是比较幸福的，留下来的，也并不是强者，但是，在这彻心的苦，切肤的疼痛里，我仍是要说——“为了爱的缘故，这永别的苦杯，还是让我来喝下吧！”', 13);
INSERT INTO `sententce` VALUES (3034, '你有“眼睛”，再平凡的风景在心里一看，全都活了起来。人间到处有青山，何必能够去安排将来的旅程呢？——三毛名句', 13);
INSERT INTO `sententce` VALUES (3035, '不合意的东西，是就应舍弃的，不必留恋它们，哪怕只是一件，也不必把他留下来。', 13);
INSERT INTO `sententce` VALUES (3036, '学着主宰自己的生活，没有了爱人，你也有潜力一个人过活。——三毛名言', 13);
INSERT INTO `sententce` VALUES (3037, '雨中的日子总是湿的，不知道是雨还是自己总在弄湿这个流光。等待阳光吧，除了等待之外，怎样发愁都是无用的。我已经没有多少尊严了，给我一点小小的骄傲吧……', 13);
INSERT INTO `sententce` VALUES (3038, '一刹真情，不能说那是假的。爱情永恒，不能说只有那一刹。', 13);
INSERT INTO `sententce` VALUES (3039, '我想，一个人的过去，就像圣经上雅各的天梯一样，踏一步决不能上升到天国去。而人的过程，也是要一格一格的爬着梯子，才能到了某种高度。在那个高度上，满江风月，青山绿水，尽入眼前。这种境界情绪与踏上第一步梯子而不知上方将是什么情形的迷惘惶惑是很不相同的。', 13);
INSERT INTO `sententce` VALUES (3040, '看得不顺眼的话，千万富翁也不嫁；看得中意，亿万富翁也嫁。', 13);
INSERT INTO `sententce` VALUES (3041, '生命短促，没有时间能够再浪费了，一切随心自由才是就应努力去追求的，别人如何想我，便是那么的无足轻重了。', 13);
INSERT INTO `sententce` VALUES (3042, '青年人对于社会的要求也高，失望也快，却很少注意到，一个成功的中年人或老年人的背后，往往有着许多辛酸血泪的故事。这尚不够，那份持续的认真与努力，也是一个成功者必然的付出。这以上说得又不完全，智慧才是一个人成功最大的条件之一，缺了它，什么也不成。－－三毛[社会名言]', 13);
INSERT INTO `sententce` VALUES (3043, '一个朋友很好，两个朋友就多了一点，三个朋友就未免太多了。知音，能有一个已经很好了，不必太多，如果实在没有，还有自己，好好对待自己，跟自己相处，也是一个朋友。人活在世界上，最重要的是有爱人的潜力，而不是被爱，我们不懂的爱人又如何能被人所爱？不要自怜，不要怨叹。“不幸”当是生命极大的苦痛时才能用的字，没有知音就算不幸，万一别的不顺心来了，要叫什么呢？不去认识人生，是无法认识去爱人的快乐的。', 13);
INSERT INTO `sententce` VALUES (3044, '天空没有痕迹,而我已飞过！', 13);
INSERT INTO `sententce` VALUES (3045, '我们一生复杂，一生追求，总觉得幸福遥不可企及。不知那朵花啊，那粒小小的沙子，便在你的窗台上。', 13);
INSERT INTO `sententce` VALUES (3046, '爱情，如果不落实到穿衣吃饭数钱睡觉这些实实在在的生活里去，是不容易天才地久的。', 13);
INSERT INTO `sententce` VALUES (3047, '小聪明人，往往不能快乐；大智慧人，经常笑口常开。', 13);
INSERT INTO `sententce` VALUES (3048, '你有死的勇气，难道没有生的勇气吗？', 13);
INSERT INTO `sententce` VALUES (3049, '毕竟，先走的是比较幸福的，留下来的，也并不是强者，但是，在这彻心的苦，切肤的疼痛里，我仍是要说——“为了爱的缘故，这永别的苦杯，还是让我来喝下吧！”', 13);
INSERT INTO `sententce` VALUES (3050, '我们的父母是恒星，我们回家他们永远是在的；我们的朋友是行星，有的时候来有的时候去，但是他们也是天空中的星；在我们的生命中擦肩而过的，一些可能在今生你再也不会碰到的人，我将他们叫做流星。', 13);
INSERT INTO `sententce` VALUES (3051, '心，若没有栖息的地方，到哪里都是流浪。', 13);
INSERT INTO `sententce` VALUES (3052, '最深最和平的快乐，就是静观土地与人世，慢慢品位出它的没与和谐。这份快乐，乍一看也许平淡无奇，事实上，它深远而悠长。在我，生命的享受就在其中了。让那永不醒觉的人自生自灭好了，如果他们抱怨，我们把耳朵塞起来。因为，他们不肯对人生对世界，对生命，有一丝一毫感激的心。我喜欢把快乐当做一种传染病，每一天将它传染给我所接触的社会和人群。', 13);
INSERT INTO `sententce` VALUES (3053, '人，不经过长夜的痛哭，是不能了解人生的，我们将这些苦痛当作一种功课和学习，直到有一日真正的感觉成长了时，甚而会感谢这种苦痛给我们的教导。', 13);
INSERT INTO `sententce` VALUES (3054, '我的心境，已如渺渺青空，浩浩大海，平静，安详，淡泊。', 13);
INSERT INTO `sententce` VALUES (3055, '人之所以悲哀，是因为我们留不住岁月，更无法不承认，青春，有一日是要这么自然的消失过去。而人之可贵，也在于我们因着时光环境的改变，在生活上得到长进。岁月的流失固然是无可奈何，而人的逐渐蜕变，却又脱不出时光的力量。', 13);
INSERT INTO `sententce` VALUES (3056, '风淡云轻,细水长流何止君子之交,爱情不也是如此,才叫落花流水,天上人间?', 13);
INSERT INTO `sententce` VALUES (3057, '梦想，能够天花乱坠，理想，是我们一步一个脚印踩出来的坎坷道路。', 13);
INSERT INTO `sententce` VALUES (3058, '你此刻不知道，你将来知道的时候，已经太晚了。', 13);
INSERT INTO `sententce` VALUES (3059, '爱情有如甘霖，没有了它，干裂的心田，即使撒下再多的种子，终是不可能滋发萌芽的生机。——三毛名言', 13);
INSERT INTO `sententce` VALUES (3060, '我爱哭的时候便哭，想笑的时候便笑，只要这一切出于自然。我不求深刻，只求简单。', 13);
INSERT INTO `sententce` VALUES (3061, '有时候我们要对自己残忍一点，不能纵容自己的悲哀失望；有时候我们要对自己深爱的人残忍一点，将对他们的爱的记忆搁置', 13);
INSERT INTO `sententce` VALUES (3062, '在朋友交谈之间，语言需要当心。成年人更要步步为营，不传坏话，便可促进双方的友谊。减少是非是促进人际关系重要的一环，好话要多传，坏话一句也不传。－－三毛[友谊名言]', 13);
INSERT INTO `sententce` VALUES (3063, '不要自怜，不要怨叹。', 13);
INSERT INTO `sententce` VALUES (3064, '三毛说:世上的幸福悲欢总结起来只有几种,而千行的眼泪却有千种不一样的疼痛,那打不开的泪结,只有交给时间去解！', 13);
INSERT INTO `sententce` VALUES (3065, '世上的幸福悲欢总结起来只有几种,而千行的眼泪却有千种不一样的疼痛,那打不开的泪结,只有交给时间去解！', 13);
INSERT INTO `sententce` VALUES (3066, '时光无情，来去匆匆——不能够伤感呀，天下哪有不散的筵席，即使千里搭长蓬。', 13);
INSERT INTO `sententce` VALUES (3067, '我迎著朝野站在大海的面前,对自己说:如果时光不能倒流,就让这一切,随风而去吧', 13);
INSERT INTO `sententce` VALUES (3068, '爱情有如佛家的禅——不可说，不可说，一说就是错。', 13);
INSERT INTO `sententce` VALUES (3069, '我不能确定我见过飞碟，但我确实见过不明飞行物！——三毛名句', 13);
INSERT INTO `sententce` VALUES (3070, '与朋友之间不要有金钱来往，不要借钱给朋友，要是你借钱给人家，就象胡适先生一样，我借了，就不要求还。人与人之间可有金钱来往，使我们人人际关系比较成功。－－三毛[友谊名言]', 13);
INSERT INTO `sententce` VALUES (3071, '梦里花落知多少中的即使不成功,也不至于空白', 13);
INSERT INTO `sententce` VALUES (3072, '没有人能够弃你，除非你自暴自弃，因为我们是属于自己的，并不属于他人。', 13);
INSERT INTO `sententce` VALUES (3073, '要到你很老我也很老，两个人都走不动也扶不动了，穿上干干净净的衣服，一齐躺在床上，闭上眼睛说：好吧！一齐去吧！', 13);
INSERT INTO `sententce` VALUES (3074, '红尘十丈，茫茫的人海，竟还是自己的来处——三毛语录', 13);
INSERT INTO `sententce` VALUES (3075, '“连死的勇气都有，何况活呢？”', 13);
INSERT INTO `sententce` VALUES (3076, '路是由足和各组成的。足表示路是用脚走出来的，各表示各人有各人不一样的路。', 13);
INSERT INTO `sententce` VALUES (3077, '人的生命不在于长短，在于是否痛快活过。', 13);
INSERT INTO `sententce` VALUES (3078, '爱，到底是什么东西，为什么那么辛酸，那么苦痛，只要还能握住它，到死还是不肯放弃，到死也是甘心。', 13);
INSERT INTO `sententce` VALUES (3079, '戏，这么演，叫戏，那么演，也叫戏，这一场下了，那一场上来，看戏的，是自己，上台的，也是自己。你是自由的，你有权利以自己的方式表达自己的路。他人喜不喜欢你走出来的路，不是你的事情，因为，毕竟，你没有强迫任何人。——三毛名句', 13);
INSERT INTO `sententce` VALUES (3080, '男人是泥，女人是水，泥多了，水浊；水多了，泥稀；不多不少，捏成两个泥人——好一对神仙眷侣。这一类，因为难得一见，老天爷总想先收回一个，拿到掌心去看看，看神仙到底是什么样貌。', 13);
INSERT INTO `sententce` VALUES (3081, '每个人心里一亩一亩田，每个人心里一个一个梦，一颗啊一颗子，是我心里的一亩田——三毛语录', 13);
INSERT INTO `sententce` VALUES (3082, '“我最后明白我的生命在爱我的人眼里是多么的重要……我的爱有多长，我的牵挂与不舍也就有多长。', 13);
INSERT INTO `sententce` VALUES (3083, '每想你一次，天上飘落一粒沙，从此构成了撒哈拉。', 13);
INSERT INTO `sententce` VALUES (3084, '“不幸”当是生命极大的苦痛时才能用的字，没有知音就算不幸，万一别的不顺心来了，要叫什么呢？不去认识人生，是无法认识去爱人的快乐的。', 13);
INSERT INTO `sententce` VALUES (3085, '学校能够滚，但书不能够不读！', 13);
INSERT INTO `sententce` VALUES (3086, '偶尔抱怨一次人生可能是某种情感的宣泄，也无不可，但习惯性的抱怨而不谋求改变，便是不聪明的人了。', 13);
INSERT INTO `sententce` VALUES (3087, '如果我不喜欢，百万富翁我也不嫁，如果我喜欢，千万富翁也嫁。', 13);
INSERT INTO `sententce` VALUES (3088, '当我们应对一个害怕的人，一桩恐惧的事，一份是人不安的心境时，唯一克服这种感觉的态度，便是应对它。', 13);
INSERT INTO `sententce` VALUES (3089, '我笑，便面如春花，定是能感动人的，任他是谁。——三毛语录', 13);
