INSERT INTO `sententce` VALUES (3092, '三毛:今日回来,心已经碎了荷西:碎的心,能够用胶水把它黏起来三毛:黏过后,还是有缝的荷西把三毛的手拉向他的胸口,说:这边还有一颗,是黄金做的,把你那颗拿过来,我们交换一下吧', 13);
INSERT INTO `sententce` VALUES (3093, '三毛说:爱情是一种奥妙，在爱情中出现籍口时，籍口就是籍口，显然已经没有热情的籍口而已，来无影，去无踪。如果爱情消逝，一方以任何理由强求再得，这，正如强收覆水一样的不明事', 13);
INSERT INTO `sententce` VALUES (3094, '我漠视无谓的闲言，这使我内心舒畅。', 13);
INSERT INTO `sententce` VALUES (3095, '与朋友之间不要有金钱来往，不要借钱给朋友，要是你借钱给人家，就象胡适先生一样，我借了，就不要求还。人与人之间可有金钱来往，使我们人人际关系比较成功。', 13);
INSERT INTO `sententce` VALUES (3096, '幸好此刻痛的是我，如果是荷西，我拼了命也要跟上帝争了回来换他。', 13);
INSERT INTO `sententce` VALUES (3097, '路是由足和各组成的。足表示路是用脚走出来的，各表示各人有各人不一样的路。', 13);
INSERT INTO `sententce` VALUES (3098, '生命的滋味，无论是阳春白雪，青菜豆腐，都要自己去尝一尝啊~', 13);
INSERT INTO `sententce` VALUES (3099, '有时候我们要对自己残忍一点，不能纵容自己的悲哀失望；有时候我们要对自己深爱的人残忍一点，将对他们的爱记忆搁置。——三毛语录', 13);
INSERT INTO `sententce` VALUES (3100, '“我是一个像空气一样自由的人，妨碍我心灵自由的时候，绝不妥协。”', 13);
INSERT INTO `sententce` VALUES (3101, '请相形上天的旨意，发生在之世界上的事情没有一样是出于偶然，终有一天这一切都会有一个解释。——三毛名言', 13);
INSERT INTO `sententce` VALUES (3102, '一刹真情，不能说那是假的，爱情永恒，不能说只有那一刹。', 13);
INSERT INTO `sententce` VALUES (3103, '世间最平和的快乐就是静观天地与人世慢慢地品味出它的和谐', 13);
INSERT INTO `sententce` VALUES (3104, '三毛说:雨中的日子总是湿的，不知道是雨还是自己总在弄湿这个流光。等待阳光吧，除了等待之外，怎样发愁都是无用的。我已经没有多少尊严了，给我一点小小的骄傲吧……', 13);
INSERT INTO `sententce` VALUES (3105, '明日，是一个不能逃避的东西，我没有退路。有谁，在这个世界上不是孤独的生，高度的死？', 13);
INSERT INTO `sententce` VALUES (3106, '爱情如果不落到穿衣吃饭睡觉数钱这些实实在在的生活中去，是不会长久的。真正的爱情，就是不紧张，就是能够在他面前无所顾忌地打嗝放屁挖耳朵流鼻涕；真正爱你的人，就是那个你能够不洗脸不梳头不化妆见到的那个人。', 13);
INSERT INTO `sententce` VALUES (3107, '等我长大了，我要做个拾破烂的……拾荒人眼底下的垃圾场是世界上最抚媚的花园因为这种职业，不但能够呼吸新鲜的空气，同时又能够大街小巷的游走玩耍，一面工作一面游戏，自由快乐得如同天上的飞鸟。更重要的是，人们常常不知不觉的将许多还能够利用的好东西当作垃圾丢掉，拾破烂的人最愉快的时刻就是将这些蒙尘的好东西再度发掘出来，这……”', 13);
INSERT INTO `sententce` VALUES (3108, '世上的事，只要肯用心去学，没有一件是太晚的。', 13);
INSERT INTO `sententce` VALUES (3109, '出生是最明确的一场旅行,死亡难道不是另一场出发?', 13);
