INSERT INTO `sententce` VALUES (3112, '我唯一锲而不舍，愿意以自己的生命去努力的，只但是是保守我个人的心怀意念，在我有生之日，做一个真诚的人，不放弃对生活的热爱和执着，在有限的时空里，过无限广大的日子。——三毛名句', 13);
