INSERT INTO `sententce` VALUES (3530, '以后不要说什么蓝瘦香菇，那是南方人才说的，北方人要有自己的个性。鳖蛆，想蚝。', 14);
INSERT INTO `sententce` VALUES (3531, '单身并不难，难的是应付那些千方百计想让你结束单身的人。', 14);
INSERT INTO `sententce` VALUES (3532, '每次手机卡时就狂按home键，就像在给手机做心肺复苏。', 14);
INSERT INTO `sententce` VALUES (3533, '我不骂人，因为我动手潜力比较强。', 14);
INSERT INTO `sententce` VALUES (3534, '自打我学会了顶嘴，我老婆也学会了磨刀。', 14);
INSERT INTO `sententce` VALUES (3535, '我想说我就一苦逼，世界末日的那天就是我的生日。', 14);
INSERT INTO `sententce` VALUES (3536, '你认真起来的那一瞬间，真有点像路边贴膜的。', 14);
INSERT INTO `sententce` VALUES (3537, '人生没有彩排，每一天都是直播；不仅仅收视率低，而且工资不高。', 14);
INSERT INTO `sententce` VALUES (3538, '将薪比薪的想一下，算了，不想活了。', 14);
INSERT INTO `sententce` VALUES (3539, '你总是，间歇性踌躇满志，持续性混吃等死，筹谋一天，躺尸一年。', 14);
INSERT INTO `sententce` VALUES (3540, '骑驴把歌颂，不是秃子头发总是会失光的。', 14);
INSERT INTO `sententce` VALUES (3541, '没喝酒之前我是沈阳的，喝完酒之后沈阳是我的。', 14);
INSERT INTO `sententce` VALUES (3542, '您复杂的五官，掩饰不了您朴素的智商。', 14);
INSERT INTO `sententce` VALUES (3543, '你永远要感谢给你逆境的众生。', 14);
INSERT INTO `sententce` VALUES (3544, '横溢的不只是才华，还有腰间的脂肪。', 14);
INSERT INTO `sententce` VALUES (3545, '最好的满足就是给别人满足。', 14);
INSERT INTO `sententce` VALUES (3546, '皮肤给你送了，段位给你打了，你此刻跟我说你是男的，草泥马就算是男的我也要跟你在一起。', 14);
INSERT INTO `sententce` VALUES (3547, '戒烟了，再抽真就腾云驾雾了！', 14);
INSERT INTO `sententce` VALUES (3548, '人生就像斗地主，刚还是一伙的，一转眼就是敌人。', 14);
INSERT INTO `sententce` VALUES (3549, '有事直接奔主题,不要拿你的无知,挑战我的黑名单。', 14);
INSERT INTO `sententce` VALUES (3550, '做人必须要昂首挺胸，这样别人才看不见你的双下巴。', 14);
INSERT INTO `sententce` VALUES (3551, '小泵娘们梦中都想找一匹白马，睁开眼发现满世界都是灰不溜秋的驴，悲痛欲绝后，只能从驴群中挑个身强力壮的，这样的驴就被命名为：经济适用男。', 14);
INSERT INTO `sententce` VALUES (3552, '早上闹钟开始发狂，被子突然抱住我，枕头给我唱安眠曲，然后我就睡着了。', 14);
INSERT INTO `sententce` VALUES (3553, '如果你吃了亏，千万不要喝水，不然你会变污的。', 14);
INSERT INTO `sententce` VALUES (3554, '你们最好选择在中午秀恩爱，知道为什么吗？因为早晚会有报应。', 14);
INSERT INTO `sententce` VALUES (3555, '人不犯我，我不犯人；人若犯我，礼让三分；人再犯我，我还一针；人还犯我，斩草除根。', 14);
INSERT INTO `sententce` VALUES (3556, '如果我是僵尸，我必须择吃掉所有好学生的脑。', 14);
INSERT INTO `sententce` VALUES (3557, '当你生活不顺心的时候，不要慌；看看你的钱包和存款，哭出来就好了。', 14);
INSERT INTO `sententce` VALUES (3558, '有时候喝一点酒，借着冷冷的月光总翻来覆去想不明白，我为什么要下凡？', 14);
INSERT INTO `sententce` VALUES (3559, '执子之手，方知子丑，泪流满面，子不走我走。', 14);
INSERT INTO `sententce` VALUES (3560, '在神经的人群里呆久了，我发现我正常了。', 14);
INSERT INTO `sententce` VALUES (3561, '我之所以高贵，是因为你们在下方跪着！', 14);
INSERT INTO `sententce` VALUES (3562, '有了雕牌印钞机，赚钱就是快。', 14);
INSERT INTO `sententce` VALUES (3563, '充实自我，享受生命，没有阳光，心中也可温暖。', 14);
INSERT INTO `sententce` VALUES (3564, '忽然发现自从我配了眼镜就不敢出门了。', 14);
INSERT INTO `sententce` VALUES (3565, '提到感情，脑袋就痛，大投资金，浪费生命。', 14);
INSERT INTO `sententce` VALUES (3566, '人家有的是背景儿，我有的只是背影儿。', 14);
INSERT INTO `sententce` VALUES (3567, '给我一双筷子。我能够吃掉整个地球。', 14);
INSERT INTO `sententce` VALUES (3568, '我们老板是小怪兽，我们是奥特曼。但我们见了老板就跑，因为我们没带召唤器。', 14);
INSERT INTO `sententce` VALUES (3569, '脸乃身外之物，可要可不要，钱乃必要之物，不得不要。', 14);
INSERT INTO `sententce` VALUES (3570, '敢诅咒我吃方便面没有调味料，我诅咒你吃方便面只有调味料。', 14);
INSERT INTO `sententce` VALUES (3571, '间歇性郁闷症发作期间，生人勿扰，熟人勿找。', 14);
INSERT INTO `sententce` VALUES (3572, '上帝是很公平的，他让你过了光棍节，就不会让你过情人节！', 14);
INSERT INTO `sententce` VALUES (3573, '长得好看的人才有青春，像我们这种人就只有大学了。', 14);
INSERT INTO `sententce` VALUES (3574, '无理取闹，必有所图！', 14);
INSERT INTO `sententce` VALUES (3575, '一白遮三丑，一高遮五丑，一瘦遮七丑，一富遮百丑，一胖毁所有！', 14);
INSERT INTO `sententce` VALUES (3576, '鸳鸳相抱何时了，鸯在一边看热闹。', 14);
INSERT INTO `sententce` VALUES (3577, '古九尾狐狸有九命，分别亡于语数外政史地理化生。', 14);
INSERT INTO `sententce` VALUES (3578, '老子下个学期好好学习，虐爆那些名次排在我前面的人。', 14);
INSERT INTO `sententce` VALUES (3579, '情侣间最矛盾的地方就是幻想彼此的未来，却惦记着对方的过去。', 14);
INSERT INTO `sententce` VALUES (3580, '一句“拿着”胜过两句“我会给你的”。', 14);
INSERT INTO `sententce` VALUES (3581, '前年睡不醒，后年睡不着。', 14);
INSERT INTO `sententce` VALUES (3582, '时间太瘦，指缝太宽。', 14);
INSERT INTO `sententce` VALUES (3583, '以后别问我有没有对象了，我们神仙跟凡人谈恋爱是违背天条的。', 14);
INSERT INTO `sententce` VALUES (3584, '中华儿女千千万万，这个不行就要换。', 14);
INSERT INTO `sententce` VALUES (3585, '我的进步让他刮目相看，从此他失去了双眼。', 14);
INSERT INTO `sententce` VALUES (3586, '偷吃不是我的错，是我嘴巴的寂寞。', 14);
INSERT INTO `sententce` VALUES (3587, '别和我抢东西，虽然我不会撒娇，但我会玩摔跤。', 14);
INSERT INTO `sententce` VALUES (3588, '我们能做的不是帮别人消除一切的烦恼，更重要的是帮忙寻找快乐的根源。', 14);
INSERT INTO `sententce` VALUES (3589, '哥吸烟，是因为它伤肺，不悲哀。', 14);
INSERT INTO `sententce` VALUES (3590, '这个夏天出门就是进烤箱走路就是麻辣烫坐下就是铁板烧还是别下雨了下雨就成水煮鱼。', 14);
INSERT INTO `sententce` VALUES (3591, '是镜子，总会反光的……是金子，总会花光的!', 14);
INSERT INTO `sententce` VALUES (3592, '为什么一看书，就困呢？因为书，是梦开始的地方', 14);
INSERT INTO `sententce` VALUES (3593, '当你快乐时，你要想，这快乐不是永恒的。当你痛苦时你要想这痛苦也不是永恒的。', 14);
INSERT INTO `sententce` VALUES (3594, '你说走就走，从未顾虑过我的感受，见你第一眼就知道，你是一条难养的狗。', 14);
INSERT INTO `sententce` VALUES (3595, '作业君，宫玲已毁，断念已残，今日你我恩断义决。', 14);
INSERT INTO `sententce` VALUES (3596, '你像捧在手心里的挚爱，掌心一合，不憋死你才怪…', 14);
INSERT INTO `sententce` VALUES (3597, '原本想一口一口吃掉忧愁，不料却一口一口吃成胖子。', 14);
INSERT INTO `sententce` VALUES (3598, '我要努力存钱，买个atm自动提款机。', 14);
INSERT INTO `sententce` VALUES (3599, '别人都是笑起来很好看，但是你却不一样，你是看起来很好笑。', 14);
INSERT INTO `sententce` VALUES (3600, '悲伤已经在现代泛滥成灾了，所以记得对自己好点。', 14);
INSERT INTO `sententce` VALUES (3601, '穿潮了，潮过头就是非主流，穿性感，性感过头就是坐台的。', 14);
INSERT INTO `sententce` VALUES (3602, '我也不知道怎样形容此刻这种感觉，反正就是，不想活了。除非你亲我一下。', 14);
INSERT INTO `sententce` VALUES (3603, '如果上帝关掉你的一扇窗顺便也把门堵上了，有可能上帝要开空调了哦。', 14);
INSERT INTO `sententce` VALUES (3604, '在白雪公主身邊的不必须是小矮人，也可能是葫芦娃。', 14);
INSERT INTO `sententce` VALUES (3605, '老师总是叫我们不要说谎，一到上方来检查时就教我们说谎。', 14);
INSERT INTO `sententce` VALUES (3606, '一个班级一个后宫，总有那么几个人在争宠。', 14);
INSERT INTO `sententce` VALUES (3607, '午觉这种东西，果然还是趴在学校桌子上睡得香。', 14);
INSERT INTO `sententce` VALUES (3608, '如果你不给自己烦恼，别人也永远不可能给你烦恼。因为在你自己的内心，你放不下。', 14);
INSERT INTO `sententce` VALUES (3609, '好马不吃回头草，所以我一向不回头向前绕圈走，结果我又碰上那草了。', 14);
INSERT INTO `sententce` VALUES (3610, '考试时，本想要咸鱼翻锅的，他奶奶的，没想到粘锅了。', 14);
INSERT INTO `sententce` VALUES (3611, '我觉得打电话挺好的，这样说的每句话都是值钱的。', 14);
INSERT INTO `sententce` VALUES (3612, '原本想一口一口吃掉忧愁，不料却一口一口吃成胖子。', 14);
INSERT INTO `sententce` VALUES (3613, '仁慈是好的，但是你有没有想过，你此刻乱发善心，不如立志做出一翻事业，那样能够帮忙更多的人。', 6);
INSERT INTO `sententce` VALUES (3614, '一个人的字体，决定其性格；一个人的话语，决定其修养；一个人的行为，决定其品质；一个人的修为，决定其前途；一个人的轨迹，决定其命运；一个人的态度，决定其心态；一个人的胸怀，决定其仕途；一个人的血液，决定其亲缘。', 6);
INSERT INTO `sententce` VALUES (3615, '信实的话不漂亮，漂亮的话不信实！善良的人不巧辩，巧辩的人不善良！有真知的人不博杂，博杂的人并没有真知！', 6);
INSERT INTO `sententce` VALUES (3616, '不要羡慕别人的精彩，不要嫉妒别人的成功，任何精彩和成功的背后，都沉淀着酸楚，融解了心血。精彩和成功，只是事物结束的方式，行动和过程，才是连缀我们生命的线条。要想多些精彩和成功，行动前要有坚定的决心，拼搏中要有不折的韧性，败北后要有应对的勇气。成功，就是我们战胜了自己。', 6);
INSERT INTO `sententce` VALUES (3617, '如果理智的分析都无法支持自己做决定的时候，就交给心去作主吧！', 6);
INSERT INTO `sententce` VALUES (3618, '钱能够买到什么？钱能够买到房屋，但买不到家庭；钱能够买到药物，但买不到健康；钱能够买到饰物，但买不到青春；钱能够买到钟表，却买不到已流走的时光。', 6);
INSERT INTO `sententce` VALUES (3619, '汤显祖：惊觉相思不露，原来只因已入骨，情不知所起，一往而深。', 6);
INSERT INTO `sententce` VALUES (3620, '人没潜力把钱带到地狱，但钱有魔力把人带进棺材。', 6);
INSERT INTO `sententce` VALUES (3621, '要了解一个人，只需要看他的出发点与目的地是否相同，就能够知道他是否真心的。', 6);
INSERT INTO `sententce` VALUES (3622, '世界没有杯具和喜剧之分，如果你能从杯具中走出来，那就是喜剧;如果你沉缅于喜剧之中，那它就是杯具。如果你只是等待，发生的事情只会是你变老了。', 6);
INSERT INTO `sententce` VALUES (3623, '当你决定了从此要做一个快乐的人，你也知道了自己首先要做的是一个坚强的人……', 6);
INSERT INTO `sententce` VALUES (3624, '看懂一个人，必须是你在意过；看清一个人，必须是你落魄过；看破一个人，必须是你较量过；看透一个人，必须是你付出过；看穿一个人，必须是你受骗过；看淡一个人，必须是你珍惜过；看明一个人，必须是你放弃过；看好一个人，必须是你感动过；看坏一个人，必须是你受伤过；看准一个人，必须是你经历过。', 6);
INSERT INTO `sententce` VALUES (3625, '我们之所以会心累，就是常常徘徊在坚持和放弃之间，举棋不定；我们之所以会烦恼，就是记性太好，该记的，不该记的，都会留在记忆里；我们之所以会痛苦，就是追求的太多；我们之所以不快乐，就是奢望的太多。', 6);
INSERT INTO `sententce` VALUES (3626, '其实，每个人都要学会善于理解我们不能承受的东西，那是生命过程中无法避免的，只要达观地看待就行了。有的人可能一辈子也没有住过高楼，而往往高楼里的你却发出声声叹息。人就是活个心境。', 6);
INSERT INTO `sententce` VALUES (3627, '不要过分在乎身边的人，也不要刻意去在意他人的事。在这世上，总会有人让你悲伤嫉妒咬牙切齿。并不是他们有多坏，而是因为你很在乎。所以想心安，首先就要不在乎。你对事不在乎，它就伤害不到你；你对人不在乎，他就不会令你生气。在乎了，你就已经输了。什么都不在乎的人，才是无敌的。', 6);
INSERT INTO `sententce` VALUES (3628, '逆境是上帝帮你淘汰竞争者的地方。', 6);
INSERT INTO `sententce` VALUES (3629, '成长是一种经历，成熟是一种阅历。每个人都会成长，但不是每个人都会成熟。成熟的人，不为得而狂喜，不为失而痛悲，竭心尽力之后，坦然理解而已；成熟的人，不因功成名就而目中无人，也不因籍籍无名而卑躬屈膝，持一颗平淡的心，不卑不亢地生活。成熟的人，能够担当，懂得感恩，心静气和，淡定从容。', 6);
INSERT INTO `sententce` VALUES (3630, '我们已于昨日过去了，只要过好今日，明天自然美丽。放弃能够说是件痛苦的事，因为对生活寄予太多的渴望，对未来秉持长久的梦想，许多东西不能割舍。但是，生活有时是低谷，深渊，过多的负重，可能加速坠落，带来精神的不堪。', 6);
INSERT INTO `sententce` VALUES (3631, '在人与人的交际中，我们总喜欢单凭别人的一两句话就断定别人是怎样样的一个人。或许你是无心，但听者却并不必须这样想。有时候以偏概全，伤害得不只是一个人，而是一群人。交际要果断，而不是武断。要自信，而不是自以为是！在评价别人的时候，请给自己三分钟想想自己。', 6);
INSERT INTO `sententce` VALUES (3632, '五个要：要唱，要跳，要俏，要笑，要苗条。六个不能：不能饿了才吃，不能渴了才喝,不能困了才睡，不能累了才歇，不能病了才检查，不能老了再后悔！', 6);
INSERT INTO `sententce` VALUES (3633, '没有一个人，能够一辈子享受幸福快乐。人生要想一辈子，永远都保证自己都是快乐的，那是不可能的。只有经历过，才会懂得；只有痛苦过，才知道快乐时刻是多么开心；只有爱过了，才知道心痛的感觉；只有付出了，才能获得回报；只有辛苦过，才知道快乐其实是那么不易；只有失败过，才知道成功是那么艰难。', 6);
INSERT INTO `sententce` VALUES (3634, '根本不必回头去看咒骂你的人是谁？如果有一条疯狗咬你一口，难道你也要趴下去反咬他一口吗？', 6);
INSERT INTO `sententce` VALUES (3635, '最浪漫的三个字，不是“我爱你”，而是“在一起”。', 6);
INSERT INTO `sententce` VALUES (3636, '到最后，你总会明白，谁是虚心假意，谁是真心实意，谁为了你不顾一切。', 6);
INSERT INTO `sententce` VALUES (3637, '认识别人的人，算有智慧！认识自己的人，才算高明！战胜别人的人，算有潜力！战胜自己的人，才算坚强！知道满足的人算是富有！努力不懈的人，才算有志！不丧失安身立命之所的人，才能长久！身体虽死而精神犹存的人，才算长寿！', 6);
INSERT INTO `sententce` VALUES (3638, '当你对自己诚实的时候，世界上没有人能够欺骗得了你。', 6);
INSERT INTO `sententce` VALUES (3639, '所谓幸福，是有一颗感恩的心，一个健康的身体，一份称心的工作，一位深爱你的爱人，一帮值得信赖的朋友。', 6);
INSERT INTO `sententce` VALUES (3640, '有些路段，只能你一个人寂静地走;有些辛酸，只有我一个人无奈地尝。人生苦短，但愿有人，能给我一世纵容。', 6);
INSERT INTO `sententce` VALUES (3641, '当你说别人卑鄙无耻的时候，要思考是不是对方涉及到了你的个人利益，如果没有那你就是正直的，如果涉及到自己的利益更要客观的去看。', 6);
INSERT INTO `sententce` VALUES (3642, '情执是苦恼的原因，放下情执，你才能得到自在', 6);
INSERT INTO `sententce` VALUES (3643, '你什么时候放下，什么时候就没有烦恼。', 6);
INSERT INTO `sententce` VALUES (3644, '三毛：我觉得我这一生虽然爱过很多男子，但是我跟了荷西以后，我就是他唯一的女人，他也是我唯一的男人。', 6);
INSERT INTO `sententce` VALUES (3645, '多看古书，多听老话，有些话是糙，但是理不糙。有些老人口里的话比书本上的值钱。你能把三字文理解透彻了，比孔子不差多少。', 6);
INSERT INTO `sententce` VALUES (3646, '每一种创伤，都是一种成熟。', 6);
INSERT INTO `sententce` VALUES (3647, '孔尚任《桃花扇》的一段唱词：大道才知是，浓情悔认真。回头皆幻景，对面是何人。', 6);
INSERT INTO `sententce` VALUES (3648, '爱着的人，和睡在身边的人，不是同一个，这是常有的事。把爱她的话，说给别的人听，这是常有的事。想着将来，计划着将来，但将来永远都不会出现，这也是常有的事。所以，我说，人的一生，有时候，就这样，错误的渐渐结束了。', 6);
INSERT INTO `sententce` VALUES (3649, '修身齐家治国平天下……要记得这个顺序，切莫颠倒来玩。', 6);
INSERT INTO `sententce` VALUES (3650, '拥有远见比拥有资产重要，拥有潜力比拥有知识重要，拥有人才比拥有机器重要，拥有健康比拥有金钱重要！', 6);
INSERT INTO `sententce` VALUES (3651, '生命从来不是公平的，得到多少，便要靠那个多少做到最好，努力的生活下去。', 6);
INSERT INTO `sententce` VALUES (3652, '每个人，都在争取一个完满的人生。然而，世界上没有绝对完满的东西。太阳一到中间，立刻就会偏西；月圆，立刻就会月亏。所以，有缺憾才是恒久，不完满才叫人生。其实，最好的境界就是花未开全，月未圆。肯低头，就永远不会撞门；肯让步，就永远不会退步。求缺的人，才有满足感；惜福的人，才有幸福感。', 6);
INSERT INTO `sententce` VALUES (3653, '有智慧的人不夸夸其谈，夸夸其谈的人没有智慧！堵塞他们利欲的孔窍，关掉他们利欲的门户，磨去他们的锋芒，解除他们纷扰，涵藏自己的光彩！混同于尘俗之中！', 6);
INSERT INTO `sententce` VALUES (3654, '不要轻易剥夺别人的希望；生气的时候不要作出什么决定；不要指望生活会是完全公平的；每一天称赞个人；保守秘密；及时承认自己的错误；凡事先作计划，尽量将目标视觉化；写下来，不要太依靠脑袋记忆；每一天提前分钟上班，推迟分钟下班。', 6);
INSERT INTO `sententce` VALUES (3655, '“其实他人不坏。”我们因为这句话，容忍了生活中多少不该容忍的人和事。', 6);
INSERT INTO `sententce` VALUES (3656, '内心充满忌妒，心中不坦白，言语不正的人，不能算是一位五官端正的人。', 6);
INSERT INTO `sententce` VALUES (3657, '如果我没有什么能够帮到你，至少能够陪着你。', 6);
INSERT INTO `sententce` VALUES (3658, '人一生的成就有些靠天分，有些靠运气，有些靠努力，而人所能掌握的仅仅只是自己的那一分深情与用心。但是，这一分深情与用心才是作为人生最重要的价值。至于成就，我们只能尽心而知命，毋须过分在意。', 6);
INSERT INTO `sententce` VALUES (3659, '一个内心丰富的人既不害怕独处，也不害怕人群，因为他们能够在独处时心中绽开大千世界，也能够在人群中持续一份恬淡清寂。', 6);
INSERT INTO `sententce` VALUES (3660, '一段友情离开了就淡了，一段爱情分离了就散了，珍惜此刻所拥有的，也许下一秒就不再属于你。没有能回去的感情，就算真的回去了，你也会发现，一切已经面目全非。唯一能回去的，只是存于心底的记忆，所以，我们只能一向往前。', 6);
INSERT INTO `sententce` VALUES (3661, '生活不能游戏人生，否则就会一事无成；生活不能没有游戏，否则就会单调无聊。', 6);
INSERT INTO `sententce` VALUES (3662, '我们的生命，就是以不断出发的姿势得到重生。为某些只有自己才能感知的来自内心的召唤，走在路上，无法停息。', 6);
INSERT INTO `sententce` VALUES (3663, '人生最大的悟，是“怎样来”和“怎样去”；人生最大的幸福，是“身已安”和“心亦宽”。', 6);
INSERT INTO `sententce` VALUES (3664, '情绪好要抱抱，情绪不好也要抱抱。', 6);
INSERT INTO `sententce` VALUES (3665, '坦诚让你受到伤害，但还是要坦诚。', 6);
INSERT INTO `sententce` VALUES (3666, '坚持用心乐观坚强的心态，它们会令疑虑恐惧和失败闻风丧胆。', 6);
INSERT INTO `sententce` VALUES (3667, '人生感悟的句子，生活这场表演，更需要百遍练习，才可能换来一次美丽。生活给你一些痛苦，只为了告诉你它想要教给你的事。一遍学不会，你就痛苦一次，总是学不会，你就在同样的地方反复摔跤。', 6);
INSERT INTO `sententce` VALUES (3668, '你既然认准一条道路，何必去打听要走多久。', 6);
INSERT INTO `sententce` VALUES (3669, '人不会苦一辈子，但总会苦一阵子。许多人为了逃避苦一阵子，却苦了一辈子。', 6);
INSERT INTO `sententce` VALUES (3670, '当初有些事，让我们刻骨铭心；以前有些人，令我们难以释怀。我们一路走来，告别一段往事，走入下一段风景。路在延伸，风景在变幻，人生没有不变的永恒。走远了再回头看，很多事已经模糊，很多人已经淡忘，只有很少的人与事与我们有关，牵连着我们的幸福与快乐，这才是我们真正要珍惜的地方。', 6);
INSERT INTO `sententce` VALUES (3671, '当你想念一个人的时候，尽情去想念吧，也许有一天，你再也不会如此想念他了。到了那一天，你会想念以前那么想念一个人的滋味。当你爱一个人的时候，尽情去爱吧，也让他知道你是如此爱他。也许有一天，当你长大了，受过太多的伤，失望太多，思虑也多了，你再也不会那么炽烈地爱一个人。', 6);
INSERT INTO `sententce` VALUES (3672, '做女人必须要经得起谎言，受得起敷衍，忍得住欺骗，放得下诺言，最后用微笑来伪装掉下的眼泪，宁愿相信世界上有鬼，也不要相信男人的那张破嘴！', 6);
INSERT INTO `sententce` VALUES (3673, '同样的瓶子，你为什么要装毒药呢？同样的心里，你为什么要充满着烦恼呢？', 6);
INSERT INTO `sententce` VALUES (3674, '真正的爱不是“捆绑”，好的感情是拉得开却扯不断的。拉得开就是彼此都拥有独立的人格尊严和价值决定，而扯不断是说彼此之间的温暖和依恋。所以，爱不是一种捆绑，相反我们能够把爱看成是人生的一种“松绑”，因为爱是如此的温暖宽容，包含着彼此的信任与疼爱，给有限的人生带来无限的体贴与希望。', 6);
INSERT INTO `sententce` VALUES (3675, '生命本是场漂泊的远行，谁与你擦肩，你与谁偶遇，其实都是美丽的意外。珍惜能让你感动的人，铭记能让你哭泣的人，放下能让你淡漠的人，遗忘能让你无关的人。是风雨，就勇敢地追逐，用挑战衡量人生的成色；是阳光，就尽情的接纳，用成长舒展生活的底色；是挫败，就无畏地笑对，用坚强浸润命运的本色。', 6);
INSERT INTO `sententce` VALUES (3676, '如果有本事找到逃避问题的办法，其实也有本事找到解决问题的途径。', 6);
INSERT INTO `sententce` VALUES (3677, '每一个人都拥有生命，但并非每个人都懂得生命，乃至于珍惜生命。不了解生命的人，生命对他来说，是一种惩罚。', 6);
INSERT INTO `sententce` VALUES (3678, '困难，就是困在家里万事难;出路，就是出去走走就有路。', 6);
INSERT INTO `sententce` VALUES (3679, '你不可能取悦平息或改造一个混蛋。', 6);
INSERT INTO `sententce` VALUES (3680, '真正的安全感，来自你对自己的信心，是你每个阶段性目标的实现，而真正的归属感，在于你的内心深处，对自己命运的把控，因为你最大的对手永远都是自己。一个人能够，并且就应让自己做到的，不是感到安全，而是能够接纳不安全的现实。', 6);
INSERT INTO `sententce` VALUES (3681, '我喝酒是想把痛苦溺死，但这该死的痛苦却学会了游泳恋爱就像口香糖，时间长了会平淡无味，觉得平淡了就想放弃，而无论丢在什麽地方，都会留下难以抹去的痕迹。', 6);
INSERT INTO `sententce` VALUES (3682, '要不要奋斗，归根结底，取决于你想做什么样的人，过什么样的人生。其实这是个伪命题，讨论它是没有好处的。因为如果你认为对的，喜欢的事，就去做，去实现，是感觉不到奋斗的挣扎，而是享受。', 6);
INSERT INTO `sententce` VALUES (3683, '爱，就大声说出来，因为你永远都不会知道，明天和意外，哪个会先来。', 6);
INSERT INTO `sententce` VALUES (3684, '其实全世界最幸福的童话，但是是，与心爱的人一起度过柴米油盐酱醋茶的岁月。', 6);
INSERT INTO `sententce` VALUES (3685, '在这条路上，我们并没有选择。无路可退，也无法逃避，只能让肃杀的风凌冽地扑面而来，冻得鼻青脸肿却不屈地缓慢前行。不是风雨之后总能见彩虹。但是咬着嘴唇温柔又倔强勤奋总会胜利。', 6);
INSERT INTO `sententce` VALUES (3686, '君子会被小人击倒，但还是要做君子', 6);
INSERT INTO `sententce` VALUES (3687, '你永远要感谢给你逆境的众生。', 6);
INSERT INTO `sententce` VALUES (3688, '你帮忙的人会击你，但还要帮忙他们。', 6);
INSERT INTO `sententce` VALUES (3689, '总有某段路，只能你一个人走；总有许多事，需要你一个人扛。别畏惧孤独，它能帮你划清内心的清浊，是你无法拒绝的命运历程；别躲避困苦，莫让冷世的尘埃，冰封你的笑容，迟滞你的步履。走得越久，时光越老，人心越淡。忘不掉昨日，它就是束缚你的阴影；向往着明天，你才能描绘它的模样。', 6);
INSERT INTO `sententce` VALUES (3690, '再坚强的人，心里都必须有那么一些弱点，一触就碎，一碰就痛。因为不想受伤，我们戴上方具，穿上武裝，设法把自己脆弱的一面藏起來。但是，我们隠藏的愈多，被发现的时候，暴露的就更多。我們愈不敢应对伤痛，被刺伤的时候，伤口就愈痛。最不容易受伤的人，不是最坚强的人，而是最坦诚应对自己的人。', 6);
INSERT INTO `sententce` VALUES (3691, '说一句谎话，要编造十句谎话来弥补，何苦呢？', 6);
INSERT INTO `sententce` VALUES (3692, '拥有了一颗赤城的心，便拥有了朋友；拥有了一颗善良的心，便拥有了友爱。', 6);
INSERT INTO `sententce` VALUES (3693, '即使蒙上眼睛独自前行，也不再感到彷徨和恐惧。因为，黑暗中一向有温暖的灯光，在我的心底。', 6);
INSERT INTO `sententce` VALUES (3694, '人生这部大戏，一旦拉开序幕，不管你如何怯场，都得演到戏的结尾。戏中我们爱犯一个错误，就是总把希望寄予明天，却常常错过了今日。过去不会重来，未来无法预知，我们唯一可做的，就是不要让今日成为明天的遗憾。人生没有预演，我们迈出的每一步都应是弥足珍贵。', 6);
INSERT INTO `sententce` VALUES (3695, '真正可笑的不是对牛弹琴，而是一群牛对着你弹琴。', 6);
INSERT INTO `sententce` VALUES (3696, '一个人思虑太多，就会失却做人的乐趣。', 6);
INSERT INTO `sententce` VALUES (3697, '我们用一只眼睛看见现实的灰墙，却用另一只眼睛勇敢飞翔，接近梦想。', 6);
INSERT INTO `sententce` VALUES (3698, '不要把一些现代的东西和古典的东西理解的太复杂，他们都来源于生活，哲学只是一个人的世界观。假如说，你认为这个世界是方的，那么你忽悠一大群认可你的说法，你也是哲学家。', 6);
INSERT INTO `sententce` VALUES (3699, '人之所以痛苦，在于追求错误的东西。', 6);
INSERT INTO `sententce` VALUES (3700, '得意时要看淡，失意时要看开。人生有许多东西是能够放下的。只有放得下，才能拿得起。尽量简化你的生活，你会发现那些被挡住的风景，才是最适宜的人生。千万不要过于执着，而使自己背上沉重的包袱。', 6);
INSERT INTO `sententce` VALUES (3701, '原谅与宽恕，是我们涉远的护符。就算再苦再累，路总是要走的，生活还要继续，别太为难自己苛求他人。潜力有大小，水平有高低，凡事不可求全责备，谁也无法成为完人。故当顺势，以卵击石易碎，螳臂挡车多伤；故当看开，一已之力有限，众人拾柴焰高；故当放下，可为时尽力，不可为时宽心。', 6);
INSERT INTO `sententce` VALUES (3702, '心有余而力不足往往是托词，力有余而心不足才是真相。', 6);
INSERT INTO `sententce` VALUES (3703, '成熟的人不问过去；聪明的人不问此刻；豁达的人不问未来。', 6);
INSERT INTO `sententce` VALUES (3704, '不要刻意去猜测他人的想法，如果你没有智慧与经验的正确决定，通常都会有错误的。', 6);
INSERT INTO `sententce` VALUES (3705, '阳光虽然宝贵，但照射时间长了也会遭到谩骂。', 6);
INSERT INTO `sententce` VALUES (3706, '生活中一半的麻烦是由于你说Yes太快，说No太慢！------成熟的人不问过去，聪明的人不问此刻，豁达的人不问未来。------凡事顺其自然，遇事处之泰然，得意时淡然，失意时坦然。', 6);
INSERT INTO `sententce` VALUES (3707, '等待太久得来的东西，多半已经不是当初自己想要的样貌了。世上最珍贵的不是永远得不到或已经得到的，而是你已经得到并且随时都有可能失去的东西。', 6);
INSERT INTO `sententce` VALUES (3708, '不要只追求漂亮的外表，它会蒙蔽你的眼睛；不要只追求财富，它只但是是过眼烟云；追求一个能让你真心微笑的人，只有笑容能使黑夜不再漫长，驱走阴霾，带来温暖阳光。', 6);
INSERT INTO `sententce` VALUES (3709, '一个人最难得的是平常心，得而不喜，失而不忧，内心宁静，则幸福常在；成而不骄，败而不馁，心灵和谐，则快乐常存。很多人之所以痛苦，在于追求错误的东西。更多人都是辛辛苦苦时，过舒服日子；舒舒服服时，过的却是辛苦日子。奋斗过后的痛苦莫过如此。', 6);
INSERT INTO `sententce` VALUES (3710, '不要等被爱了才懂得去爱；不要等孤独了才想起了朋友；不要等拥有了才懂得分享；不要等失败后才想起别人的忠告；不要等别人受伤在去恳求原谅；不要等分开了才想到去挽回；不要等待，人生没有那么多的等待；让回忆过去，让未来过来。', 6);
INSERT INTO `sententce` VALUES (3711, '朋友就是……我前言不搭后语，你却都懂。', 6);
INSERT INTO `sententce` VALUES (3712, '人生百相，世态万千，当从容应对，淡泊处之，不畏浮云蔽眼，不被微利惑心，不为陷阱锁步，不使闲情损志。有些人，笑一笑，就陌生了，那些刻意的亲近，终究消失得难寻踪迹；有些事，摆一摆，就过去了，当下的困苦挫败，可能是你以后登高的阶梯。行至水穷路自横，坐看云起天亦高，凭的就是眼界与心胸。', 6);
INSERT INTO `sententce` VALUES (3713, '人生感悟的句子，人活一辈子，开心最重要。要拥有健康的体魄，在快乐的心境中做自己喜欢做的事情，安全地实现自身价值，这是人生最大的幸福。好景不常在，好花不长开。人生短暂，好好地去珍惜它，善待它，把握它吧！学会珍惜珍重你身边的每个人。人就这么一生，没有来世，所以让我们从微笑开始！', 6);
INSERT INTO `sententce` VALUES (3714, '机会不是等来的，而是争取来的，就像吃饭，如果光等着吃别人送到你碗里的菜，你可能就吃不到自己想吃的菜。', 6);
INSERT INTO `sententce` VALUES (3715, '一个人如果不能从内心去原谅别人，那他就永远不会心安理得。', 6);
INSERT INTO `sententce` VALUES (3716, '放弃选择是一种遗憾，而选择放弃却是一种谋略；垂青机遇是一种梦想，而机遇垂青则是一种运气。', 6);
INSERT INTO `sententce` VALUES (3717, '再平凡的人生，都是悲喜交融，哭笑掺杂，上帝不会过分眷顾谁，没人一向笑，没人老是哭。哭过了才知道笑的不易，再笑时方懂得哭的艰辛。若嚎哭能够疗养心伤，那就尽情宣泄，哭过再站起来，勇敢走自己的路。别把哭泣当成一种矫情与演饰，有时不哭也是一种选择，毕竟哭与不哭，我们都要追逐。', 6);
INSERT INTO `sententce` VALUES (3718, '善于做将帅的人，不轻易动武！善于作战的人，不轻易发怒！善于战胜的人，不跟敌人硬拼！善于用人的人，对人态度很谦虚！这就叫做不与人相争的美德，这就叫做善于利用别人的力量！', 6);
INSERT INTO `sententce` VALUES (3719, '命运中最核心的东西，是学习，人生如花草，若无学习之浇灌，再艳丽亦将枯萎。能够促使你学习的，是勤奋，早起的鸟儿有虫吃，只有在勤奋中方可触及梦境；永保勤奋之姿的，是坚持，成败原本咫尺之遥，看谁能够最后咬牙三分钟。坚持的长短，源自有无好胜之心，那些打败你的，说到底，还是你自己。', 6);
INSERT INTO `sententce` VALUES (3720, '人需要沉淀，要有足够的时间去反思，才能让自己变得更完美。也许每个人出生时都以为这天地是为他一个人而存在的，当他发现自己错的时候，他便开始长大。', 6);
INSERT INTO `sententce` VALUES (3721, '在你困苦的时候，不离不弃是雪中送炭。在你安定的时候，不离不弃是心心相惜。在你得意的时候，不离不弃是锦上添花。', 6);
INSERT INTO `sententce` VALUES (3722, '痛苦并不可怕，可怕的是内心背叛自己，成为痛苦的帮凶。', 6);
INSERT INTO `sententce` VALUES (3723, '世界上没有任何傻子，不要和任何人耍小聪明，不被戳穿你进步不了，被戳穿你下不来台。', 6);
INSERT INTO `sententce` VALUES (3724, '该说的要说，该哑的要哑，是一种聪明。该干的要干，该退的要退，是一种睿智。该显的要显，该藏的要藏，是一种境界。', 6);
INSERT INTO `sententce` VALUES (3725, '当你快乐时，你要想这快乐不是永恒的。当你痛苦时，你要想这痛苦也不是永恒的。', 6);
INSERT INTO `sententce` VALUES (3726, '恋爱最美的时期，就是暧昧不清的阶段。彼此探询对方的呼吸，留意翼翼辨别对方释出的心意，戒慎恐惧给予响应。每一个小动作似乎都有好处，也开始被赋予好处。', 6);
INSERT INTO `sententce` VALUES (3727, '在我们这个不完美的人生里，也需要一些无谓的浪费', 6);
INSERT INTO `sententce` VALUES (3728, '希望有那么一个人，在我安静的时候，明白我的沉默;难过的时候，紧紧地拥抱着我;需要倾诉的时候，耐心地聆听。', 6);
INSERT INTO `sententce` VALUES (3729, '这个世界是绝对的不公平，要么你顺从，要么你把天平倾向自己，否则你就别怨天由人，那没用。', 6);
INSERT INTO `sententce` VALUES (3730, '有时，一个笑就击败了一辈子，一滴泪就还清了一个人。', 6);
INSERT INTO `sententce` VALUES (3731, '帮忙别人要看自己的潜力，还要看对方的贪婪程度。要多做雪中送碳渴中送水的事，少玩虚的，否则你就假装什么都没看到。', 6);
INSERT INTO `sententce` VALUES (3732, '你不要一向不满人家，你就应一向检讨自己才对。不满人家，是苦了你自己。', 6);
INSERT INTO `sententce` VALUES (3733, '如果你不给自己烦恼，别人也永远不可能给你烦恼。因为你自己的内心，你放不下。', 6);
INSERT INTO `sententce` VALUES (3734, '世上的每一条路都是弯的。', 6);
INSERT INTO `sententce` VALUES (3735, '不要浪费你的生命在你必须会后悔的地方上。', 6);
INSERT INTO `sententce` VALUES (3736, '经常有人问在朋友和恋人之间叫你选择，你会选择哪一个？其实这个问题是剩余的。真正懂你的朋友或恋人，他们会体谅你的行为，如果不体谅你，因此失去也不必太在意。朋友或恋人是要互相帮忙的，而不是硬性迁就。', 6);
INSERT INTO `sententce` VALUES (3737, '心中装满着自己的看法与想法的人，永远听不见别人的心声。', 6);
INSERT INTO `sententce` VALUES (3738, '一辈子最终要赢的不是钱和权，而是眼光境界胸怀和朋友。', 6);
INSERT INTO `sententce` VALUES (3739, '在这个世界上，没有一劳永逸完美无缺的选择。你不可能同时拥有春花和秋月，不可能同时拥有硕果和繁花。你不可能所有的好处都是你的。你要学会权衡利弊，学会放弃一些什么，然后才可能得到些什么。你要学会理解命的残缺和悲哀，然后，心平气和。因为，这就是人生。', 6);
INSERT INTO `sententce` VALUES (3740, '精神有了寄托，委屈能够诉说；心灵有了归宿，人生不再漂泊。飘过风和雨，才知道不弃的是深爱；经历荣与衰，才懂得不变的是真情。走过一段路，经历一些事，才能真正看清一些人。患难时，读懂了人情冷暖；平淡中，体会到缘分善变。时间，会沉淀真挚的情感；风雨，会历练值得珍惜的情缘。', 6);
INSERT INTO `sententce` VALUES (3741, '有时候我们有些近视，忽略了离我们最真的情感;有时候我们有些远视，模糊了离我们最近的幸福。', 6);
INSERT INTO `sententce` VALUES (3742, '告女孩：没用的东西，再便宜也不要买;不爱的人，再寂寞也不要依靠。', 6);
INSERT INTO `sententce` VALUES (3743, '善良是一种聋子能听见盲人能看见的语言。', 6);
INSERT INTO `sententce` VALUES (3744, '广结众缘，就是不要去伤害任何一个人。', 6);
INSERT INTO `sententce` VALUES (3745, '让生活变好的金钥匙不在别人手里，放弃我们的怨恨和叹息，完美生活就垂手可得。我们主观上本想好好生活，但是客观上却没有好的生活，其原因是总想等待别人来改善生活，不要指望改变别人，自己做生活的主人。', 6);
INSERT INTO `sententce` VALUES (3746, '空气虽然珍贵，但轻易能获取的东西没人会珍惜。', 6);
INSERT INTO `sententce` VALUES (3747, '我想知道：有人正从世界的某个地方朝我走来吗?像光那样，从一颗星到达另外一颗星。', 6);
INSERT INTO `sententce` VALUES (3748, '人生感悟的句子，人的一生需要知己，不管是爱人朋友还是情人，如果在那里能得到心灵的慰籍同时又能够畅所欲言无所顾忌，苦闷欢笑他/她都陪伴着你，这就是我们理想中的知己，有了这样的知己会使自己的生活不再寂寞空虚。', 6);
INSERT INTO `sententce` VALUES (3749, '人是毫无逻辑，不讲道理的，但还是要爱他们。', 6);
INSERT INTO `sententce` VALUES (3750, '痛过，才知道如何保护自己；哭过，才知道心痛是什么感觉；傻过，才知道适时的坚持与放弃；爱过，才知道自己其实很脆弱。------其实，生活并不需要这么些无谓的执著，没有什么就真的不能割舍。', 6);
INSERT INTO `sententce` VALUES (3751, '狂妄的人有救，自卑的人没有救，认识自己，降伏自己，改变自己，才能改变别人。', 6);
INSERT INTO `sententce` VALUES (3752, '茶喝三道，第一道，苦若生命；第二道，甜似爱情；第三道，淡若轻风。', 6);
INSERT INTO `sententce` VALUES (3753, '在生命里寻觅快乐的方法，就是了解你被赋予生命是为了享受生命。', 6);
INSERT INTO `sententce` VALUES (3754, '憎恨别人对自己是一种很大的损失。', 6);
INSERT INTO `sententce` VALUES (3755, '女人，能够做自己的公主，但不要指望做全世界的公主。女人的经历能够沧桑，但女人的心态绝对不能够沧桑。女人因为有缺点才可爱。聪明的女人总会把自己的破绽暴露给男人。男人女人之间的较量，输家永远是女人。不是因为她不够聪明，仅仅是因为她更爱他。', 6);
INSERT INTO `sententce` VALUES (3756, '人一简单就快乐，一世故就变老。持续一颗年轻的心，做个简单的人，享受阳光和温暖。生活就应当如此。', 6);
INSERT INTO `sententce` VALUES (3757, '在选择前，是要有一张真诚坚定的脸；在选择后，那么也就有一颗绝不改变的心。', 6);
INSERT INTO `sententce` VALUES (3758, '得不到的东西，我们会一向以为他是完美的，那是因为你对他了解太少，没有时间与他相处在一起。当有一天，你深入了解后，你会发现原不是你想像中的那么完美。', 6);
INSERT INTO `sententce` VALUES (3759, '今日的执着，会造成明日的后悔。', 6);
INSERT INTO `sententce` VALUES (3760, '你永远要宽恕众生，不论他有多坏，甚至他伤害过你，你必须要放下，才能得到真正的快乐。', 6);
INSERT INTO `sententce` VALUES (3761, '毁灭人只要一句话，培植一个人却要千句话，请你多口下留情。', 6);
INSERT INTO `sententce` VALUES (3762, '拖延是最彻底的拒绝。', 6);
INSERT INTO `sententce` VALUES (3763, '走过的路长了，遇见的人多了，经历的事杂了。不经意间发现，人生最曼妙的风景是内心的淡定与从容，头脑的睿智与清醒。人生最奢侈的拥有是一颗不老的童心，一个生生不息的信念，一个健康的身体，一个永远牵手的爱人。一个自由的心态，一份喜欢的工作，一份安稳的睡眠，一份享受生活的完美情绪。', 6);
INSERT INTO `sententce` VALUES (3764, '人生有两样东西千万不要错过：一个是，最后一班回家的车；另外一个是，最后一个深爱你的人。爱情有两样东西千万不要隐瞒：一个是，假如你不爱对方却假装深爱着对方；另外一个是，隐瞒着一个人往爱另外一个人。', 6);
INSERT INTO `sententce` VALUES (3765, '有一种爱，明明是深爱，却说不出来。有一种爱，明明想放手，却无法离弃。有一种爱，明知是煎熬，却又躲不开。有一种爱，明知无前路，心却早已收不回来。', 6);
INSERT INTO `sententce` VALUES (3766, '我不需要别人的理解，不需要别人体谅自己敏感，由着我固执的性子，只是在我莫名的留下眼泪时，只要有个肩膀在自己的身边，说“我都懂”，就够了。', 6);
INSERT INTO `sententce` VALUES (3767, '我们总以为来日方长，可一不留意就是后会无期。', 6);
INSERT INTO `sententce` VALUES (3768, '香烟爱上火柴，就注定要被伤害！一只风筝一辈子只会为一根钱冒险！在爱的世界里，没有谁对不起谁，只有谁不懂得珍惜谁！', 6);
INSERT INTO `sententce` VALUES (3769, '建设是脆弱的，但还是要建设。', 6);
INSERT INTO `sententce` VALUES (3770, '放弃同样是一种选择，放弃并不是自己无能，而是因为自己有了更好的选择。有时候，放弃比坚持还需要勇气。', 6);
INSERT INTO `sententce` VALUES (3771, '人生有两难，一是把自己脑子里的东西放到别人脑子里，二是把别人口袋的钱装到自己口袋，要慢慢来，你急了没用。', 6);
INSERT INTO `sententce` VALUES (3772, '有时候，我们活得很累，并非生活过于刻薄，而是我们太容易被外界的氛围所感染，被他人的情绪所左右。行走在人群中，我们总是感觉有无数穿心掠肺的目光，有很多飞短流长的冷言，最终乱了心神，渐渐被缚于自己编织的一团乱麻中。其实你是活给自己看的，没有多少人能够把你留在心上。', 6);
INSERT INTO `sententce` VALUES (3773, '人生就像一扇门，有人悲观于门内的黑暗，有人却乐观于门内的宁静；有人忧愁于门外的风雨，有人却快乐于门外的自由。其实，人生很多东西无所谓最好的，只要是你认为值得就是最好。成功与失败，幸福与不幸，在各自心里的定义都不会相同。人活的就是心态，持续一个好的心态，人生就是一个快乐的天堂。', 6);
INSERT INTO `sententce` VALUES (3774, '别硬要把单纯的事情看得很严重，那样貌你会很痛苦。', 6);
INSERT INTO `sententce` VALUES (3775, '喜欢花的人是会去摘花的，然而爱花的人则会去浇水。', 6);
INSERT INTO `sententce` VALUES (3776, '有些事，有机会做的时候，就去做，别等没机会了，再去做，就来不及了；有些人，有机会珍惜的时候，就去珍惜，别等失去了，再去把握，就没好处了。人心，原本就看不懂猜不透；生活，原本就甜一阵苦一场，情绪，原本就喜一寸忧一尺；人生，原本就跋一路涉一程。唯有看透,方可从容；唯有看轻，才有幸福！', 6);
INSERT INTO `sententce` VALUES (3777, '想了解一个男人么，和他喝酒和赌钱，看他对钱的态度和酒的态度。装B不装B就体现出来了。不能喝，却不推辞的人，可交。明明很能喝，却很推诿的不和他玩。赌钱时输再多也能上钱比较快，而且面带笑容的交。大哭小叫的不交。', 6);
INSERT INTO `sententce` VALUES (3778, '老婆是电视，情人是手机，在家看电视，出门带手机；破产卖电视，发财换手机；偶尔守电视，整天玩手机；固定的电视，移动的手机；频道免费，手机收费。男人都想拿着手机看电视。', 6);
INSERT INTO `sententce` VALUES (3779, '总想努力工作认真生活，总想待人真诚持续微笑。总想永怀希望从不绝望，总想善待家人友爱朋友，总想心怀感恩乐观向上。却发现生活中总有一些路，一向难行。总有太多期待一向失望，总有太多梦想一向落空，总有太多言语无人可诉。总想逃离纷争，被现实牵绊，总有很多不平，一向无奈。', 6);
INSERT INTO `sententce` VALUES (3780, '沉默是毁谤最好的答覆。', 6);
INSERT INTO `sententce` VALUES (3781, '人生如梦，岁月无情。蓦然回首，才发现人活着是一种情绪。穷也好，富也好，得也好，失也好。一切都是过眼云烟。不论昨日今日明天，能豁然开朗就是完美的一天。不论亲情友情爱情，能永远珍惜就是好情绪。', 6);
INSERT INTO `sententce` VALUES (3782, '人生最大的烦恼，不是选择，而是不知道自己想得到什么，不知道到了生命的终点，自己想有些甚么人在身边。', 6);
INSERT INTO `sententce` VALUES (3783, '学会忘记------人生不如意常十八九，要让自己快乐，就必须给自己减压，减压的好方法就是学会忘记，人生需要能拿得起，有时候放得下更重要。------春有百花秋有月，夏有凉风冬有雪。若无闲事挂心头，便是人间好时节。', 6);
INSERT INTO `sententce` VALUES (3784, '如果你信命，那么一切的偶然都是注定；如果你不信命，那么一切的注定都是偶然。', 6);
INSERT INTO `sententce` VALUES (3785, '生活中没有信念，就好比圆规没有支点无法画一个完美的圆圈。', 6);
INSERT INTO `sententce` VALUES (3786, '人生的真理，只是藏在平淡无味之中。', 6);
INSERT INTO `sententce` VALUES (3787, '明知道天要下雨，就该带把伞。明知道不会有结果，就请别开始。', 6);
INSERT INTO `sententce` VALUES (3788, '不要我的我不要，不爱我的我不爱;把灯关上，连背影都不会存在。', 6);
INSERT INTO `sententce` VALUES (3789, '用伤害别人的手段来掩饰自己缺点的人，是可耻的。', 6);
INSERT INTO `sententce` VALUES (3790, '人生，少年，中年，老年，就如喝茶的三个阶段。头遍苦涩，正如初入社会磕绊坎坷。二遍舌底生津，在拼搏后收获财富，稳重和信心。第三遍茶已逐渐淡去，犹如年纪渐大，耳顺易平心静，经过时光的洗练，心中一片清澈，诚如茶之味淡，茶水愈加透明。', 6);
INSERT INTO `sententce` VALUES (3791, '上帝听不懂凡间言语，用行动祈祷才能让上帝了解你的意图。', 6);
INSERT INTO `sententce` VALUES (3792, '被误解的时候微微一笑，是一种素养；受委屈的时候坦然一笑，是一种大度；吃亏的时候开心的一笑，是一种豁达；身处窘境时候自嘲的一笑，是一种智慧；无奈时候达观的一笑，是一种境界；危难时候泰然一笑，是一种大气；被轻蔑的时候能平静的一笑，这是一种自信；失恋的时候能轻轻一笑，这是一种洒脱。', 6);
INSERT INTO `sententce` VALUES (3793, '用钱之道：一百万能买套房，住着安逸；十万块买不到房，却能买辆车，来去方便；一万块买不到车，却能买个钻戒，情定终身；一千块买不到钻戒，却能买块表，掌控时间；一百块买不到表，却能买套书，充实头脑；十块钱买不到书，却能买碗面，起码管饱；一块钱买不起面，却能给乞丐，奉献爱心。', 6);
INSERT INTO `sententce` VALUES (3794, '别人的钱和房子还有地位和你无关，你只有努力就行，此刻什么样都不丢人。', 6);
INSERT INTO `sententce` VALUES (3795, '绑不住我的心就不要说我花心！如果你是我眼中的一滴泪，那我永远都不会哭泣，因为我怕失去你！', 6);
INSERT INTO `sententce` VALUES (3796, '有些事，我们明知道是错的，也要去坚持，因为不甘心；有些人，我们明知道是爱的，也要去放弃，因为没结局；有时候，我们明知道没路了，却还在前行，因为习惯了。', 6);
INSERT INTO `sententce` VALUES (3797, '拥有一颗无私的爱心，便拥有了一切。', 6);
INSERT INTO `sententce` VALUES (3798, '你硬要把单纯的事情看得很严重，那样貌你会很痛苦。', 6);
INSERT INTO `sententce` VALUES (3799, '与其靠励志句子励志，倒不如鼓起勇气让自己丢足一次脸。', 6);
INSERT INTO `sententce` VALUES (3800, '再富有的人也需要别人帮忙，再穷困的人也有机会帮忙别人。', 6);
INSERT INTO `sententce` VALUES (3801, '两个人在一起，能做最多的事，就是陪伴。我干我的，你干你的，有另一个人坐在那儿，就感到很踏实而已。那些已经进入稳定爱情的两个人，他们很相爱。他们下班回家一起吃一顿饭后，一人一台电脑，他打游戏，她逛淘宝。都在自己的世界里，但不一样的是，身边伴着另一个人，这就是爱情，最常态的爱情。', 6);
INSERT INTO `sententce` VALUES (3802, '深的话要浅浅地说，长长的路要挥霍的走。大大的世界要率真地感受，会痛的伤口要轻轻的揉。拥别的时候去勇敢的祝福，不被了解的时候相信自己值得。', 6);
INSERT INTO `sententce` VALUES (3803, '你是不是总是会为了某人而不断地修改自己的底线?不停地为某人找借口，不停地想去原谅……但是，傻孩子，可能他没那么喜欢你……', 6);
INSERT INTO `sententce` VALUES (3804, '生活遇到困难，你抱怨了，说苦；工作遇到挫折，你退缩了，说难；总是怨天尤人，整日的唉声叹气，羡慕别人的成就，悲观了自己的路。其实人生不如意，能够慢慢来，因为经验需要积累；生活不开心，别着急，生活本就是大杂烩。别人今日成功，是他的过去所成就的，你今日虽不如意，但是你年轻，你还有未来。', 6);
INSERT INTO `sententce` VALUES (3805, '这一次，你敢不敢，像第一次恋爱那样爱，像最后一次爱那样爱?', 6);
INSERT INTO `sententce` VALUES (3806, '别和别人比，和自己比就行了，天知道你每一天进步一点，你一年会是什么样貌？十年会是什么样貌。只是你能不能坚持每一天进步一点。想学英语？你只需要每一天记住一个单词，一个语法就行了。十年时间你似乎能够当专家了。', 6);
INSERT INTO `sententce` VALUES (3807, '有些事，明知是错的，也要去坚持，因为不甘心;有些人，明知是爱的，也要去放弃，因为没结局;有时候，明知没路了，却还在前行，因为习惯了。', 6);
INSERT INTO `sententce` VALUES (3808, '生命是一种缘，让我们在缘分的天空下，守候真诚与善良，坚持期待与梦想，珍惜拥有，懂缘惜缘，认真的对待生命，认真的对待生活，认真的对待生存——只要每个人都认真的对待了自已的人生，当你回首走过的路时，你会惊奇地发现：“缘来如此”！“缘”——原来一向都在自已的身边!', 6);
INSERT INTO `sententce` VALUES (3809, '人生的十个不要等——想要得到爱时才学会付出；孤单时才想念起你的朋友；有了职位时才去努力工作；失败时才记起他人的忠告；生病时才意识到生命脆弱；分离时后悔没有珍惜感情；有人赞赏你时才相信自己；别人指出才知道自己错了；腰缠万贯才准备帮忙穷人；临死时才发现要热爱生活。——这些都不要等。', 6);
INSERT INTO `sententce` VALUES (3810, '心，是封闭于暗室的一盏烛，自己不点燃，没人能替你点燃。心，是荡漾于禁苑的一泓湖，自己不清淤，没人能替你清淤。心，是紧锁于里侧的一扇窗，自己不打开，没人能替你打开。心，是经行于体内的一轮日，自己不发热，没人能替你发热。心，是冬眠于灵魂的一个梦，自己不圆梦，没人能替你圆梦。', 6);
INSERT INTO `sententce` VALUES (3811, '知道了而自以为不知道，这是最好的；不知道却以为知道，这就是缺点！', 6);
INSERT INTO `sententce` VALUES (3812, '你永远都不会知道自己有多坚强，直到有一天你别无选择。', 6);
INSERT INTO `sententce` VALUES (3813, '爱，就大声说出来，因为你永远都不会知道，明天和意外，哪个会先来！', 6);
INSERT INTO `sententce` VALUES (3814, '有些事，我们明知道是错的，也要去坚持，因为不甘心；有些人，我们明知道是爱的，也要去放弃，因为没结局；有时候，我们明知道没路了，却还在前行，因为习惯了。', 6);
INSERT INTO `sententce` VALUES (3815, '人生如梦岁月无情。蓦然回首，才发现人活着是一种情绪。穷也好，富也好，得也好，失也好。yispace，一切都是过眼云烟。想想，不管昨日今日明天，能豁然开朗就是完美的一天。不管亲情友情爱情，能永远珍惜就是好情绪。以前拥有的不要忘记；已经得到的要更加珍惜。', 6);
INSERT INTO `sententce` VALUES (3816, '做事要低头，沉得下多少心思，受得了多少忍耐，决定你能做何事；做人要抬头，承得住多少目光，抗得了多少压力，决定你能做何人。低头，蕴含谦卑与低调，属大气；抬头，藏纳奋进与不屈，乃骨气。顺意时低头，你会走得更远；逆况中抬头，自信最为可贵。低头，撞不着门槛；抬头，望得了天空。', 6);
INSERT INTO `sententce` VALUES (3817, '心理成熟的标志------不再盲目跟风；不再犹豫不定；合理安排时间；开始关注新闻国事；开始养生；在爱情友情亲情之间，首先想到亲情；不再用哭闹来解决问题；重视身边的朋友；让周围的人快乐；在得失方面变得大度；学着尊重每个人。', 6);
INSERT INTO `sententce` VALUES (3818, '你不要一向不满人家，你就应一向检讨自己才对。不满人家，是苦了你自己。', 6);
INSERT INTO `sententce` VALUES (3819, '默默的关怀与祝福别人，那是一种无形的布施。', 6);
INSERT INTO `sententce` VALUES (3820, '人生就是这样，想要拥有却不能够拥有，或许会使人们自暴自弃。确实失去，就要越坚强，过去的事就让它过去，无法挽回过去。就让我们坚强起来，失去了一个人，至少还有其他人，不会让我们觉得寂寞的！', 6);
INSERT INTO `sententce` VALUES (3821, '世界上有很多出色美丽的男人和女人，然而属于你的真实情感只有一个，千万不要因为别人的眼光而改变自己的挚爱，千万不要活在别人的眼睛里，失去了自己，永远不要贪心，真正爱一个人，无法说出爱什么，和爱的原因，可你会明白，其实简单的想念，分秒心的跟随就是幸福！', 6);
INSERT INTO `sententce` VALUES (3822, '认识自己，降伏自己，改变自己，才能改变别人。', 6);
INSERT INTO `sententce` VALUES (3823, '白白的过一天，无所事事，就像犯了窃盗罪一样', 6);
INSERT INTO `sententce` VALUES (3824, '志气太大，理想过多，事实迎不上头来，结果自然是失望烦闷;志气太小，因循苟且，麻木消沉，结果就必至于堕落。', 6);
INSERT INTO `sententce` VALUES (3825, '爱情就象一捧沙，抓得越紧，流失得越多。', 6);
INSERT INTO `sententce` VALUES (3826, '人生最大的财富是健康。人生最大的幸福是知足。人生最大的敌人是自己。人生最大的失败是自大。人生最大的愚蠢是欺骗。人生最可怜的是嫉妒。人生最大的错误是自卑。人生最大的痛苦是痴迷。人生最危险的是贪婪。人生最烦恼的是名利。人生最大的破产是绝望。人生最大的债务是人情债。人生最大的礼物是宽恕。', 6);
INSERT INTO `sententce` VALUES (3827, '生活中的言语很神奇，有时长说不如短说，有时短说不如不说，有时多说不如少说，有时正说不如反说，有时当面说不如背后说。', 6);
INSERT INTO `sententce` VALUES (3828, '活在别人的掌声中，最易迷失自己；处在别人的关爱中，最易弱化自己。', 6);
INSERT INTO `sententce` VALUES (3829, '我相信一见钟情，而且，只相信一见钟情。', 6);
INSERT INTO `sententce` VALUES (3830, '生命很有限，无须太多人。世间看似熙攘，其实喧嚣在身外，没几个人有关联。我们的幻觉是，自己不可或缺，总在那自以为是。这但是是一厢情愿罢了，地球离开谁都转，每个人都在谋求生存。孤单与狂欢，如花开草长，上演着命运的开启或谢幕。弥足珍贵的，是那些静默的陪伴，深谙你的内心，方是你的至爱。', 6);
INSERT INTO `sententce` VALUES (3831, '想要收缩它，必须暂且扩张它！想要削弱它，必须暂且加强它！想要废弃它，必须暂且支持它！想要夺取它，必须暂且给予它！这叫做微妙的策略，柔能胜刚，弱能胜强！', 6);
INSERT INTO `sententce` VALUES (3832, '人生感悟的句子，人生有很多事，需要忍。人生有很多话，需要忍。人生有很多气，需要忍。人生有很多苦，需要忍。人生有很多欲，需要忍。人生有很多情，需要忍。忍是一种眼光，忍是一种胸怀，忍是一种领悟，忍是一种人生的技巧，忍是一种规则的智慧。圣经说：你要保守你心，胜过保守一切，因为一生的果效，是由心发出。', 6);
INSERT INTO `sententce` VALUES (3833, '小时候幸福是一件东西，拥有就幸福；长大后幸福是一个目标，到达就幸福；成熟后发现幸福原来是一种心态，领悟就幸福', 6);
INSERT INTO `sententce` VALUES (3834, '爱上一个人不需要靠努力，只需要靠机遇，是上天的安排，但是持续地爱一个人就要靠努力。世界上的人虽多，但在下雨的深夜陪你回家的，实际上只有一个。', 6);
INSERT INTO `sententce` VALUES (3835, '永远不要浪费你的一分一秒，去想任何你不喜欢的人。', 6);
INSERT INTO `sententce` VALUES (3836, '有些事，轻轻放下，未必不是简单。有些人，深深记住，未必不是幸福。有些痛，淡淡看开，未必不是历练。坎坷路途，给身边一份温暖，风雨人生，给自己一个微笑。生活，就是体谅和理解，把快乐装在心中，静静融化，慢慢扩散！', 6);
INSERT INTO `sententce` VALUES (3837, '善于行走的人，不留痕迹！善于说话的，语言无漏洞！善于计算的，不使用筹策！', 6);
INSERT INTO `sententce` VALUES (3838, '愿意吃亏，别人才会与之交，于无形中赢得人心。若时时权衡，事事计较，总想讨得好处占得便宜，久而人必疏之避之远之，无语则友少，无友则情淡。懂得吃亏的人，总是吃不了亏。失了微利，终能赢得大贵。东西再好，你也无法长相拥有，不如常怀怜悯之心，常伸援助之手，常予温暖之爱，做人谋事，成矣。', 6);
INSERT INTO `sententce` VALUES (3839, '成功带来敌人，但还是要成功。', 6);
INSERT INTO `sententce` VALUES (3840, '有些人成功是因为他们命中注定；但绝大部分人成功是因为他们下定决心要成功。', 6);
INSERT INTO `sententce` VALUES (3841, '不要为昨日的错而萎靡不振，只要今日做好今日的事，就OK，你就是最棒的！', 6);
INSERT INTO `sententce` VALUES (3842, '别人讲我们不好，不用生气难过。说我们好也不用高兴，这不好中有好，好中有坏，就看你会不会用？', 6);
INSERT INTO `sententce` VALUES (3843, '对人恭敬，就是在庄严你自己。', 6);
INSERT INTO `sententce` VALUES (3844, '你若将过去抱的太紧，怎样能腾出手来拥抱此刻?', 6);
INSERT INTO `sententce` VALUES (3845, '人生在世，没有一种痛苦是属于自己的，所以，没必要悲观失望。生活在这个世界，没有一个人是没有痛苦的，没有一个人是不会流泪的。痛苦对每个人而言，只是一个过客，一种磨练，一番考验。应对痛苦，不要一味难过，而要振作精神。痛苦是难免的，不要丧失信心，坚信苦尽甘来。', 6);
INSERT INTO `sententce` VALUES (3846, '活着一天，就是有福气，就该珍惜。当我哭泣我没有鞋子穿的时候，我发现有人却没有脚。', 6);
INSERT INTO `sententce` VALUES (3847, '对生活怀一颗朴素的心，知道杏花开了梨花也要开，不再刻意想那些和自己没有关联的梦。知道了脚踏实地，懂得了感恩，学会了微笑。此时的我，看花是那样的美，看叶是那样的灿，即使是风雨，也知道那是人生中必要经历的风景，而且心中一向盼望着彩虹。', 6);
INSERT INTO `sententce` VALUES (3848, '管你信不信，原本花心的人到最后最痴情，原本专一的人到最后最绝情。', 6);
INSERT INTO `sententce` VALUES (3849, '如果一个男人真爱你，永远不会丢下你，不管情形有多难。', 6);
INSERT INTO `sententce` VALUES (3850, '人生若只如初见，那么似水流年会不会繁华一些?', 6);
INSERT INTO `sententce` VALUES (3851, '请你用慈悲心和温和的态度，把你的不满与委屈说出来，别人就容易理解。', 6);
INSERT INTO `sententce` VALUES (3852, '你能够拥有爱，但不要执着，因为分离是必然的。', 6);
INSERT INTO `sententce` VALUES (3853, '人最值得高兴的事：父母健在知己两盗不走的爱人。其他都是假象，别太计较。', 6);
INSERT INTO `sententce` VALUES (3854, '无论你的收入是多少，记得分成五份进行规划投资：增加对身体的投资，让身体始终好用；增加对社交的投资，扩大你的人脉；增加对学习的投资，加强你的自信；增加对旅游的投资，扩大你的见闻；增加对未来的投资，增加你的收益。好好规划落实，你会发现你的人生逐步会有超多盈余。', 6);
INSERT INTO `sententce` VALUES (3855, '你要哭，就好好的哭一场。但是，结束以后，就再也不要想起，再也不要哭泣。', 6);
INSERT INTO `sententce` VALUES (3856, '我一生之中最幸运的两件事情，一件是时间最后将我对你的爱消耗殆尽，另一件事，很久很久前有一天，我遇见你。', 6);
INSERT INTO `sententce` VALUES (3857, '多一分心力去注意别人，就少一分心力反省自己，你懂吗？', 6);
INSERT INTO `sententce` VALUES (3858, '最难打开的是心门，最难走的路是心路，最难过的桥是心桥，最难调整的是心态。世界上最难干的工程是改造人的内心世界！', 6);
INSERT INTO `sententce` VALUES (3859, '永远扭曲别人善意的人，无药可救。', 6);
INSERT INTO `sententce` VALUES (3860, '也许有那么一个时侯，你忽然会觉得很绝望，觉得全世界都背弃了你，活着就是承担屈辱和痛苦。这个时候你要对自己说，没关系，很多人都是这样长大的。风平浪静的人生是中年以后的追求。当你尚在年少，你受的苦，吃的亏，担的责，扛的罪，忍的痛，到最后都会变成光，照亮你的路', 6);
INSERT INTO `sententce` VALUES (3861, '发展是硬道理，但硬发展是没道理。', 6);
INSERT INTO `sententce` VALUES (3862, '得到了再失去，总是比从来就没有得到更伤人。', 6);
INSERT INTO `sententce` VALUES (3863, '与其等到别人来爱你，不如自己学着努力多爱自己一些，如果今日的你没有比昨日更喜欢自己，那明天对你来说又有什么好处呢？', 6);
INSERT INTO `sententce` VALUES (3864, '女人一辈子最幸福的事，莫过于，不管有多少美女，他的眼神，永远在你身上。', 6);
INSERT INTO `sententce` VALUES (3865, '不要太肯定自己的看法，这样貌比较少后悔。', 6);
INSERT INTO `sententce` VALUES (3866, '人生最重要的不是选择，而是选择的方向。人生最痛苦的不是爱，而是爱错了一个人；生命最害怕的是等待，由于你不知道你能够等到哪一天，等来怎样的一个结果，你以为你的等待是值得的，但是你却不知道你的等待让自己变得很卑微。', 6);
INSERT INTO `sententce` VALUES (3867, '学会选择，懂得放弃。我们的痛苦不是问题的本身带来的，而是我们对这些问题的看法而产生的。跳出来换个角度看自己，你就会从容坦然地应对生活，再也不会拿别人的错误来惩罚自己了。', 6);
INSERT INTO `sententce` VALUES (3868, '不要试图寻找不可能的捷径，世上没有便宜的事，只有脚踏实地才是最好的方法…无论做何事；不要对明知不是好事的事过分好奇，有可能你会因此而丧命；不要在冲动时做任何决定，否则这个决定就有可能成为你一辈子的遗憾。', 6);
INSERT INTO `sententce` VALUES (3869, '人生的十二种财富：用心的精神态度；良好的体格；人际关系的和谐；脱离恐惧；未来成功的希望；信念的容量；与人分享自己的幸福的愿望；热爱自己的工作；对所有的事物有开放的内心；严于自律；理解人的潜力；经济保障。', 6);
INSERT INTO `sententce` VALUES (3870, '爱是两个人的事，如果你还执着着，纠缠着，原地打滚痛苦的爱着。时过境迁之后，你会发现，是自己挖了坑，下方埋葬的全部都是青春。', 6);
INSERT INTO `sententce` VALUES (3871, '如果你能把做事当锻炼，把忙碌当享受，把挫折当成长，把吃亏当收获，把不幸当噩梦，把成功当往事，那么，你的生活就会感到无比宽慰，无比自在！', 6);
INSERT INTO `sententce` VALUES (3872, '踮起脚跟的人站不稳，跳越行进的人走不远，自我显示的人，反而不能显闻！自以为是的人，反而不能明辩！自夸耀的人，反而不能成功！自高自大的人，反而没有长进！', 6);
INSERT INTO `sententce` VALUES (3873, '只有启程才会到达理想和目的地，只有播种才会有收获。只有追求，才会品味堂堂正正的做人，只有保留一份单纯，才会多些人生的快乐！', 6);
INSERT INTO `sententce` VALUES (3874, '人若是有勇气说再见，生活也会还我们一个崭新的开始。', 6);
INSERT INTO `sententce` VALUES (3875, '来是偶然的，走是必然的。所以你必须，随缘不变，不变随缘。', 6);
INSERT INTO `sententce` VALUES (3876, '生活中有太多无可奈何的选择。社会就像江湖，总是让人身不由己，言不由衷。爱情亦是如此，当爱情遭遇分手，那份痛谁能感同身受？你若先走了，转身时就不要怪我也在背对着你！', 6);
INSERT INTO `sententce` VALUES (3877, '男人是用来靠的，所以要可靠；女人是用来爱的，所以要可爱。', 6);
INSERT INTO `sententce` VALUES (3878, '放得下的是以前，放不下的是记忆。', 6);
INSERT INTO `sententce` VALUES (3879, '生命中，再无聊的时光，也都是限量版。', 6);
INSERT INTO `sententce` VALUES (3880, '一个人的个人潜力再强也无法战胜一个团队。', 6);
INSERT INTO `sententce` VALUES (3881, '但愿有一天你会记起，我曾默默地，毫无希望地爱过你。我这扇门曾为你打开，只为你一人打开，此刻，我要把它关上了。', 6);
INSERT INTO `sententce` VALUES (3882, '我们，不要去羡慕别人所拥有的幸福。你以为你没有的，可能在来的路上；你以为她拥有的，可能在去的途中。有的人对你好，是因为你对他好；有的人对你好，是因为懂得你的好！成熟不是心变老，而是眼泪在眼睛里打转，我们却还能持续微笑；总会有一次流泪，让我们瞬间长大。', 6);
INSERT INTO `sententce` VALUES (3883, '男人喜欢听话的女人，但男人若是喜欢一个女人，就会不知不觉听她的话。', 6);
INSERT INTO `sententce` VALUES (3884, '如果身处顺境，千万不要张扬，要和满山的杜鹃花一起绽放。如果身处逆境，千万不要放弃，要像开败的白玉兰一样，在下一个春天再向世界招手。如果身处绝境，千万不要沮丧，要像万丈天坑底部的一棵狗尾巴草，虽然死无出路，但也要昂起毛茸茸的头颅，向着太阳灿烂地微笑。', 6);
INSERT INTO `sententce` VALUES (3885, '每个人真正强大起来都要度过一段没人帮忙，没人支持的日子。所有事情都是自己一个人撑，所有情绪都是只有自己知道。但只要咬牙撑过去，一切都不一样了。无论你是谁，无论你正在经历什么，坚持住，你定会看见最坚强的自己。', 6);
INSERT INTO `sententce` VALUES (3886, '一向想做一个善良的人，守着一份愿得一人心，白首不相离的爱情，以岁月做笺，在时光的隧道中播种完美，欣然每一个日出，用心感悟，释然每一个日落，用心聆听，抖落岁月的尘埃，以一颗无尘的心，还原生命的本真，以一颗感恩的心对待生活中的所有。', 6);
INSERT INTO `sententce` VALUES (3887, '朋友是那么一批人------是你不容易忘掉的人，是你痛苦的时候第一个想到的人，是给你帮忙不需要说多谢的人，是惊扰之后不用心怀愧疚的人，是你走麦城不对你另眼相看的人，是你步步高升对你的称呼从来不改变的人。------人生得一知己足矣，斯世当以同怀视之。', 6);
INSERT INTO `sententce` VALUES (3888, '不是所有的故事都能成为你的眼睛里的色彩，因为岁月会淡化你的颜色。当你的人生路走得不平顺的时候，不要忘记了，你只是走过这条路而已，走过以后一切只能任时光处置。', 6);
INSERT INTO `sententce` VALUES (3889, '有些事，是能够论输赢的，赢了一时欢喜，输了还能从头再来。有时候，输了就彻底地败了，失去了的东西再也找不回来。比如父母，须趁早尽孝，莫要子欲养而亲不待；比如健康，别在拼命搏击时肆意践踏，等到功成名就后无福消受；比如情感，有的人已在岁月的浸染中，幻化成你的影子，少了，注定你孤苦无依。', 6);
INSERT INTO `sententce` VALUES (3890, '做好事，别人会说你动机不良，但还是要做好事。', 6);
INSERT INTO `sententce` VALUES (3891, '如果你生气了，请在应对爱人之前先应对镜子。看看自己，你喜欢此刻这张脸吗?', 6);
INSERT INTO `sententce` VALUES (3892, '生命很有限，无须太多人。世间看似熙攘，其实喧嚣在身外，没几个人有关联。我们的幻觉是，自己不可或缺，总在那自以为是。这但是是一厢情愿罢了，地球离开谁都转，每个人都在谋求生存。孤单与狂欢，如花开草长，上演着命运的开启或谢幕。弥足珍贵的，是那些静默的陪伴，深谙你的内心，方是你的至爱。', 6);
INSERT INTO `sententce` VALUES (3893, '宁可骑着单车微笑，也不要躲在奔驰车里哭泣。', 6);
INSERT INTO `sententce` VALUES (3894, '如果说人生是一首优美的乐曲，那么痛苦则是其中一个不可缺少的音符；如果说人生是一望无际的大海，那么挫折则是一个骤然翻起的浪花。如果说人生是湛蓝的天空，那么失意则是一朵漂浮的白云。', 6);
INSERT INTO `sententce` VALUES (3895, '时间总会过去的，让时间流走你的烦恼吧！', 6);
INSERT INTO `sententce` VALUES (3896, '说话的时候要认真，沉默的时候要用心。', 6);
INSERT INTO `sententce` VALUES (3897, '这似乎是一条定律：每次决定放弃前再努力一下下，往往是惊喜出现的时候。', 6);
INSERT INTO `sententce` VALUES (3898, '旁若无人走自己的路，不是撞到别人，就是被别人撞到。', 6);
INSERT INTO `sententce` VALUES (3899, '我们能够躲开大家，却躲不开一只苍蝇。生活中使我们不快乐的常是一些芝麻小事。', 6);
INSERT INTO `sententce` VALUES (3900, '人要说的尽兴，必需要另一个人听得入神。善言能赢得听众，善听才干赢得朋友。', 6);
INSERT INTO `sententce` VALUES (3901, '生活有进有退，输什么也不能输了情绪。', 6);
INSERT INTO `sententce` VALUES (3902, '合抱之木，生于毫末;九层之台,起于累土;千里之行，始于足下。——《老子》', 6);
INSERT INTO `sententce` VALUES (3903, '最痛苦的莫过于徘徊在放与不放之间的那一段。真正决心放弃了，反而，会有一种释然的感觉。', 6);
INSERT INTO `sententce` VALUES (3904, '如果全世界背叛了你，我愿为你背叛全世界。', 6);
INSERT INTO `sententce` VALUES (3905, '时光永远不会逆行，把握好每一个属于自己的清晨。', 6);
INSERT INTO `sententce` VALUES (3906, '百尺竿头，更进一步。——朱熹《答巩仲至》', 6);
INSERT INTO `sententce` VALUES (3907, '我从来不自欺欺人。我只看真实。', 6);
INSERT INTO `sententce` VALUES (3908, '在岁之前，及时回头，改正。从此褪下幼稚的外衣。将智慧带走。然后，要做一个合格人。开始负担，开始顽强地爱着生活，爱着世界。', 6);
INSERT INTO `sententce` VALUES (3909, '我也曾像你一样，当电话里能够拨打的名单越来越少，能够彻夜深聊的人更是少之又少时，变的慌乱和紧张。总为失去谁，离开谁而难过和纠结。但最终都会想通一些道理，理解某些现实，当这个世界把你变的独立而勇敢之前，总会先帮你解除掉一些不够稳固的关系，以及阻碍着你，羁绊着你的某些人和事。', 6);
INSERT INTO `sententce` VALUES (3910, '偶尔我只想一个人静静的就好，不受任何打扰。不是冷漠，只想放空自己，感受生命完美。', 6);
INSERT INTO `sententce` VALUES (3911, '谁人生，静则思己，动则达人。心不静则不能剖心，行不规则不能喻人。', 6);
INSERT INTO `sententce` VALUES (3912, '人生就像一杯没有加糖的咖啡，喝起来是苦涩的，回味起来却有久久不会退去的余香。当眼泪流尽的时候，留下的就应是坚强。', 6);
